INSERT INTO `entreprise` VALUES (12,'ZEZETTE LA BELLE EPOQUE','Zezette La Belle Epoque est une biscuiterie artisanale crée par Gaston BENTATA biscuitier depuis 1978, Gaston Bentata, est attaché à la tradition et veut partager, avec les gourmands, au travers de La Belle Epoque, les petits biscuits issus de vieilles recettes familiales, goûtées et appréciées depuis plusieurs décennies.\n\nDepuis sa création, La Belle Epoque est primée régulièrement lors des concours Hérault Gourmand, qui regroupent lensemble des acteurs de la Gastronomie Régionale Haut de Gamme. \n\nLes épicuriens retrouveront les biscuits sucrés et salés : \n-	en boîtes fraîcheur et métal en grande distribution et dans les commerces de proximité, \n-	en étui \'premium\', en sachet dégustation, fermé par un nud en raphia naturel, en coffret métal dans les épiceries fines.\n\nSouvent copiée mais jamais égalée exigez la qualité « La Belle Epoque » !',1),(13,'colombine','Nous somme une entreprise familiale de père en fils\nNos produit sont élaborés dans notre entreprises situé a Carcassonne\nNous travaillons avec un Maximum de produits locaux.\nSpécialisé dans la biscuiterie et confiserie',1),(14,'Sarl Les Moulins De La Catalogne','Les Moulins de la catalogne, basés à coté de Carcassonne se sont spécialisés dans la fabrication des madeleines, des oreillettes et autres spécialités régionales depuis plus de 50 ans.\nAvec sa gamme sud de France composée en autre d\'oreillettes, madeleines, de cakes, du gâteau au poivre ( Pebradou) fabriqués à partir de recettes traditionnelles, l\'entreprise est en train de s\'implanter durablement.\nAujourdhui, grâce à plusieurs opérations réussies et à la pérennité de nos implantations dans plusieurs grands magasins, les Moulins de la Catalogne se positionne comme un partenaire privilégié.',1),(15,'Les Biscuits de Mel','Vous avez peut-etre entendu parler de Merveilles, Bugnes, Bottereaux ou Tourtisseaux selon que vous vous trouviez a Bordeaux, Lyon, Nantes ou en Vendee\n\nDans le Sud de la France, la specialite pour le Carnaval, cest loreillette ! Lorsquon voit ce petit rectangle plat dore et croustillant, on a du mal a lassocier a un beignet.\n\nEt pourtant, sa conception participe du meme principe. Selon la tradition, la pate est etiree jusqua devenir tres fine, puis plongee dans une huile bouillante, egouttee, pour devenir legere et craquante et enfin, saupoudree de sucre semoule ou de sucre glace, selon les gouts.\n\nCes petites gateries sont traditionnellement la recompense apres les privations du careme et font par ailleurs partie des 13 desserts traditionnels de Noel.\n\nPour la realisation de vos oreillettes, C.M.J. a mis au point une recette justement dosee avec une cuisson minutee et minutieuse pour vous offrir un joli produit, ni trop gras, ni trop peu cuit : loreillette de C.M.J. est divinement appetissante.\n\nPour les gourmands et les gourmets, loreillette demeure un vrai petit delice original a consommer toute lannee !',1),(16,'LES AMANDES ET OLIVES DU MONT BOUQUET','Producteur transformateur d\'amandes et d\'olives.\nAdhérent au réseau bienvenue à la ferme',1),(17,'LES DELICES D\'ALIENOR','Les Delices dAlienor est une patisserie artisanale,de 18 salaries, specialisee dans la fabrication du Pastis Gascon.\n\nInspiree dune vieille recette Maure, cette tradition gasconne sest perpetuee dans les fermes ou nos grands-meres etiraient la pate a la main le samedi pour le repas dominical ou pour les fetes. \n\nNous perpetuons cette tradition en conservant a ce dessert aerien de renommee, son ame genereuse et campagnarde.\n\nUn savoir-faire unique permet un etirage manuel de la pate pour atteindre au plus le dixieme de millimetre avant de la beurrer non plus a la plume de canard comme autrefois,  mais au pinceau.\n\n« Mieux quun voile de mariee », \n\nCela aucune machine au monde ne peut le faire. Lexperience de nos «  croustadieres »  est irremplacable. Pour ces raisons la fabrication du veritable pastis gascon sera toujours artisanale.\n\nUne fois etiree la pate est garnie de pommes fraiches macerees dans un vieil armagnac.',1),(18,'VITAL AINE','Cest en 1836 que Jacques Vital et sa femme Jeanne-Marie, tous deux enfants du pays, créèrent à Martres Tolosane la pâtisserie qui porte encore aujourdhui leur nom.\nTrès vite, la renommée de leur Maison dépassa les frontières du canton.\nPuis le fils aîné reprit lenseigne\nPuis encore les aînés des filsdepuis 180 ans.\nCest dire si lesprit de famille perdure. Et avec lui la transmission de génération en génération de secrets de pâtissiers.\nAujourdhui, comme hier, les clients de la Maison Vital Aîné aiment toujours ce bon goût des choses bien faites.\nGoûteuses, délicieusement parfumées, les pâtisseries Vital Aîné se dégustent avec le même bonheur quil y a 180 ans. Comme à la sortie du four',1),(20,'Les Chênes Verts','L\'Association Les Chênes Verts, est gestionnaire de  L\'ESAT les chênes Verts. L\'établissement permet à une soixantaine de travailleurs en situation de handicap mental de s\'insérer socialement par le biais du travail. C\'est au travers de cinq pôles d\'activités que l\'E.S.A.T «Les Chênes Verts» propose\ndifférents métiers et prestations :\nBiscuiterie,\nEspaces verts et petits travaux (murets en pierres sèches, petite maçonnerie, peinture, second uvre...),\nCarrosserie-peinture, (automobile)\nServices aux entreprises,\ndont le Lavage Auto. \n\nL\' E.S.A.T \'Les Chênes Verts\' offre, enfin, un service de détachement ou de mise à disposition sur site, en partenariat avec des entreprises de l\'agglomération Nîmoise.\n\nLa Biscuiterie «Les Chênes Verts» est l\'un des ateliers de l\'E.S.A.T dans lequel environ 25 ouvriers sont accompagnés dans leur apprentissage par trois moniteurs.\n\nParticuliers, Associations, administrations, écoles, crèches, mairies, Comité d\'entreprises... tous sont nos clients privilégiés.\n\nDepuis 1974, la réputation et le sérieux de l\'établissement n\'ont cessé d\'être connus et reconnus, permettant ainsi la pérennité et le développement des ateliers.\n\nLa politique de l\'établissement veut s\'inscrire dans une démarche de développement durable et dans un réseaux privilégiant la proximité (fournisseurs, matières premières...)',1),(21,'Chez ce cher Serge','Chez ce cher Serge est la première marque à proposer du snacking encas bon, bio et local !\n\nNos 10 références, sucrées et salées, soutiennent les emplois non délocalisables et les traditions de notre pays.\n\nNous proposons des carrés croustillants poivron-piment d\'Espelette  romarin-thym  comté-sésame, des sablés pur beurre  citron-graines de lin  pépites de chocolat, des guimauves aux fruits, des guimauves enrobées de chocolat et des billes de maïs enrobées de chocolat lait ou noir.',1),(22,'PASSION CEVENNES','mise en valeur du terroir cévenol... en créant une ligne de produits agroalimentaires utilisant des matières premières d\'origine cévenole,  ou en adaptant des recettes aves des matières premières de bases produites en Cévennes.',1),(23,'LES CHOCOLATIERS CATHARES','Artisan chocolatier,biscuitier,sucrecuitier,nous fabriquons des chocolats pur beurre de cacao,des sucettes et bonbons cuits au chaudron,des gouttelines,des nougatines,des biscuits variés.\nNous élaborons tous nos produits dans notre atelier à Montredon Des Corbières et utilisons des matières premières locales,dans la mesure du possible.\nNous proposons la visite gratuite de notre entreprise ainsi que des ateliers créatifs pour petits et grands les mercredis et samedis.',1),(24,'Maison COURNILLE','Boulangerie Pâtisserie artisanale depuis 1901. Nous sommes la 5ème génération et sommes viscéralement attachés aux produits FAIT MAISON. La boulangerie et la pâtisserie ont  constitué le coeur de métier de notre entreprise et en est encore un pilier. Au fil des générations nous avons également développé une gamme de pâtisseries, de biscuits et de chocolats qui nous sont propres. Nous repartons inlassablement dans les livres de recettes de nos anciens et revisitons celles-ci en y ajoutant notre \'patte\'.',1),(25,'Les biscuits de mumu','Notre objectif est de faire decouvrir ou redecouvrir la saveur authentique des biscuits d\'antan faits main que notre fabrication artisanale vous permet de retrouver avec son savoir-faire .\n\nC\'est avec plaisir que nous fabriquons des produits de qualites qui vous apporterons toute satisfaction. \n\nNous privilegions des produits de qualite comme le beurre a 82% de matiere grasse, l\'huile dolive, les fruits seches, le sucre, le vin du Sauvignon du Gard, le miel, larome naturel, nous faisons notre propre sucre vanille a partir de sucre roux et de gousses de vanille.\n\nNos biscuits ne sont pas trop sucres, sans huile de palme, sans conservateur.',1),(26,'PATRICK MANCA','Qui nous sommes : \nUne petite entreprise familiale creative, souple et reactive, a taille humaine pour travailler, echanger et construire des projets. Torrefacteur et importateur, fabrication, production, transformateur,  preparateur de recettes negoce de cafe, de cacao, epices, distributeur. Nous selectionnons nos matieres premieres et tous nos produits a la source et en circuit court, tout en controlant la qualite de nos achats en agriculture raisonnee (souvent  biologique), commerce equitable, developpement durable, nous garantissant la qualite.\nNos leitmotivs : \nNous privilegions les productions bios locales en circuit-court, et de lagriculture raisonnee, achat   en vrac.\nVous garantir un maximum de fraicheur, nous ne travaillons uniquement a la demande et exclusivement au depart des matieres premieres  les plus nobles, pour vous garantir un maximum de fraicheur.',1),(27,'LES ECUREUILS DU LANGUEDOC','La societe « Les Ecureuils du Languedoc » fabrique a Beziers des cakes bouchons et des madeleines depuis plus de 60 ans. \nCes produits evoquent a toute une frange de la population un « parfum denfance ». \nLa societe est restee fidele, non seulement aux recettes originales elaborees dans les annees 50 mais egalement au packaging, lensemble ayant fait la reputation de la societe.',1),(28,'BISCUITERIE ARIEGEOISE','Biscuiterie Ariegeoise artisanale situee a Saint-Lizier.',1),(29,'LA CURE GOURMANDE','Depuis plus de trente ans, La Cure Gourmande rejouit les gourmands de biscuits, confiseries et chocolats fabriques en Occitanie dans ses propres ateliers.\n\nNotre savoir-faire, la passion, la gourmandise et la rigueur qui nous animent au quotidien, font de La Cure Gourmande une maison de haute qualite au savoir-faire incomparable, a la recherche permanente de gouts et saveurs qui enchanteront les meilleurs palais.\n\nNous attachons une grande importance a la qualite de nos matieres premieres  que nous sourcons en grande partie aupres de producteurs regionaux.',1),(30,'Petites Manies','MANDISIO au travers de sa marque \'Petites Manies\' reprend le savoir faire et les traditions de trois generations de patissiers pour vous proposer des recettes originales et gourmandes.\nInstalles a Cologne dans le Gers, avec lOccitanie pour grenier, nous produisons artisanalement nos biscuits avec des ingredients\nissus majoritairement de lagriculture locale.\nLa biscuiterie \'Petites Manies\' propose des biscuits sales et sucres tous certifies issus de l\'agriculture biologique.',1),(31,'Histoires Gourmandes','Histoires Gourmandes s',1),(32,'Aux ateliers de la liberte','Notre entreprise artisanale de 7 personnes oeuvre gaiement depuis 2012 aux pieds des Pyrenees.\nRecemment passee en SCOP, notre petite equipe est investie dans son travail avec valeurs et convictions\n\npour permettre notre developpement harmonieux. Nous concretisons en 2021 notre projet de boutique-\nsalon de the associe a un tiers-lieu aussi en creation.\n\nNos produits reconnus par les clients et professionnels de la bio sont non seulement AB mais aussi sous\nmention Nature & Progres (cahiers des charges techniques plus exigeants ; charte prenant en compte les\naspects environnementaux et economiques). Les biscuits sont vendus en vrac uniquement : c\'est un atout\nenvironnemental et economique. L\'equipe bien complementaire ne change pas, s\'est meme impliquee dans\nla SCOP, et assure la production tout au long de l\'annee.',1),(33,'le p&#39;tit d&#39;oc','nous avons creer une epicerie local vrac et bio il y a 3 ans et depuis juillet nous avon agrandis et avond creer un espace salon de the restaurant et souhaitons developer la vente a l\'exterieur des produits que nous fabriquuons sur place.\n\nbiscuits sec, rousquille, pain, glace, chocolats....',1),(34,'BISCUITERIE DES AUMIERES','Situee en Occitanie, et plus precisement dans l\'Aveyron, sur les hauteurs de Millau, la Biscuiterie des Aumieres fabrique artisanalement des cookies, sables et cakes, sans gluten et sans lactose. Elle propose une production de qualite, des ingredients selectionnes, issus de l\'agriculture biologique, des recettes sans colorant et sans conservateur. Le conditionnement est realise manuellement.\nLes cakes, brownies et madeleines sont fabriques a la commande pour vous garantir un maximum de fraicheur.\nVenez decouvrir notre boutique de gourmandises',1),(35,'ori','La Demarche ORI s\'inscrit dans un mouvement holistique global, en considerant  l\'alimentation / nutrition / la planete  comme un systeme global.\n\nUne bonne alimentation fait appel a des aliments vrais, complets, diversifies, issus d\'une agriculture durable  respectueuse de l\'environnement, qui preserve les eco-systemes naturels de faune et flore et leurs environnement de vie .\n\nORI est la seule et premiere marque FULL & NATIVE SORGHUM  en France et Europe . \n\nAvec un ecosysteme multidisciplinaire  et complementaire ( agriculteurs, nutritionniste, patissier, scientifiques, ...) nous mettons le sorgho au centre de alimentation smart de demain. \n\nORI apporte une innovation d\'usage avec le sorgho pour alimentation humaine en FR/ EU. \n\nPeu consommatrice en intrants, la culture du Sorgho est assez simple en France, en Europe en particulier, grace aux temperatures estivales  et aux pluies annuelles. Elle ne requiert ni insecticide, ni fongicide. Une culture amie a la Biodiversite !\nC\'est une culture qui peut se pratiquer sans irrigation (contrairement au mais, grand consommateur d\'eau, d\'intrants  et de traitements  phytosanitaires) . \n\nLe sorgho est une cereale extremement resistante a la secheresse et aux manque d\'eau, il trouve de plus en plus sa place sur notre territoire Occitanie / Sud Ouest / France / Europe. Pour nous aider a face aux enjeux de dereglement climatique et de securite alimentaire,le sorgho, ce super grain, sera de plus en plus notre allie pour le futur.',1),(36,'Biscuiterie des Aumieres','Situee en Occitanie, et plus precisement dans l\'Aveyron, sur les hauteurs de Millau, la Biscuiterie des Aumieres fabrique artisanalement des cookies, sables, cakes, preparations pour pains, sans gluten et sans lactose. Elle propose une production de qualite, des ingredients selectionnes, des recettes sans colorant et sans conservateur. Le conditionnement est realise manuellement.\nLes cakes, brownies et madeleines sont fabriques a la commande pour vous garantir un maximum de fraicheur.\nVenez decouvrir notre boutique de gourmandises !',1),(37,'LA BELLE DRECHE','Notre mission est de transformer un residu de production en une ressource saine et gourmande, parce qu',1),(38,'Valeurs et traditions','\'Valeurs et traditions du Sud\' est une entreprise familiale qui a pour but de remettre au gout du jour d\'anciennes recettes regionales de nos grands-meres.',1),(39,'AUZIER CHABERNAC','HISTORIQUE\nLa maison AUZIER a été créée en 1923 par Léon AUZIER. En ce temps là, il y avait à Montpellier cinq confiseurs qui fabriquaient tous de la réglisse, des boules de gomme, de la guimauve et des dragées. Ils étaient les derniers successeurs d\'une corporation venue du Moyen-Age où la confiserie voisinait avec la pharmacie, dans une ville où Jacques Cur avait introduit les produits d\'Orient.\nA Montpellier, au temps de Rabelais, les apothicaires multipliaient leurs inventions et les étudiants offraient des dragées pour fêter leur thèse. Aujourd\'hui, AUZIER CHABERNAC perpétue la tradition de Montpellier par son savoir faire et ses recettes traditionnelles de pâte vanillée, pâte de réglisse, réglisse au miel, guimauve et bien sur, les dragées.\nAUJOURD\'HUI\nToutes nos confiseries sont réalisées dans le respect des recettes d\'autrefois, jalousement gardées depuis 3 générations de confiseur. Nous apportons un soin particulier à la sélection de nos matières premières, auprès de nos différents partenaires, afin de garantir une qualité constante, et satisfaire notre clientèle de gourmands.',1),(42,'Dulsa France','Dulsa France commercialise avec sa marque BONBEST, des chouchous de fabrication artisanale, de la pâte vanillée, des pralines aux amandes et des Bienfaisant.',1),(43,'LES PERLES DE MONTPELLIER','Bonbons au Miel de Garrigue \n\nPour la fabrication de nos douceurs, les Perles de Montpellier,  nous avons choisi comme composé naturel, le Miel de Garrigue. \nCe miel est spécifique dune flore aromatique du pourtour méditerranéen, il restitue toutes les odeurs typiques de ces paysages secs et caillouteux. \n\nPourquoi avons-nous choisi le miel comme base de notre produit ?\n\nLe miel a toujours accompagné  lHomme, comme en témoignent dailleurs de nombreuses peintures rupestres. Dabord prélevé directement sur les arbres, le miel fait lobjet dune véritable culture, lapiculture, dès lAntiquité. Le bassin méditerranéen est un creuset aux conditions naturelles largement favorables à sa production. Miel du soleil, il est 100% naturel, dont la qualité est assurée par une nature restée à létat sauvage. \n\nPourquoi la sélection du miel de garrigue ?\n\nCest un miel qui se distingue par son goût puissant et typé qui perdure en bouche. Dans la garrigue, les abeilles butinent des espèces aromatiques aux effluves odorants qui se retrouvent dans ce Miel typique de notre Région. De teinte ambrée, il provient surtout du thym, du romarin, de la lavande mais aussi de la sarriette, du chêne vert, de la ronce et de lasphodèle. Il assure donc le goût exceptionnel des Perles de Montpellier.\nLe Miel de Garrigue est connu aussi pour ses vertus médicinales. Aux bienfaits classiques qui sont attribués au miel, avec les qualificatifs principaux dantiseptique, de diurétique, dantianémique, sajoutent ceux plus spécifiques liés au Miel de Garrigue. Ses vertus médicinales ne sont plus à prouver. Riche en oligoéléments, il a des vertus fortifiantes et toniques, capables de gommer les effets négatifs dus à notre vie moderne. \n\nNotre produit est fabriqué sans colorants, ni conservateurs, ce qui lui confère une véritable authenticité et lui permet de refléter un parfum unique aux mille saveurs de notre Région.',1),(44,'LES CHIPS DE L&#39;AVEYRON','Fondee en 1997, notre entreprise fait perdurer avec passion la fabrication artisanale de chips dans le respect des traditions en proposant des produits simples: sans colorant, sans conservateur et d\'origine 100% francaise.',1),(45,'Terres d\'Uzes','Agriculteurs en mode biologique, nous cuisinons les plantes aromatiques, les fleurs, les fruits et legumes mediterraneens issus de nos recoltes. \nEn gamme sucree : confitures , confits et sirops de plantes et de fruits bio. En gamme salee : apero-tartines, confits et chutneys de fruits et legumes bio. Aussi sorbets et glaces vegetales',1),(46,'Flore En Thym','Flore en Thym est une Jeune Entreprise Innovante (JEI) basee dans le village de Saint-Martin-de-Londres, au pied du Pic Saint-Loup qui propose une gamme de plantes aromatiques sauvages. Issues du cur des garrigues du Languedoc-Roussillon, les plantes sont cueillies a la main a la facon des anciens et sont labellisees Agriculture Biologique.\nAfin dintegrer harmonieusement son activite dans son environnement, Flore en Thym sinscrit fortement dans les principes du Developpement Durable et de lEconomie Sociale et Solidaire (remuneration equitable des cueilleurs, prelevement respectueux de la plante et de son milieu, accords des proprietaires, developpement local)',1),(48,'le lait cru de campserdou','Mon exploitation agricole de 40 vaches laitières prim\'holtein se situe dans l\'Aude au cur du Pays Cathare. Ma production est le lait cru que je commercialise en vente directe et en coopérative et dans des magasins. Il sert à l\'élaboration à de nombreux plats à base de lait cru et surtout des desserts. Nous transformons une partie en fromage blanc et confiture de lait. Le point de vente à la ferme est ouvert tous les jours à l\'heure de la traite. Du 1er octobre au 31 mars de 17h30 à 19h30 et du 1er avril au 30 septembre de 18h à 20h.',1),(49,'Le Mas des Confitures',NULL,1),(50,'LES SAVEURS DE MIRAILHES','Je suis dans les Corbières à Lagrasse et je viens de développer cette activité.\nJe ramasse du thym et du romarin sauvage sur le domaine.\nJe cultive du safran et de la menthe en petite quantité\nAvec ces produits je fabrique de façon artisanale mais en laboratoire (sur Couiza) des sirops, gelées, confits.\nCes produits sont de qualité mais un peu méconnu, ce qui explique ma démarche envers vous afin de mettre en uvre toutes mes chances pour la réussite de mon entreprise.\nPouvez vous me dire également si la labellisation chez vous est gratuite, car je ne peux me mettre en bio à cause du coût, mes produits étant pourtant fabriqués avec du sucre bio et de l\'Agar bio. Peut être par la suite...',1),(53,'Vidal Nadia','une exploitation en Cevennes Lozeriennes composee de vergers de chataiggniers, pommiers, fruits rouges, et d\'un elevage de poules pondeuses en agriculture biologique',1),(54,'Le Fruitier des Cevennes','Artisan confiturier proposant une gamme de 24 parfums de confitures sous differents conditionnements notamment un specifique pour les hoteliers, 6 parfums de coulis, 5 parfums de sirops, 6 parfums de pates de fruits en sachets, boites ou paves de parfums aux choix, nectars de cerises, nectars d\'abricots, nectars de poires et nectars de peches. Tous ces produits sont fabriques de facon totalement artisanale et dans la tradition de qualite et de savoir-faire des Cevennes.',1),(57,'L\'EPICURIEN SAS','L\'Epicurien, société fondée par un Maître Artisan Confiturier, fabrique depuis plus de 30 ans de merveilleuses confitures et bien plus encore...\nL\'Epicurien a pour ambition de permettre à ses clients de retrouver le goût des confitures maison d\'autrefois et également de découvrir à travers de nouvelles associations et de nouvelles textures des saveurs gourmandes inédites...\nL\'Epicurien a étendu son savoir-faire et propose aujourd\'hui des confitures, des gourmandises, des confits de fleurs, de thés, de vins, et d\'herbes aromatiques; mais aussi des pâtes à tartiner, des spécialités salées à toaster ou à cuisiner...\nOuvert du Lundi au Jeudi de 9h00à 13h00 et de 14h00 à 17h30; le Vendredi de 8h30 à 12h30.\nFermé entre Noël et Jour de l\'An.',1),(58,'Safran de Pyrene','Situee au pied des Pyrenees ariegeoises, Safran de Pyrene propose des produits authentiques et naturels issus de l\'agriculture biologique.',1),(59,'LES GOURMANDISES DE BLOURS','Il s\'agit d\'une petite exploitation agricole productrice et transformatrice de petits fruits en agriculture biologique.Cette entreprise est située en montagne en plein cur du Parc Naturel Régional des Pyrénées Ariégeoises. Tous les fruits produits sont transformés sur place en confiture,coulis,sirop,jus,nectar,sorbet. La particularité, des taux de fruits élevés afin de privilégier la saveur des produits.',1),(60,'La gourmandise de Paul','entreprise artisanale, fait maison sans conservateur ajouté, maximum de produits bio et locaux. gâteaux a la broche, biscuits, chutney, compoté de fruits, \nbuffets froids assortiment de tapas régionaux, petits déjeuner assortiment sucrés.\ncoffrets entreprise.\nlabel eco-defi.  hygiène très satisfaisant',1),(61,'Delices du Haut Languedoc','Produits totalement naturels (sans conservateurs, ni additifs )plein des saveurs de notre nature sauvage. Fabriqué à la maison dans un cadre pittoresque débordant de fleurs et parmi les sculptures , la Villa Issiates vous invite à déguster ses produits.',1),(62,'Les Cueilleuses Sauvages','Depuis 2019, je cueille et transforme des plantes sauvages de l\'Herault en sirops, tisanes, condiments et gelees. De la cueillette a la vente, l\'ensemble de ma production est artisanale et locale, et les ingredients que j\'utilise sont biologiques (sucre de fruits bio origine Gard, sel de Camargue...). \nLes plantes sont cueillies a la main, dans des parcelles sous convention de cueillette, ou je peux m\'assurer de l\'absence de traitements et autres pollutions. Les cueillettes sont realisees dans l\'Herault, majoritairement a moins de 30 km de Montpellier.\nRegalez-vous avec le sirop de coquelicot, la gelee de rose sauvage ou la tisane \'Bouquet de Morphee\' ! Je vends mes produits dans les foires et marches autour de Montpellier.',1),(63,'MAISON DU SAFRAN DU TERROIR TARNAIS','Nous cultivons le safran depuis 2004 au cur du Parc Naturel Regional du Haut Languedoc. Ce terroir du Tarn, Cur de lOccitanie, est repute depuis des siecles pour la qualite de son safran. \nNotre safran est desherbe manuellement, ne subit aucun traitement et ne recoit que de lengrais naturel.\nCuisines a lancienne a la propriete par nos soins, tous nos produits safranes sont naturels : sans colorant, ni arome, ni conservateur. Sur chacun deux, vous trouverez des idees dutilisation. Des recettes simples et festives sont a votre disposition avec nos produits pour regaler vos convives. De meme, nous vous apprendrons comment cuisiner le safran de qualite afin quil rende le maximum de son arome dans vos plats.\nNous vous accueillons dans notre Maison du Safran de Castres, ou vous pourrez voir photos et videos sur notre culture, mais aussi consulter des textes anciens sur le safran Albigeois, et bien-sur, deguster nos produits safranes.',1),(64,'Les Fines Louches','Les Fines Louches cest une conserverie locale et végétale implantée à Narbonne en Occitanie. Nous transformons fruits et légumes frais cultivés par des maraîchers locaux en cuisinant pour vous des soupes, des tartinables, des compotes et des confitures en bocaux.',1),(65,'La CLEF de FER','nous sommes producteurs de chataignes et marrons et des produits en decoulant.\nNous produisons de la confiture de framboises, de la confiture de baies de cade et commercialisons des champignons frais et secs( cepes, girolles, trompettes de la mort, lactaires).\nEn 2023, nous produirons des asperges vertes d\'argenteuil',1),(66,'LA COMMINGEOISE','Situee a Agassac, un petit village sur les coteaux du Comminges, la ferme familiale offre une vue imprenable sur les Pyrenees.\nCette envie de faire evoluer cet heritage, je la dois principalement a tout le travail et au devouement des femmes que j',1),(67,'Le temps des confitures','Le temps des confitures produit de veritables confitures artisanales, elaborees a Montpellier avec des fruits frais de saison cultives dans la majorite des cas en Occitanie.\nUne selection rigoureuse des fruits vous garantit un produit de premiere qualite, contenant au minimum 60 % de fruits frais\nDecouvrez sur Instagram nos methodes artisanales de production : \nhttps://www.instagram.com/letempsdesconfitures/',1),(68,'Les cabas de Sandie','Sandie exploite un hectare et demi exclusivement dedie aux fruits & legumes de saison, en defendant une agriculture respectueuse de la nature sur un sol vivant.\n\nMangez mieux bon et local en consommant responsable.\n\nProduction locale et saisonniere, fruits, legumes, oeufs, lentilles BIO. Transformation des produits : veloute, tartinade, gaspacho,  ketchup, plat cuisine vegetarien, confiture. Vente directe a la ferme, marches, livraison de panier hebdomadaire sur abonnement.',1),(69,'Bio des Coteaux','Installee dans les coteaux du Quercy, je cultive des fruits, legumes, fleurs et plantes aromatiques en agriculture biologique depuis 1994.\n\nDans l\'atelier a la ferme, j\'elabore une gamme de conserves artisanales: confitures, coulis, sirops, jus, chutneys etc, issues essentiellement de mes productions et cueillettes sauvages.',1),(70,'Il était un fruit','Il était un fruit...c\'est une gamme inédite de fruits juste séchés sans additifs ni sucres ajoutés : de délicieux pétales de fruits pratiques pour une consommation outdoor, fruits cultivés en France',1),(71,'O GOURMANDISES D ALICE','artisan chocolatier confiseur ,biscuiter , travaillant des produits locaux',1),(72,'BOY MAURY','Boy Maury est une entreprise familiale implantée depuis plus de 50 ans dans le Lot à Biars-sur-Cère.\n Son activité principale est l\'expédition de noix sèches du Lot ( Noix du Périgord AOP ), nous commercialisons aussi l\'asperge de Tauriac ( 46 ) des noisettes du Lot, la prune reine Claude de Carennac (46), le Melon des coteaux du Quercy, ainsi que le marron du Lot et de l\' Aveyron.',1),(73,'MARCOU','C\'est en famille et avec passion que nous produisons des noix dans le Lot. Notre savoir-faire nous permet de vous proposer toute l\'annee des produits de qualite : noix coque, cerneaux, huile, confiture, ... Il y en a pour tous les gouts !\nN\'hesitez plus a integrer la noix dans votre alimentation. C\'est un fruit naturellement riche en Omega 3 qui participe au bon fonctionnement du systeme cardiovasculaire et une excellente source de vitamines. Il suffit d\'en consommer 3 a 5 par jour.',1),(74,'ANTOLIN DELICES','',1),(75,'Cabiron traiteur','traiteur organisation de réception',1),(76,'Pole Sud','En 2008, le glacier Pole Sud et le pâtissier Le Gourmet Parisien se sont associés pour former le groupe La Compagnie des Desserts.\n\nCette fusion est apparue comme une évolution naturelle de lhistoire entre les deux spécialistes du dessert. Suivront Midi Pyrénées en 2011 puis, La Croquanterie.\n\nCes quatre marques poursuivent une ambition forte commune: devenir le spécialiste du dessert dans la restauration commerciale.\n\nLa créativité, la qualité gustative des produits et la sécurité alimentaire sont les atouts de La Compagnie des Desserts. Ils ont séduit la clientèle des professionnels de la restauration qui apporte beaucoup dattention au savoir-faire et à lutilisation de matières premières nobles.\n\nNous nous sommes fixés délever le travail du dessert au niveau dun art dédié à la gourmandise et au plaisir des yeux. \n\nCest dans cet esprit que nous vous invitons à visiter notre site et à nous faire part de vos suggestions pour offrir encore plus de bonheur aux gourmands.',1),(77,'La Belle Aude','fabrication artisanale de glaces et de sorbets',1),(79,'Audeline','Depuis de nombreuses annees , nous elaborons nos cremes glacees a partir de lait frais produit sur notre ferme.Retrouvez la douceur des glaces de votre enfance et laissez vous seduire par nos nombreux parfums issus d\'aromes naturels.',1),(80,'BARRELLE','Barrelle c\'est quoi ?\nUne chocolaterie-glacerie artisanale et pâtisserie à ses heures perdues. \n\nBarrelle c\'est qui ? \nImaginé par Barbara et Alexandre, respectivement diplômée décole de commerce et chef pâtissier-chocolatier et glacier, la marque gourmande ressemble aux envies de ses créateurs : un savoir-faire artisanal associé à des produits originaux et créatifs.\n\nBarrelle C\'est où ?\nCest dabord, dans un seul et même lieu, une boutique et un laboratoire de production à Blagnac, à côté de Toulouse. Derrière la verrière intérieure, on observe Alexandre travailler ses produits frais, locaux et made in France. Barbara sactive dans les coulisses, cest elle qui gère notamment le site e-commerce la communication et la vente aux professionnels. \n\nDu 100% fait maison !\nTous les produits certifiés Barrelle sont réalisés par Alexandre, dans son laboratoire. Il travaille des ingrédients locaux (autant que possible) et qualitatifs de façon artisanale (cest-à-dire beaucoup avec ses mains et peu avec des machines !).',1),(81,'Le Grenier Aux Abeilles','Vente de miels et de produits de la ruche chez le producteur',1),(82,'La ruche du fringaire','Apiculteur',1),(83,'Rucher Des Garrigues Gardoises','Un viticulteur fut pris de passion pour les abeilles, en 1957 :\nMonsieur Robert GALIBERT décida d\'acheter des ruches.\nLes premières années seront difficiles.\nAfin de mieux évoluer, M. GALIBERT suit des formations,\net au fil du temps la pratique et les relations avec des\napiculteurs professionnels lui permettent de bien évoluer.\nSavoir gérer les abeilles c\'est déjà un art, mais il se devait \nde vendre les miels récoltés pour en vivre.\nAlors avec son épouse ils créent le\nRUCHER DES GARRIGUES GARDOISES\nIls atteignent 500 ruches et rentrent dans le cercle des \nplus grands apiculteurs du Gard.\nIls arrivent à commercialiser 5 à 7 miels en direct.\nLeur fille rencontre Gérald MEGER qui a une formation de technicien en gestion d\'entreprise et\npassionné par la biologie, la génétique et l\'abeille.\nIls créent ensemble leur entreprise apicole en 1983 et gèrent 200 ruches, développent leurs \nconnaissances sur les élevages de reines d\'abeilles, la production de gelée royale et de pollen.\nEn 1996 Monsieur GALIBERT prend sa retraite et leur fille Myriam et Gérald MEGER prennent la suite du RUCHER DES GARRIGUES GARDOISES.\nA ce jour ils gèrent de 700 à 1000 colonies, produisent 10 à 14 variétés de miels, de la gelée royale et du pollen.',1),(86,'GAEC Le Rucher De Montimas','Du producteur au consommateur, motre objectif est de vous faire découvrir différentes saveurs de miels et ainsi profiter de leurs bienfaits, le tout à un prix producteur.\n\nAlors nhésitez pas à varier votre commande et profitez de frais de ports avantageux et de remises conséquentes pour toute commande par douzaine de pots.\nNotre métier est délever les abeilles et den tirer le meilleur, car il faut savoir que ces dernières produisent bien plus que du miel:\ndu pollen\nde la gelé royal\nde la cire\nde la propolis (antiseptique de la ruche)\ndu venin (utilisé en apithérapie :sclérose en plaque)\nla pollinisation (indispensable a la production de fruit par exemple)\nle miel\n\nNe pouvant pas tout exploiter, la production de miel est notre priorité, nous proposons également le pollen. \nLa transhumance des ruches nous permet de suivre les fleurs au fil des saisons et de produire ainsi une dizaine de variétés de miel.\nFabienne et Rodolphe Tonnellier',1),(87,'Les Miels de Mon Pays','miels et produits de la ruche (pollen/propolis)',1),(88,'MIEL ROUQUETTE','Exploitation apicole crée en 1960 par Charles Rouquette, aujourd\'hui, l\'une des plus importante de la région avec l\'exploitation de ces 1000 Ruches.\nGrâce à la transhumance nous produisons 10 variétés de miel et tous les produits dérivés : pain dépices, nougats, brut de miel......\nNous sommes également labellisés \'destination sud de France\' car nous faisons visiter notre établissement au grand public pour qu\'il découvre notre métier et nos produits.',1),(89,'Nectars Du Soleil','La société Nectars du Soleil est créée en 2008 pour proposer à des apiculteurs professionnels de réaliser l\'extraction de leurs miels.\nDe ce fait la société se trouve en présence de produits dont elle connait l\'origine et surtout dont elle maitrise s\'extraction.\nLes responsables décident donc de commercialiser ces produits sous la marque NECTARS DU SOLEIL.\nLe choix de la vente fut orienté vers des boutiques spécialisées produits du terroir etc...\nDepuis un an nous développons la marque à l\'import ainsi que vers du conditionnement pour des sociétés.',1),(90,'Famille Peyre','Apiculteurs recoltants sur 3 generations dans l\'Herault (34), Famille Peyre, vous fait decouvrir un miel de grande qualite produit selon des traditions familiales.',1),(92,'RUCHERS DE BOHEME','Nous sommes apiculteurs-producteurs-transhumants.\n\nNotre ferme est situee a 35 min de Toulouse, entre Gaillac et Montauban.\n\nNotre exploitation est conduite en agriculture biologique.\n\nNous produisons entre 8 a 10 miels differents en fonction des saisons. Nous faisons aussi les produits de la ruche, pollen, propolis, savons au miel, bonbons...\n\nNous transhumons nos ruches sur la Lozere pour faire les miels de framboisiers, de montagne et de bruyere callune et sur le plateau de Sault(84) pour le miel de lavande. Les autres miels sont produits dans le Tarn, Tarn et Garonne et Haute Garonne.',1),(93,'TAVANEL','Au début du siècle passé, au creux des collines aveyronnaises, le village de La Vernière comptait parmi ses habitants les plus estimés un prêtre, un médecin, et un professeur. Si lun soccupait des âmes, lautre des corps, et le dernier des esprits, celui dont le métier et le rôle fascinait le plus les habitants était lapiculteur. Son habileté à apprivoiser les abeilles permettait aux cultures dêtre pollinisées, aux rhumatismes dêtres guéris, et aux organismes dêtre régalés et fortifiés par ce produit extraordinaire quest le miel. \nComme beaucoup de villages, La Vernière ne fut pas épargnée par lappel des villes et au fil du temps il ny eut plus de prêtre, plus de professeur, plus de médecin, et plus dapiculteur. Ce dernier cependant ne laissa pas son savoir faire tomber dans loubli, et avant quil ne séteigne, il transmit ce quil savait à un professeur de Béziers qui venait dacheter une maison au hameau. Quelques années plus tard celui ci transmit ce savoir faire unique à son fils qui après une carrière de photographe et écrivain retourna au travail de la terre et des abeilles. \nAujourdhui cest à mon tour de me montrer digne dun métier ancestral qui de part les fonctions vitales quil remplissait, était au centre de la vie collective et estimé par chacun. Cest ma volonté de recréer ce lien qui unissait jadis, habitants et apiculture.\nJe suis apiculteur, mon père était écrivain, mon grand père professeur, et celui qui a ancré dans notre famille lamour des abeilles, sappelait Tavanel.',1),(94,'Coopérative des Apiculteurs d\'Occitanie','La Coopérative des Apiculteurs d\'Occitanie tient ses origines dans l\'association des Apiculteurs du Languedoc créée en 1955. L\'objet de la coopérative est la création dun outil économique rentable&#8232; pour l\'apiculture régionale. Accompagner et former des apiculteurs en devenir et professionnels, fournir des prestations de formation, danimations et évènementielles, fournir des espèces végétales mellifères, des essaims d\'abeilles et éditer des supports pédagogiques. Mais surtout produire et vendre des produits de la ruche de ses adhérents Occitans.',1),(96,'Le rucher de Bastien','Exploitation familiale apicole de 200 ruches située en zone montagne dans la vallée de La Barguillère (09) à 600 mètres d\'altitude. Nos ruchers sont exclusivement dans la vallée et les ruches transhumées l\'été en haute montagne. \nNous produisons plusieurs variétés de miels principalement mais aussi une large gamme de produits de la ruche (pollen, propolis, miel en rayon, vinaigre de miel et bougies)',1),(97,'Le rucher de Gascogne','Rucher familial situé dans les coteaux Lomagnols. L\'extraction de notre miel se réalise de façon traditionnelle au couteau. Nous proposons actuellement Quatre miels différents ainsi que deux pains d\'épices. Attachés a notre terroir prochainement un troisième pain d\'épices aux couleurs locales (pruneau armagnac) viendra compléter notre gamme modeste mais néanmoins authentique.',1),(98,'LES RUCHERS DE LA FERME DE PUECH CABRIER','Exploitation apicole cree en Fevrier 2018 a Uchaud (Gard) par Sebastien FLOUTIER. Veritable passionne dapiculture et de nature, Sebastien possede un cheptel d\'environ 500 ruches qu\'il transhume au gre des saisons et des floraisons dans de nombreux terroirs naturels dans le but de produire un gamme de miels varies et labellises (AB, IGP Miel des Cevennes, IGP Miel de Provence, Label Rouge). Cet apiculteur fabrique aussi de facon artisanale divers produits a base de son miel: nougat bio au miel de lavande, vinaigre de miel bio, pain d\'epices bio, Caramiel et Tartin\'o miel (pates a tartiner au miel).',1),(99,'Art de miel','L\'exploitation \'Art de Miel\' est avant tout une histoire de cur et de famille, lancée par Mireille et Christian PONS. Après 30 ans de passion pour l\'apiculture, ils sont devenus exploitants dans le village de COURNONSEC à l\'ouest de MONTPELLIER. \n\nLes produits :\n\n- Le miel de première qualité, artisanal et non pasteurisé, composé des nectars qui fleurissent dans la région. Récolté et extrait avec respect pour la santé des abeilles.\n\n- Le pain d\'épices, la moutarde, les sucettes... tous les produits transformés à base de miel sont fabriqués directement sur l\'exploitation de façon artisanale.',1),(101,'Famille Edo','Famille Edo est une entreprise agricole de production de miels. Métier/Passion,  lintérêt pour lapiculture cest labeille qui la fait naitre.                                     \n A son contact, ce petit insecte apporte par bien des égards des joies au quotidien. \n  Famille Edo, cest dabord Annick et Jean François qui dès 1994, voguent de formation CIVAM Bio en rencontre dacteurs de la profession, de fait lentreprise sest rapidement officialisé auprès des instances régissant le monde paysan.   Au-delà des premières ruches la réflexion qui estime que nous empruntons la terre à nos enfants plutôt que den hériter de nos ancêtres évoque l\'éthique que nous portons à lactivité en préservant le respect du vivant. Observer lhumilité face aux expériences nouvelles saison après saisons.  \n    Très engagé dans la filière qualité depuis ses débuts, Famille Edo qui sest élargi avec  Marina et Jeremy propose aujourdhui une large gamme de miels issus de sa production.        \nLa traçabilité que nous portons à notre gamme permet de distinguer chaque miel à son rucher de production.   Ainsi vous pourrez découvrir et consommer local diffèrent miel de Garrigue tels les incontournables  miels de Frontignan, Montbazin, Poussan, Mèze.  Famille Edo sinscrit dans  un volet environnemental pour la pollinisation et la biodiversité en  engageant des ruchers sur le bassin de Thau, en Occitanie et au-delà.  \nFamille Edo.',1),(102,'BEEZOU','Beezou nait en 2017 a laeroport de Toulouse-Blagnac. Cette cooperation originale sinscrit dans la demarche de Responsabilite Societale dEntreprise (RSE) de laeroport. Les abeilles beneficient ainsi des 700 hectares de prairies de la plateforme aeroportuaire avec 150 ruches.\nBeezou se developpe en region Occitanie et  produit egalement du miel issu de la vallee de la Leze avec 250 ruches ou les abeilles se nourrissent pour les deux tiers de nectar de colza et de tournesol.\nBeezou consacre toute son energie a devoiler les richesses du terroir Occitan, tout en contribuant a la preservation de la biodiversite si menacee aujourdhui. La qualite et la mise en avant de notre territoire, la mise en valeur des produits locaux et du terroir, la mise en place de circuits courts sont nos points dhonneur.',1),(103,'Au Miel Occitan','Couple d\'apiculteurs recoltants.\nNous produisons une douzaine de miels non chauffes, du pollen frais congele et sec, ainsi que du vinaigre de miel.\nNous vendons des essaims de printemps et hivernes et proposons nos services a des agriculteurs pour des pollinisations.',1),(104,'HAPPY-BRUC','Chez Happy-Bruc, nous vous proposons des Miels Occitans 100% Naturels recoltes en Montagne Noire pour le Chataignier et en Malepere pour le Toutes Fleurs. Nous proposons egalement des produits derives, Patisseries et prestations Traiteur a base de Produits de Qualite issus de notre region en priorite.',1),(105,'la miellerie de l&#39;abeiau','entreprise d\'apiculture situer dans l\'ouest Herault, nous produisons des miels du terroir( bruyere, chataignier, garrigues, foret).  nous travaillons en familles et vendons en particulier en circuit courts.',1),(106,'miellerie des clauses','La Miellerie des Clauses produits depuis plus d e50 ans des miels de terroir, pain d\'epice et hydromels au c',1),(107,'BISCUITERIE VEDERE','Située dans le département des Hautes Pyrénées à proximité de Lourdes, la biscuiterie Védère est, depuis 1905, lambassadeur de ses montagnes. Elle perpétue la riche tradition pâtissière de ces hautes terres et nous fait retrouver les recettes de nos grands-mères réalisées avec des produits du terroir. Chez Védère, les blés ont mûri sous le soleil du Gers, les ufs viennent des fermes gasconnes et le beurre na rien perdu de son onctuosité dhier. Parce que les trois valeurs fondamentales de la maison sont le terroir, la tradition et lauthenticité. Védère travaille pour un développement durable et éthique.\n\nUn mois cest :\n4 tonnes de farine\n3 tonnes de sucre\n1.5 tonnes de beurre\n100 000 oeufs\n130 000 biscuits \n15 000 tourtes \n\nHISTORIQUE\nAu départ de cette aventure, il y a deux hommes. Deux amoureux des recettes de leur terroir : Jean Brau et Paul Védère. \nEn 1905, le premier cuit et vend dans sa petite échoppe de Tarbes, une variété locale de biscuits à la cuillère, les traditionnels biscuits de Pyrénées, dont se régalent tous les gamins et les gourmands du coin. \nQuelques années plus tard, à Montgaillard, au pied du Pic du Midi, entre Tarbes et Bagnères-de-Bigorre,  Paul Védère cuit le pain. Il est témoin des tentatives de son fils de remettre au goût du jour les pâtisseries quil mangeait enfant. Parce que son palais na jamais oublié la texture et le goût des tourtes de sa grand-mère, quil savourait en rentrant de lécole, Jean Védère son fils,  décide de les ressusciter. Nous sommes en 1950 et cest le début dune saga qui transforme la boulangerie en pâtisserie de renom. Les tourtes plaisent tellement que léchoppe familiale sagrandit, rachète rapidement la petite fabrique de Jean Brau élargissant du même coup son savoir-faire. \nAujourdhui Védère, est un acteur économique et culturel du département des Hautes Pyrénées qui a su marier tradition et modernité. Chaque jour les farines des blés et les ufs du Gers se marient dans les recettes. Leur alliance parfaite contribue au développement local autant quau rayonnement de la Bigorre dans toute la France. La grande distribution du grand sud ouest diffuse ces produits de qualité ainsi que quelques grandes enseignes parisiennes.',1),(109,'Boc d\'Oc','&#9989; Des plats cuisine&#769;s frais, savoureux, pre&#769;pare&#769;s avec de bons produits locaux, achete&#769;s en direct des producteurs.\n\n&#9989; Des recettes qui changent chaque semaine, et au fil de saison.\n\n&#9989; La solution repas ide&#769;ale pour tous les gourmands qui manquent de temps &#128077;&#127995;\n\n&#9989; Des bocaux consignes & reutilises, pour un repas zero dechet !',1),(110,'Chocolaterie Gonzalez','Proche de Montpellier, à l\'Espace Bocaud de Jacou (34), la chocolaterie Gonzalez vous propose un large choix de chocolats, biscuits, macarons, confiseries, pâtisseries et glaces. Patrice Gonzalez se démarque par ses recettes traditionnelles et authentiques mais aussi par la création de chocolats originaux. Le chocolatier Gonzalez élabore une grande variété de spécialités maison : des chocolats (Prix Sélection Hérault Gourmand 2005) mais aussi pâtisseries, caramels, glaces, nougats, pâtes de fruits (Prix Excellence Hérault Gourmand 2006) et dernièrement le 1er prix ARTINOVART 2013-2014 catégorie \'Passion et tradition\'.',1),(111,'Arena Franck','biscuits',1),(112,'Domaine des Massols','Le Domaine des Massols est situé en Haute Vallée de l\'Aude, dans la vallée du Rébenty, au croisement des 3 départements Aude, Pyrénées Orientales et Ariège. A 700m d\'altitude nous sommes idéalement situés pour la culture du Safran en Agriculture Biologique. Nous cultivons également les petits fruits rouges et récoltons l\'ail des ours et les orties présents naturellement sur le Domaine. Après huit années de travaux et le soutien financier du département de l\'Aude, de la région Languedoc-Roussillon et de l\'Europe nous disposons d\'un outil de travail performant avec un atelier de transformation végétal, des chambres et tables d\'hôtes.',1),(113,'MAISON CHABANOL','Boulangerie Pâtisserie Artisanale',1),(114,'Maison Bruyere','Maison Bruyère est une biscuiterie artisanale familiale fondée en 1964 dans le Tarn. Nous sommes spécialisés dans la confection de biscuits haut de gamme, naturels et qualitatifs. Maison Bruyère fabrique beaucoup de recettes traditionnelles locales comme le croquant de Cordes-sur-Ciel ou le chalumeau d\'Albi et le gâteau à la broche.',1),(115,'GLACES ARTISANALES PHILIPPE FAUR','Notre « philosophie de la glace » est aussi simple quambitieuse : retrouver le gout des produits naturels tout en gardant les saveurs authentiques et originelles. Toutes nos fabrications sont 100 % naturelles, sans exhausteur de gout, sans aromes artificiel, sans conservateur. \nPhilippe Faur aime bousculer les idees recues, partir en quete de nouvelles saveurs. Il travaille et selectionne des matieres premieres de haute qualite, nobles et naturelles qui donnent vie a ses creations. Ses allies ? la rigueur, la patience, la recherche, lamour du travail bien fait, et le retour aux vraies valeurs.\n\n Latelier de fabrication est base a Caumont, pres de St Girons (09). Depuis sa creation il a concu plus de 120 parfums, repartis en 3 gammes : les cremes glacees et sorbets ainsi quune gamme salee.',1),(118,'SOMAPAIN','Somapain, est une PME qui emploie  une vingtaine de salariés, située à Poulx près de Nîmes. Nous sommes fabriquant de pains traditionnels, pains spéciaux, pains bio certifié par ECOCERT, ainsi qu\'une large gamme de viennoiseries. Créée en 2008, Somapain assure depuis janvier 2015, la continuité des ETS BUISSON, maison familiale de Père en Fils, fondée en 1812, gardienne de recettes ancestrales . Nous sommes présents sur 4 départements, le Gard, L\'Hérault, Les Bouches du Rhône et le Vaucluse.',1),(119,'SARL VERRIERE APICULTURE','Pascal Verrière, apiculteur dans le Couserans élabore un miel d\'une grande pureté. Les miels de Pascal Verrière sont produits dans des montagnes préservées et donc éloignées de toute forme de pollution. Aujourd\'hui, Pascal Verrière possède plus de 400 ruches qui produisent entre 10 et 15 tonnes de miel par an. Les ruches les plus en hauteur sont situées entre 1500 et 1700 mètres d\'altitude, et les meilleurs sites sont sélectionnés en fonction de la densité de fleurs ou d\'arbres sur lesquels les abeilles vont butiner.',1),(120,'Gie castane','Castane et l\'alliance d\'un groupe de petits producteurs qui ont crees les specialite issues de chataignes cultivees en agriculture biologique et preparees sur place dans le respect des traditons cevennoles.',1),(121,'Les Ruchers d\'Embideau','ruchers',1),(122,'APINATURE','',1),(123,'FRUGAM SAS','APIFRUIT est une PME qui produit et distribue des fruits cuits sous vide à destination des professionnels de la restauration commerciale et collective. Les produits sont vendus via un reseau de grossistes au niveau national.\n\nBasé à Montauban, la société achète ses fruits majoritairement en France.\n\nLes fruits, conditionnés en poche sous vide, sont prêts à l\'emploi avec une grande simplicité de mise en oeuvre. La cuisson sous vide à la vapeur permet d\'obtenir des fruits à longue DLC, à la texture préservée, sans aucun sucre et aucun sirop ajouté.',1),(124,'Aux Délices de Maya','Apiculteur professionnel depuis 1987, produit une large gamme de miels de cru',1),(125,'Caroline Davelu','Productrice artisanale de miels et plantes aromatiques et médicinales Biologiques.',1),(126,'Le Fournil Cabanais','La boulangerie  pâtisserie  chocolatier  glacier a été créée le 1er Août 2016.\nJean-Luc MIROUZE a depuis le début fait le choix de travailler des produits de qualité fabriqués de façon artisanale avec des produits nobles issus en grande partie du territoire de lOccitanie (farine du Gers, noix du Lot, noisettes du Gers )\nLEsquirol (gâteau aux noisettes) spécialité de la boutique ainsi quune gamme de biscuits  sont nés sous la marque déposée « Coucos dAriejo ».\nCette gamme est en vente à la boulangerie ainsi que dans différents points de vente du département ariegeois. Un développement commercial va être mis en place afin détendre sur la région Occitanie la vente de la gamme « Coucos dAriejo ».\nAfin de faire connaître cette marque, un site a été créé où les consommateurs découvriront les packagings de ces produits sous de magnifiques photos : coucosdariejo.fr',1),(127,'GAEC DES RUCHERS SAINTE MARIE','la famille MORLIERE apiculteurs producteurs depuis 3 generations\nvous font decouvrir leur metier et leur passion au travers de la visite de leur exploitation et des produits elabores sur place \nMiels et produits de la ruche ainsi que la visite de la cite des abeilles parc sur la vie de l\'abeille antique a aujourd\'hui et parcours botanique afin de decouvrir les plantes melliferes.',1),(128,'Bleu de Nature','BLEU PAR NATURE :  la vie est bien plus belle en Bleu ! La marque eco friendly du groupe Terre de Pastel propose un ravissant catalogue Beaute, Accessoires de Mode et Maison. Fabriques en Occitanie, tous les produits sont issus des vertus vegetales du Pastel Isatis tinctoria L. reimplante par le groupe sur plusieurs hectares en agriculture responsable aux portes de Toulouse. Cette plante medicinale et colorante, tresor du patrimoine occitan, est pour BLEU PAR NATURE une source merveilleuse de creations Cosmetiques et Textiles respectueuses de l\'Homme et de l\'Environnement.',1),(129,'Marie de Livinhac','C\'est à Decazeville, ancien bassin minier en plein coeur d\'une région à la nature préservée avec des habitants attachés à leur terroir et à leurs spécialités culinaires, que l\'entreprise a choisi de s\'installer en juillet 1991.\n\n   Marie de Livinhac s\'engage à pérenniser et à transmettre l\'héritage du goût en fabriquant une gamme de préparations culinaires. Toute l\'originalité de l\'entreprise réside dans son savoir-faire qui s\'appuie sur une technologie de pointe : la lyophilisation.\nPrivilégiant notamment le goût, le terroir, la culture et la facilité de préparation pour le consommateur, l\'entreprise souhaite déconfidencialiser et favoriser l\'accessibilité à des spécialités françaises à forte notoriété régionale. Elle propose ainsi ses produits sur le marché français et parfois même international.\n\n   L\'idée à l\'origine de la création de l\'entreprise Marie de Livinhac est la proposition au consommateur de \'recettes traditionnelles au goût du jour\'. Les spécialités développées par l\'entreprise sont issues de l\'Aveyron, de l\'Auvergne et même de la Savoie. Parmi elles, on trouve :\n- l\'Aligot d\'Aveyron\n- l\'Estofinade Aveyronnaise\n- la Truffade Auvergnate\n- le Rösti à l\'Emmental\n- la Galette au Comté\n- la Tartiflette de Savoie',1),(130,'EP LES GOURMANDS!','Ep les Gourmands est installe dans le Tarn depuis 2016. Nous vous proposons des produits artisanaux  sucres et sales elabores a partir de produits locaux et de saison. Nous n\'utilisons aucun additifs. \n\nOriginaux ou etablis a partir de recettes traditionnelles, nos produits racontent tous une histoire, qu\'elle soit humaine ou historique.',1),(131,'le rucher secret des camisards','',1),(132,'ô saveurs du terroir et les secrets de mamy','Fabrication de produits artisanaux , sauces maisons , marinades et fond de sauces 100 % végétal , moutarde aromatisée , vinaigrette à l\'huile d\'olive , sels aromatisées,caramels maison',1),(134,'Croix d\'Aspouze','producteur d\'huile d\'olive en agriculture raisonnee avec une specificite monovarietale.\n\nVente sur rendez vous',1),(135,'La Truitelle','La Truitelle a cree et commercialise les premieres boites de conserves de petits poissons a l\'huile labellisees AB. A la fois ecologiques et gastronomiques, les conserves La Truitelle constituent une innovation importante tant pour le monde de l\'aquaculture que pour celui  de la conserverie. Notre gamme compte aujourd\'hui 8 recettes, elaborees sur les conseils de certains grands noms de la gastronomie occitane. Chaque conserve est composee d\'ingredients d\'exception, pour la plupart produits en region Occitanie, et fabriquee dans une conserverie artisanale francaise.',1),(136,'L&#39;Olivene','Huile d\'Olive du Gard et ses derives tel que: olives de bouche ou olivades.\nNos oliviers sont plantes sur des sols argilo-calcaire exploites en sec, exposes plein sud. Les traitements sont effectues en bio. \nNos olives sont cueillies sur l\'arbre a maturite complete. Aucune olives n\'est ramassees au sol. Elles sont triturees immediatement par lot et varietes separees.\nL\'huile est extraite par un mecanique a froid dans un moulin specialise.\nLes huiles ainsi recueillies sont de suite entreposees dans les cuves inox a l\'interieur de nos locaux sans adjonction de produit conservateur. Elles sont ni centrifugees, ni filtrees. La decantation se fait seule dans le temps. Selon les annees nous proposons la Negrette, l\'Aglandau, le Cayon, la Lucques, l\'Amello ou la Picholine.',1),(137,'Dilemme','Agriculteurs-producteurs en BIO depuis 1999, entre Languedoc et Vaucluse, nous mettons tout en oeuvre pour vous proposer une gamme d\'huiles d\'olive vierge extra aux aromes multiples. Nous vous accueillerons a Montpellier, Villedieu ou Saint Pargoire pour vous expliquer notre travail autour de la vigne, du thym et des oliviers.',1),(138,'Riz De Canavere','Dans la famille Benoit c',1),(139,'Domaine Olea','Depuis plusieurs générations, nous produisons de l\'huile d\'olive de grande qualité, et à partir de 2010 le domaine est passé en agriculture biologique. Nous commercialisons directement des huiles d\'olives fruité mûr et fruité vert ainsi que des huiles aromatisées, du safran en pistil, des bulbes de safran,  des amandes et des tisanes naturelles bénéfiques pour la santé, tout en AB. Nous organisons sur le domaine 2 pique-niques par an ainsi que des visites des oliveraies sur rendez-vous. Voir plus d\'informations sur notre site web.',1),(140,'Sels De Gruissan','Adosse au massif de la Clape, entoure par la mer et par l\'etang de l\'Ayrolle et en plein cur du Parc naturel regional de la Narbonnaise en Mediterranee, le Salin de lile Saint Martin s\'etale sur 400 hectares en bordure du village de Gruissan.',1),(141,'Les Salins du Midi','Depuis 1856, la Compagnie des Salins du Midi, largement reconnue au travers de ses marques La Baleine et le Saunier de Camargue, dispose d\'un savoir-faire unique et reconnu dans le domaine du sel de mer.\nIssu dun terroir dexception, le sel Le Saunier de Camargue est recolte sur le salin d\'Aigues Mortes au cur d\'une nature sauvage. Il est le fruit authentique dun savoir-faire transmis de generation en generation.',1),(142,'Amours De Camargue - Camargue et Traditions','Fabrication artisanale de sels de Camargue aromatisés aux épices.\nUne invitation au voyage des sens. \nArômatiques et exhausteurs de goûts, ces sels colorent la saveur des mets.\nNous avons sélectionnés les plus nobles variétés et les plus belles qualités d\'épices pour que ces mélanges vous procurent des saveurs qui vous feront voyager au quotidien.',1),(143,'SALIN DE LA PALME','Le Salin de La Palme est l\'un des principaux sites de saliculture de l\'Aude avec plus de 400 hectares.\nTerre blanche, rose et salée entre la mer et la garrigue.\nAu loin le Canigou et tout près la falaise de Leucate.\nDepuis l\'Antiquité, la fabrication du sel est en osmose avec la nature.\nLa Salin de La Palme est reconnu pour la qualité et la pureté de son sel.\nEn venant sur ce site vous serez conquis par l\'authenticité des paysages et la force des éléments.',1),(144,'Ail Noir Bio Terroirs de France','Ail Noir Bio est une petite entreprise artisanale  de transformation  d\'un seul produit,  l\'ail  bio en ail noir bio.\nJe ne suis pas productrice d\'ail. Jachete l\'ail, ail rose et ail blanc  aupres de producteurs locaux  en Occitanie seulement (Tarn et Tarn et Garonne),agrees en agriculture biologique.\nL\'ail   est transforme en ail noir , par etuvage en petites quantites afin de pouvoir assurer une qualite maximale tout au long du processus.. D\'ailleurs, l\'entreprise est agree   bio, par  l\'organisme de certification Ecocert.',1),(145,'MAGRADA','La Maison MAGRADA propose des produits savoureux elabores a partir de viandes issues d\'elevages d\'Ariege ou de departements limitrophes. Nos procedes de fabrication perpetuent les recettes de nos anciens tout en adoptant des equipements et procedes conformes aux normes sanitaires actuelles. Par nos methodes, resolument artisanales, nous apportons un soin particulierement meticuleux et patient a chacun de nos produits.\nElaborees sans ajout de nitrites, ni sucres, ni additifs, conservateurs ou colorants, les viandes MAGRADA sont pauvres en graisses et riches en proteines...',1),(146,'Les Jardins de Jammes','Les Jardins de Jammes, Plantes medicinales et aromatiques en Aveyron.\nDomaine en agriculture biologique et biodynamique',1),(147,'Safran de Bize','Entre combes et garrigue, au coeur du Languedoc, notre exploitation de Safran et de Plantes Aromatiques et Médicinales labellisée Agriculture Biologique et Production Sud de France s\'étend sur 2,2 hectares entourant une ancienne Bastide du XVII ème siècle rénovée, dans l\'Aude et plus particulièrement sur la magnifique commune de Bize-Minervois (11120).\n\nTraversée par la rivière de la Cesse, et voisine du Canal du Midi, à l\'intersection des fameuses Cités Médiévales de Minerve, Narbonne, Carcassonne et Béziers et à 20 km de la mer Méditerranée, c\'est une terre riche de cultures, aussi complexe dans son Histoire que dans les arômes intenses qu\'elle peut nous offrir.\n\nAmoureux de notre terroir et de ses trésors, nous apportons un soin extrême à mettre à l\'honneur sa richesse et l\'intensité de sa nature...\n\nNotre gamme de Sirops se compose de 4 concentrés de saveurs, 100% naturels et contenant un minimum de sucre, dont nous recommandons l\'utilisation en cuisine et sur l\'assiette, en accompagnement ou nature et à boire.\n\nQuant à notre Safran, dont la finesse et l\'intensité reconnues sublimeront vos préparations culinaires, nous le déclinons par notre savoir-faire spécifique (nous effectuons notamment un séchage au feu de bois) en une palette de saveurs des plus étonnantes.\n\nAu plaisir de vous la faire découvrir,\nBien à vous... et bonne dégustation...\n\nMarion BENOIST-ANTOINE',1),(148,'AROMANDISE','AROMANDISE (arômes - gourmandise), exprime le plaisir de travailler avec les plantes qui nous réjouissent de leurs parfums, leurs saveurs et leurs bienfaits. \'Aux sources du bien-vivre\', c\'est une invitation au voyage et aux découvertes personnelles, l\'ouverture vers le monde du bien-être et de l\'art de vivre.\n\nNous concevons, développons et distribuons des produits, sous les marques Les encens du monde, Hildegarde de Bingen, Fleurs à croquer et Cristaux d\'Huiles Essentielles .\n\nCes marques font désormais référence en France et dans plusieurs pays d\'Europe, chacune dans leur domaine. Leur succès provient du savoir-faire et du professionnalisme d\'une équipe, mais surtout de la cohérence d\'une démarche de 20 ans autour d\'un même projet fondateur : défendre, faire connaitre et apprécier les savoirs et les produits du monde, dans les domaines de l\'art de vivre et du bien-être ; concevoir et distribuer des produits authentiques et riches de sens ; pratiquer notre activité dans le respect actif de l\'écologie et de l\'équité sociale et culturelle.',1),(150,'Myhomefarmer','Notre metier d\'agriculteur.\n\nTout le monde connait le Languedoc Roussillon, ses plages, son terroir, son vin et surtout son soleil...\nSavez-vous que l\'on y cultive aussi les aromatiques les plus raffinees et l\'epice la plus precieuse du monde et seule epice tiree du pistil d\'une fleur ?\nNiche dans la plaine ensoleille du petit village de Villeveyrac qui se situe a 10 km du Bassin de Thau proche des villes de Sete et Montpellier, entre vignes et oliviers, c\'est au sein de notre exploitation',1),(151,'LE CLOS FERRIE -SAFRAN et APICULTURE','Aux portes de Montauban (82), Julie cultive un Safran de souche Quercy, certifie Bio, et vous propose de nombreux produits safranes fabriques ou transformes a la ferme.\nElle eleve ses abeilles dans un milieu encore protege et ne les transhume pas. Le miel produit est issu des bois et prairies entourant l\'exploitation du Clos Ferrie.\n-Vente directe a la ferme sur rendez-vous-',1),(152,'Domaine de Pouzes','Nos plantes aromatiques et médicinales vont révéler vos légumes et grillades dété mais aussi réchauffer vos tisanes dhiver.\nCultivées au sein de notre ferme familiale, au cur dun vallon préservé situé entre Languedoc et Cévennes, ces variétés méditerranéennes ont été sélectionnées pour leurs goûts et leurs arômes prononcés. Sous forme de feuilles et fleurs entières, elles peuvent être consommées en condiment ou en tisane. \nIssues dune agriculture biologique innovante et intégrée, ces herbes vernaculaires, très mellifères, participent à enrichir la biodiversité locale.\nLe séchage naturel en grange restitue leur qualité gustative ainsi que leurs principes actifs puisés dans ce terroir de schiste cévenol et de garrigue méridionale, baigné de soleil.',1),(153,'FBG','Fruits et legumes sans pesticides sans engrais. \nVarietes de menthe\nDifferents fruits et legumes : tomates, courgettes, melons, pasteques, oignons, concombres.... \nPlusieurs varietes connu ou moins connus : melon ananas, melons cornu, concombres lemon Apple, tomates ananas, noires de crimes, supersteak, ou cur de buf....',1),(154,'Lubrano et fils','Entreprise familiale cree  en 1934 et reconnue pour son savoir faire. Nous sommes une boulangerie industrielle situee a Gigean, specialise dans la fabrication de pains \'premium\'.\nPrivilegiant un sourcing local (fournisseur farine Sud de France), et pro-actif dans les circuit court et RSE. \nNous souhaitons continuer notre demarche en proposant une produits Sud de France.',1),(155,'EIRL SALABEL','Nous sommes producteur de Safran du Quercy et nous realisons des produits safranes pour les fins gourmets.\n\nSitue au c',1),(156,'Vert coquelicot','Mille et une façons est une Entreprise Adaptée et Solidaire agréée (entreprise qui emploie des personnes en situation de handicap)basée à Saint-Gilles dans le Gard. Notre entreprise engagée dans la démarche IGP riz de Camargue commercialise une gamme de riz de Camargue IGP Bio à la marque \'Vert coquelicot\'.\nCes riz sont sélectionnés avec soins puis conditionnés sur nos lignes.',1),(157,'Ferme des Hauts Coteaux','Ferme familiale bio en polyculture élevage bovin viande et Porcin.\nNous avons \n- Un taureau Angus, Des blondes d\'aquitaine et croisés Angus\n- Des truies noire et Duroc, un verrat large-white croisé piétrain, des cochons croisés\n- Des céréales pour la consommation animale (méteil, orge, lupin, maïs...)\n- Des céréales pour la consommation humaine : blés anciens, sarrasin, seigle\n- Du colza\n- Des prairies, foin, paille',1),(159,'SCIC Graines Equitables','La SCIC Graines Equitable a ete fondee en 2014 par 7 agriculteurs dans l\'Aude.\nEn 2021 notre cooperative, integralement en Bio, est forte d\'une quarantaine d\'adherents agriculteurs en Occitanie.\n\nLa SCIC Graine Equitables commercialise environ 1000 000 Tonnes de cereales, principalement de grande culture Bio telles que le ble tendre et le ble dur mais aussi des lentilles, des pois et des graines de luzerne.\n\nDans ses perspectives de fort developpement, le fonctionnement est optimise. Les operation de nettoyage, tri et stockage qui etaient externalisees sont desormais internalisees.',1),(160,'Malterie Occitane','La premiere activite de la Malterie Occitane est de produire du malt. Dans une exigence de qualite notre outil de production est une malterie continue dune capacite de 1500t par an. Combine a un cahier des charges exigeant sur la qualite des orges, cet outil nous permet de proposer des malts dexceptions uniques.\nPour repondre aux demandes des brasseurs et des consommateurs notre malterie sapprovisionne exclusivement en orge local. Grace a notre collaboration avec la cooperative cerealiere regionale Arterris nous pouvons garantir une tracabilite brusque la parcelle. De plus, la collecte et le stockage de nos orges sont optimaux et nous reduisons notre empreinte ecologique.',1),(161,'Lo Cantou de Bastien','Petit paysan en agriculture biologique depuis 2008 , eleveur d\'agneaux bio sous la mere et en plein air.\nProducteur d\'huiles vegetales et de lentilles vertes et de pommes de terre. Tres attache au respect et au bien-etre du vivant qu\'il soit vegetal ou animal.',1),(162,'ALIGERMA','Nous achetons des legumineuses (pois chiche, lentille...) labellisees (BIO et HVE) a un reseau d\'agriculteur 100% Occitan. Nous transformons ces legumineuses a Albi de facon innovante. Nous faisons tremper, germer, cuire a la vapeur et surgeler nos legumineuses que nous destinons au professionnels. Notre gamme est ainsi plus digeste, avec plus de vitamines, des proteines plus assimilables et un temps de preparation de 4 minutes en cuisine avec une remise en oeuvre tres simple. Nos produits sont des bases culinaires, sans sels ou ajouts autres, prets a etre degustes ou transformes.',1),(163,'la payse de Chapieu','Paysans-boulangers bio en Lozere',1),(165,'MOULIN DE RIVIERES','',1),(166,'Mie\'Nutie Les Moulins Pyrénéens','Les MOULINS PYRENEENS  est une activité de meunerie. Nos deux sites,  à Sallèles dAude (11) et  à Saverdun (09) Travaillent des blés dur et blés tendre, proviennant exclusivement de la région Languedoc Roussillon Midi Pyrénées.',1),(167,'ALBIGEOISE DES PATONS','Albigeoise des Patons est situee au coeur de l\'Aveyron, l\'entreprise existe depuis 25 ans, fabrique des pains crus, cuits, et des patisseries regionales, destines a la vente aupres des particuliers par nos commercants ambulants dans les villages des departements de l\'Aveyron, du Lot, Lot et Garonne, la Lozere, la Correze, du Tarn et Tarn et Garonne. Ventes egalement sur les marches regionaux, aupres des acteurs du food-services et de la grande distribution recherchant des produits qualitatifs.',1),(168,'BA PLA','Depuis plus de 70 ans, la famille PIGOT soccupe de ses terres agricoles située 81 RD 964 GAMOT à TECOU dans le département du Tarn (81) sur une exploitation agricole traditionnelle. C\'est de la richesse des terres tarnaises, dans la plaine de Técou, que sont nées les pâtes BA PLA. \nLa SARL DELORT ET PIGOT a été créé en Septembre 2012, la fabrication et commercialisation des produits a débuté en Février 2016 après élaboration du packaging et après avoir finaliser la conception des pâtes.\nAttaché au savoir-faire et à l\'amour de la terre,  Jean-François PIGOT, transforme aujourdhui le blé dur en pâtes sèches alimentaires dans son atelier de fabrication,  dans le respect des normes.\nCest les différentes variétés de blé dur utilisé et la présence de son (2 à 3%) dans le blé dur qui confère à ces pâtes une couleur et un gout particulier. La qualité de fabrication confère une bonne tenue à la cuisson et une saveur très appréciée. \nPour une sécurité alimentaire optimale, nos productions sont contrôlées par un laboratoire indépendant.',1),(169,'Domaine De Peries','Le domaine de Peries est situe a louest du departement de lAude, au cur du Pays Lauragais, grande region productrice de ble dur de qualite. Nous fabriquons nos pates avec notre culture de ble dur que nous developpons sur des parcelles minutieusement selectionnees et destinees exclusivement a notre production. Nous cultivons nos cereales dans une demarche responsable, respectueuse de bonnes pratiques agricoles, pour offrir au consommateur des produits sains de grande qualite.',1),(170,'NUTRINAT','NUTRINAT, LALTERNATIVE ALIMENTAIRE 100% BIO, 100% VEGETALE, 100% LOCALE.\n\nNUTRINAT est une entreprise agroalimentaire certifiee bio et creee en 2010 autour de lassociation des cereales et des legumineuses germees. Nous proposons gamme de plats, riches en proteines vegetales et en vitamines tels que des salades traiteurs et des plats chauds vegetariens. Nous produisons egalement une gamme unique de pates seches enrichies en legumineuses germees. Enfin, NUTRINAT valorise la production des agriculteurs bio du Gers et du Tarn et Garonne de son partenaire QUALISOL en distribuant leurs graines et leurs legumineuses.',1),(171,'LANDREAU','Située à Toulouse, rue Boulbonne, l\'entreprise est délocalisée à Tournefeuille dans les années 70 et son usine est créée.\nL\'entreprise est aujourd\'hui est aujourd\'hui dirigé par M. Pelc, le gendre de M. Landreau.\nL\'entreprise familiale est spécialisée dans les pâtes et raviolis frais. \nLandreau choisi de la semoule de blé dur pour la fabrication de ses pâtes, car il s\'agit d\'un blé plus qualitatif.\nPar son positionnement haut de gamme la société peut garantir un produit de grande qualité, ce qui lui vaut d\'être un acteur incontournable et responsable des \'pâtes\' dans la région.',1),(172,'Nim&#39;grain','Nous sommes situes sur la commune de Nimes.\nNous produisons des cereales, oleagineux, legumes secs, du foin et de la paille.\nNos produits\n- Farines alimentaires  : grace a notre moulin a meule de pierre, nous proposons differentes farines (Ble tendre, Ble dur, Seigle, mais (farine et polenta), Pois chiche, Lentilles.\n- Legumes secs : pois chiches, lentilles vertes et blondes, haricots coco blancs.\n- differentes sortes de pates.',1),(173,'LA FERME o Pates','Un petit tour  dans le Comminges ca vous tente ? Bienvenue !\n\nNotre exploitation en quelques mots : \n* des hommes : nous sommes trois a travailler a temps  plein (Florian & Christine associes et Joel salarie) et une personne en apprentissage (licence pro).\n* des animaux : \n  - des vaches laitieres, 55 Prim Holstein et Prim Holstein x Simmental\n  - des poulets de chair eleves sous signe officiel de qualite (label rouge du sud ouest): 2 batiments de 400 m',1),(174,'L\'oulibo','Créée en 1942, la Coopérative lOulibo est actuellement la seule Coopérative oléicole du département de lAude. Après le gel de 1956 qui a décimé loléiculture française, lOulibo a continué à perpétuer la culture de lolivier dans lAude. Elle reçoit les olives de 3 départements : lAude, lHérault, les Pyrénées Orientales. Du fruit à lhuile, découvrez le travail des oléiculteurs, du moulinier.. et suivez toutes les étapes de la transformation, jusque dans la boutique de nos producteurs.',1),(176,'LE MOULIN DE FABI','Le Moulin De Fabi est une petite Entreprise familliale.\nNous produisons, transformons et commercialisons nos olives de\nbouche \'Lucques\' ainsi que nos huiles d\'olive des variétés \'Oliviére, Verdale, Bouteillan, Picholine\' ainsi que notre assemblage \'Thomas\'.',1),(177,'Huilerie Cooperative De Beaucaire','Beaucaire, ville dart & dhistoire, a la limite du Languedoc et de la Provence, sur la rive droite du Rhone, au cur du triangle d\'or Nimes, Arles et Avignon, est la region ou l\'Olivier et la Vigne regnent en maitres.\n\nCreee en 1924, lHuilerie Cooperative de Beaucaire se situe a deux pas du Chateau feodal et sa tour triangulaire.\nCest le plus ancien atelier de transformation dolives en huile de Beaucaire et des communes gardoises environnantes.\n\nCest dans ce cadre exceptionnel que la cooperative se renouvelle sans cesse, afin dobtenir ce precieux nectar dore, regulierement recompense lors de concours oleicoles.\n\nAujourdhui, nous sommes ravis de pouvoir vous accueillir sur notre site et vous faire decouvrir notre gamme de produits autour de lolive et lhuile dolive.\nUne invitation au voyage autour des sens ; dun confit de tomates sechees, aux saveurs naturellement poivrees de nos huiles en passant par nos preparations culinaires a base dhuile dolive.\nNous comptons sur vous pour faire evoluer notre site a travers vos commentaires et suggestions, afin de preserver une eternelle jeunesse a notre cooperative.',1),(178,'Le Domaine De Bordère','7 confits d\'oignons pour foie gras, viande, poissons, légumes. Vinaigrette au confit d\'oignons, soupe à l\'oignon, croustilles d\'oignons, beurre clarifié au confit d\'oignons et crème à l\'ail.\n\nLoignonière du Domaine de Bordère est située dans lAude, à Alaigne entre Limoux et Carcassonne, à 373 m daltitude. Elle bénéficie du climat méditerranéen et océanique et est irriguée par une petite rivière qui borde le Domaine et qui sappelle le «Sou». Nos oignons sont cultivés sur le Domaine, suivant les principes de lagriculture raisonnée et cuisinés comme autrefois !\n\nTous ces éléments naturels, conjugués aux soins intensifs que nous leur apportons, font de nos oignons, les meilleurs du monde.\n\nRiche en vitamine C, en potassium, en sélénium, en oligo-éléments, antibactérien antiallergique, bien pourvu en fibres, hypoglicémiant, loignon est un véritable médicament délivré sans ordonnance !',1),(179,'MOULIN A HUILE DE LA CHARTREUSE','Le Moulin à Huile de la Chartreuse a été fondé en 1358 par l\'Ordre des Chartreux, avec la bénédiction du Pape Innocent VI. Il est résolument ancré dans l\'histoire de son terroir gardois.\nLa Boutique, le site de production ainsi que notre Bistrot sont labellisés Qualité Tourisme - Sud de France.\nNous sommes ouvert 7j/7 de 7h30 à 20h toute l\'année et nous sommes toujours ravis de recevoir les visiteurs de tout horizon.',1),(180,'le moulin d\'uzes','C\'est a Uzes et ses alentours, berceau de la variete Picholine, que sont situees nos olivettes. Le soin apporte a la culture de nos arbres, a la cueillette de nos olives et a la phase d\'extraction, garantie une huile d\'olive riche en aromes et equilibree. Son caractere marque est le resultat du travail et de la passion de l\'oleiculteur pour vous offrir une huile d\'olive vierge extra, a partir d\'olives exclusivement issues de notre terroir local.',1),(181,'CAUVIN','Depuis sa création en 1951, l\'huilerie Cauvin est attachée à son terroir d\'origine : le Gard et à son produit phare : l\'huile d\'olive.\n\nNîmoise et fière de l\'être, notre PME a acquis une réputation internationale et s\'est diversifiée pour proposer aujourd\'hui une palette dhuiles parmi les plus complètes du marché. Elle offre une grande variété de goûts et de qualités nutritionnelles : huiles d\'olive de terroir, 100% purs jus d\'olive ou grands crus, huiles Bio, vinaigres et vinaigrette Bio, huiles rares et de goût comme le sésame, l\'argan, le sésame, la noisette, le lin \n\nVolumes commercialisés en 2018 : 10 000 KL \nChiffres d\'affaires 2018: 27 Millions \ndont 60% en Grande Distribution.',1),(184,'CHATEAU COUPE ROSES','Château Coupe-Roses est un domaine familial situé dans la partie montagneuse du Minervois; les pratiques culturales sont dans le respect de notre environnement et  nous travaillons à l\'expression forte de notre terroir.Les vins sont biologiques, chaque cuvée ayant sa propre expression originale et unique.',1),(185,'CAPRIOLI','30 ha d\'oliviers sur les collines à Cordes sur Ciel cultivés en bio\ncertifié Ecocert\nhuile d\'olive et fabrication de produits dérivés, tapenades, sot\'oli \nainsi que figues (confitures) distribués en circuits courts',1),(186,'MOULIN DU MAS CARDELLE','Exploitation agricole familiale, une partie en viticulture et une autre en oléiculture ainsi qu\'un moulin à huile. La partie oléiculture est en agriculture biologique.',1),(187,'huile du grand olivier','culture et vente d\'huile d\'olive',1),(188,'DOMAINE LA PARRA','Production de Blanc ,Rosé ,Rouge, \nen AOP minervois , IGP pays d\'oc, 	\nde vin passerillé et de vin sans sulfites ajoutés  élaboré selon des Recettes Romaines. \nProduction d\'huile d\'olive  et de jus de pomme.\n\nLe DOMAINE LA PARRA, cest :\nUn travail de la vigne de manière raisonnée, une taille aux ciseaux manuels, une limitation de produits phytosanitaires (avec utilisation de produits homologués en bio),pas d\'irrigation des parcelles, une vendange en partie manuelle, un travail de cave avec un petit pressoir, une vinification traditionnelle sans apport de levures exogènes, ni produites chimiques stabilisateurs (ce qui peut engendrer un dépôt natuel dans le fond de la bouteille) dans le but davoir un produit authentique et non standardisé .Un bouchonnage et étiquetage à la main.\nUne vinification sans sulfites ajoutés pour les vins Antiques.\nNos vins sont originaux . Ils sont différents dune année à lautre selon les cépages et les procédés de vinification utilisés.\n   Vins passerillés, c\'est à dire, surmûris sur la souche : nous avons dans cette catégorie plusieurs produits moelleux : muscat petit grain et le DEFRUTUM : assemblage de Grenache ,Vermentine  ,Roussanne ,en méthode Antique). \nNos cuvées Antiques sont des produits rares et très intéressants.',1),(189,'Le Moulin de Pignan','La coopérative oléicole intercommunale de PIGNAN a été créée en 1939 par 500 oléiculteurs provenant de 8 communes limitrophes.  Elle a rapidement progressé pour atteindre plus de 1500 adhérents et une production de  800 à 900 tonnes d\'olives, jusqu\'au gel de 1956.  \n\nActuellement nous produisons des huiles de Toutes Variétés et variétales (aglandau, olivière, lucques, verdale, picholine et Rougette de Pignan, qui est notre fleuron) ainsi que des olives de table et des purées d\'olives. Nous présentons également d\'autres produits du terroir et de l\'artisanat dans notre magasin de vente\nEt ceux, grâce à l\'investissement de plusieurs générations de Coopérateurs qui sont avec la Coopérative depuis 80 ans.\n\nDécembre 2015, pour pérenniser la structure, nous fusionnons avec la coopérative oléicole de Villevieille (30) pour devenir : SCA Les Moulins de Villevieille et Pignan, chacun ayant pu préserver son identité et sa production locale (BIO, AOP de Nîmes, Rougette de Pignan...) avec son point de vente. En 2016, le Moulin de Pignan c\'est vu doté des outils de transformation et de production d\'huile. Le Moulin de Pignan propose sa propre production d\'huile d\'olive !',1),(190,'OLIVERAIE BARTHELEMY','L\'Oliveraie Barthelemy c\'est le travail passionne d\'un pere et d\'un fils: Alain & Franck : producteurs, confiseurs et mouliniers.\nEntre Gard & Herault, pres de 3000 oliviers sont en production au sein de l\'exploitation familiale. \nLes olives sont transformees entierement par nos soin.\nPour le plaisir de tous : huile d\'olive, olives de bouche, tapenades,.... ; en vente 100% direct via le magasin et les boutiques de producteurs.',1),(191,'LES OLIVIERS DU MAS DIEU - JF BOSC','Oliveraie de 4 ha sur le domaine du Mas Dieu, plantee en 2004; le domaine se situe sur la commune de Montarnaud, route de murviel.\nProduction de diverses varietes ancestrales de la region: lucques, olivieres, verdales de l',1),(192,'BIOGRANETA','Nous sommes paysans bio, meuniers, postiers et pressons egalement de l\'huile sur notre ferme a partir de nos recoltes. Nous travaillons 100 hectares et transformons tout a la ferme et commercialisons ensuite en circuits courts.',1),(193,'DOMAINE DE L\'OULIVIE','Situé sur la commune de Combaillaux, à 7 km au Nord-Ouest de Montpellier, dans un site d\'exception,  LOulivie est un domaine oléicole familial de plus de 50 ans dhistoire. \nLe Domaine a vu le jour en 1957, grâce à Charles Billet, grand-père de Pierre et Roch VIALLA, qui employa toute son énergie à laménagement de loliveraie.\nDepuis 3 générations, les oliviers sont cultivés dans le respect des traditions. Cest actuellement, lune des plus grandes oliveraies de lHérault.',1),(194,'LE CLOS DES COMBALS','entreprise',1),(195,'SALLES FRERES','La societe SALLES FRERES est un acteur majeur sur le marche de l\'UNIVERS VEGETAL : condiments, aides culinaires et produits tartinables.\n\nFondee en 1920, notre activite familiale de production et de transformation a ete maintenue par trois generations successives sur le site d\'Aniane, dans le SUD DE LA FRANCE.\n\nNous sommes fiers de notre TERROIR et de notre PATRIMOINE, que nous avons a cur de valoriser dans nos produits. Nous sommes notamment un acteur majeur de la filiere OLEICOLE regionale et valorisons les varietes locales telles que les olives Lucques et Picholines.',1),(196,'Daniel / Les Ateliers Du Moulin','Issus de l\'entreprise familiale fondee en 1959, Les Ateliers du Moulin et DANIEL vous proposent leurs specialites nimoises : la brandade de morue a l\'huile d\'olives, les Olives Picholine et les  olives regionales francaises, la tapenade noire, la pulpe d\'olive verte, les huiles d\'olives ... Des produits de terroir fabriques dans notre laboratoire nimois et vendus aux Halles de Nimes sur l\'etal des olives DANIEL, allee du Safran.',1),(197,'Le berger cueilleur','Je suis exploitante agricole en ovins viande et châtaignes; je transforme mes châtaignes en différents produits: des châtaignades, gamme salée déclinée en 7 saveurs, idéale à l\'apéritif, sur toasts grillés, avec des légumes crus; elle se consomme à la façon d\'une tapenade ou d\'une anchoïade, c\'est ma tapenade lozérienne, produit novateur.\nJ\'ai développé un autre produit novateur, toujours en gamme salée pour l\'apéritif, les croc\'marrons: des marrons aux différentes huiles aromatisées: cumin, piment, estragon...\nEn gamme sucrée, je dispose de tarti\'châtaignes avec 3 parfums: amandes, noisettes, noix de coco\nD\'autres produits sont en cours de test\nEnfin, j\'ai des confitures, plus classiques',1),(200,'Sud camargue','Entreprise specialisee dans la fabrication de la Fougasse salee du Languedoc consomme principalement a l\'aperitif. \nnous la proposons declinee en plusieurs varietes :\n- aux gratons de Porc\n- aux gratons de Canard\n- aux olives noires\n- au roquefort & noix\n- au poulet facon kebab\nNous proposons un chausson traditionnel a la Frita appele aussi coca et dont l\'origine est l\'Empanadas d\'Espagne.\nNous avons aussi remis au gout du jour d\'anciennes recettes sucrees : le sacristain glace royal aux amandes et le Jesuite a la creme vanillee.\nNotre savoir faire et la maitrise du cycle froid nous permettent de livrer nos produits cru surgeles, pre-pousse et pre-dore laissant ainsi aux clients de faire uniquement la cuisson au fur et a mesure des besoins.\nNous sommes present dans quelques enseignes de distribution ainsi que chez les professionnelle de la distribution en boulangerie.',1),(201,'respect des saveurs','Fabrication artisanale de biscuit, crackers, gateaux, chips, ...',1),(202,'SATHOAN','La SATHOAN regroupe aujourdhui près de 90 navires de pêche sur lensemble de la façade de méditerranée française ; de la frontière espagnole jusquen Corse.\n\nLa Coopérative est reconnue des 1991, comme Organisation de Producteurs (OP) par arrêté n°3127 du 31/12/1991 (reconnaissance modifiée par arrêté du 15/06/1994 - JO 2007/C 94/14 Liste des organisations de Producteurs UE dans le secteur des pêches).\nLes Organisations de Producteurs jouent un rôle important dans le domaine des pêches maritimes. Ce rôle a été renforcé dans le cadre du nouveau règlement européen (Règlement 1379/2013).\nAinsi, les OP sont les acteurs clés de la bonne mise en uvre de la politique commune de la pêche (PCP) et de l\'organisation commune des marchés (OCM).\n\nCes règlements doivent permettre :\n\nun meilleur ajustement de loffre et de la demande, en qualité et quantité\nde valoriser les produits afin daméliorer les revenus des producteurs\nde développer des activités de pêche de manière durable',1),(203,'Le petit zeste','Le petit zeste est une biscuiterie du Sud de la France fondee par deux ingenieurs agronome et agroalimentaire dont la vocation est de mettre en valeur les matieres premieres locales dans ses biscuits. Les recettes sont gourmandes et originales et toujours sans conservateurs, sans aromes artificiels ni colorants.\n\nLes biscuits se declinent en deux gammes, salee et sucree, pour tous les palais et toutes les occasions de consommation. Aux aficionados de l\'aperitif les sables a l\'huile d\'olive, Pelardon AOP et herbes de Provence, pour les adeptes de la pause sucree preferez des marguerites sablees avec une ganache au chocolat noir Valrhona, huile d\'olive et fleur de sel de Camargue.',1),(204,'secret des cathares','Apres maintes recherches et autres farfouilleries sur les pratiques culinaires du 12eme siecle, secret des cathares a concocte des produits qui regalent papilles et pupilles.\nDes saveurs retrouvees, un enchantement des sens, une Histoire a raconter et a partager.\nNos recettes sont uniques, elles sont nos creations a partir des ingredients de la cuisine medievale.\nnous avons a coeur de selectionner majoritairement des fournisseurs de matieres premieres locaux, situes dans la sphere geographique Cathare.\nNos produits sont naturels, sans colorants, sans conservateurs, sans additif chimique.',1),(206,'CONSERVERIE QUATREFAGES','La Conserverie Quatrefages est une petite entreprise familiale et  artisanale existant depuis plus de 30 ans, qui fabrique et commercialise des pâtés et terrines gourmandes dont les recettes sont inspirées du terroir Aveyronnais et d\'autres qui sont de véritables créations originales.\nNous offrons une large gamme de recettes à base de canard, de gibiers, de volailles fermières, agrémentées d\'épices et d\'aromates méticuleusement sélectionnés. Certains de nos produits sont des spécialités fortement reconnues comme le pâté au Roquefort, la Terrine de canard aux cèpes\nNous avons développé le pâté au Laguiole, fromage de l\'Aubrac, comme nouveau fleuron de notre beau département, et plus récemment une recette dans l\'air du temps, la terrine au chorizo et poivron rouge, qui accompagne idéalement le temps de l\'apéritif estival.\nNotre développement de nouveaux produits se tourne désormais vers les spécialités à base de canard  tels que les foies gras, cous farcis, fritons, avec notre intégration de l\'entreprise AFG Foie Gras et le développement de la filière CANARD DE LAVEYRON.',1),(207,'Les Saveurs d\'Uzès','Les Saveurs dUzès est une entreprise créée en 2019, qui produit de la Brandade de Morue Artisanale et qui propose diverses spécialités autour de cette Brandade \nCette préparation qui sent bon le Sud de France se déguste froide ou chaude, en apéritif ou en cuisine : elle sadapte aux goûts de chacun',1),(208,'les délices de dany','fabrication artisanale de conserves à base de tomates séchées\nconserves à base d\'ail des ours de la haute vallée de l\'Aude\nhuile d\'olive de limoux (Pont du sou) avec truffes de l\'Aude',1),(209,'Maison Théas','Notre ferme familiale située dans un petit village des Hautes Pyrénées (Gardères) oeuvre chaque jour, dans la tradition pyrénéenne du gavage de canard de qualité.\nLes 4 générations de notre Maison témoignent d\'un savoir faire dans l\'élevage, l\'agriculture et la production fermière.\nNotre passion, notre exigence et l\'amour de notre terre nous guident dans la confection de nos produits. Nous valorisons la nature qui nous entoure et profitons de la richesse de Pyrénées pour trouver, en famille, notre inspiration.\nL\'exception de notre ferme réside dans notre savoir faire traditionnel, la sélection de nos canards du Sud-Ouest à la chair tendre et goûteuse, le respect de l\'animal, la culture de notre propre maïs et la maîtrise de toute la chaîne de production. Nos canards sont gavés avec un maïs cultivé dans notre exploitation, sur une terre unique: l\'enclave des Hautes-Pyrénées. Cette terre noire est connue pour sa richesse, sa profondeur, sa qualité et sa capacité à se régénérer sans apport d\'eau.\nNotre ferme a fait le choix de la qualité et non de la quantité afin de garantir l\'excellence de nos produits à tous nos clients.',1),(210,'Sarl Moya','Sarl Moya , maison tisseyre boucherie/charcuterie à Olonzac',1),(211,'Le Hameau des saveurs','....',1),(212,'BARTHET BIO','La SARL BARTHET BIO, creee le 18 fevrier 2019, commercialisera, a partir du 1er septembre 2019, les legumes biologiques (courges, patates douces) produits sur les deux exploitations agricoles appartenant a Andre et Corinne BARTHET et situees a 32170 SAINTE-DODE.',1),(214,'Granhota L\'atelier Du Vinaigre','En Languedoc, au coeur du plus grand vignoble du monde, Granhota met tout son savoir-faire a la conception \nde vinaigres a lintensite aromatique rare offrant une experience gustative unique.\nNos vinaigres sont elabores a partir de nos vignes et de vins vieux selectionnes pour leur potentiel. Une transformation artisanale de bout en bout, une maturation de plusieurs annees en vieux futs,  et lapport savoureux depices inattendues : tous les ingredients reunis dune gamme de vinaigres elegants et naturels.\n\ngustative unique.',1),(215,'Le Betuliculteur','Aliments et boissons haut de gamme, a base de Seve de Bouleau d\'Ariege bio. 100% issus du Massif Pyreneen.\n« Le Betuliculteur » est une activite agroalimentaire innovante en plein developpement dans Le Parc Naturel Regional des Pyrenees Ariegeoises.\nEn tant qu\'artisans innovants, nous considerons la seve de bouleau  comme une « matiere premiere ». \nNous avons developpe de nouvelles techniques d\'elaboration et de conservation de la seve de bouleau, qui n\'affectent pas la composition originale. Nous avons concu des produits derives innovants haut de gamme et nous avons brevete leur processus de fabrication.\nUn de nos produits phare est « Syroh de France ». Le seul sirop de bouleau gastronomique, 100% pur, fabrique en France.\nPour nous « biologique » sans « ecologique » est une coquille vide... A partir de 2021 aucun de nos produits ne seront plus conditionnes dans du plastique a base de petrole. Les emballages seront compostables/biodegradables ou en verre.',1),(216,'DOMAINE LAFFITTE','Entreprise familiale créée en 1989 et spécialisée dans la fabrication de Pur Jus de Fruits, Pétillants et Vinaigres haut de gamme.',1),(220,'Maison de Garniac','Indépendante et familiale, Maison de Garniac , depuis sa création s\'est assignée pour mission de vous proposer des truffes et des produits d\'exception.\nMaison de Garniac participe au maintien de la trufficulture, culture atypique marquée par la précision, la patience et la passion.\nMaison de Garniac cultive un esprit d\'exigence inventive qui contribue à sa personnalité.\nLa société célèbre un raffinement discret, un art de vivre basé sur l\'expertise, l\'exigence, lexcellence.',1),(221,'ROGER VIDAL','Roger Vidal est une entreprise familiale installee dans le sud Aveyron au contrefort du plateau du Larzac, entre Millau et Montpellier creee dans les annees 1970, fabriquant des conserves de pates et terrines, des tartinables (traditionnels et bio).\n\nBoucher charcutier de pere en fils depuis plusieurs generations, les recettes des pates et terrines Roger Vidal sont luvre de toute une experience, de tout un savoir-faire et dune\ntradition regionale. Elle sapprovisionne aupres de fournisseurs les plus proches possibles dans le departement ou la region Occitanie (porc, ufs, agneau, fromage, creme ) et en cas  dimpossibilite dans dautres regions de France. Lorigine etant une reference a laquelle lentreprise reste attachee pour faire valoir ses produits autant en France qua letranger ou elle realise plus de 40% de son chiffre daffaires.',1),(222,'LA QUERCYNOISE','Cooprative de producteurs de canards gras depuis plus de 40 ans installe dans le Lot (sud ouest de la France) avec 193 producteurs. La Quercynoise contrle toute la filire, du caneton d\'un jour jusqu\'au produit fini avec des contrles rigoureux pratiqus en interne et en externe (organismes officiels). L\'Identification Gographique Protge SUD OUEST s\'applique  l\'ensemble de nos produits certifis. Cette IGP garantit un produit de terroir labor  dans le Sud Ouest de la France, certifi par l\'organisme indpendant Qualisud.',1),(223,'Terra Alter Gascogne','Située à Marciac dans le Gers, la SCIC Terra Alter Gascogne est une plateforme de collecte, de transformation et de commercialisation de fruits et légumes. Tous les produits proposés sont locaux, équitables et issus de l\'Agriculture Biologique. \nDepuis sa création en 2017, Terra Alter Gascogne vise a structurer la filière des fruits et légumes bio dans le Gers et ses départements limitrophes. Notamment auprès de la restauration scolaire, afin d\'apporter au plus grand nombre une alimentation de qualité.\nAgréée Entreprise Solidaire d\'Utilité Sociale et engagée aux côtés d\'une cinquantaine de producteurs grâce à des contrats d\'achats signés pour 3 ans, Terra Alter joue un rôle grandissant dans la composition du tissu économique local.',1),(224,'PEPINIERES RUIZ','Dans l\'Hérault, aux portes de Montpellier, la pépinière RUIZ est un GAEC et une entreprise familiale, créée au printemps 2001.\n\nElle est dirigée par Messieurs Ruiz Jean Michel et Bruno, qui assurent la succession de Monsieur Ruiz Michel créateur de cette société en 1975.\n\nDe 1975 au 31 Août 2009, lexploitation se situait à Mauguio.\n\nLexpropriation par Réseau Ferré de France pour la ligne TGV nous a contraint à déménager sur la commune de Saint Aunes. Cela nous a permis de concevoir un aménagement plus moderne, plus pratique pour accueillir notre clientèle, sur un site plus grand.',1),(225,'France Sapin Bio','France Sapin Bio est une jeune entreprise ariegeoise, creee en 2013.  Elle est situee au cur du Parc naturel regional des Pyrenees ariegeoises.\n\nC\'est par un souci de developpement durable, que nous realisons cette demarche de production unique de sapins de Noel, issue de l\'agriculture biologique en France. Une production de sapins de Noel naturel, 100% bio, 100% francais et de qualite.\n\nNous proposons des produits derives issus du sapin : sirop de sapin bio, huile essentielle bio, bourgeon de sapin, des bougies et prochainement du vinaigre de sapin bio.',1),(226,'AUTANE','Producteurs de plantes, aromatiques, médicinales, petits fruits, maraîchage, cultivés en bio à Castres dans le Tarn et transformés artisanalement en Tisanes, Sirops, Gelées, Aromates... \nPetite spécialité : le \'Bar à Plantes\' bar ambulant vintage qui se déplace au gré des festivités et événements (marchés, foires, fêtes de villages, fêtes privées...) pour vous proposer ses boissons naturelles, ses granités maison, ses soupes, ses gaufres fourrées aux gelées et confitures de la ferme...',1),(228,'ROMATIC','ROMATIC est une marque ecoresponsable d',1),(229,'font colombe','exploitation agricole familiale, a dominante viticole en cave cooperative, un petit atelier ppam a vu le jour en 2020, avec du lavandin Super distille a la propriete.',1),(230,'Clairettes Et Coquillon','Située aux portes de la Camargue  la SARL Clairettes et Coquillon vous offre une palette de produits tel que abricots , pèches blanches et jaunes ,nectarines blanches et jaunes dans diverses variétés qui ont  été sélectionnées pour leur parfum et leur  sucre de manière à régaler nos clients.\n Production Fruitière intégrée selon la Charte Sud Nature, certifiée GLOBALGAP  .Nos produits sont à maturité courant MAI et s\'échelonnent jusqu\'à la fin de la période estivale .',1),(231,'LES VERGERS DU CHÂTEAU DE LA PINÈDE','Entreprise produisant et commercialisant des abricots sur la commune de Saint-Gilles dans le Gard.\nNous sommes en vergers éco responsable',1),(233,'SAS ESTAGEL','La SAS ESTAGEL est specialisee dans la commercialisation de fruits a noyau (abricot, peche/nectarine) et de kiwi issus de vergers certifies GlobalGap.\nLa qualite des fruits que nous proposons est le resultat dune longue experience du metier darboriculteur, puisque Henry-Pierre BOIS, dirigeant de la SAS ESTAGEL, est aussi producteur de fruits a noyau.\nLes fruits que nous commercialisons proviennent de producteurs selectionnes sur le niveau de qualite de leur production et leur capacite a respecter strictement les specifications de nos clients. \nLa SAS ESTAGEL garantit la qualite et la securite des fruits et une tracabilite totale.',1),(234,'Nougaret julien Sainte Emilie','Je suis jeune agriculteur installé à coté de Saint Guilhem le Désert à 35 kms au nord ouest de Montpellier, \nje cultive plusieurs variétés de raisin de table en agriculture biologique ainsi que de l\'arboriculture.\nNotre objectif est de travailler en harmonie avec la nature et surtout de préserver notre environnement.',1),(235,'Fruits Et Compagnie','Entreprise familiale, creation en 1993, basee a Caissargues (Gard)\nproducteur, conditionneur, expediteur de fruits du Sud Est . \nUne selection de fruits',1),(236,'CAROUX','production de Fruits et Légumes 100% HEREAULT',1),(237,'Mas col des muzels','Paysan Bio depuis 2011, Nous sommes producteur de fruits legumes, eleveur de brebis et chevres sur Sigean.\nNos fabrications sont issu de la production de notre exploitation:\nConserves, pain',1),(238,'La Rosee','SAS \'La Rosee\' creee le 1er janvier 1992, est issu de la reunion de deux exploitations individuelles, celle de M. Antoine TEJEDOR et de M. Alphonse TEJEDOR charges respectivement de la production et de la commercialisation.\nIl compte de nos jours, en plus de ses deux cogerants, 30 employes agricoles permanents, auxquels s\'ajoutent approximativement 600 saisonniers pendant la periode de forte production (d\'avril a aout), ce qui represente en moyenne 66 salaries a temps plein dans l\'annee.\nSur le plan de l\'infrastructure, la progression constante a permis au cours des annees la construction de plusieurs entrepots permettant le stockage, des emballages, l\'emplacement des machines (calibreuse, laveuse, ensacheuse, cercleuse, etc..), de quatre chambres froides, d\'un quai de chargement, et d\'une plate forme permettant de placer le materiel agricole (camions, tracteurs, bus permettant le transport du personnel, etc...) ce qui represente 2 500m',1),(240,'Force Sud','Producteurs Expéditeurs Spécialistes du Melon Charentais depuis 1998. Nous avons une maitrise totale de la production, du conditionnement jusquà la commercialisation. \nProfondément respectueux de lenvironnement nous préservons notre terroir et la qualité de nos melons tout au long de leur itinéraire de production\nNotre association de producteurs est  certifiée LABEL ROUGE, global gap et agriculture biologique \nAvec  une culture  sous le soleil du sud de la France et des variétés rigoureusement sélectionnées, nous nous engageons à  pérenniser lauthenticité de nos fruits et légumes.\n\nNotre force : un terroir, des hommes, un savoir faire\nNos produits :   melon charentais (toute l\'année)\n		Salade (batavia blonde et rouge, feuille de chêne blonde et rouge, laitue) Décembre à Mars\n		Fraise (gariguette et Clery) Mars et Avril\n		Mini Pastèque origine France  (Juillet à Septembre)\n		Oignon doux de Lézignan la Cèbe (Mai à Aout)',1),(241,'Nectapêches','Nectapêches produit, conditionne et commercialise des fraises, cerises, abricots, pêches, nectarines, raisin, mirabelles et figues, de mars à octobre.',1),(242,'Vergers de l\'Oustalou','Nos produits sont authentiques au bon goût du terroir de miolles. Les vergers de l\'oustalou Didier Dumas, est une exploitation familiale depuis trois générations. J\'ai repris l\'exploitation en 1990 après des études arboricoles. Je restructure les vergers de forme classique en haies fruitières et m\'oriente vers la culture raisonnée.\n\nLexploitation est située sur la commune de Miolles dans le canton d\'Alban, département du Tarn. A une altitude de 450 mètres, dans une vallée accidentée bénéficiant d\'un micro-climat qui permet la production fruitière. Je suis aidé de mon épouse Marie-Françoise, elle vous accueillera toutes les après midi du lundi au vendredi de 14h à 19h, le samedi toute la journée et le dimanche suivant notre disponibilité',1),(243,'FARANDOLE','Située à Montans dans le Tarn, la SCOP Terra Alter Pays d\'Oc est une plateforme de collecte, de transformation et de commercialisation de fruits et légumes. Tous les produits proposés sont locaux, équitables et issus de l\'Agriculture Biologique. Depuis sa création en 2018, Terra Alter Pays d\'Oc vise a structurer la filière des fruits et légumes bio dans le Tarn et ses départements limitrophes. Notamment auprès de la restauration scolaire, afin d\'apporter au plus grand nombre une alimentation de qualité. Agréée Entreprise Solidaire d\'Utilité Sociale et engagée aux côtés d\'une quinzaine de producteurs grâce à des contrats d\'achats signés pour 3 ans, Terra Alter joue un rôle grandissant dans la composition du tissu économique local.',1),(244,'Cancel Fruits','Cancel Fruits est un producteur et expéditeur de fruit, spécialisé dans la prune, le kiwi, la cerise et le raisin.\nNotre production ainsi que celle de nos partenaires nous permettent d\'être aujourd\'hui des acteurs reconnus avec la commercialisation de 19000 tonnes de fruits/an.\nRéactif et flexible, nous saurons répondre à vos besoins en emballage et cahier des charges.',1),(245,'Le Potager D\'antan','Le Potager D\'antan est une exploitation familiale. Nous avons ouvert notre jardin il y a cinq ans. Nous vendons nos fruits et légumes dans notre boutique située dans notre village Puisserguier.',1),(246,'LA PETITE ROUQUETTE','',1),(248,'OLMOS','PRODUCTEUR DE MELON\nVITICULTEUR EN COOPERATIVE',1),(250,'PIERRE BLANCHE','',1),(256,'NOVAPOM','Le bureau de vente Novapom est né du regroupement de producteurs de la région de Montauban, en Tarn-et-Garonne, pour valoriser au mieux leurs productions.\nNous produisons 27000 tonnes de pommes, 350 tonnes de poires et 80 tonnes de cerise.\nNous proposons un large gamme variétale pour satisfaire les goûts des différents marchés, notre offre compte une douzaine de variétés en pommes, 3 en poires, 8 en cerises. Grâce à des investissements dans les dernières techniques de production (ensacheuse, barquetteuse, cireuse), nos 8 stations de conditionnement sont équipées pour vous apporter avec réactivité un service sur mesure.',1),(258,'Domaine de Tabory','Le Domaine de Tabory se situe dans le Tarn et Garonne, a&#768; Nohic entre la ville de Toulouse et de Montauban.\n\nDepuis plusieurs anne&#769;es lexploitation sest spe&#769;cialise&#769;e dans la production de :\n- Salades\n- Tomates anciennes (coeur de boeuf, noire de crime&#769;e, ananas)\n- Tomates grappes \n- Tomates cerises \n- Potimarrons \n- Melons \n- Concombres \n- Fenouils\n\nA&#768; ce jour le Domaine de Tabory cest :\n5,5 hectares de serres plastiques BIO&#8232;\n6,5 hectares de serres en verre BIO&#8232;\n5 hectares de terre nue BIO \n40 ha de terre nue en conventionnel',1),(260,'AGRIVIVA MON MARCHE LOCAL','AGRIVIVA PRODUCTION s\'appuis sur 3 activités\n1 La légumerie ; légumes et fruits issus de l\'agriculture locale,crus prêt à cuisinés destinés à la RHF publique et privée.\n2 La fraiche découpe en baquette distribuée en GMS\n3 une gamme régionale de fruits et légumes 1ère gamme conditionnée en barquettes sous la marque \'Mon Marché Local\' également destinée au réseau GMS',1),(261,'Terre d\'Amandes','Producteur d\'amandes dans l\'Aude, à Ornaisons, j\'ai planté en 2016 dix hectares d\'amandiers qui aujourd\'hui sont rentrés en production. Je travaille dans une démarche agro-écologique mes arbres en visant une production de qualité dans le respect de l\'environnement.',1),(263,'Lacassagne','Exploitation maraichère et horticultrice en vente direct et dans une démarche dagriculture raisonnée avec lutilisation de systèmes de bio-contrôle.',1),(264,'Dalou Eric','Les volailles fermieres sont elevees en liberte : pintades, poulets et poules pondeuses. Elles sont nourries exclusivement de cereales non O.G.M. et sans antibiotiques. Elles sont elevees pendant 110 jours minimum avant l\'abattage qui est realise sur place dans un atelier agree .\nLes productions maraicheres sont saisonnieres selon une agriculture raisonnee et durable. L\'objectif est de limiter, tant que possible, l\'utilisation des substances chimiques notamment grace a l\'utilisation des fumiers de volailles comme engrais naturel. Des auxiliaires de cultures sont utilises : bourdons pour la pollinisation, coccinelles et carabes pour la lutte contre les pucerons.',1),(266,'BioPhiLeus','Implantee sur la Metrolole Montpeliieraine, BioPhiLeus produit, grace a sa plateforme innovante, des champignons exotiques Bio haut de gamme. Les premieres varietes sont les pleurotes jaunes et roses. Tres prochainement, des productions de nouvelles varietes comme l',1),(269,'MARGIS','',1),(270,'Saveurs du Midi','Ail  Oignons  Echalotes\nProducteurs dans le Midi Toulousain nous vous proposons une gamme de produits cultives sous le soleil pour vous donner les meilleures saveurs possibles.',1),(271,'EARL NOLAN','Exploitation agricole de Pommes de terres et Carottes des sables cultives au parc naturel de Camargue.',1),(272,'PYRENALLIANCE','PYREN\'ALLIANCE est l\'union commerciale de la COOPERATIVE DU HARICOT TARBAIS et de TOUPNOT.\nBasés à Tarbes (65), nous vous proposons une gamme de 3 familles de produits :\n- HARICOT TARBAIS  IGP LABEL ROUGE SEC : récolté à la main dans les Hautes Pyrénées, et proposé en 3 tailles de sachets : 250 GR  500 GR  1 KILO.\n- HARICOT TARBAIS CUISINE : 7 recettes, traditionnelles et innovantes, autour du Haricot Tarbais FONDANT,\n- Barquettes \'CUISINE DES PYRENEES\' : 12 recettes du SUD OUEST, de qualité, dans un format micro-ondable.',1),(273,'BIODIS','',1),(275,'BIOPOP','Maraîchage biologique en techniques mixtes : agro-foresterie, permaculture et classique. Vente en gros, demi gros et détail pour les particuliers, directement sur le terrain. 5.000 m² de serre chapelle avec productions diversifiée de saison et légumes un peu plus exotiques comme les gombos, le kiwano ou les chicorées du nord et d\'Italie. Plus d\'informations sur notre site web. En cours d\'inscription au réseau Bienvenue à la Ferme.',1),(277,'Karine & Yvan Caussel, La Noisette d\'Oc','vente d\'huitres',1),(278,'Maredoc','Produits de la mer : élevage, purification et expédition de coquillages. Négoce de crustacés. \nFabrication et distribution de produits biologiques.',1),(279,'Belot Jean Pierre','Conchyliculture',1),(280,'gaec MISTRAL','Producteur, affineur et expéditeur des huitres et moules de Bouzigues depuis 4 générations.\nNotre structure nous permet de gérer le processus de  production dans son ensemble.\nTous nos produits sont conditionnés sur place.\nNotre objectif est de donner un produit fiable et de qualité aux consommateurs.',1),(281,'SANCHEZ GUY EXPEDITION','Producteur, affineur et expéditeur des huitres sur l\'étang de Thau\nNotre société a à cur de vous offrir une solution complète du suivi de la production, du naissain au conditionnement. La modernisation de nos outils, de notre méthode de production et de conditionnement ainsi que notre capacité dadaptation au marché nous ouvrent de nouvelles perspectives dévolution.\nNotre partenariat avec les salins de Gruissan nous offre une grande capacité de diversification de nos produits tant pour laffinage des huîtres que le stockage. Grâce à notre technique daffinage des huîtres de méditerranée sur les salins de Gruissan, nous avons réalisé une huître spéciale appelée « La Spéciale de lîle Saint Martin ».',1),(282,'LA BELLE OCCITANE','Le GAEC LE ROCHER est une entreprise familiale s\'inscrivant dans une demarche qualite. Labellisee Bio depuis 2015 la qualite de sa production en Mer ou sur lEtang et une priorite. Moules de pleine mer Huitres Speciales et Premium chaque membre du GAEC travaille dans le respect des animaux de l\'environnement et du milieu avec le but dameliorer la production et les saveurs sans les denaturer en gardant les specificites de notre region.',1),(283,'Quentin et Emmeline','Producteurs sur l\'etang de thau, nous venons a votre rencontre une fois par semaine sur differents emplacements. Nous proposons des huitres de differentes tailles issu de notre petite production familiale, mais aussi moules et petit coquillages.',1),(284,'Oceane Alexandre','Producteur depuis 5 Generations\nJ\'ai suivis la trace de mes parents, je me suis lancer a mon compte en 2015 et mon compagnon m\'a rejoint en 2020\nC\'est une entreprise familiale\nNous vendons notre production dans les Halles de Lunel du jeudi au dimanche matin  sur le stand \'Oceane Coquillages \'\nNous preparons egalement des plateaux de fruits de mer a deguster sur place ou a emporter',1),(285,'LE MAS SAINT CLAIR','La SAS Le Mas Saint Clair est une jeune structure de production d',1),(286,'Etablissement Martinez','L\'Etablissement Martinez c\'est une aventure debutee en 1989',1),(287,'CRIEE DE SETE','La criée de Sète commercialise les apports de 80 bateaux de pêche dont une dizaine de chalutiers pour 2 816 tonnes de poisson en 2014, et un volume de vente de 11 millions deuros environ.\nPremière Criée informatisée dEurope, elle a servi dexemple pour la création ou la modernisation de nombreuses criées (Port de Bouc, Arcachon ).\nA ce jour, 116 Acheteurs dont une dizaine de mareyeurs participent aux enchères montantes et descendantes.\nLa criée dispose, depuis sa mise en place, de deux appontements et de 11 postes de débarquement pour les produits de la pêche.\nEn 2014, les 10 espèces les plus vendues en criée ont été :\nMerlu\nBaudroie (lotte)\nDaurade\nPoulpe\nRouget\nAnchois\nEncornet/calamar\nCapelan\nSole\nLoup (bar)',1),(288,'Umamiz','Umamiz, cest laventure de 3 spiruliniers qui unissent\nleur savoir-faire et leur passion pour delivrer ce que\nla spiruline peut apporter de meilleur. Ensemble, nous\nportons un projet original, ecologique et coherent que\nnous souhaitons partager. Notre specialite, c\'est la spiruline fraiche, car nous souhaitons que cette micro-algue aux vertus nutritionnelles exceptionnelles devienne un aliment a part entiere. Nous proposons des produits 100% spiruline seche, fraiche ou congelee, et sommes controles par Ecocert pour la production ecologique.',1),(289,'ANDREA','Navire petit métier basé au Grau d\'Agde, je pratique différents métiers en fonction des saisons pour amener un produit extra-frais aux consommateurs.',1),(290,'LE CERCLE DES HUITRES','La societe CapElevage produit, de maniere artisanale, grace a des methodes innovatrices et en suivant les cycles naturels et biologiques, des huitres de qualite superieure.',1),(292,'Spiruline Algahe','Je suis producteur de spiruline a Noyes petit village de l\'Aveyron sur la commune de Camboulazet . La spiruline est une cyanobacterie extremement riche en vitamine, oligo-element, mineraux et fer, elle est l\'aliment anti-fatigue par definition.',1),(293,'Archer Coquillages','Producteur de Coquillages de l\'etang de Thau a Marseillan. Je propose des produits issues des methodes traditionnelles ainsi qu\'une gamme superieure d\'huitres. Je distribue mes marchandises  sur les marches locaux et je dispose aussi d\'un espace amenage sur mon lieu d\'exploitation pour la vente sur place. Je suis toujours ravi de presenter mon metier et le milieu dans lequel je l\'exerce.',1),(294,'Spiruline de Montauban','L\'EARL Spiruline de Montauban, cree en 2016 par Eric Constans, est une entreprise productrice de spiruline artisanale. La spiruline y est cultivee dans l\'eau en bassins sous serres.\n\nL\'entreprise cultive, produit et vends sa propre spiruline. \n\nIl s\'agit d\'une production 100% naturelle, utilisant l\'energie solaire pour la croissance de la spiruline et qui realise un sechage basse temperature afin de conserver les qualites nutritionnelles de la spiruline.\n\nNous sommes passionnes et soucieux de la qualite de notre spiruline. Cultiver la spiruline requiert beaucoup d\'attention, nous sommes toujours a son ecoute.\nNous nous efforcons d\'innover pour faciliter la prise de spiruline a travers de nouveaux produits.',1),(296,'DOMAINE DE MAGNAUT','Le Domaine de Magnaut se  situe  en Gascogne sur la commune de Fourcès au Nord-Ouest du département du Gers. Ce  domaine familial se compose dun vignoble de 45 hectares aux terroirs riches et variés. Le mariage entre ces terroirs et les expériences professionnelles  acquises par Jean-Marie Terraube, dans différents vignobles, a permis de créer une gamme de Vins des Côtes de Gascogne et Flocs de Gascogne et de mettre en valeur les Eaux de Vie dArmagnac. Aujourdhui lensemble des produits du domaine sont régulièrement récompensés. Le domaine est tourné vers l\'oenotourisme. Nous sommes certifiés Haute Valeur Environnementale (Niveau 3) depuis 2016.',1),(297,'DOMAINE DU GRAND COMTE','VIGNERON INDÉPENDANT AU CUR DU VIGNOBLE DU HAUT ARMAGNAC A COTE D\'AUCH\nEXPLOITATION DE 20HA DE VIGNE SUR LES COTEAUX DU PETIT VILLAGE DE ROQUELAURE\nNOUS VALORISONS NOS CÉPAGES BLANCS POUR L ÉLABORATION DE NOS ARMAGNACS',1),(298,'DOMAINE LAGUILLE','Le Domaine Laguille est une propriete familiale qui produit et commercialise des vins IGP Cotes de Gascogne, des Bas Armagnacs et des Flocs de Gascogne.\nOutre sa gamme traditionnelle de vins et darmagnacs, le domaine a developpe depuis quelques annees des produits originaux, tels que le vin blanc demi-sec « La Rencontre » (Sauvignon  Gros Manseng  Petit Manseng), et une gamme de Bas Armagnacs « Small Batch » en edition limitee et numerotee.',1),(299,'ARMAGNAC DELORD','De la vigne à la mise en beauté des flacons, la famille Delord pose son empreinte à chaque étape de l\'élaboration de ses Armagnacs.',1),(300,'Saint Amans','Saint Amans est une entreprise française basée dans le Sud-Ouest de la France. Nous avons développé un gin artisanal haut de gamme à base de plantes locales, principalement récolté dans les jardins environnants et la campagne locale.\nLe gin est produit avec un esprit à base de raisin donnant un goût original différent des gins à base de grains. L\'entreprise valorise l\'environnement et utilise le sous-produit de la vinification dans une démarche d\'économie circulaire.\nL\'entreprise utilise 18 ingrédients 100% naturels. Il comprend du piment d\'espelette, un produit d\'origine géographique protégée du sud-ouest de la France, donnant une saveur épicée de piment doux. Le gin a combiné le genévrier donnant la saveur de gin classique avec la baie de goji, également cultivée localement.',1),(301,'AURIAN','La Maison AURIAN est un artisan liquoriste, négociant en vin et Armagnac depuis les années 1880. Situé à Condom, vous pourrez visiter le processus de fabrication des liqueurs et sur un autre niveau le chai de vieillissement d\'Armagnac, son processus de fabrication, son musée et son alambic Armagnacais.',1),(302,'Alain Servat','Artisan distillateur. Fabrication d\'eaux de vie naturelles à base de fruits issus de la région Occitanie: prune, poire, pomme, abricot, cerise,fraise, framboise et myrtille.\nDistillateur ambulant dans les départements d\'Ariège, Gard, Haute Garonne, Gers.\nDistillation dans les domaines viticoles.\nBoutique \'Au coin de l\'alambic\' dégustation vente des eaux de vie et de produits du terroir.',1),(303,'Distillerie Castan Père & Fils','Les origines de la distillerie Castan remontent à 1941, lorsque Gilbert Castan, bouilleur de cru, récupère un alambic ambulant qui date de 1926.\nSi autre fois lactivité principale de la famille Castan a été la distillation de fruits, cest en 2010 que Sébastien Castan, troisième génération, et sa femme Céline, vont réinventer ce métier en misant sur une boisson inédite : le whisky. \n\nDepuis, même si la Distillerie évolue et se modernise, la maison Castan, implantée à Villeneuve sur Vère, dans la région tarnaise, travail lexcellence dans le respect de ses méthodes traditionnelles. Les whiskies, distillés dans lalambic en cuivre vieux de 93 ans, sont vieillis à la distillerie, dans des ex-fûts de vins rouges et blancs en chêne français, pendant 4 ans. Ce processus permet lobtention dun liquide souple, riche, doux et fruité. \n\nLa distillerie Castan cultive son orge de brasserie et puise son eau à 110 mètres sous ses pieds. Aucun colorant nest ajouté aux Whiskies pour préserver lauthenticité du produit. \nLa gamme se décline aujourdhui autour de 5 expressions : le Berbie, Le Gost, le Segala, le Roja et le Terrocita (tourbé). \n\nVisite et dégustation vous attendent \nUn nouvel espace est en cours de construction, pour accueillir dans les meilleures conditions possibles les nombreux touristes qui arpentent la route entre Albi et Corde.',1),(304,'HDM, Les Hauts de Montrouge','La cave des Hauts De Montrouge est situee a Nogaro dans le Gers (sud-ouest de la France). Creee en 1963, elle regroupe aujourd',1),(305,'CAVE DE L\'ORMARINE','Rencontre de terroirs.de la mer à la garrigue et aux portes des Cévennes\nSuite aux dernières fusions de caves coopératives, la Cave de lOrmarine compte désormais trois sites de vinification ( Pinet, Villeveyrac et Cournonterral), cinq sites de collectes du raisin et cinq espaces de dégustation/vente (les trois précédents auxquels s\'ajoutent en 2017, Vias et Saint-Hippolye-du-Fort).\nLa Cave de l\'Ormarine compte près de 500 coopérateurs répartis sur un vignoble de 2 200 hectares, et possède ainsi 160 000 hectolitres de potentiel de production (40% en cépages blancs et 60% en cépages rouges).\nLa spécificité de ses différents terroirs donne à ses vins un caractère à nul autre pareil. \nVous retrouverez donc dans ses cinq espaces de dégustation/vente, une gamme complète de vins blancs, rosés et rouges, en IGP et en AOP Picpoul de Pinet, Languedoc, Saint-Georges d\'Orques ainsi que lAOP Muscat de Frontignan.',1),(306,'Meduz','Entre Mer et Terre, Mediterranee et Uzes, la brasserie artisanale Meduz vous propose des bieres de garde elaborees dans l\'esprit des bieres belges et du Nord de la France par notre brasseur.?\n\nDes bieres de qualite, non pasteurisees et refermentees en bouteille offrant un caractere unique, une fraicheur agreable et une richesse aromatique inegalable.',1),(307,'LE PETIT BERET','Lauréat du concours coups de pousse à l\'innovation 2015 en Languedoc Roussillon, Le Petit Béret est spécialisée en conception et commercialisation d\'une boisson innovante certifiée sans alcool 0,0%, ni fermentation au goût des grands vins. Cette boisson innovante à base de raisins du Languedoc Roussillon est accompagné par Innovosud, la pépinière d\'entreprises de l\'Agglo de Béziers. Après trois ans de recherche et développement avec l\'INRA et lexpertise de Dominique Laporte, Meilleur Sommelier de France, le Petit Béret présente une gamme de trois cépages : un rouge syrah, un blanc sauvignon et un rosé grenache cinsault. Cette boisson innovante est une réponse aux attentes liées à la sécurité routière mais aussi des femmes enceintes, des sportifs et des personnes âgées. Elle portera la certification halal et sera la seule boisson issue de la viticulture pouvant être consommée par tous les musulmans du monde car non issu de la fermentation alcoolique.',1),(308,'La Barbaude','',1),(310,'Abeille cool','fabrication vente de bières urbaine artisanale',1),(312,'Brasserie Artisanale BRESCOU','Fabrique de bières Artisanales à Agde dans l\'Hérault en Occitanie. Toutes nos bières sont élaborées à partir d\'ingrédients naturels de qualité, en fermentation haute, non filtrées, non pasteurisées et sans conservateurs.',1),(313,'Brasserie Kiss\'Wing','',1),(314,'Bombero','Déjà dans la restauration, je voulais diversifier mes activités et créer ma propre marque de bière, ancien pompier du Bataillon des Marins Pompiers de Marseille, j\'ai aussi passé prés de 20 ans en tant que sapeur pompier volontaire au centre de secours de Castres, cette bière est un hommage pour tout les pompiers de France et du monde, et surtout à mes camarades mort en service.',1),(315,'TORIA','THORIA est le projet de quatre entrepreneurs passionnes, caracterises par leurs experiences complementaires\nnecessaires au succes du projet.\nIl consiste a creer une brasserie artisanale a Beziers, dans le parc dactivite economique du Capiscol.\nCe ne sera pas une enieme brasserie surfant sur la mode de la biere artisanale. Nous portons un projet qui se veut\nreellement qualitatif, et un concept innovant qui sinscrit dans un environnement local favorable.\nEn effet, nous proposons un nouveau concept de la vente de biere :\n- En proposant la vente au verre dans un lieu attractif qui repond aux multiples besoins des utilisateurs de la zone\n(restauration, after/work, co-working, avant et apres matchs, salle de seminaire).\n- En developpant la vente de bouteilles grace a une marque et une communication forte, des produits de qualite et\npersonnalisables, des produits derives et un marketing personnalise.\nPour cela, nous nous appuyons sur 4 forces :\n- La Qualite : Une biere hautement qualitative, brassee par un maitre brasseur dexperience\n- La Notoriete : Une marque et un marketing fort\n- Linnovation: Un concept inedit de services aux entreprises et aux usagers de la zone industrielle\n- La performance : Des moyens de production industriels avec une capacite de production annuelle de 2000 hectolitres',1),(316,'BRASSERIE ARTISANALE RATZ','Au pays d\'Olt, la biere a un nom... RATZ.\n\nDu nom de son brasseur, Christophe RATZ - ingenieur a l\'INSA de Toulouse et ancien rugbyman - a installe la Brasserie Artisanale Ratz en 2001 dans le departement du Lot aux portes de Cahors, apres avoir acquis une grande partie de son experience professionnelle dans des brasseries artisanales en Belgique et en Angleterre.\n\nSa creativite et sa passion lui ont permis de relancer la biere artisanale dans le Quercy.\n\nChristophe RATZ a su meler le meilleur de son savoir-faire et le respect de ce terroir pour brasser cette biere, infusion de pur malt et de houblon aromatique.\n\nLa biere RATZ est une biere naturelle non pasteurisee. Cette recette unique par la selection des levures lui permet d\'evoluer dans l\'harmonie des saveurs, au fil du temps...\n\nVenez decouvrir notre savoir-faire artisanal et authentique lors d\'une visite de notre brasserie realisee par un membre du personnel : visualisation de la zone de production et explication du procede de fabrication de notre biere.\n\nVous pourrez aussi deguster et apprecier nos bieres au bar ou sur notre terrasse : Beer Garden.',1),(317,'La Gorge Fraîche','La bière artisanale La Gorge Fraîche est née en mai 2014 d\'un amour de la région d\'Occitanie, par les soins de trois copains denfance, enfants du pays. Entre produits artisanaux haut de gamme et communication cocasse, l\'univers La Gorge Fraîche promeut l\'identité Sud de France dans un contraste décapant qui fait aujourd\'hui sa marque de fabrique. Sous la référence humoristique à la lutte contre la \'gorge sèche\' produite par la Tramontane, Mathieu Debilliers et Ludovic Lasserre commercialisent en Occitanie leur gamme de rafraîchissements artisanaux et locaux. Les potions magiques (blondes, blanches et ambrées) se sont peu à peu implantées dans le circuit local des restaurateurs, cavistes et boutiques, jusqu\'à devenir incontournables sur les tables du midi. Dans une interaction étroite avec sa clientèle professionnelle et particulière, la marque sillonne la région à la découverte des \'Perles du Midi\': petites merveilles de restaurants gastronomiques locaux qu\'elle met régulièrement à l\'honneur sur son site internet www.lagorgefraiche.fr .\n\nLors de son lancement en 2014, La Gorge Fraîche était en totalité brassée en partenariat chez un artisan brasseur basé dans le Lot (46), Christophe Ratz. \n\nDepuis Mai 2019, nos compères ont fait l\'acquisition d\'un bâtiment qu\'ils ont entièrement rénové ainsi que d\'un outil de production proche du Canal du Midi afin d\'intégrer sur place une partie du brassage. Ils ont ainsi créé autour de cette brasserie artisanale un véritable lieu de vie inspirée de l\'univers de La Gorge Fraîche, faisant la promotion des produits locaux et de l\'art de vivre occitan, à la fois pour les touristes et pour les gens du cru.',1),(318,'Brasserie Belles de Trebas','\'Belles de Trebas\' est une brasserie artisanale installee depuis 2012 dans la vallee du Tarn, dans le departement du meme nom, plus precisement dans le village de Trebas, autrefois repute pour la qualite de ses eaux. \n\nLes bieres Belles de Trebas sont des bieres de garde, de fermentation haute, vivantes, expressives au palais. \nNi pasteurisees, ni microfiltrees, elles sont produites avec des ingredients de qualite (plus de 95% des ingredients sont labelises bio et produits dans le Tarn) et brassees avec patience, amour, et passion par Remi Clerfeuille, votre brasseur. \n\nPourquoi Belles de Trebas ? \nParce qu',1),(320,'BDQ Beer Co.','L\'aventure BDQ Beer Co. a deja une longue histoire.\nNous fabriquons nos bieres au coeur de la campagne francaise. Notre premiere brasserie, et le Taproom ouvert en 2012 dans le petit village de Puivert.\nAujourd\'hui, nous faisons notre bieres a Chalabre et nous vendons nos bieres dans toute la France.\nNotre but etait de creer des Saisons, IPAs et Stouts passionnants - bieres artisanales issues de productions de qualite. Nous sommes vraiment fiers de notre reputation pour les bieres de excellentes saveurs et une qualite constante. Il y a plus de 28 references differentes en rotation - avec les varient de degres d\'alcool de 3.5% a 12%. Il ya beaucoup a decouvrir. Nos bieres en fut apportent une dimension supplementaire.\n\nA notre Puivert <BDQ Taproom>, vous y trouverez un accueil chaleureux et une vue magnifique. Et toujours les bonne bieres.\n#brasserieduquercorb #puivert #chalabre #biereartisanale',1),(322,'Korma French Craft Beer','Notre brasserie KORMA, située dans la Tarn, au cur de lOccitanie, est spécialisée dans la production de bières artisanales de qualité fabriquées avec des ingrédients 100% français.\nInspiré par les tendances américaines mais fiers de notre ancrage local, nous proposons des recettes inédites fabriquées avec des ingrédients majoritairement locaux et toujours 100% français.\nLunivers brassicole offre une multitude de possibilité et nous nous efforçons au quotidien à innover en permanence pour satisfaire et surprendre le plus grand nombre !',1),(324,'Brasserie Alaryk','La Brasserie Alaryk puise son inspiration du Languedoc, plus vaste terroir en agriculture biologique et en biodynamie dEurope. Comme un bon vin, Alaryk se definit comme un produit dexcellence et de gastronomie, dont les qualites sexpriment a chaque etape de son elaboration : de par le choix de ses matieres premieres naturelles : malts et houblons bio, levures garanties sans OGM, sans additifs, en fermentation haute, sans ajout de CO2.',1),(325,'Bieres LA BERLUE','Nous produisons des boissons 100% BIO (bieres, limonades, fizz...) a Gaillac, dans le Tarn, au pays du vin !\n\nNous avons a coeur de travailler avec notre environnement (collaborations avec des vignerons, cueillette de fruits locaux...) pour elaborer des boissons modernes et audacieuses.',1),(326,'LA BIERATAISE','la biérataise existe depuis 20 ans.\nImplantée en Haute Garonne  sur la région Occitanie, la brasserie produit  1200hl par an.\nsa gamme  comprend la bière blonde, blanche (à la violette) l\'ambrée (à la figue sèche) et la brune.\ndes bières saisonnières (printemps , noel ...) s\'ajoutent également aux habituelles.\nces différentes productions sont conditionnées en bouteilles 33cl et 75cl ainsi qu\'en fut pression de 30 litres.',1),(327,'Brasserie la triple A','Microbrasserie Craft & Ecoresponsable entre Ales et Anduze. Je cree des recettes de caractere mais accessibles au plus grand nombre. Deja une medaille d\'Or au Gard Gourmand 2022 et Bronze au France Biere Challenge pour une entreprise qui vient de demarrer, c\'est un beau palmares ;)\nEnfin, je travaille avec du malt de la region et je recupere mes bouteilles vides.',1),(328,'Kos Mas du verdier','Brasserie Artisanale, Biologique et Nature et Progres.\nCeline et Aurelien : 2 passionnes, dans une batisse quercynoise au c',1),(329,'Domaine Du Cardona','Le Domaine du Cardona est une petite exploitation familiale, viticole et apicole située à Fraïsse des Corbières dans l\'Aude.\nViticulteurs et apiculteurs depuis cinq générations Bruno et François Desnier, passionnés d\'histoire, ont su se démarquer d\'une production conventionnelle en élaborant selon des recettes originales, les breuvages Antiques et Médiévaux historiques aupassé de leur région. Hypocras, clairet, Mulsum, Vinum mentha, hydromels ...',1),(330,'Domaine Galtier','Lise CARBONNE a repris le domaine familial en 1995 qui se situe sur la commune de Murviel les Beziers, sur un plateau calcaire a 120 m daltitude,balaye par le vent du Nord -ouest.\nLe domaine represente :25 hectares de vignes,1.5 hectare d\'Olivier et un demi hectare de Thym pour produire de l\'Huile Essentielle\nLes vignes ont de 5 a 55 ans dage, et le vignoble est conduit en taille courte ( Royat ) ; la conduite du vignoble est faite dans le respect de lenvironnement.\nLe domaine adhere depuis 2002 a la Charte Nationale \'Terra Vitis \' d\'agriculture durable.\nLes cuvees sont des assemblages aussi bien en AOC quen I.G.P..\nLes vins produits sont soit en AOC St Chinian: rouge uniquement ,soit en AOC  Languedoc ,et en IGP Pays Coteaux de Murviel dans les trois couleurs.\nLe domaine est chaque annee, recompense  par des medailles a differents concours ou des citations dans les guides',1),(331,'GRAP\'SUD','La distillerie coopérative « La Grappe » de Montpellier fondée en 1923, anciennement située sur les rives du Lez, fait partie du patrimoine historique de la ville. Elle est depuis longtemps reconnue pour son savoir-faire dans la fabrication des eaux de vie de marc du Languedoc. Nous collectons les co-produits de la vinification des vignerons des cantons alentours et certains de nos adhérents sont emblématiques de la métropole régionale.\n\nVodka unique\n\nIssue de nos vignobles\n\nLorsque de nos raisins nous faisons les meilleurs vins, il en reste pulpe, peau et pépins.\n\nAvec ce marc de raisin, nous élaborons notre vodka, distillée 5 fois pour obtenir un produit pur à 40° de qualité premium.\n\nC\'est un vrai défi, un savoir-faire donnant un produit unique, moderne et local, portant nos valeurs régionales.',1),(332,'La Mentheuse','',1),(333,'INNO\'VO','INNO\'VO est née de la volonté de placer l\'innovation au coeur de la stratégie du groupe coopératif Val d\'Orbieu Uccoar, premier producteur de vin en France. INNO\'VO développe une offre de solutions innovantes dans divers conditionnements (Tetra Pak, Bag\'innov, Mini Wine Pack) aux différents circuits de distribution (GMS,CHD, Circuits spécialisés) sur les marchés du vin, des boissons aromatisées à base de vin, des jus de fruits et cocktails sans alcool. Une nouvelle gamme de Pur Jus de Fruits biologiques à la marque \'Les Fées Bio\' en brique 1L avec des fruits d\'origine 100% Languedoc Roussillon arborent le logo \'Sud de France\'.',1),(334,'La soif du temps','La soif du temps est une hydromellerie artisanale, qui remet au gout du jour l',1),(335,'Domaine de Peyris','Le Domaine de Peyris, exploitation du\nLycée Agri viticole de Riscle, possède\n15 hectares de vigne en appellations\nCôtes de Gascogne, Floc de Gascogne et\nBas-Armagnac. \n\nCest un lieu de production,\ndexpérimentation et dapprentissage\npour nos élèves, support de la formation\ndes vignerons de demain.\n\nSitué au cur de la Gascogne, sur les\nsables fauves du Bas Armagnac, notre\nvignoble est mené de manière raisonnée\nafin dexprimer tout le potentiel\naromatique de nos cépages.\n\nLes cuvées produites sont issues du\ntravail des élèves et de tout le personnel du\nlycée et de lexploitation.',1),(336,'BRASSERIE LA MER A BOIRE','Micro Brasserie Artisanale situee sur le site tres touristique de  la plage des chalets a Gruissan-11- Nous proposons des bieres artisanales (6 dans la gamme) fabriquees avec des malts locaux.\nNous disposons d\'un magasin de vente sur le site de production et nous faisons des visites de la brasserie',1),(337,'Château Lassalle Baqué','Depuis cinq génerations, au château de Lassalle Baqué, situé au cur de la Gascogne, sont distillées dans un alambic armagnacais, puis élaborées dans un chai de plusieurs centaines d\'années, de nobles eaux de vie.\nvieillies naturellement en fûts de chêne du sud-ouest, ces eaux de vie donnent naissance à des Armagnacs d\' une grande finesse aromatique.',1),(338,'LES ARRANGEURS FRANCAIS','Les Arrangeurs Francais realisent au coeur du Gers des Rhums et Armagnacs arranges 100 % Bio embouteilles a la main',1),(339,'Le Berger Des Abeilles','Nous vous proposons un miel de qualite, mis en pot des la recolte afin de lui preserver toutes ses proprietes gustatives et therapeutiques.',1),(340,'Domaine de Bile','Une histoire, une famille, un savoir-faire.\nLe Domaine de Bile est situe a Bassoues, au carrefour de trois villes festives gersoises Marciac, Mirande et Vic-Fezensac. C\'est une de ces grandes maisons gasconnes a la beaute simple entre la force tranquille d\'un domaine familial empreint d\'histoire et l\'impetuosite joyeuse de ses jeunes vignerons.',1),(341,'Le Jardin de Nathalie','Artisan fabricant.\nMa devise : local et naturel\nConfitures, conserves de fruits ou de légumes, fleurs de sel de Camargue parfumées, biscuits, pralines de différents parfums, paniers garnis, travail à façon.',1),(342,'Cabrol La Salvetat','Charcuterie artisanale depuis 1990, 5ème génération, située au coeur du parc régional du haut Languedoc.\nTous nos produits de salaison sont séchés à l\'air libre et au feu de bois.\nToute notre production est VPF (Porc français), transformée dans la plus pure tradition salvetoise avec des recettes d\'antan.',1),(344,'MICOULEAU','Créé en 1888, notre entreprise familiale fabrique des conserves artisanales de produits du Sud-Ouest, tels que le Foie Gras, le Cassoulet, le Confit, les Pâtés Fins et plats cuisinés régionaux divers. Nos produits sont élaborés dans le respect de la tradition, sans colorant ni conservateur, et fabriqués à Beaumont de Lomagne. Depuis plus dun siècle, nous donnons toute sa saveur au mot terroir. Nous nous sommes toujours souciés de lorigine de notre approvisionnement afin doptimiser la qualité de la production. \nTous les produits vendus sont de notre fabrication. \n \nEn 2013, la Maison Micouleau a fêté lévolution de son statut dArtisan à celui de Maître Artisan.\nNous avons également acquis la certification IGP Sud-Ouest pour notre foie gras de canard et notre confit.\n\nAinsi, notre fois gras de canard entier mi-cuit a été plusieurs fois médaillé dor , dargent, et de bronze au Concours Générale Agricole de Paris, depuis 2002.',1),(345,'Maison PAPILLON','Une Histoire de Famille\n\nLa conserverie « PAPILLON » est une entreprise familiale, créée il y a plus d\'un demi-siècle sur  la commune de St Jean du Bruel.  Cest donc en Aveyron que Mercedes et Henri PAPILLON élaborent un savoir-faire qui fait notre réputation  depuis trois générations. \nLes successeurs, leur fille puis  leur petit-fils, ne modifieront pas les valeurs de lentreprise qui allient fierté et qualité. Nos recettes sont toujours réalisées à partir dingrédients sélectionnés et travaillées avec le hachoir des artisans charcutiers. \nCe moyen de production demeure très exigeant  sur la qualité des matières premières mais permet de réaliser des pâtés de qualité supérieure. Ce goût pour le respect des traditions conjugué à notre dynamisme nous permet aujourdhui de présenter  un large choix de  recettes plusieurs fois récompensées aux niveaux régional et national.\nDepuis 60 ans, nos recettes sont élaborées sans artifices destinés à modifier lesthétique et le goût. Notre cuisine simple et traditionnelle est garantie sans colorant, sans conservateur, sans gluten, ni lactose. A limage dun vin, nos différentes préparations réalisées avec le même savoir-faire peuvent être proches sans jamais se ressembler mais toujours fidèle à nos valeurs : « naturellement bon ! »\n \nLa saga Maison PAPILLON, 60 ans en détails \nHistoriquement le village de St Jean du Bruel na aucune tradition charcutière, blotti entre le contrefort des Cévennes,  au pied du Parc Régional des Grands Causses et à proximité du plateau du Larzac, cette commune a pourtant connu lessor de 3 conserveries en 60 ans. \nMme PAPILLON est à lorigine de la spécificité de la commune en commercialisant la première ses terrines et pâtés de qualité supérieure. La deuxième génération, Monsieur et Madame MARMUS née PAPILLON, va connaître dans le milieu des années 80 larrêt ministériel Interdisant la commercialisation de la grive représentant alors plus de 50% des ventes. En réaction, ils vont élaborer alors des recettes associant des produits de la région : châtaignes, roquefort à la base de leurs préparations. Ce sera un changement important dans loffre de la conserverie qui séloigne des standards des recettes autour du gibier. Ce choix innovant sur le département sera ensuite reproduit au point que la terrine au roquefort est devenue une spécialité régionale.\n Au début des années 2000, notre développement a été réalisé avec lunivers du BIO qui représentait  un cercle de passionné, amoureux de leur savoir-faire et savoir-être. Depuis quelques années, le développement de ce marché qui léloigne de ses valeurs primordiales a renforcé notre sentiment conservateur de la qualité naturelle nous amenant à créer notre propre filière locale agréé et financée partiellement par lAgence Bio (Agence Française pour le Développement et la Promotion de lAgriculture Bio). Cette recherche de qualité a été consacrée par l\'obtention de la médaille d\'or \'Meilleur produit BIO Français\' au concours national de Nantes en 2007 catégorie carné et plusieurs citations dans le Guide Hachette du BIO.\nLa même démarche a été réalisée pour nos gammes en conventionnel.\n\n\nEn 2005, Alexandre MARMUS sattache à donner un nouvel élan à lentreprise en observant le mode de consommation des terrines à limage vieillissante. Il opte pour le lancement de la gamme Gastronomie qui sattaque au marché de lapéritif. Un produit festif qui conjugue le sucré et le salé dans un écrin design à double ouverture.\nIl différencie donc son offre par loriginalité des recettes et du packaging qui permet en plus de démouler aisément la terrine et de la servir en assiette. Original, identifiable et pratique.\nCette gamme est très appréciée par les cavistes qui constituent une nouvelle clientèle ainsi que par la Grande Epicerie de Paris qui sert de référence dans le monde de lépicerie fine.\nCette gamme est appréciée également à linternational où nos produits jouissent dune bonne image, classés dans les délicatesses françaises notamment pour les populations rebutées par le gavage du canard et de son produit phare le foie gras. A linternational et dans lunivers BIO, nous sommes ainsi une alternative au Foie-gras tout en bénéficiant de son image de marque.\n\nLieu de fabrication actuel :\n\nLa décision de construire et transférer lentreprise a été prise en 2007 avec sa finalisation en novembre 2009. Le choix de limplantation sur la commune de la Cavalerie, à 20 km de nos origines, a été évident : proximité de lA75 (axe Nord-Sud de la France), commune templière et aveyronnaise située sur le Larzac soulignant notre appartenance à un terroir facilement identifiable, proximité du Viaduc de Millau symbole dune région à forte tradition mais qui se modernise.\nLentreprise a investi dans un bâtiment de 1 900 m² aux normes HACCP.\nToutes les opérations manuelles napportant pas de plus-value aux produits ont été automatisées tandis que notre process est resté identique tant sur les outils primordiaux que sur la philosophie de nos achats.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nSans rien changer à ses valeurs et toujours avec des  recettes travaillées avec le hachoir des artisans charcutiers, la Maison PAPILLON conjugue tradition et modernité. \nIl y a plus de 15 ans, la Maison PAPILLON créait sa gamme BIO qui obtenait la médaille d\'or \'Meilleur produit BIO Français\' catégorie carné, ainsi que plusieurs citations dans le Guide Hachette du BIO.\nPour les 60 ans de lentreprise et les 100 ans de sa créatrice, la Maison PAPILLON  souligne  la qualité de ses produits sans colorant, sans conservateur et sans lactose, avec un nouveau label « sans GLUTEN ».\nEn 2015, pour la Maison PAPILLON, la tradition cest toujours naturellement bon !',1),(347,'La Ferme d\'en Loune','',1),(348,'Maison Recape - Tradition du Lauragais','La premiere boucherie Recape a ete creee en 1945 par M. Recape, a Lanta (31), au Sud-Est de Toulouse. Reprise par son fils Max Recape, celui-ci a cree en 1974 la societe Recape afin de poursuivre son developpement.\nAujourdhui lentreprise compte 6 boucheries dans lEst toulousain ainsi quun atelier de decoupe de viande de porc et de fabrication de charcuteries, de conserves et de plats cuisines.',1),(349,'Les Richesses de la Mer','',1),(350,'Marrons de l\'Aveyron','La ferme de la Châtaigneraie de la Famille Clermont  se situe à Saint-Hippolyte ,en Aveyron, à proximité des Gorges de la Truyère et du Château de Valon, entre Entraygues  et Mur de Barrez.\nDans une nature préservée la châtaigneraie familiale a repris des couleurs pour émoustiller vos papilles de produits aux saveurs naturelles ou sucrées notamment :\n-Marrons entiers\n-Crèmes de marrons \n-Farine et liqueur de châtaignes\n-Purée de marron non sucrée\n-Gâteaux à la châtaigne\n\nLa totalité de la production de châtaignes et marrons  du Gaec de la Châtaigneraie est transformée sur l\'exploitation.\nLes fruits sont non traités et issus de l\'Agriculture Biologique .Les produits sont élaborés avec le plus grand soin ,sans emploi de colorant et de conservateur .\nLes crèmes de marron se déclinent en 7 parfums : nature, à la vanille, à la pomme, à la poire ,aux noix, au chocolat et au rhum-raisin et 3 grammage différents .\nVente à la ferme tous les jours 9h-12h et 14h-18h (sauf période récolte ).\nVisite du laboratoire et de la ferme le jeudi après midi lors des goûters à la ferme(sur réservation-5/pers)\n Présents sur le marché nocturne de producteurs de pays d\'Entraygues  en juillet et août et dans les commerces locaux. Nous adhérons au réseau Bienvenue à la ferme et à la charte Fabriqué en Aveyron',1),(351,'INSTANT BOCAL','L\'Instant Bocal est un traiteur eco-responsable qui propose des bocaux repas sterilises « fait maison » elabores prioritairement a partir de produits cultives dans les 30 km autour du laboratoire de production. Nous realisons des plats a partir de fruits et legumes recoltes a maturite, issus dune agriculture raisonnee.\nNous nous efforcons au maximum de travailler des viandes dont la provenance respecte un cahier des charges centre sur le bien etre animal.\nNos bocaux beneficient dun traitement thermique. Nos recettes ont ete testees et validees en laboratoire et beneficient dune date de consommation longue (1 an), et dune conservation a temperature ambiante.\nIl est desormais encore plus facile de manger bon et local !',1),(352,'Ferme des Milley une Brebis','Ferme dune centaine de brebis elevees en plein air et nourris au foin et cereales de la ferme ( mais, triticale et feverole)\nPate de brebis, pates brebis au piment Espelette, Rillettes de brebis et sur commande agneau decoupe et mis sous vide, agneau carcasse.',1),(353,'Maison Cévenole Richard','Je mappelle Juliette, originaire du Bassin Alésien, et Cévenole Avant tout ! Jai crée la Société « Maison Cévenole Richard » en juin 2018 dans le but de faire partager ma passion du goût, des bons produits, et faire découvrir les pépites culinaires de notre terroir.\nJe propose, via mon site internet www.maison-cevenole-richard.fr des produits locaux, en direct producteur, que je sélectionne rigoureusement sur les exploitations.\nEn parallèle, chaque mois, je sélectionne chez mes éleveurs des bêtes (buf Aubrac, porc, agneau, volailles, veau) pour obtenir des viandes de qualité et une traçabilité exemplaire. Je transforme, selon des recettes traditionnelles, chacune de ces viandes en terrines et plats cuisinés. Ces bocaux stérilisés sont sans additifs ni conservateurs.\nDéjà récompensée par une médaille dArgent en 2020 au Concours Gard Gourmand-Militant du Goût dans ma gamme de fleur de sels aromatisées, je développe chaque jour de nouvelles recettes.\nJe livre chaque semaine les clients particuliers à leur domicile ou sur leur lieu de travail. Mes produits sont également disponibles dans certaines épiceries fines.',1),(354,'MAS D&#39;ESPIARD-HISTOIRES D&#39;A','Histoires d',1),(355,'Florent Rousseau Elevage Le Peyron','Elevage bovin de race Aubrac situe sur les communes de St Laurent d\'Aigouze et Marsillargues.\nCommercialisation en vente directe aupres de particuliers\nen colis ou dans des boutiques de producteurs, restaurant et restauration collective.\nProduits : viande en frais, sous forme de petites portions emballees sous vide ou bien transformee, en conserves.',1),(356,'LE GOURMET BAROUSSAIS','Conserverie artisanale, produits du terroir, plats cuisines (cassoulets baroussais , peteram, garbure) divers pates .\nSitue dans la vallee de la Barousse .\nNous travaillons a 80% avec des fournisseurs de la region Occitanie .\nNous travaillons essentiellement avec des grandes surfaces et epiceries dans une zone de 80 km autour de notre conserverie.\nNous sommes une structure familiale (parents,fils).',1),(357,'VALETTE','La Maison Valette, établie à Gourdon, au nord du Lot, perpétue le savoir-faire dans l\'art de la production du foie gras et de la culture gastronomique depuis trois générations. Des spécialités de qualité alliant tradition et modernité : foies gras, truffes noires du Périgord, pâtés au foie gras, terrines, confits, cassoulets, entrées fines, douceurs.',1),(358,'jimmy gourmet','Jimmy gourmet, c\'est simplement la rencontre entre l\'audace d\'un cuisinier et la passion du geste d\'un artisan.\nFoie gras prime lors du concours de l\'Herault gourmand.',1),(359,'Ferme De La Viale','Cest dans ce petit coin de Causse, au bord des falaises de la Jonte que nous élevons cochons et brebis et cultivons les fourrages et céréales nécessaires à tout ce petit monde. Nous passons aussi une partie de notre hiver à confectionner les pâtés et charcuteries que vous pourrez ensuite déguster lors de vos séjours chez nous, ou en nous en passant commande.',1),(360,'GAEC LES MOULIOTS','Conserveur a la Ferme a MONBLANC (32), nous vous presentons notre charte qualite.\nNous avons choisi de travailler le canard de Barbarie couramment appele Musquet pour son foie naturellement parfume, dune texture en bouche tres fine, et sa viande tres charnue.\nNos canards sont eleves par nos soins et gaves dans la pure tradition Gersoise au Mais blanc grain entier que nous cultivons sur notre exploitation.\nLabattage et la transformation de nos canards se font par nos soins, dans nos ateliers conformes a la reglementation en vigueur\nLelaboration  des produits :\nProvenant exclusivement de canards issus de notre ferme, nos produits sont elabores selon des recettes de cuisine gasconne traditionnelle.Nos conserves sont garanties sans colorant ni produit de conservation.\nFoie gras de canard, confit de canard, magret de canard, aiguillettes de canard, saucisse fraiche et seche, differents pates, plats cuisines ...',1),(361,'Pig\'s Daddy','Pigs Daddy propose une alternative au systeme de consommation carne actuel et prone une vision partagee par de nombreux consomacteurs citoyen :\n\nLe respect de lanimal et de lenvironnement\nUne remuneration plus juste des petits eleveurs locaux.\nDes produits de qualite avec un engagement fort au niveau local\nUne transparence et une tracabilite parfaite des produits\n\n« Ce que vous consommez devient aussi ce que vous protegez ! »',1),(362,'GAEC VIGIER','Sabine et Pascal VIGIER\n\nÉleveurs de vaches de race Aubrac en haute Lozère sur les régions naturelles de la Margeride et de lAubrac.\n\nNotre élevage est familial de génération en génération et à taille humaine. Chaque vache est appelée par son nom.\nNotre priorité est le bien-être de nos animaux auxquels nous apportons toute lattention nécessaire. Notre but est de produire des animaux de boucherie qui nous donneront une viande aux qualités gustatives exceptionnelles ainsi que des animaux destinés à lengraissement à lexport.\nNous sommes en système extensif, nos terres sont enrichies avec nos effluents de ferme et le minimum dengrais nécessaires à la bonne pousse de lherbe.\nNous nourrissons nos animaux avec les fourrages récoltés sur lexploitation ainsi que notre céréale. Des compléments alimentaires sont toutefois nécessaires pour obtenir un équilibre alimentaire sans oublier les vitamines et minéraux.\nNous travaillons avec des partenaires locaux dans un rayon de 30 km pour labattage, la découpe, lemballage et la transformation.',1),(363,'Bleu Blanc Vin','Faire decouvrir, dans le cadre dateliers de degustation ludiques et authentiques, veritables moments de rencontre et de partage, organises chez un hebergeur et animes par la/le proprietaire, amateurs eclaires, une selection de vins respectueux de lenvironnement et vendus au prix du domaine.',1),(364,'LES BOCAUX DE FRANCE','Les bocaux de France des plats bons et gourmands\nPas le temps de cuisiner ?\nLa valeur du temps est si precieuse. Nous vous faisons gagner du temps avec notre concept',1),(366,'Hotel de France','L\'Hôtel de France de Castelnaudary cuisine son Cassoulet depuis plus d\'un siècle. Il s\'est ainsi forgé une réputation sans égal. Le cassoulet frais en terrine que nous expédions est le même que nous servons dans notre restaurant. Nous faisons artisanalement des conserves et plats cuisinés.',1),(367,'ALIGOT EXPRESS','Entreprise agroalimentaire basee a Flagnac dans l\'Aveyron, specialisee dans la fabrication de plats cuisines regionaux surgeles tels que l\'Aligot, les palets d\'Aligot et Auvergnats a snacker, les tapas occitans au Roquefort, a la truffe, au canard, au cantal echalotes...',1),(368,'Ferme de Las Crabères','Située à LIsle Jourdain dans le Gers, cur de la Gascogne, entre Toulouse et Auch, La Ferme de Las Crabères est une petite exploitation agricole familiale qui depuis 2 générations sest consacrée exclusivement à la production du canard gras. Nous élevons, engraissons et transformons nous-même nos canards. Notre conserverie est agréée CE. Nous vendons à la ferme et par correspondance.  Visite de la ferme sur RDV.',1),(369,'MIQUEL','L\'entreprise Miquel, depuis toujours implantee a la croisee du Lot et de l\'Aveyron est fiere de promouvoir a travers ses produits une tradition de recettes rustiques et authentiques.\nSituee a Bouillac sur les rives du lot la maison Miquel emploie aujourd\'hui une vingtaine de personnes, qui garantissent par leur implication la transmission des gestes, des recettes et des valeurs d\'autrefois. Les produits Miquel sont travailles avec des methodes traditionnelles (Cuisson longue, preparation au chaudron, ) \'',1),(370,'BIOTERROIR','Bioterroir est situee en plein c',1),(371,'Gascogne Solutions','Notre cuisine est traditionnelle (avec un maximum de produits locaux), nous mettons en bocal a la main (pas d',1),(372,'MAISON TINO','Cree en 1987,  MIDI TIELLES est une PME implantee sur le bassin de Thau, au cur de la culture culinaire Setoise et meridionale.\nApres avoir developpe, avec succes, sa gamme de Tielles Setoises et de tartes salees du Sud de la France, MIDI TIELLES propose desormais une large gamme de plats cuisines: des recettes cuisinees comme a la maison .',1),(374,'MARIE-AMELIE','Entreprise spécialisée dans les produits de la mer depuis 1981: soupe de poissons, encornets farcis...',1),(376,'LES PLAISIRS DU MIDI','les Plaisirs du Midi',1),(377,'Le Domaine d\'Helix','Ferme helicicole, situe dans l\'ouest de l\'Aveyron, a 5 km de Villefranche de Rouergue.',1),(378,'Le Grand Tetras','Fabrication de pates fraiches, ravioli, Lasagnes, a base de farces cuisinees avec des produits locaux (Pyrenees)',1),(379,'fabrique aveyronnaise','La fabrique aveyronnaise est une société artisanale qui commercialise des plats traditionnels aveyronnais. \nUne gamme salée : farçous, estofinade, aligot et truffade. \nUne gamme sucrée : déclinaison de fouace : nature, chocolat, fruits confits.\nSoucieux de transmettre tout notre savoir faire artisanal à travers nos recettes, nous travaillons en majeure partie avec des producteurs locaux. En un mot \'l\'Aveyron dans votre assiette\'.',1),(380,'Les Cigalines','Fabrication artisanale de glaces, sorbets et desserts glacés',1),(381,'Fromages Du Salagou','Fromagerie artisanale: elaboration a partir du lait cru de nos producteurs locaux de fromages de chevre , vache et brebis.',1),(382,'Domaine de Portes','Fort de son ancrage regionnal, le Domaine de Portes situe a St Pons de Thomieres perpetue la production d\'oeufs depuis 4 generations. Notre savoir faire nous permet d\'assurer nos engagements :\n- Fraicheur\n- Qualite\n- Tracabilite\n- Service',1),(383,'FROMAGERIE DU BUISSON BLANC','Fromagerie du Buisson Blanc\nSituée au Ségur, la Fromagerie du Buisson Blanc est une exploitation agricole familiale du Ségala Tarnais gérée par la famille Basse depuis 1933.\nAujourdhui les vaches laitières sont élevées par Philippe et Florian Basse.\nDe race PrimHolstein, elles sont nourries avec une alimentation traditionnelle, produite directement sur lexploitation, selon les principes de lagriculture biologique. Pour leur bien-être de nos vaches, lorsque le temps le permet, elles sortent au grand air pour se la couler douce au milieu des prairies.\nUne partie du lait produit à la ferme, est transformée sur place en suivant les recettes familiales. La Fromagerie du Buisson Blanc fait ainsi partie des rares fermes du Sud de la France qui produisent encore beurre et crème fraîche à partir de lait cru. De nombreux autres produits sont fabriqués dans notre fromagerie : fromage blanc traditionnel, yaourts, fromages affinés Vous les retrouverez dans de nombreux magasins ou marchés de la région.',1),(384,'BLANC DES HAUTES PYRENEES','Un collectif local à taille humaine 100% Hautes-Pyrénées, de 19 exploitations laitières familiales, engagé dans une démarche responsable.',1),(389,'Fromagerie de Hyelzas SAS Le Fedou','Notre Fromagerie est situee sur le Causse Mejean, en Lozere, classe au patrimoine de l\'UNESCO.\n\nA Hyelza, nous fabriquons des fromages au lait cru de brebis (a ne pas confondre avec les chevres des Cevennes voisines). \nNotre gamme de 20 fromages traditionnels s\'etend des pates semi-pressees aux pates molles (Meule, Tommes, Soureliettes, Perail, Brique, Fedou, Cardabelle, Titounet, Lactique, Brousse).\n\nVous pourrez les deguster sur place avec d\'autres produits du terroir, les commander ou les retrouver chez votre cremier.\n\nNous vous accueillerons dans notre salle panoramique perchee au dessus des Gorges de la Jonte.\n\nSur Hyelzas a deux pas de chez nous, venez visiter la Ferme Caussenarde dAutrefois. \nPour vous situer, nous sommes voisin de lAveyron (Viaduc de Millau) et du Gard (Mont-Aigoual), au cur dune region tres touristique, naturelle et remarquable (gorges du Tarn, de la Jonte, Aven Armand, Grotte de Dargilan, Abime de Bramabiau, Belvedere des Vautours, Chevaux de Przewalski) a 2 heures de Montpellier.',1),(390,'Duolozère','Fabrication de produits laitiers (yaourts, fromages blancs, faisselle, fromages au lait cru, beurre...)\nEntreprise artisanale de 8 salariés située au centre de la Lozère, à 7km au nord de Mende.',1),(391,'GAEC GRAINE','fabrication de fromage de chevre',1),(393,'LAITERIE RISSOAN','La LAITERIE RISSOAN produit et commercialise ses propres fromages fabriques dans ses locaux en lozere. Le lait utilise pour la fabrication des fromages provient uniquement de Lozere et dArdeche aux environs de 1000 metres daltitude. La LAITERIE RISSOAN collecte elle-meme ce lait chez des agriculteurs fideles depuis de nombreuses annees, souvent depuis plusieurs generations et en assure lorigine du terroir.\n\nEn achetant les produits du terroir de fabrication artisanale de la LAITERIE RISSOAN vous contribuez a la preservation de nos campagnes et a sa qualite de vie.',1),(394,'La Ferme du Mas Rolland','Exploitation caprine en transformation fermière fromagère',1),(395,'LA FERME DU RAMIER','Cest à Montauban, au cur du Tarn et Garonne, que la famille Maraval fabrique avec passion et bonne humeur ses fromages fermiers au lait cru. Eleveurs laitiers depuis 4 générations, Edith et Hélène, les deux filles, perpétuent le savoir-faire. Bien-être des animaux, tradition et innovation sont les maîtres-mots de cette ferme hors du commun. Ici, les vaches se reposent sur des matelas et se font traire toutes seules ! Pas étonnant quavec leur lait les fromages soient de si grande qualité !',1),(396,'Gaec Rodier-Sartre','Notre ferme familiale se situe sur le contrefort de l\'Aubrac Lozerien a 950 metres d\'altitude. Nous elevons 85 vaches aubrac, 80 chevres alpines et une cinquantaine de porcs charcutiers.\nSur notre exploitation, nous pratiquons une agriculture raisonnee. \nNotre principal objectif est de vous garantir des produits de qualite avec du gout:\nLe buf: veritable buf Aubrac. Eleve au paturage, engraisse avec les fourrages et cereales de l\'exploitation pendant les derniers 8 mois, abattu entre 24 et 30 mois et mature pendant plus de 15 jours.\nLe veau aubrac eleve exclusivement au lait de sa mere.\nLe porc: eleve aux cereales de l\'exploitation, aux produits du jardin et au petit lait, sous produit de la transformation fromagere, gage dune charcuterie traditionnelle.\nLe fromage de chevre « le cabrou de l\'Aubrac »: fromage au lait cru non pasteurise, moule a la louche quotidiennement, affine pendant plusieurs semaines selon les gouts.\nNotre 2eme objectif est l\'autonomie: cest-a-dire que la totalite des aliments servant a nourrir nos animaux est produite sur la ferme, vous garantissant des animaux eleves sans OGM et qui paturent sur l\'Aubrac durant la periode estivale.\nNotre 3eme objectif est de garantir la tracabilite de nos produits grace a une fromagerie, un laboratoire de decoupe et de cuisine aux normes CEE. Nous maitrisons tout d\'un bout a l\'autre: lelevage, la transformation et la vente.\nC\'est avec determination et passion que nous faisons notre metier. Fier de nos racines et de la mission qui nous est confie: vous nourrir sainement.\n\nGaec Rodier-Sartre',1),(397,'Les Bergers du LARZAC','Voilà plus de vingt ans maintenant que lidée de faire un ou des fromages sur ce grand Plateau du LARZAC, à germée ! Transformer son propre lait (du pis au Gourmet), sous une forme coopérative cest imposé de suite !\n\nCe fut un peu moins rapide (plus de trois ans)  pour franchir le pas et réaliser la 1ère cuve le 8 Avril 1996 dans une ancienne laiterie, à La Cavalerie, où nous passâmes 15 ans.\n\nAujourdhui, Les Bergers Du LARZAC sont dans  un nouveau bâtiment, toujours à la Cavalerie, plus moderne et plus respectueux de ses salariés et de lenvironnement. Nous y transformons le lait de nos brebis en fromages et autres produits lactés. Nos fromages se déclinent en 7 types différents et sont daffinages très variés (allant de 10J à plus de 16 mois). Nous fabriquons des tommes Mi-Cuite, des Non-cuites, des pérails pâtes molles et lactiques, des pâtes molles à croutes fleuries, des pâtes molles à croutes lavées et des fromages de lactosérum (Brousses et recuites). Sur lensemble de ces fabrications, nous avons plusieurs déclinaisons en termes de poids, formes et affinages.\n\nDe plus, nous déclinons notre gamme en agriculture Conventionnelle et en agriculture Biologique.\n\nEnfin, nous transformons nos eaux blanches et le petit lait en Biogaz grâce à notre station de Méthanisation. Le Biogaz produit nous permet alors de chauffer la majorité de leau utilisée dans la fromagerie et ainsi de diminuer fortement notre consommation dénergies fossiles.\n\nLe pari de créer un outil collant aux réalités économiques du causse et pouvant apporter quelques richesses pour notre agriculture, est réussi au-delà de toutes espérances ! ! !\n\nLobjectif pour les Paysans est atteint : Valoriser leur lait et rester sur leur terre ! \n\nNous vous invitons à partager avec nous, nos fromages de caractères si différents  et de passer à table.  \n\nLes Bergers du Larzac',1),(399,'FERME DE PROUZIC','EXPLOITATION AGRICOLE PRODUCTEUR DE PRODUITS LAITIERS FERMIERS YAOURTS&FROMAGES',1),(400,'FROMAGERIE DU MADRES','Situé au pied du massif du Madres, dans les Pyrénées Audoise, nous élevons des Abondances. Nous transformons la totalité du lait en fromage, flan crème et beurre; puis commercialisons en direct.',1),(401,'L\'Atelier de Ccourbière','Nous trayons pour l\'AOP Roquefort depuis 1950, et avons débuté la transformation fromagère avec les tommes moelleuses aux gout fleuris au lait cru de brebis, tomette, petits frais et les douces glaces au lait de brebis. \nA Courbière, ferme familiale sur les hauteur de la vallée TARN, a côté des éoliennes d\'ASSAC, nous élevons nos 450 brebis de race LACAUNE. Elles sont nourries exclusivement en auto consommation de foin de séchage en grange et beaucoup de pâturage en prairie.',1),(402,'Roquefort Gabriel Coulet','Fabricant roquefort AOP Gabriel Coulet. Tomme de Brebis, fromage de brebis pour salade.\n\nLe premier ingredient du Roquefort Gabriel Coulet n',1),(404,'GAEC de Recoules','Eleveur en production laitiere bio bovin, caprin et ovin. \nEntreprise familiale depuis plusieurs generations situee au nord Lozere a 1060 m d\'altitude\nNous transformons la totalite de notre production laitiere ovine et caprine et une partie de la production bovine.',1),(405,'gaec de l&#39;elanion','C\'est l\'histoire de Daniel (agriculteur) et  Ophelie (installation or cadre suite reconversion professionnelle), nous avons une petite exploitation en bovin lait avec un atelier de transformation fromagere situe dans le Tarn et Garonne (a Comberouger).\nNous elevons nos vaches et genisses dans une agriculture raisonnee, nous les soignons principalement en homeopathie, phytotherapie, aromatherapie et argilo therapie, le troupeau se nourrit exclusivement de foin, d\'herbe et un peu de cereales (orge, triticale) qui sont produites sur la ferme.\nNous fabriquons des lactiques  et tommettes a differents stades d\'affinages, du fromages a tartiner, des faisselles, du fromages blancs, des yaourts de differentes sortes, et des desserts dont certain sans',1),(406,'LES 30 FERMES DE CANTAVEYLOT','',1),(407,'Tradi-bergere et Mon Berger','Depuis plusieurs generations, nos familles vivent d\'agriculture caussenarde dont l\'essentiel se resume en la traite de brebis pour la fabrication du celebre fromage de Roquefort.\nMais bien d\'autres produits laitiers tel que le Yaourt vous permettrons de decouvrir toutes les qualites de ce lait. En effet, en etant transforme dans le respect des traditions delaissees par les industriels, ce dernier vous offrira un produit d\'une qualite exceptionnelle et a la saveur remarquable. \nDepuis 1996, nous avons choisi de conduire notre exploitation en Agriculture Biologique, et c\'est en 2008 que nous avons decide de transformer notre lait sur place. Nous garantissons une alimentation des brebis au foin, sans ensilage synonyme d\'agriculture intensive, en utilisant le sechage solaire des fourrages en grange. Nous ne travaillons qu\'avec du lait frais avec un delais tres court apres la traite. \nGrace a tout ce soin apporte, nos yaourts sont reconnus pour leur qualite, avec notamment 14 medailles sur ces 10 dernieres annees au Concours General Agricole de Paris (dont 5 en Or). En novembre 2012,',1),(408,'FERME DES 3 CHEMINS','Producteur d oeufs et de volailles plein air avec respect de la environnement',1),(409,'LA POULE AUX OEUFS D\'OC','Nous collectons auprès de nos producteurs locaux des ufs pour les distribuer ensuite auprès de transformateurs, détaillants, GMS.\nSachant que nos producteurs (plein air Bleu Blanc Coeur ou Bio) se trouvent en Occitanie. Ainsi que nos clients de Montpelier à Agen en passant par Toulouse ou Perpignan.\nNous avons deux marques : TANAGRA et LA POULE AUX OEUFS D\'oc.',1),(410,'ferme Rongo','ferme maraichage diversifier BIO\nelevage de poule pondeuse BIO \ntransformation',1),(411,'EARL MOUNDY','Elevage de 60 vaches laitières dans la Montagne Noire.\nAtelier de transformation et vente directe de yaourt , fromage blanc et lait cru',1),(412,'Ferme du Picou','petite ferme dans les Pyrènes audoise a 1000m d\'altitude ou l\'on élève un troupeau de vache Brune des Alpes pour leur lait afin de faire du yaourt et des fromage.',1),(413,'YeO frais','YeO frais, filiale du groupe cooperatif MLC, est specialisee dans la conception et la production de yaourts et creme fraiche. Situee a Toulouse, YeO frais emploie 180 personnes. \nCreee il y a 50 ans, la laiterie transforme le lait frais collecte par la cooperative regionale, livre chaque jour directement des fermes des eleveurs-cooperateurs a la laiterie.  \nIssu du monde cooperatif, notre mission est de valoriser au mieux le lait de nos eleveurs dans le respect des valeurs de la cooperation : solidarite, respect des personnes, equite et transparence, responsabilite, confiance.\nGrace a son accreditation BIO obtenue en mars 1999, YeO frais a ete le premier intervenant a lancer les yaourts BIO a MDD et est aujourdhui le leader sur ce marche. Avec cet engagement de longue date, YeO s\'est inscrit dans une dynamique Developpement Durable coherente afin dengager une reelle responsabilite sociale et environnementale, de maintenir la filiere laitiere et ses emplois dans la region Sud-Ouest et enfin de garantir des produits de qualite, innovants et differenciants.',1),(414,'Gaec Martin','producteur fermier',1),(415,'LOCALAIT','Localait propose des produits laitiers ethiques en Occitanie en mettant en place un modele vertueux qui profite a tous : producteurs ecoresponsables, bien-etre animal, remuneration des producteurs fixee par les producteurs eux-memes, emballages en verre consignes et reemployes, distribution dans des petits commerces independants.',1),(416,'cazaubon','Fabrication de yaourt fermier et de compotes artisanales dans les Hautes Pyrénées',1),(417,'La Fromagere des Monts d\'Alban','Petite entreprise artisanale familiale specialisee dans la transformation du lait en fromages. Travaille les 3 laits, avec une large gamme de produits, des pates fraiches aux pates dures, en passant par des pates molles et des bleus, natures ou aromatises. Nous sommes situes en zone de moyenne montagne, dans un environnement preserve de toute pollution. Nous developpons une gamme conventionnelle avec des animaux de race rustique, nourris sans ensilage et sans OGM, ainsi qu\'une gamme BIO certifiee ECOCERT.\nNotre experience de plus de 35 ans, nourrie d\'une riche experience en France et a l\'etranger, nous permet une gamme de produits tres diversifies, classiques ou innovants. Nos nouveaux locaux nous permettent de travailler de facon traditionnelle dans un environnement moderne, ou toutes les regles d\'hygiene sont respectees.',1),(418,'la chèvre baillarguoise','chèvrerie',1),(419,'Mas Des Genêts','Exploitation caprine fermière avec transformation fromagère, vente directe sur les marchés locaux. Label Qualité : Agriculture Biologique, AOP Pélardons\n\nCréée il y a une trentaine d\'années, en pleine garrigue , à la périphérie de Nîmes, au carrefour de Bernis, Langlade et Milhaud, entre montagne et mer, une exploitation moderne et respectueuse de son environnement accueille un troupeau de chèvres alpines chamoisées. Céline, Stéphanie et Jean-Christophe se partagent les travaux de l\'exploitation. Les chèvres mettent bas autour de la mi-février et produisent du lait jusqu\'à la mi-décembre. Elles pâturent en permanence dans la garrigue environnante, se délectant de chêne, arbousier, olivier sauvage, thym, laurier sauvage et autres plantes de garrigue. Elles sont aussi nourries avec du foin de Crau (AOC) , de foin de luzerne et d\'un peu de concentré de céréales , tous issus de l\'agriculture biologique. La fromagerie, implantée sur l\'exploitation, permet de transformer le lait produit par nos chèvres, et d\'affiner notre production de fromage. Nous nous sommes engagés dans une démarche qualité qui nous permet , à chaque étape de la transformation, de vous proposer au travers de nos produits les saveurs d\'antan, la typicité gustative du fromage de chèvre.',1),(420,'ferme de la sarrette','Nous sommes producteurs de lait de brebis et avons notre fromagerie sur la ferme.\nActivité familiale,nous produisons le foin et les céréales dont nos animaux ont besoin.\nNous avons une gamme de yaourts et de fromages au lait cru.',1),(421,'Chevrerie de Combebelle','Elevage de chevres alpines avec transformation fromagere',1),(422,'Sica Les Vergers De Mauguio','La SICA les Vergers de Mauguio est une coopérative fruitière regroupant 14 producteurs pour une production globale de 20000 T. Les vergers se situent dans l\'Hérault et le Gard.\nToute notre production est certifiée Sud Nature, GlobalGap, AH Protocol, mais également Tesco Nurture et F2F. La station est certifiée BRC',1),(423,'EARL MAS DU SOLEIL','Notre propriété se trouve en bordure du Rhône, sur l\'île du Pilet, site exceptionnel classé Natura 2000 où la nature a été préservée. Nous travaillons avec conviction dans une démarche d\'agriculture raisonnée au travers de la certification Global Gap. Nos jus et nectars de fruits sont élaborés à partir des fruits de nos vergers, récoltés à maturité.\nNos jus et nectars de fruits sont pasteurisés ce qui permet de préserver toute leur saveur. Adhérent à la marque Sud De France, nous avons été plusieurs fois primés aux Concours Gard Gourmand et au Concours Général Agricole.',1),(428,'Vergers de Barousse','Exploitation arboricole en production de pommes de table. 10ha en agriculture raisonnee sous le label \'Verger Ecoresponsable\' et 6ha en Agriculture Biologique.\nProduction de jus et petillant de pommes.',1),(430,'LA BONNE ENERGIE','Nee autour dune reflexion sur lalimentation moderne, La Bonne energie sinspire des equilibres naturels du monde vegetal pour developper sa gamme de produits Sport & Bien-etre. Avec des matieres premieres specifiquement selectionnes, nos produits sont ensuite transformes en douceur pour garder les proprietes des matieres premieres.',1),(432,'MAISON POUGET AVEYRON','La Maison Pouget est une entreprise familiale situee a Pruines dans l\'Aveyron, village de tradition fruitiere. Nous proposons toute une gamme de jus de fruits artisanaux alliant savoir-faire et modernite. Nos produits sont naturels et donc sans ajout de sucre, colorants ou de conservateurs. La selection pointilleuse des fruits utilises nous amene a vous proposer une gamme de produits authentiques et de qualite. Aujourd\'hui, on peut retrouver les jus de fruits de la Maison Pouget a la carte de certains restaurateurs etoiles, mais aussi dans des cafes-brasseries, des grandes surfaces ou encore des epiceries fines.',1),(433,'Les vergers du bosquet','Un verger familial cultive depuis trois generations par des arboriculteurs passionnes par les fruits de la nature.',1),(435,'Delices de la Cigale / Atelier du Sirop','Sirops artisanaux, sans conservateur. Plus de 35 saveurs de Fruits, de Plantes, de Fleurs et d\'Epices. Rejoignez-nous et decouvrez notre gamme ! La marque \'Delices de la Cigale\' a vu le jour au coeur de la Provence en 2005. En 2019, l\'entreprise \'L\'Atelier du Sirop\' avec ses deux marques \'l\'Atelier du Sirop\' et \'Delices de la Cigale\' perpetue le savoir-faire et les recettes qui ont fait le succes de ces sirops artisanaux, riches et savoureux, fabriques en France et sans conservateurs. Nous produisons et developpons dans notre atelier proche de Montpellier une gemme complete et evolutive d\'une trentaine de saveurs a dominante Fruits, Fleurs, Plantes et Epices. Nous selectionnons nos ingredients avec rigueur et exigence pour satisfaire vos papilles en dilution dans l\'eau, en nappage sur les desserts ou en cuisson sur les viandes ou poissons.',1),(436,'les sirops du mont bouquet','Bonjour, je suis producteur de sirops artisanaux a base de plantes issues de la cueillette et de la culture par mes soins.\nthym, lavande, romarin, verveine, sauge, menthe, citronnelle, sureau...\nLes sirops sont confectionnes avec du sucre de canne bio, citron bio. Les produits sont entierement naturels.\nA consommer avec de l\'eau, en aperitif et en cuisine.',1),(438,'SAS LIMO SUD','La societe LimoSud produit une large gamme de boissons (gazeuses pour la plupart), qui ont la specificite d\'etre aromatises aux huiles essentielles et aromes naturellement presents dans les huiles essentielles des plantes.',1),(439,'Lionel DESFARGES','Notre vergers de 7ha est situé en Vaunage, sur la commune de Boissières entre Nîmes et Sommières.\nNous produisons des abricots depuis 2008 et renouvelons notre verger avec des variétés atypiques (goûts, formes, couleurs). Nous mettons en place un plan de diversification de notre production avec de nouvelles espèces telles que les Grenades et les Kiwis.\nDepuis 2019 nous transformons une partie de nos abricots en Nectar, premier produit transformé d\'une futur gamme de jus et nectars.',1),(440,'PIERRE CHAVIN','Pierre Chavin, assembleur et éleveur de vins français, a la culture de linnovation et de la différenciation ancrées dans son ADN. Positionnée à lexport et présente dans une cinquantaine de pays, la maison imagine et créée des vins répondant et anticipant les goûts des consommateurs et les tendances mondiales.\n\nLe vin est une histoire de passion et damour, chaque création est élaborée à la manière dune pièce de haute couture.\n\nLes collections viniques Chavin jonglent entre tradition et originalité, elles proposent des vins innovants de lintérieur à lextérieur et misent sur des packagings résolument différents axés sur le Made in France, toujours accompagnés dune pointe daudace.\n\nOsons la différence ! Acceptons que des siècles de tradition puissent se marier avec élégance à la modernité',1),(441,'Seve de Bouleau Bio','Une exploitation Agricole d\'elevage de chevaux sauvee par la Seve de bouleau...\n\nA la sortie de lhiver, il est de coutume dans les pays du nord et de lEst de lEurope ainsi quau Canada de faire une cure de seve de bouleau, ceci depuis des generations.\n\nEn France, il est preconise de faire une cure de Seve de Bouleau Bio en Mars et une en Octobre\n\nLes periodes de cures sont liees a la nature donc a la montee de la Seve et avant lapparition des Feuilles. La seve de bouleau est recoltee sur les arbres de Bouleau situes entre 600 et 1200 metres daltitude. En France depuis une vingtaine dannees des exploitants appeles BETILICULTEURS se sont installes.\n\nPour certains producteurs, le materiel vient du Canada : tuyaux aux normes alimentaires, pinces, raccords, chalumeaux ( bec qui entre dans larbre, meme materiel que pour la recolte du sirop derable)\n\nAujourdhui, de grandes entreprises de negoces importent de la Seve de bouleau de FINLANDE et des Pays de L\'est ( Lituanie, Estonie..)\n\nEn France la production totale natteint pas le 1er million de litres.\n\nLes bienfaits de la seve : DETOX, nettoie les reins, le foie, lorganisme en general et amene des oligos elements ; mineraux, rajeuni les cellules ( donc lutte contre le Vieillissement), aide a la perte de poids ( elimination de la cellulite), anti rhumatismal, drainant et diuretique, traite la goutte..., anti stress ( voir article Osteopathe Jacques ESTRADE )\n\nun agriculteur producteurAriegeois recoltant bio a lance en 2018 une gamme Seve de Bouleau Bio pour les animaux de compagnie Chats et de sports pour les Chevaux, meme effets que sur les humains. Present au Salon de lAgriculture du 22  au 25 fevrier 2020 HALL 3 C145?\n\nLeur exploitation de chevaux de Merens deficitaire depuis 17 ans a ete sauvee par la seve de bouleau et ses inovations..\n\nDe la Petite fille a larriere Grand Mere, 4 generations feminines produisent de la seve de 6 a 87 ans.\n\nhttp://www.seve-bouleau.fr',1),(442,'LES FILS DE FORT BASILE','Les Fils de Fort Basile, entreprise familiale installée à saint girons depuis 1948, sélectionne pour vous chez les fermiers, les meilleurs animaux.\nNous assurons une maturation optimale de la viande, garante de la saveur et de la tendreté de nos produits. Nous en garantissons la provenance en établissant des certificats de traçabilité propres à chaque carcasse.\nNos bêtes sont confiées aux abattoirs locaux qui se chargent du suivi sanitaire de chaque animal.\nToute une tradition d\'élevage.\nLes viandes \'fleurs d\'Occitanie\' sont issues d\'élevages traditionnels. Cette agriculture participe à la protection de l\'environnement et au maintien de l\'emploi local.',1),(443,'Viandes du sud Toulousain','',1),(444,'VIANDES OCCITANES','La SARL Viandes Occitanes a été créée en 2003 avec 3 associés. Nous sommes implantés à Montauban (Tarn et Garonne, 82). Nous proposons une gamme complète de viande bovine (Blonde daquitaine, Limousine, Aubrac, Charolaise) ainsi que veau fermier, agneau laiton (Tarn et Garonne et Lot) et porc de Midi-Pyrénées.\nLactivité est orientée vers les collectivités, boucheries, restaurants et GMS. L\'atelier de découpe de viande propose des viandes de qualité en carcasse ou conditionnées sous vide pouvant porter l\'appellation Saveur Occitane.\nLes animaux sont sélectionnés et achetés par nos soins :\n&#61610;	En ferme locales ou sur les marchés aux bestiaux régionaux de Midi-Pyrénées\n&#61610;	Pour assurer un approvisionnement qualitatif régulier, nous possédons sur notre exploitation un nombre important danimaux,\n&#61610;	Labattoir SOGAM de Montauban, situé sur notre zone de production et à proximité de notre atelier de découpe, assure les abattages.',1),(445,'La ferme de Lagoute','J\'élève depuis l\'année dernière une trentaine de chèvres des Pyrénées. C\'est une  race rustique, inscrite au Conservatoire du Patrimoine Biologique Régional.\nL\'objectif est de valoriser des milieux fermés avec cette race qui apprécie particulièrement les sous bois, les landes et les taillis.\nLe troupeaux pâture toute l\'année, à l\'exception de la période des naissances où il est renté en bâtiment.\n\n\nJe commercialise les chevreaux en caissettes sous vide ainsi qu\'en rillettes, pâté et confits. La transformation est effectué aux seins de la coopérative des gaves, située à Lourdes.',1),(446,'Christophe NALES-MAUBERT','Élevage d\'agneau, découpe personnalisé,en demi, en quart ou entier, puis livré sous vide.\nLes commandes se font le mercredi pour le mercredi suivant.',1),(447,'FOIE GRAS ROBERT','Nous sommes producteurs de foie gras d\'oie et de canard dans le Lot depuis plusieurs generations et nous sommes attaches a notre terroir.',1),(449,'GAEC DE LORAN','Exploitation Bovins lait (troupeau de jersiaises) et Bovins allaitant (troupeau charolais), en agriculture biologique et en 100% pâturage. \nVente directe de viande découpée dans un atelier agréé situé à Auch.\nLe lait est collecté par Biolait.',1),(450,'Les Steakeurs','Avec une bande d\'amis agriculteurs ariégeois, nous nous sommes associés sous le nom \'Les Steakeurs\' pour mettre en avant notre savoir faire sur la production de viande de Jeunes Bovins.. Notre solution est de la commercialiser nous même avec une juste rémunération de l\'agriculteur. \nLes éleveurs qui composent les Steakeurs sont des fermes familiales et qui sont répartie sur toute lAriège. Notre idée et donc de s\'entraider pour faire vivre correctement les agriculteurs de notre département de par cette initiative. \nNotre viande est garantie 100% ariégeoise. Les Jeunes Bovins naissent sur la ferme, son sevrées à 8 mois, puis engraissées pendant 3 mois avec de l\'herbe, du fourrage ou des céréales produits exclusivement sur la ferme et sans OGM. L\'abattage, avant 12 mois, se fait sur Pamiers et la transformations à Laroques d\'olmes. La viande ne sort pas de lAriège sauf si elle est vendue en dehors du département. \nTous les agriculteurs on signé La charte de bonne pratiques de l\'élevage basée sur le bien être animale, de la traçabilité des produits, de garantir une bonne alimentation mais aussi de participer au respect de l\'Environnement',1),(451,'Sas Ateliers Viandes et Saveurs','Petite equipe,  installe depuis 2017 a murat sur vebre qui  fait vivre ses produits regionaux.',1),(452,'TERROIR DE LA TRILLE','Entreprise familiale, installée en Ariège depuis bientôt 20 ans, nos animaux naissent, et vivent sur la ferme, ils sont nourris de l\'herbe de nos prairies.\nVente de viande bovine de race limousine,  vente directe au particulier, vente en boucherie, livraison France entière.\nVente de conserves de viande bovine élaborées par nos soins.',1),(453,'EARL LAFFITTE','Exploitation de 207 hectares, polyculture a élevage dominante bovin/ viande, 70  hectares de cultures(mais, céréales...) 130 hectares de prairies pour un cheptel de 85 mères (races charolaise) et 4 taureaux reproducteurs\nProduction naisseur , engraisseur et vendeur de reproducteurs.\nFinition de toutes mes femelles de 3 à 10 ans \nTous les animaux sont engraissés/finis avec les céréales de ma ferme.\nJe suis dans une démarche d\'engraissement plus longue car je cherche le persillé et le gras de couverture.',1),(454,'Ferme La Montagnette','Notre ferme est située au coeur du plateau de l\'Aubrac, à 4km du village de Laguiole. Nous y élevons un troupeau de 120 vaches Aubrac que nous nourrissons naturellement grâce à l\'herbe de nos prairies. \nNous proposons notre viande Aubrac de boeuf et de veau en vente directe à la ferme, mais aussi en livraison dans de nombreuses régions françaises.',1),(455,'FERME DES 2 PIGEONNIERS','Benoit et Dominique Moncouet elevent des vaches Limousines, une authentique race a viande. Eleveurs soucieux de la qualite de nos produits et du bien-etre de nos animaux, nous mettons notre savoir-faire a votre service, pour vous proposer une viande de qualite exceptionnelle, a travers un haut niveau de tracabilite et avec la garantie qu\'aucun traitement antibiotique ni d\'hormone, ne sont administres a nos betes.',1),(456,'Languedoc Salaisons','Situé à Pézenas (Hérault), Languedoc Salaisons est une société spécialisée dans l\'élaboration de jambons secs depuis plus d\'un quart de siècle. Dynamique et réactive, elle a su s\'imposer sur un marché fortement concurrentiel. Dotée d\'un outil de production des plus modernes et du savoir-faire traditionnel des ses maîtres affineurs, Languedoc Salaisons vous invite à découvrir sa gamme et ses spécialités.',1),(459,'G. BORIES','Depuis plusieurs generations, les familles ESCANDE et PISTRE ont ete actives dans le metier de la salaison. \nLentreprise est une entreprise familiale dune douzaine de personnes specialisee dans la production de salaisons seches sous boyau.\nLa gamme proposee va de la saucisse apero a de grosses pieces destinees au tranchage en passant par la production de specialites comme la saucisse de foie, de canard ou au piment dEspelette.\nDepuis 1998, elle produit des saucissons et saucisses Label Rouge pour les rayons charcuterie libre service et coupe.\nElle distribue ses produits a marque propre en GMS, par des reseaux de grossistes et fabrique egalement des produits vendus a marque de distributeur\n\nLa  Lacaunaise est « LE SPECIALISTE » dont le savoir faire et la maitrise technique lui permettent de sadapter aux differents besoins des rayons LS, Coupe ou Frais Emballe.\n\nDepuis juin 2020, la charcuterie Bories a repris la production et la commercialisation des produits de La Lacaunaise et perpetue ainsi la tradition, le savoir faire et la qualite des produits de l\'entreprise lacaunaise.',1),(460,'Maison Milhau','La Maison Milhau est une entreprise de charcuterie et salaison fondee en 1926 et situee a Lacaune, la capitale de la charcuterie en Occitanie. A 800 metres d\'altitude, l\'air pur et les vents se melent idealement pour affiner nos produits de salaison. Nous selectionnons une viande de porc exclusivement francaise, nous embossons en boyaux naturels et nous affinons tous nos produits a Lacaune. Notre large gamme de produits nous permet de repondre aux differents besoins des consommateurs : saucisserie fraiche, jambon sec et salaison seche sont notre cur de metier.',1),(461,'Domaine Rey - Marie et Nicolas REY','Marie et Nicolas Rey, naisseurs et éleveurs de Porc Noir de Bigorre AOP : un élevage passion, un terroir, des valeurs pour un goût dexception.\nNous sommes un couple déleveurs de Porc Noir de Bigorre sur les coteaux de Loubersan dans le GERS, un terroir unique pour lélevage de cette race porcine en voix de sauvegarde. Juste quelques lignes pour vous présenter nos valeurs : \n Perpétuer l\'histoire et sauvegarder l\'élevage du Porc Noir de Bigorre au sein du Consortium Noir de Bigorre. Race à labandon car animaux trop gras, trop lent à élever, trop peu productif et donc inadaptés aux conditions d\'élevage intensif \n Élever nos animaux selon un mode naturel et raisonné, en démarche de qualité AOP, en parfaite harmonie avec notre écosystème \n Respecter l\'animal et lui laisser le temps de grandir et se développer à son rythme pendant 14 mois en moyenne, dans les prés et les bois, avec un maximum de 20 porcs /ha de prairies \n Fabriquer laliment de nos porcs pour les nourrir sainement avec des céréales non OGM et toutes les ressources de leur milieu naturel: herbe, glands, racines... \n Cultiver l\'exception et l\'excellence du goût de nos produits issus du Porc Noir de Bigorre',1),(462,'ETS CANCE','SALAISON DE MOINS DE 20 SALARIES, APPARTENANT A LA COOPERATIVE D\'ELEVEURS PORCINS APO. LES ETS CANCE DEVELOPPENT UNE GAMME DE PRODUITS 100% LOCAL EN PROPOSANT DE LA CHARCUTERIE ELABOREE EN AVEYRON AVEC DES PORCS ELEVES ET ABBATUS DANS L\'AVEYRON. \nLA CHARCUTERIE CANCE EST LE RESULTAT DU SAVOIR FAIRE AVEYRONNAIS, NOUS NOUS POSITIONONS COMME DES EMBASSADEURS DE NOTRE REGION EN PRODUISANT EN CIRCUIT LE PLUS COURT ET LOCAL POSSIBLE.',1),(463,'Charcuterie du Cagire','Cest a 600 m daltitude, dans le village de Juzet dIzaut au pied du Cagire, quest installee la Charcuterie du Cagire, Bares et fils, maison familiale et de tradition depuis 1951, dont Mr Pierre Bares est le Dirigeant.\nSoucieuse de transmettre le veritable plaisir du gout et de la tradition, la Charcuterie du Cagire propose une tres large gamme de produits charcutiers fabriques a partir de porcs rigoureusement selectionnes dorigine France, controles a reception afin de verifier le respect de nos exigences, tant en matiere de qualite que de securite alimentaire et de tracabilite. Redecouvrez lauthenticite de recettes regionales 100% pur porc.\nLa Charcuterie Bares emploie aujourdhui 25 personnes pour perpetuer lauthenticite de ses recettes regionales depuis 3 generations, et contribue ainsi a lactivite economique du village de montagne ou elle est implantee et de ses environs.',1),(464,'CHARCUTERIE SERRES','De la Terrine Aveyronnaise, veritable fleuron de la societe, aux pates de campagne en passant par les produits de tete jusquau celebre boudin galabart, cest un large eventail de specialites charcutieres regionales qui vous est propose tout simplement !\n \n La signature Charcuterie Serres : une garantie de qualite qui a su traverser le temps pour en restituer toute lauthenticite des Pays Tarnais et Aveyronnais !',1),(465,'Domaine du Catie','Lorigine.\nLorigine du Domaine, il faut aller la chercher a la croisee de mes plus fortes passions, cest un murissement de 50 ans de vie. Ma premiere passion, celle du monde paysan qui ne ma pas quitte depuis mon plus jeune age. Ma deuxieme, celle de la liberte qui permet detre acteur de sa vie. Et enfin ma troisieme acquise tout au long de ma vie professionnelle, celle de la gastronomie et des produits du terroir.\nDevenir eleveur est en fin de compte un nouveau depart tant je le porte en moi.\n\nLa foret du Catie.\nCest ma grand-mere Simone qui a achete en 1925 cette belle propriete et avec laide de son mari Francois la petit a petit boisee. Ensuite mes parents lont geree avec passion et conviction. \nSituee en zone de montagne a 750 metres daltitude a la croisee des influences mediterraneennes et oceaniques notre pays subit de forts coups de vent et des neiges lourdes. Il nous faut des arbres solidement implantes, ils doivent donc etre espaces les uns des autres ce qui laisse place a une vegetation abondante a leur pied. \nEt voila que germe en moi lidee du sylvopastoralisme.\n\nLe sylvopastoralisme.\nIl ma suffi de cloturer des parcelles de jeunes douglas pour mettre en pratique mon idee delevage en foret. Le cochon sest vite impose, comment faire autrement avec cette forte tradition de charcuterie qui existe ici ! Le cochon Mangalitza ou familierement appele « cochon laineux » est la race ideale, un animal tres rustique, a la chair fine et savoureuse reconnue par les plus grands gastronomes. \n\nLalimentation.\nPour avoir une chair et un gras exceptionnels, les cochons doivent pouvoir brouter toute la journee de lherbe, des ronces et dautres bonnes choses. Il faut preserver leur paturage cest pourquoi dans mes parcs je ne mets pas plus de 10 a 15 cochons par hectare.\nEn complement je leur donne tous les jours de lorge germee et de la luzerne. \n\nUne production hors norme.\nMon elevage est atypique par son investissement materiel faible :  des clotures, une Kangoo 4x4, des barriques pour faire germer lorge et le sylvopastoralisme permet en meme a la parcelle de donner du bois. Mon principal investissement cest le temps. Il faut deux ans et demi a trois ans pour elever un cochon laineux. \nToutes mes betes paturent dans de grands parcs de la naissance a lage adulte, elles ont une vie sociale, sont calmes et tranquilles. Tout ceci nest pas la norme pour lUnion Europeenne et par consequent je ne beneficie daucune aide type PAC.\n\nUne viande exquise 100% naturelle.\nDes animaux eleves dans de telles conditions donnent une viande exceptionnelle, fine, savoureuse et puissante a la fois.\nTous mes produits sont garantis 100% naturels sans aucun additif, colorant et conservateur. Les salaisons sont faites sans nitrite uniquement avec du sel et du poivre.',1),(466,'La Ferme de Michel','Nous sommes specialises dans l\'elevage, la transformation et la vente directe de porcs roses, veaux et bufs de race Limousine.\n\nTous nos animaux sont eleves sur la ferme, nourris sans antibiotiques et avec les cereales non OGM que nous produisons nous-meme.\n\nNous transformons la viande dans notre laboratoire agree CEE. Tous les produits frais, charcuteries ou conserves sont elabores sans colorants, sans conservateurs, sans sels nitrites.\n\nNotre volonte : proposer des produits simples, en circuit court et de qualite.',1),(467,'CAZAUX JEAN-LUC','Cest au cur de lAriège, à Lorp-Sentaraille, que Mr André CAZAUX créé en 1969 sa charcuterie artisanale. Grâce à son savoir-faire et la qualité de ses produits, lentreprise familiale se développe rapidement. En 1991, il se lance dans la construction dun atelier de fabrication où le rejoignent ses fils Serge, qui prend les rennes de latelier de fabrication, et Jean-Luc qui accompagne le développement commercial. \n\nEn 1995, suite à la disparition brutale dAndré CAZAUX, ils reprennent la Direction de lentreprise Ariégeoise.\n\nPoursuivant sur la voie tracée, lentreprise élabore des produits charcutiers de qualité grâce à son savoir-faire et au choix rigoureux des matières premières. Les viandes fraîches utilisées proviennent uniquement de porcs dorigine Midi-Pyrénées et Aquitaine. \n\nLe travail des deux frères est récompensé en 2007 par lattribution du Titre de Maître-Artisan à Serge CAZAUX, et une distribution commerciale qui sétend rapidement bien au-delà du Sud-Ouest.\n\nLa Charcuterie André CAZAUX élabore avec exigence ses produits hauts de gamme tels que ses délicieux jambons secs, frottés à la main pour un salage doux au sel sec, sans aucun conservateur. Leur goût authentique a dailleurs été doublement distingué au Salon de lAgriculture à Paris par une Médaille dor en 2009 et 2012. Ses saucissons secs, fabriqués dans le plus pur respect de la tradition du Terroir, ont également été quatre fois Médaille dor au Salon de lAgriculture entre 2008 et 2013. En 2015, trois produits ont été médaillés de bronze : saucisson André CAZAUX, saucisse sèche le Pastou et le pâté de campagne à lancienne. En 2016, cest au tour de notre saucisse sèche le Pastou dêtre médaillée dor.\n\nForte de ses multiples reconnaissances de son savoir-faire, lentreprise André CAZAUX se différencie par un savoureux mélange de rigueur et de tradition artisanale pour vous offrir des produits de grande qualité au goût inimitable de lAriège.',1),(469,'Le Jambon d\'Auch','La salaison GERIAL, à Gimont dans le Gers en Gascogne existe depuis plus de 30 ans. Située au cur du Gers en Gascogne, elle vous propose des produits de charcuterie authentiques, élaborés uniquement à partir de jambons du Sud-Ouest, dune très grande qualité, hautement gustatifs et qui satisfont les palais les plus fins.',1),(470,'SALAISONS OBERTI','La société OBERTI est une société familiale, située dans les Monts de Lacaune, à 800 m d\'altitude. Elle produit des salaisons sèches et charcuteries depuis 1956, selon un savoir-faire familial et des recettes d\'antan : jambon de lacaune IGP, saucissons et saucisses sèches, coppa, pancetta, terrines, boudins, et spécialités régionales... les matières premières sont rigoureusement sélectionnées, et l\'origine des porcs français contrôlée. Affinées lentement en séchoir de montagne, nos salaisons ont du goût; celui de l\'authentique.',1),(471,'Porc plein air Baron des Cévennes','',1),(472,'Le Gratons Castillonnais','',1),(473,'MAISON SERRAULT','La maison Serrault est une entreprise familiale fondée à Capdenac-Gare en 1923 par Léon Serrault.\nDepuis 5 générations de charcutiers ont succédé à Léon Serrault.\n48 personnes travaillent dans notre atelier de Capdenac-Gare.\nNotre cur de métier : la saucisserie Fraîche.\nNos saucisses fraîches sont fabriquées uniquement à partir d\'épaules de porc, une des parties les plus nobles.\nNous pratiquons un hachage traditionnel \'au couteau\' pour préserver toutes les qualités de la viande.\nLes Gammes :\n*Charcuterie crue (chipolata, saucisses de Toulouse, farce à légumes, merguez, chorizo,...)\n*charcuterie cuite (friton, boudin noir, pâté, cuisse de canard confite, poitrine farcie...)\n*Produits saumurés (jambonneau, plat de côte, palette, couenne, pied, oreille,...)\n*Poduits appertisés (jambonneau, confit de foie de porc,...)\net une nombreuse gamme en RHF& RHD.',1),(474,'le grenier à jambons','Nous élevons nos cochons sur paille en liberté.\nIls sont nourris avec des céréales sans OGM ni antibiotique.\n\nNous les transformons dans notre atelier avec des recettes traditionnelles\n\nNos produits sont en vente dans notre boutique à Rimont, sur le marché de St GIRONS et dans des épiceries fines de TOULOUSE;\n\nVous pouvez déguster nos produits dans notre  restaurant fermier',1),(475,'Société Porc Montagne','La Société Porc Montagne est l\'unité d\'abattage, de découpe et de commercialisation de viande de porc du groupe Alliance Porci d\'Oc (APO), basée à Sainte-Radegonde dans l\'Aveyron.\nAPO est une coopérative qui regroupe près de 300 éleveurs de porcs situés principalement en région Occitanie.\nLa Société Porc Montagne (SPM) emploie 150 salariés et abat environ 6000 porcs par semaine pour un tonnage annuel commercialisé de près de 30 000 tonnes de viande.\nSPM propose plusieurs offres commerciales qui vont du porc VPF (porcs nés, élevés, et abattus en France) au porc issu de l\'Agriculture Biologique. \nElle propose notamment une offre sous appellation \'Porc de l\'Aveyron (R)\', marque commerciale appartenant au groupe APO. Environ 100 élevages, adhérents du groupe APO, entrent dans la démarche \'Porc de l\'Aveyron\', principalement des élevages familiaux, fabriquant leur aliment à la ferme. L\'abattage et la découpe des porcs se font au sein de la Société Porc Montagne (seul abattoir autorisé pour abattre les porcs de la démarche \'Porc de l\'Aveyron\').\nAinsi le \'Porc de l\'Aveyron\' est la garantie d\'une filière courte gage de qualité et d\'authenticité des produits.',1),(476,'Tranchage de la Jasse','Tranchage de la Jasse, est une société fondée en 2004, spécialisée dans le tranchage, le travail à façon et le conditionnement de charcuteries. \nDotée dun outil industriel performant et dun savoir faire véritable, Tranchage de la Jasse a su devenir expert dans la fabrication de chiffonnade, de tranché fin ainsi que de hors froid, et  propose des prestations de qualité.\nNotre rigueur et notre polyvalence nous permettent dobtenir un résultat personnalisé, pensé pour satisfaire une clientèle exigeante à la demande variée.',1),(477,'La Ferme de l\'Enclave','Ferme dans les Hautes-Pyrenees de 18 ha avec productions de cochons, de mais pour lalimentation.\nNous faisons de la charcuterie depuis 1974, en 1992 nous avons cree un atelier de transformation ou nous transformons toute notre production en charcuterie fermiere.',1),(478,'Maison LE DE','Charcutier traiteur de pere en fils depuis 1969 installe a Gimont dans le Gers en Gascogne, que nous avons reprise avec mon mari il y a 16 ans. Nous avons a coeur de fabriquer des produits de qualite, dans le respect de la tradition et des recettes ancestrales.\nNotre respect des traditions ne nous empeche pas d\'innover. En effet, nous venons de creer un nouveau pate, le \'breton gascon\', en hommage aux origines bretonnes de l\'arriere grand pere de Franck Le De. Ce nouveau pate remporte un franc succes aupres de nos clients. Nous avons egalement obtenu 9 medailles au concours general agricole des produits en 6 participations au concours, dont 2 medailles d\'or cette annee, une pour le pate de campagne et une pour le magret seche entier.',1),(479,'FERME LE COCHON DU MADRES','ferme d\'elevage plein air en pyrenees audoises, bovins et cochons,\ntous nos produits sont elabores par nos soins dans notre atelier de\nfabrication C.E sur notre ferme. Viandes fraiche de boeuf et cochon,salaisons et conserves. Mais egalement servi a notre ferme\nauberge.',1),(480,'Mangalitza du Pic Saint Loup','Dans l\'arriere pays Montpellierain, aux portes des Cevennes, sur la commune d\'Argelliers, nous avons installe nos cochons Mangalitza au milieu des etendues de chenes vert.\n\nLes cochons laineux grandissent pendant 15 mois en semi liberte avec une alimentation quasiment naturelle composee majoritairement de glands.  \n\nNous faisons abattre sur l\'abattoir de Pezenas. Ils sont ensuite decoupes et conditionnes sous vide pour une commercialisation de la viande. Une partie de la production est acheminee a Lacaune pour y etre transformee en charcuterie. Des jambons d\'affinage de 12 a 36 mois seront proposes a la vente.\nNous les commercialisons sur differents magasins de producteurs, sur l\'exploitation mais egalement dans des restaurants de Montpellier.',1),(482,'Gaec Du Moulin De Mas','Petite entreprise familiale a vocation agricole : nous faisons naître et nous élevons nos animaux (veaux et porcs) ,puis parvenus a l\'âge adulte nous vendons leur viande et la charcuterie que nous fabriquons.',1),(483,'Charcuterie Paysanne Cévenole','charcuterie paysanne',1),(484,'RV TRISTANT','Petite entreprise située dans les monts de Lacaune;  nous sommes spécialisée dans la fabrication de charcuterie sèche et de saucisserie fraiche. La majeure partie de notre production est fabriquée avec de viandes fraiches d\'origines françaises (le porc français).',1),(485,'FOURGASSIE FRERES','Implantee a 800 m d\'altitude, la maison FOURGASSIE a ete creee en 1947 dans le soucis de ressusciter la tradition et le savoir faire millenaire du village de LACAUNE.\nUn climat specifique tres favorable a un bon affinage des produits de salaisons.\nUn processus de fabrication entierement traditionnel a l\'ancienne, et une specificite unique.\nEtuvage avec un feu de cheminee comme autrefois qui donne le gout boise incomparable des produits FOURGASSIE.',1),(486,'Charcuteries d\'Occitanie','Les charcuteries dOccitanie sont le fruit dun savoir faire traditionnel familial, herité depuis six générations (1903), a la ferme de \nMallosseves.\nNous avons naturellement choisi de travailler avec des éleveurs régionaux.\nNos méthodes de travail favorisent un traitement de nos matières premières le plus naturel possible. Nous nutilisons aucun additifchimique dans nos préparations.\nNous travaillons avec les meilleurs producteurs dépices mondiaux, ce qui apporte des saveurs uniques a nos préparations.\nNous bénéficions de la reconnaissance « artisan de qualité », attribuée par le Collège Culinaire de France, une association fondée\npar 15 chefs français reconnus internationalement, dont Alain DUCASSE, Paul BOCUSE, Yannick ALLENO, ou Joel\nROBUCHON.',1),(487,'SALAISONS DE SAINT SAUVEUR','Salaisons de Saint-Sauveur est un des derniers producteurs de Veritable Saucisse de Toulouse, produit historique de notre region et fidele ingredient du celebre Cassoulet Toulousain.',1),(488,'Gaec Des Licides','culture et production animale',1),(489,'GAEC La Ferme De Besses','',1),(491,'maxime daudet','Exploitation individuelle, en conversion à l\'agriculture biologique, située en Margeride, sur la commune de Chaudeyrac. \nElevage de bovins allaitants de race aubrac et apiculture d\'abeilles noires',1),(492,'Ferme de la Bouriette','Bienvenue a la ferme de la Bouriette\n\nJe m',1),(493,'MAISON DELCROS','Producteurs de volaille depuis 3 générations, notre exploitation se situe en Lozère proche de Saint Chély dApcher à 1100 mètres daltitude.\nAujourdhui je reprends la ferme familiale dans le but de continuer à produire des volailles de qualité en faisant cohabiter savoir-faire, passion, et modernité.\nNous proposons poulets, pintades, canards  nourris au grain et élevés en plein air toute lannée. Les volailles que vous dégusterez sont élevées, abattues et découpées sur notre exploitation.',1),(494,'LA FERME FABIOLE','Eleveur Arvicole poulet fermier plein air 2 bâtiments de 400m2 pour 1hetare environ de parcourt par bâtiment + 2 bâtiments déplaçables avec parcours.\nAbattage et transformation de la viande dans une tuerie de 200m2\nau normes  construite en 2019.\nVente directe particulier, restaurateur, boucherie.',1),(495,'les Canards de Bramal','Petite Exploitation familiale spécialisée dans l\'élevage et le gavage de canards gras. Tous nos produits proposés sont transformés en Ariège.',1),(496,'Ferme Dou Pleix','Notre exploitation se situe au pied de la chaine Pyreneenne. \nLa ferme Dou Pleix vous propose des produits de prestiges issues de races anciennes ayant chacune des caracteristiques uniques. Nous elevons en plein air et engraissons des oies fermieres du Gers , des canards Barbarie et des canards Kriaxera. Nous produisons du foie gras , des produits frais ou confits et des autres produits fermiers .',1),(497,'Alby Foie Gras','Depuis plus dun siècle, la Conserverie Lascroux exerce son savoir-faire, sa spécialité : le foie gras.\n\nSitués en plein coeur du Sud-Ouest, en Pays Albigeois, nous sommes agréés à l\'exportation Union Européenne et consacrons toute notre activité à la fabrication de produits hauts de gamme (foies gras, confits, cassoulets...). Nos canards et oies proviennent délevage Landais, garantis nourris au maïs et préparés selon la tradition. \n\nTous nos produits sont élaborés dans nos locaux, et contrôlés avec minutie, de la découpe à la transformation, en passant par  la cuisson. Pour cela , nous avons à disposition un personnel qualifié pour chacune des étapes de la fabrication (découpe, transformation, emballage, tri des foies gras...) ainsi que les outils nécessaires et notamment une chaîne déviscération permettant de découper en un temps très court pour une fraîcheur optimale toute lannée.',1),(498,'abattoir avicole de la rougearie','Depuis 3 generations, nous abattons et commercialisons nos volailles elevees en plein air.\nElles sont nourries avec une alimentation 100 % vegetale pendant 110 jours minimum ( soit un mois de plus que le label rouge) ce qui leur garanti une saveur et une qualite exceptionnelle.\nNotre abattoir agree CEE, vous propose des poulets fermiers, des pintades fermieres, des lapins, canard, pigeons ainsi que de la decoupe de volaille et de lapin.\nNous abattons egalement a facon dans le respect du bien-etre animal pour les professionnels et les particuliers',1),(499,'SA Languedoc Lozère Viande','Créée en 1993, Languedoc Lozère Viande est filiale du groupement de producteurs CELIA ancré au cur de l\'Aubrac et qui rayonne sur le sud du Massif Central, Causses et Cévennes. Languedoc Lozère Viande s\'approvisionne donc en circuit court auprès des élevages de la région. \n\nBasée a Antrenas en Lozère tout proche de l\'A75, Languedoc Lozere Viande est une entreprise moderne et performante qui commercialise des produits de terroir issus de filières qualité. \n\nSon savoir-faire sur la cheville comme sur la découpe lui permet de servir ses nombreux clients en buf, veau, agneau, porc, saurisserie, charcuteries et salaisons.',1),(500,'La Ferme de Souegnes','La Ferme de Souegnes est situee a MASSAT dans l\'Ariege au c',1),(501,'vivaplante','',1),(502,'Les serres de la Frondaie','Exploitation horticole du Lycee Honore de Balzac. Outil pedagogique mais aussi unite de production de plantes en pots.\n1700 m² de serres verre, production de plantes a massifs, suspensions, chrysanthemes, cyclamens, poinsettia, arbustes en pots.',1),(503,'HORTUS CONCEPT PEPINIERE','Notre pépinière s\'étend sur plus d\'un hectare où nous produisons des plantes d\'ornements méditerranéennes et variées. Nos pépiniéristes sont force de conseil pour vous délivrer leurs recommandations, venez nous rendre visite !',1),(504,'ESAT la Croix Verte','L\'ESAT la Croix Verte est un etablissement d\'aide par le travail. Letablissement emploi et accompagne 79 travailleurs en situation de handicap.\n\nL\'atelier horticulture produit 650 varietes de plantes, arbres et arbustes selon les principes de l\'agriculture raisonnee. Chaque variete a ete selectionnee parce qu\'elle est adaptee au climat et au terroir regional.\n\nNotre philosophie peut se resumer en une phrase: Nous laissons aux hommes et au plantes le temps de sepanouir.',1),(505,'BALARUC LES BAINS','Dans le sud de la France, rayonne une cité antique bordée par la lagune de Thau dont leau merveilleuse jaillit de sources naturelles profondes.\n Ce secret est celui de Balaruc-Les-Bains. Unique station thermale de Méditerranée, elle abrite depuis des millénaires des bains somptueux où Neptune, Dieu des Sources et les nymphes empreintes de jeunesse et de beauté, étaient vénérés. \nCette ville témoigne dun art de vivre à la romaine où les bains allient thérapie, luxe et volupté.\n Deux milles ans plus tard, lefficacité de cette eau thermale est prouvée, la science rejoint lhistoire',1),(506,'Le Moulin de Pradines','Moulin oléicole et caveau de dégustation d\'huile d\'olives , olives , tapenades , savons , soins du corps à base d\'huiles du moulin et autres produits gourmets et gastronomiques , au coeur d\'une oliveraie de 20 ha .\nSur le même lieu , trés beau lieu d\'art contemporain sur 3 salles offertes aux artistes , parc de sculptures .',1),(507,'LES SENTEURS DU LANGUEDOC','Crée en 1997 la SARL VALBAUME INTER conçoit et fabrique des produits cosmétiques de qualité pour le thermalisme, la balnéo et la kinésithérapie ainsi que la gamme de produits cosmétiques régionaux LES SENTEURS DU LANGUEDOC distribuée essentiellement en Grande Distribution.',1),(508,'Ylae','Ylae, cest la rencontre de deux adeptes du bio, qui ont su allier leurs competences dingenierie-cosmetiques et dentrepreneuriat pour creer une marque de cosmetiques naturelle et biologique, respectueuse de la peau et de lenvironnement.\nCest en 2009, a un moment ou les cosmetiques biologiques seduisaient moins les consommateurs en raison de leurs textures grasses et epaisses, que laventure commence. Ylae propose une large gamme de soins alliant beaute, bien-etre et technologie, et adaptee a la majorite des besoins : hydratation des peaux seches, solutions anti-age, soins des peaux mixtes, gamme solaire, soins du corps\nDepuis 2015, tous les produits sont imagines et fabriques a Montpellier, en Occitanie.\nAujourdhui, toujours portee par cette meme ambition de « democratiser lutilisation des cosmetiques bio », notamment par des prix abordables, lentreprise poursuit sa croissance et continue dinnover pour votre plus grand plaisir !',1),(509,'Propolia®','Créé en 1979 par un  apiculteur, APIMAB Laboratoires est un des précurseurs Français de la purification et de la transformation de la Propolis. \nDe par ses nombreuses propriétés, ce produit de la ruche peut s\'avérer efficace dans un large panel d\'applications pour le bien-être ou pour les applications cutanées, si bien qu\'aujourd\'hui, la marque phare du laboratoire, Propolia , propose près de 70 produits adaptés à tous types de besoins... avec un crédo : des produits actifs car riches en actifs.',1),(510,'BERDOUES PARFUMS ET COSMETIQUES','',1),(511,'Les Roumanisses','',1),(512,'LAPHT PHYTOFRANCE','Laboratoire francais, specialiste de la plante fraiche, de la cueillette au produit fini.\nLAPHT PHYTOFRANCE, Laboratoire d\'Aromatherapie, de Phytotherapie et d\'Herboristerie Traditionnelle, fort de 30 ans d\'experience est situe pres de Montpellier, dans le sud de la France, au milieu des vignes et tout pres de la mer Mediterrannee.\nSon equipe a mis au point une gamme de produits de base pouvant etre utilises comme matieres premieres : \n- plus de 2500 extraits hydro-alcooliques,\n- plus de 600 plantes en herboristerie,\n- environ 500 extraits fluides glycerines mielles,\n- une gamme tres etendue d\'huiles essentielles\n- en tout plus de 2300 references certifiees Agriculture Biologique.\nNotre laboratoire est ainsi en mesure de fabriquer de nombreuses matieres premieres et gammes de produits finis, ou d\'etudier et proposer a la demande, des nouvelles formules ou fabrications destinees a la France ou a l\'export.\nNous sommes specialises dans les complements alimentaires, l\'herboristerie, la phytotherapie, l\'aromatherapie et la nutritherapie.',1),(513,'La Grange au Thé','La grange au Thé est une association de producteurs de la plante appelée \'Thé d\'Aubrac\'. Son objectif est de faire connaître le goût et l\'odeur de cette plante traditionnellement consommée sur l\'Aubrac depuis des générations. La Grange au Thé a souhaité cultiver la plante pour la protéger de la cueillette et pouvoir la proposer sous différentes formes au-delà de l\'utilisation traditionnelle en tisane. C\'est pourquoi la grange au thé propose aussi des gâteaux, sirops, gelées à base de thé d\'aubrac mais aussi des cosmétiques naturels mettant en valeur l\'odeur du thé d\'aubrac.',1),(514,'Maison Bot','A Fraïssé des Corbières nous cultivons 1500 oliviers. C\'est une culture non irriguée, pour protéger la ressource en eau et garantir une huile de qualité. Pour favoriser la biodiversité quelques ruches sont installées et permettent une production de miel, ainsi qu\'une centaine d\'amandiers.\n\nEn 2019 nous avons enrichi notre gamme avec des baumes et huile de massage à base de notre huile d\'olive vierge extra et notre cire d\'abeille',1),(516,'DOMAINE GRAND GUILHEM','Domaine viticole de 12 ha en agriculture biologique avec structure d\'hébergement en Chambres d\'Hôtes et Gîtes de charme.',1),(520,'Domaine BERTRAND-BERGE','Notre Domaine se trouve à Paziols, un village vigneron situé aux confins de lAude,\nOù il bénéficie des appellations dorigine Fitou, Rivesaltes et Muscat de Rivesaltes. En dehors de ces délimitations, nos vins portent lidentité de Vins de Pays du Torgan.\nLe vignoble, dune superficie de 34 hectares, sétend sur léchelle des reliefs de la commune, depuis une plaine bénéfique jusquà léminence avantageuse des collines environnantes. Dans sa diversité, léventail des sols distingue plus particulièrement des formations de poudingues qui donnent tout son sel au secteur de Paziols. Lessence des raisins y gagne dans ce contexte, dautant plus que nos ceps possèdent un enracinement certain, conséquence dun âge moyen vénérable (60 ans) et dun travail consciencieux, fait sans recours à des produits de synthèse et dans le respect de lécosystème environnant.\nReflétant toute une tradition vigneronne, lencépagement fait toujours la part belle au carignan, variété réputée « rustique » qui, cependant, délivre une fraîcheur de sève incomparable sous notre climat et sur nos terrains. Grenache, syrah et mourvèdre le complètent comme composants des rouges. Côté blanc, un muscat dominant traduit la vocation régionale pour les Vins Doux Naturels, à laquelle nous nous efforçons de contribuer.\nLa cave, installée dans une vigneronne au cur du village, conserve son architecture originelle, datant de 1911, une disposition que nous avons choisi de respecter lors de la mise en place dune nouvelle cuverie, en 1993. En 2011, lagrandissement du chai sest également opéré en prenant en compte le patrimoine bâti.\nLa qualité de nos vins sinscrit dans les meilleurs termes des critères déquilibre et de distinction.\nPour autant, une part dauthenticité y est préservée, fruit dun terroir expressif et rémanence du savoir-faire de six générations de vignerons. Ainsi, oeuvrons-nous pour que le nom de Bertrand-Bergé soit synonyme didentité et de haute exigence.',1),(526,'Vignobles Cap Leucate','Au sud du département de lAude, du littoral Méditerranéen aux Corbières profondes, les Vignobles Cap Leucate ont su allier le meilleur de leurs terroirs pour vous offrir des vins de qualité. Près de 200 viticulteurs exploitent un territoire denviron 1400 hectares permettant la production dIGP, de vins de cépages et de 5 AOP : Rivesaltes, Muscat de Rivesaltes, Fitou, Corbières et Languedoc. Retrouvez tout le savoir-faire, lhistoire et la richesse de nos terroirs, laissez-vous tenter de lapéritif au dessert, en toute occasion, nos vins sauront vous accompagner !',1),(531,'Caves Languedoc Roussillon','A CLR, nous avons comme unique philosophie de ne vendre que les vins que nous aimons boire nous-memes. Savoir initier un nouveau produit, anticiper une tendance, ou tout simplement repondre aux attentes precises de certains marches, exigent attention permanente, esprit d\'ouverture et creativite.\nPour autant, cela ne doit pas nous faire oublier nos racines. Face a une mondialisation du gout, a une uniformisation des produits et a une approche de plus en plus industrielle du vin, nous revendiquons chez CLR, la signature de vins vrais, simples et authentiques, sans artifices et que chacun peut s\'offrir et apprecier au quotidien sans s\'en lasser.',1),(533,'Les Maîtres Vignerons de Cascastel','La SCA Les Maîtres Vignerons de Cascastel a été créée en 1921. Sa zone de production, située sur le massif des Hautes Corbières et du Haut Fitou, représente aujourd\'hui 750 hectares, 130 vignerons pour un volume de 25 000HL. Notre production est répartie en AOP Fitou, AOP Corbières (rouge, rosé et blanc), AOP Muscat de Rivesaltes, AOP Rivesaltes et IGP Vallée du Paradis. Notre vignoble est entièrement en agriculture raisonnée sous notre label « REVE », démarche Respectueuse de l\'Être Humain, du Vignoble et de l\'Environnement. La politique des Maîtres Vignerons de Cascastel est de tout vendre, de bien vendre, de façon pérenne afin doptimiser le revenu de nos vignerons et de préserver lemploi salarié. Notre cave se développe en intégrant les préoccupations sociales, environnementales et économiques de notre tissu local, tant au niveau du vignoble que de notre structure. Depuis plusieurs années, notre cave se développe et se construit en gardant à lesprit les principes du développement durable.\nAfin de répondre à nos besoins présents sans compromettre par une production incontrôlée lhéritage de nos enfants, notre cave sest démarquée en tant que site pilote pour les installations et reprises dexploitation. Cette vision davenir, lidée de stabilité des capacités et des potentiels offerts aux générations futures sont indispensables à lévolution des Maîtres Vignerons de Cascastel. Avec la mobilisation et la responsabilisation de nos adhérents et nos salariés, nous sommes convaincus que nous pouvons améliorer nos performances économiques pour le bien être et lintérêt de tous.',1),(538,'Domaine Rosier','D\'origine Champenoise depuis trois générations et très attaché aux traditions de cette région, nous exploitons 35 hectares de vignes A.O.C. situés à VILLELONGUE D AUDE, plantés essentiellement en cépages CHARDONNAY, MAUZAC, CHENIN et PINOT. Le vignoble qui constitue la majeure partie de notre approvisionnement en raisins est cultivé sans engrais chimiques, les façons culturales sont réalisées afin d\'obtenir des moûts de grande qualité.',1),(539,'Domaine Delmas','Domaine familial mene par la troisieme et quatrieme generation de vignerons, Bio depuis 1986, notre vignoble d\'exception est accroche aux coteaux des contreforts des Pyrenees au cur du terroir unique de la Haute Vallee de l\'Aude. Le Domaine Delmas a developpe une gamme de bulles prestigieuse, reconnues des professionnels et de la presse et frequemment recompensees par les guides de renom et les concours. Notre maniere de travailler se base sur le respect et la preservation du terroir, un travail meticuleux a la vigne, des vendanges manuelles, le tri consciencieux de nos raisins, des vinifications respectueuses afin d\'offrir des vins fins, elegant, et de caractere a nos consommateurs.',1),(540,'MAISON ANTECH','Nous croyons à une nologie simple, authentique et respectueuse de lenvironnement.\n\nDonner à la vigne tout ce dont elle a besoin mais seulement ce dont elle a besoin. Nous militons depuis plus de 10 ans pour des pratiques culturales « propres ».\nTous les raisins entrant dans la composition de nos Cuvées sont issus d\'exploitations qualifiées au titre de l\'agriculture raisonnée. Nous sommes également signataires de la \'Charte de Progrès pour le développement durable\' des entreprises agroalimentaires du Languedoc-Roussillon.\n\nPar ailleurs nous travaillons à la valorisation de nos déchets et avons mis en place un plan daction pour réduire toutes nos consommations dénergie.\n\nNous pensons que cest laffaire de tous de protéger la planète et nous y contribuons très activement.\n\nPar ailleurs notre Maison est engagée depuis de nombreuses années dans une véritable démarche Qualité sappuyant sur les référentiels ISO et IFS. \n\nMaison ANTECH, une Entreprise Familiale\n\nFamiliale et indépendante depuis 6 générations est spécialisée dans l\'élaboration de vins effervescents AOC, la Maison ANTECH produit et commercialise 930.000 bouteilles de Crémant de Limoux, Blanquette de Limoux et Blanquette Méthode Ancestrale.\n\n\n1.HISTORIQUE ET ATOUTS:\nLa Vigne et le Vin: une tradition familiale depuis 6 générations\nUne production exclusivement certifiée Agriculture Raisonnée\nUn Domaine familial de 60 Hectares de Vignes situé à Saint-Hilaire\nUne production annuelle de 930.000 cols\nUn approvisionnement auprès de 30 Vignerons sélectionnés\nUne équipe de 17 salariés permanents\nUne Cave dotée des équipements les plus modernes\nUne rénovation totale de l\'outil de production\nUn Chiffres dAffaires de 3.400 K\n\n2.LA GAMME ANTECH : 100% « Bulles »\nAOC Blanquette de Limoux : 74%\nAOC Crémant de Limoux : 20%\nAOC Blanquette Méthode Ancestrale : 6%\n\n3.LES ETAPES DE LA VIE DE L\'ENTREPRISE:\n1933: Création de la Société par Edmond ANTECH\n1965: Reprise de la Société par ses deux fils Georges et Roger ANTECH seuls actionnaires par moitié, sous forme de Société Anonyme au Capital de 152.449 .\n1996: Reprise de la Société par Françoise ANTECH-GAZEAU fille de Georges ANTECH, par l\'intermédiaire de la Société Civile \'FINANCIERE GAZEAU-ANTECH\' détenue à 99% par Françoise ANTECH-GAZEAU.\n\n4.DEMARCHE QUALITE : Un Véritable Moteur d\'Entreprise\n\nCertification IFS version 5 en niveau supérieur (déc 2009)\nDémarche HACCP\nSystème de Management de la Qualité\nMise en place dun Manuel de Gestion de Crise',1),(541,'Château Rives-Blanques','Vignoble familal d\'altitude dans l\'appellation de Limoux, specialisé uniquement dans les vins blancs et effervescents, dont la qualité et originalité reposent sur un authentique respect de l\'environnement.',1),(542,'DOMAINE J.LAURENS','Le Domaine produit exclusivement de vins effervescents AOC Blanquette et Crémant de Limoux depuis 1980, créé par un Champenois il  a été racheté ensuite par un enfant du pays. Qualité plutôt que quantité est le crédo de notre domaine ce qui ne nous empêche pas de nous développer raisonnablement. Nos vins sont vendus chez les cavistes en France mais surtout à lexport aux US, au Canada, au Japon, en Australie et partout en Europe.',1),(543,'MAISON GUINOT','Producteurs de Vins Effervescents depuis 1875. Nous sommes les plus anciens élaborateurs de Blanquette et Crémant de Limoux, 5° génération, maison familiale et indépendante. Nous créons nos cuvées à partir de notre propre vignoble et en nos caves souterraines et centenaires visitables.',1),(544,'VINS ROBERT','Exploitation familiale depuis 1937, 40 hectares de vignes en appellation blanquette, Crémant.',1),(545,'SIEUR D\'ARQUES','Sieur dArques, situé à Limoux à 25 Km de Carcassonne, est un acteur majeur du vin en Languedoc qui allie savoir faire technique et tradition.\nConsidérée comme pionnière en Languedoc-Roussillon en termes de qualité de production et de techniques vitivinicoles, la Cave des Vignerons du Sieur dArques a su développer dans les années 80 la sélection parcellaire sur 2800 Ha de vignoble en Appellation dOrigine Contrôlée. Notre terroir qui bénéficie dun ensoleillement méditerranéen, tempéré par laltitude liée à notre proximité des Pyrénées et les flux venus de lAtlantique, répond aux conditions idéales à lélaboration de grands vins.',1),(547,'DOMAINE COMBE DES DUCS','Domaine viticole de 50 ha  au coeur du massif de LA CLAPE \nvente directe de notre production AOP COTEAUX DU LANGUEDOC, LA CLAPE et IGP PAYS D\'OC en BAG IN BOX et BOUTEILLES',1),(548,'CHATEAU D ANGLES','Du Médoc au Languedoc\nLa famille Fabre a réussi à révéler le potentiel de\nChâteau dAnglès en quelques années, et a su démontrer\nson enthousiasme et son engagement au\ntravers dune gamme de vins de nombreuses fois\nrécompensés. Vigneron depuis toujours, lexpérience\ndEric Fabre passe par huit ans au poste de directeur\ntechnique de Château Lafite Rothschild, mais aussi\npar lascension dun domaine en Médoc de moindre\nrenommée à la victoire de la Coupe des Crus Bourgeois\nen 6 ans seulement. Cependant, sinstaller sur\nles bords de la Méditerranée était un rêve depuis\nlongtemps. En 2001, Eric et sa femme Christine partirent\nen quête dun grand terroir dans le Sud. Ils furent\nvite séduits par le Château dAnglès, ce qui est\ntout à fait compréhensible ! A flanc de la montagne\nde La Clape, le mas ancien porte son regard sur les\nvignes et la mer... Difficile dimaginer une situation\nplus idyllique, et une famille plus passionnée et engagée\ndans lamélioration constante de la qualité de\nses vins.\nMéthodes Traditionnelles et Techniques Modernes\nEric Fabre sest vite rendu compte de la qualité des\nsols, du climat et des cépages du terroir de La Clape.\nIl met alors en place un planning de restructuration\ndu domaine pour équilibrer lassemblage des cépages\ntraditionnels. Les raisins sont récoltés à la main,\nminutieusement triés et toute la production est mise\nen bouteille au château, avec la touche magique qui\nest lapanage des grands vignerons, réunissant le\nmeilleur de la tradition et des dernières techniques. Il\nest alors logique de constater que le talent et le travail\ndEric Fabre sont récompensés par un nombre\ncroissant de médailles et de sélection sur la carte de\ngrands restaurants souvent étoilés.\nUne Longue Histoire Viticole\nCe récent succès nest cependant que le nouveau\nchapitre dune histoire viticole commencée il y a plus\nde 2000 ans quand Jules César offrit cette montagne\nrocailleuse, appelée massif de La Clape, comme récompense\nà ses meilleurs légionnaires. Ainsi les soldats\nromains de la 10ème légion furent les premiers\nà planter de la vigne sur le massif et à exporter leurs\nvins dest en ouest avec succès. Le choix du Bourboulenc\n(famille de la Malvoisie) nétait pas du au\nhasard, puisque ce cépage était considéré dans la\nmythologie grecque comme donnant la sagesse à\ncelui qui buvait de son vin ! La viticulture a perduré\nau travers des siècles, et plus de mille ans après, le\nLanguedoc passe sous la bannière du roi de France\nLouis VIII. Une grande partie de la région est alors\ngérée pour le compte du roi par les Baillys dAnglès\nde 1226 jusquà la Révolution. A cette période, le\ndomaine fut occupé pendant plus de 500 ans par une\ngarnison royale chargée de surveiller lembouchure\nde lAude, importante route commerciale maritime à\nlépoque. Ce fut Barthélémy Etienne d\'Anglès, maire\ndu village, qui reprit la propriété après la Révolution.\nLe vignoble reste dans la famille Anglès pendant plus\ndune centaine dannées. Après sa division fin 19ème,\nlopportunité de réunir de nouveau Château\ndAnglès au début du nouveau millénaire fut un signe\ndes dieux que la famille Fabre comprit immédiatement!\nDes Conditions Viticoles Idéales\nLes vignes de Château d\'Anglès baignent dans 300\njours de soleil par an, profitent dune moyenne de\ntempératures de 14°C et bénéficient du Cers, vent du\nnord sec, qui les gardent en parfait état sanitaire. De\nplus, lhumidité amenée par la brise marine nocturne\nhydrate la vigne et permet aux raisins datteindre la\npleine maturité aromatique et phénolique. Et cest la\nvégétation environnante de la garrigue, les pins, le\nthym, le romarin, le genièvre, la ciste, qui apportent\nleurs arômes et contribuent à donner aux vins du\nTerroir de La Clape leur forte identité méditerranéenne.\nCet environnement apparemment sec et\nhostile cache bien sa générosité, puisquen fait, le sol\nde cailloutis calcaire dur et filtrant combiné au climat\nensoleillé et à la proximité de la mer offre des conditions\nexceptionnelles pour la viticulture.\nBlanc, Rouge et Rosé\nLes vins blancs de Château d\'Anglès portent une\nrobe jaune pale à reflets dorés. Le Bourboulenc, le\ncépage de La Clape puisquon y trouve 350 des 500\nha plantés dans le monde, apporte structure et fraîcheur.\nLe Grenache blanc, la Marsanne et la Roussanne\nen moindre proportions ajoutent une complexité\nde fleurs et de fruits à chair blanche. Les rouges\nproviennent de la Syrah avec ses arômes de petits\nfruits noirs mûrs, du Grenache noir pour son velouté,\ndu Mourvèdre pour la structure et dune pointe de\nCarignan pour sa personnalité. Le rosé de Château\ndAnglès est issu dune pressée de Mourvèdre et de\nsaignées de Syrah et Grenache. Il est souple, frais et\nenvoûte de ses arômes de framboise et dagrumes\npour de longues soirées dété bercées par le chant\ndes cigales...\nDeux Cuvées\nChâteau d\'Anglès élabore deux cuvées. Les «Classiques\n» rouge, blanc et rosé sont des vins reflétant\nlidentité de La Clape dans un style souple, frais et\ngourmand. Les «Grands Vins» rouge et blanc proviennent\nde sélections parcellaires et développent\nune grande complexité aromatique sur une belle\nstructure soyeuse. Les deux gammes sont vinifiées\navec passion avec le même soucis dexcellence.\nDes Vins Élégants qui Donnent un Nouveau Ton\nà lAccent du Languedoc\nA limage dun grand Chef, Eric Fabre a réuni les ingrédients\nde la plus grande qualité pour un résultat\nexceptionnel, donnant à létiquette Château d\'Anglès\ntoute lattention quelle mérite. En construisant sur ce\nsuccès bien fondé, la famille Fabre va sans aucun\ndoute hisser Château d\'Anglès vers de nouveaux\nsommets, pour installer durablement la personnalité\nde leurs vins méditerranéens. Considéré comme la\nnouvelle Provence en terme de tourisme, la réputation\ndu Languedoc et de ses vins fins grandit très\nvite. Dautres vignerons ont aussi reconnu les qualités\nde ce terroir exceptionnel et la famille Fabre nest\npas seule sur le massif de La Clape dans sa quête\nde qualité et de reconnaissance. Le secret va bientôt\nsortir de la boite, ou plutôt de la bouteille !',1),(549,'Commanderie de Saint Pierre la Garrigue','Propriété viticole de 60 hectares en cru la Clape, ce magnifique vignoble surplombe la mer Méditerranée dans un écrin de garrigues bordées de falaises. \nLa huitième génération de vignerons y produit des vins fins et puissants et des huiles d\'olives remarquables.',1),(550,'DOMAINE SARRAT DE GOUNDY','Le domaine Sarrat de Goundy est une aventure familiale, celle de la famille CALIX depuis trois générations. Vigneron respectueux de la nature, Olivier Calix vinifie avec passion des vins justes et francs issus de parcelles fortes et sauvages situées sur les hauteurs du terroir de la Clape. Le chai et la boutique du domaine se situent entre Narbonne et la mer Méditerranée, juste avant l\'entrée du village de Vinassan.',1),(551,'SELECT VINS','',1),(552,'Domaine Alexandrin','Balade découverte du vignoble, commentée par le vigneron à bord du « Petit Train des Vignes ».Jérôme vous fait partager sa vie au quotidien en vous amenant sur la place du village, sur les chemins de campagne et au milieu de ses vignes. Cest en serpentant au sein de ses parcelles, quil explique le travail de la vigne et de la vinification. Vous découvrirez le vignoble, les terroirs, les cépages, les assemblages, les magnifiques paysages et les vins du domaine Alexandrin !La balade est suivie dune dégustation gratuite au caveau.',1),(553,'Domaine Coulet','Le domaine familial se situe à Saint Jean de Buèges, au nord de Montpellier.\n\nNotre vignoble est composé de 15 hectares en conversion Biologique, sur les coteaux de la montagne de la Séranne.\n\nNous produisons des vins rouges  AOC Terrasses du Larzac \net AOC Languedoc pour les vins rosés et blancs.',1),(554,'Vignobles Vallat','Famille vigneronne depuis 5 générations cultivant plusieurs exploitations sur les plus prestigieux terroirs en Languedoc',1),(555,'MAS CONSCIENCE','Depuis 2003, à Saint-Jean-de-Fos dans lHérault, le domaine sinscrit dans lesprit des Terrasses du Larzac : rechercher léquilibre et la finesse dun vin plutôt que la puissance.\n\nNos vignes sont exclusivement cultivées en bio et biodynamie : respect des cycles de vie de la plante, taille courte, tri sur le rang, vendanges à la main',1),(556,'Maison Jeanjean','Moteur de la filiere languedocienne depuis 6 generations, l\'ambition de Maison Jeanjean est d',1),(557,'Mas de la Seranne','Le Mas de la Séranne (du nom de la chaîne de collines en face ) se situe à Aniane ( très ancien village viticole ) à 30 km au NO de Montpellier.\nEn 1998, nous décidons de revenir dans notre Languedoc natal et de changer de vie professionnelle.\nTout est à créer mais la passion de la vigne et du vin sont là.\nAu départ, 5 ha seulement. Petit à petit, le domaine s\'étend par l\'acquisition de petites parcelles. Actuellement, la surface est d\'environ 16ha.\nSéduits par le site magnifique, nous poursuivons chaque année son embellissement en remontant les murs de pierres sèches ou en plantant des essences méditerranéenne.\nCertifié \'agriculture biologique\' en 2012 Qualité france FR-BIO 10 - Vin Terrasses du Larzac',1),(558,'MAS DE CAPDANIEL','Le Mas de Capdaniel est situe a 25km a l\'ouest de Montpellier sur la commune de Gignac, en lisiere de garrigue et au c',1),(559,'VIGNOBLE DES 2 TERRES','',1),(560,'Mas d\'Agamas','Viticulteurs depuis plusieurs générations, nous créons en 2009 la petite cave particulière : Mas d\'Agamas.\nSoucieux de la qualité de nos vins, nous travaillons de façon artisanale : vendange manuelle, faible rendement, vinification traditionnelle.',1),(561,'Domaine Jordy','DOMAINE FAMILIAL DEPUIS 4 GENERATIONS',1),(562,'Château Capion','...',1),(563,'Domaine L\'aigueliere','L\'Aiguelière c\'est un domaine qui nous ressemble... Avec passion, rigueur, le sens du travail bien fait, de son optimisation, nous faisons vivre notre savoir-faire. Par la maîtrise des rendements et des assemblages, nous recherchons les vins de nos rêves. \nDes vins de longue garde, généreux et inexplicables, expression du lien de la terre, du ciel et de l\'homme, d\'une volonté desthétisme...des vins qui portent nos valeurs d\'innovation...des vins riches et envoutants, avec le sens du partage, mais aussi de la quête, sans oublier jamais d\'où ils viennent...de ces vignes et de ces terrasses que nous aimons tant...\n\n3 Appellations, 8 Cuvées, régulièrement récompensées depuis plus de 30 ans...',1),(564,'Mas des chimères','En 1993 Guilhem Dardé quitte la cave coopérative et créé le Mas des Chimères. Situé sur les contreforts du plateau du Larzac, dans la très préservée vallée du Salagou, le Mas des Chimères produit des vins en AOC Terrasses du Larzac et des IGP Coteaux du Salagou, tout en agriculture et vinification biologique.',1),(565,'Domaine de l\'Argenteille','Le Domaine  de lArgenteille est ue exploitation viticole de 12 hectares  dont 8 hectares de vignes dédiés à la production de vins élégants et raffinés en Appellation Languedoc St Saturnin et Terrasses du Larzac. Ce domaine appartient à notre  famille depuis 4 générations.  Le vin est une histoire de famille et de passion qui se transmet de génération en génération. Aimé et Albert, nos aïeux, puis mon père Robert et son frère René, exploitèrent successivement ce domaine. En 2011, Véronique et Roger, forts de leurs expériences diverses dans le monde de la viticulture et de lnologie, passionnés dans lâme, et particulièrement respectueux de lhéritage de leurs ainés, décidèrent de vinifier eux-mêmes leur récolte, en perpétuant la tradition tout en apportant leur propre sensibilité et leur passion. En 2016, le nouveau chai du Domaine de lArgenteille est sorti de terre, pour le plus grand bonheur de Victor qui les a rejoints à ce moment-là, en amenant sa jeunesse, sa fougue et son expérience acquise dans plusieurs domaines languedociens.\nPassionné dans lâme, il veut sattacher à perpétuer la tradition, tout en y amenant sa touche personnelle, le tout dans le plus grand respect de la biodiversité, des sols, du terroir afin de produire des vins authentiques, équilibrés et qui expriment au mieux les particularités de nos différents terroirs.',1),(566,'Chateau Mire L\'etang','Le Château Mire l\' Etang est situé sur la bordure maritime et orientale du Massif de la Clape, face au soleil levant. Son vignoble très ancien, implanté au milieu d\'une garrigue envahissante, s\'étale en terrasses surplombant la Méditerranée. \nSon terroir unique, issu de sols arides et caillouteux, est fortement impacté par la sécheresse mais il doit son originalité à la mer Méditerranée toute proche, qui grâce à ses effluves marines rééquilibre ce climat particulièrement exigeant.\nC\'est dans cet environnement très protégé que s\'expriment au mieux les différents cépages qui contribuent à l\'appellation d\'origine protégée \'La Clape\' et à la renommée des vins du Château Mire l\' Etang.',1),(567,'Fonjoya','Acteur majeur du Languedoc, Fonjoya est idealement situe a Saint Saturnin de Lucian, a la croisee des chemins reliant le causse du Larzac et la plaine de l\'Herault. Nos vignerons cultivent une mosaique de terroirs et une belle diversite de cepages en IGP Saint Guilhem Le Desert, AOP Terrasses du Larzac et AOP Languedoc Saint Saturnin. \nNous produisons des vins rouges, roses et blancs ainsi que des vins Terra Vitis, Agriculture biologique et sans sulfites ajoutes.',1),(568,'DOMAINE LE PASSELYS','Domaine viticole familial de 9 hectares, au coeur de l\'appellation Cahors.',1),(569,'VIGNOBLES LAUR','Domaine familial depuis 6 generations, d\' un superficie de 80 hectares repartis sur les principaux grands Terroirs de l\' appellation Cahors. La famille Laur est devenue Pionniere en Matiere de Roses et de Blanc de Malbec.',1),(570,'SAS LES VIGNOBLES ST DIDIER PARNAC','Nous sommes producteurs a CAHORS et Negociants en vins de la region du Sud Ouest.\nNotre activite est orientee vers l\'export.',1),(571,'DOMAINE ROUMAGNAC','Le Domaine Roumagnac est un domaine viticole familial.\nTout le process est maîtrisé au sein du domaine, de la vendange à la vinification, l\'élevage et la mise en bouteille au domaine.\nNous sommes situé sur l\'appellation AOP Fronton au nord de Toulouse. Nous produisons une gamme de vin Blanc, Rosé et Rouge. Notre philosophie est de proposer des vins gourmands, fruité et léger : des vins plaisirs.\nNous sommes aussi labellisé Vignoble et Découverte.\nNous serions ravis de vous accueillir chez nous !',1),(572,'CHATEAU CAZE','Martine Rougevin-Baville, vigneronne passionnée, cultive sa vigne et élève ses vins avec intuition et sensibilité, sans concession. Sa philosophie du vin : plaisir et partage. \nLe chai du Château Caze, créé par son ancêtre Antoine Caze en 1776, est un lieu où se mêlent majesté de larchitecture, effluves dautrefois, calme et sérénité. Une acoustique fantastique permet à ce lieu insolite daccueillir des concerts, des restaurants éphémères\nLe vignoble compte aujourdhui 14 ha de vigne dont 6 plantés en Négrette sur les terrasses du Tarn, aux portes de la ville rose.',1),(573,'FAMILLE ARBEAU','En 1878 Prosper Arbeau, fonde la societe de negoce de produits agricoles',1),(574,'Maison Labastide','La Maison Labastide est une maison vigneronne fondée en 1949, enracinée au cur de lOccitanie. Elle sest imposée au fur et à mesure des années comme un acteur majeur de son terroir dorigine : le Vignoble Gaillacois. Ses vignerons coopérateurs produisent des vins de qualité, à forte identité vigneronne avec des cépages locaux mais également des vins à bulles, comme le gaillac perlé, imaginé et crée par la Maison Labasitde. Cest une maison qui sappuie à la fois sur le savoir-faire de ses vignerons et la technicité de ses nologues, avec des équipements modernes, pour élaborer des vins dans lair du temps.',1),(575,'DOMAINE DE LONG-PECH','Sandra BASTIDEet Karine ROQUEFEUIL vigneronnes Independantes travaillent sur la propriete qui leur a ete transmise par leurs parents et grands-parents depuis cinq generations.\nLeur domaine est situe a Lapeyriere a 6 km de Lisle sur Tarn sur la rive droite du Tarn, proche de la Foret de Sivens et sur le circuit des Bastides.\nDu',1),(576,'Châteaux Montus & Bouscassé','Au coeur de Madiran et de la Gascogne, Alain Brumont, le propriétaire et vigneron des Châteaux Montus et Bouscassé ont établi un véritable nom dans la grande région du Sud-Ouest. Lesprit visionnaire et avant-gardiste dAlain Brumont vigneron hors norme, créateur de vins dexception a su depuis 30 ans produire les vins iconiques que sont les vins issus des Châteaux Montus et Bouscassé sur les appellations Madiran, Pacherenc du Vic-Bilh et Côtes de Gascogne. Ces vins issuent d\'une viticulture respectueuse de la biodiversité permettent d\'obtenir des vins de caractère dotés d\'une grande finesse et sont plébiscités par la presse internationale aux côtés des noms les plus prestigieux de la planète.',1),(577,'Croix des Marchands / Chateau Palvie','Situe en plein c',1),(578,'Chateau Clamens','Depuis 4 generations, les 25 ha de vignes du Chateau Clamens s\'epanouissent sur le magnifique terroir de Fronton, pres de Toulouse. \n\nRien n\'est laisse au hasard afin de produire des vins dun niveau dexigence et de qualite exceptionnels: travail meticuleux, lutte raisonnee, cuverie moderne.\n\nLa Negrette, notre cepage emblematique, est a la base de tous nos assemblages. Sa complexite aromatique nous permet tout autant de proposer des vins accessibles et gourmands que des vins plus complexes avec des tannins soyeux.',1),(579,'Chateau  d&#39;ESCABES','Le chateau d\'ESCABES a certainement ete bati au cours du XVIIe siecle, selon les caracteristiques de son architecture et la forme des fentes de tir encore en place. La date de 1665 inscrite sur une brique de la tour sud-est pourrait dater la construction du chateau. \nDepuis 1974, le Chateau d',1),(580,'Dominik Benz - Créateur de Vin','Au domaine viticole Dominik Benz, nous cultivons depuis 2013 la passion du vin, du partage et de lesprit familial. Mais chez Dominik Benz nous cultivons surtout de bons raisins en agriculture biologique : merlot, syrah, tannat, chenin, chardonay et bien dautres, dont vous retrouvez toute la délicatesse des arômes dans les bouteilles aux effigies des animaux qui nous entourent. Le lièvre, lâne, le sanglier, la huppe, le faisan Une belle ménagerie ariégeoise qui ravira vos papilles avec des vins de caractère ! Nous proposons toute lannée des visites et des dégustations aux visiteurs curieux de les découvrir.',1),(581,'Les Domaines Auriol','Les Domaines Auriol est une maison familiale. Lune des  plus reputees du Languedoc-Roussillon.\nNous proposons une collection complete de chateaux dans toutes les AOP, et  tous les cepages en IGP.\nLa Maison Auriol possede egalement  ses propres vignobles  Chateau Ciceron et St Auriol.\nAuriol est la maison la plus ancienne et la plus reconnue pour la qualite de ses  vins biologiques, nous possedons  notre  propre vignoble en biologie depuis 35 ans : Montmija\nClaude Vialade a ete elue « Entrepreneur de lAnnee, categorie Business Vert » en 2012.\nVeritable artisan independant, specialiste de la « Romanite » et de l expression  mediterraneenne, nous offrons une gamme complementaire en Rhone, Espagne et Bordeaux.\nTous les vins sont vinifies et controles  par les Wine-Makers des Domaines Auriol.\nCertification Iso, IFS\nLes competences des Domaines Auriol sont unanimement reconnus, en janvier 2013, Claude Vialade a ete nommee Chevalier de la Legion dHonneur.',1),(582,'SFDA','Hisser lArmagnac au rang de meilleure eau-de-vie francaise en le reinscrivant dans la culture du vin, tel est lexploit realise par le domaine dArton, vignoble dexception situe au cur de la Gascogne. Sacre Prix dExcellence en 2017 pour ses armagnacs Chateau Arton, il vient de donner naissance a un grand « second » millesime, la Flamme® d\'Arton.\nProprietaire recoltant du domaine, Patrick de Montal ressuscite un terroir confidentiel, celui du Haut-Armagnac AOC. Du haut de ses quarante annees d\'existence, Arton deploie, sur une superficie de 88 hectares, huit cepages ondoyant autour dune ravissante chartreuse datant du XIXe siecle. Une mosaique enchantee lui permettant doffrir notamment une gamme complete de vins d\'auteur et, particulierement, des Armagnacs d\'exception. Patrick de Montal fut egalement le premier a deceler le potentiel de la Blanche dArmagnac qu\'il mit en bouteille en 1985, avec vingt ans davance, sous la marque Fine Blanche® dont le nom \'Blanche\' fut retenu pour nommer la categorie.',1),(583,'LES 3 DOMAINES-FAMILLE BAURENS','Le Gaec des trois domaines, exploitation viticole de la Famille BAURENS, est situe a Rejaumont dans le Gers en pleine Gascogne dans la region d\'occitanie. Une superficie de 35ha de vigne cultivee dans le plus grand respect de l\'environnement  et certifie aujourd \'hui HVE. Notre encepagement tres diversifie nous permet de vous proposer des vins de differentes couleurs ainsi que de differents gouts, le choix est grand, il est tres difficile de ne pas trouver son bonheur pour mettre sur la table. La qualite des produits est notre objectif principal.\nEn plus de nos vins , vous pourrez aussi decouvrir nos Flocs de Gascogne rose et blanc ainsi que nos armagnacs.\nBienvenue a notre domaine, nous vous attendons !!!!!',1),(584,'Celliers du Val des Pins','Vignerons passionnés depuis 1938.\nNotre unique point de vente se situe sur l\'Avenue de Lahntal à Sussargues. Profitez d\'un accueil chaleureux dans notre caveau où vous pourrez retrouver une vigtaine de vins différents de notre production et les déguster dans un espace dédié. Nous vous proposons aussi des produits du terroir de producteurs locaux. \nA très vite !',1),(585,'ROUGE TANIN','Production et vente de vin à Fabrègues et Villeveyrac dans l\'Hérault, en appellation Languedoc et / ou Grès de Montpellier en CHR, entreprises et particuliers. Conduite de l\'exploitation en Haute Valeur Environnementale (utilisation d\'intrants réduits de 80%, utilisation de méthode de confusion sexuelle pour lutter cintre le ver de grappe, recours à des cartons et verres allégées, suppression de la contre-étiquette etc). Service de livraisons et possibilités de personnalisation d\'étiquettes.',1),(586,'Chateau De Fourques','Les 50ha de vignes du Chateau de Fourques s\'etendent aux portes de Montpellier.\n\nCe domaine familial a l\'histoire originale et singuliere se transmet de femme en femme depuis 5 generations. \n\nLe Chateau de Fourques proposedes vins blancs , roses et rouges ainsi que des declinaisons de vins tels que vinaigres de cepages, huile de pepins de raisin, confit de vin et des produits de saison : vins primeurs, rose pamplemousse...\n\nSon principal souci est de proposer des produits de qualite issus de terroirs d\'exception pour repondre aux besoins et envies des consommateurs.',1),(588,'MAS D\'ARCAY','Cave particulière',1),(590,'Maison Sinnae','www.laudunchusclanvignerons.com',1),(591,'Domaine des Romarins','Producteur de Cotes du Rhone Villages Signargues et Cotes du Rhone traditionnel rouge et de vin de pays du Gard rouge, rose et blanc depuis quatre generations a Domazan.',1),(592,'Mas del Riou','Situe dans le Sud de la France, a proximite de Toulouse, au cur du vignoble millenaire de Gaillac, un des plus vieux de France, le Mas del Riou est un domaine viticole de 20 hectares. Nos vignes sont bordees par un ruisseau, \'Riou\' en occitan. Cest proche de ce cours deau que se dresse un belvedere, devenu lembleme du domaine. En se promenant sur la rive, on distingue encore le petit pont qui relie le hameau voisin, via une majestueuse allee de platanes. Il etait coutume a lepoque que les dames et demoiselles du village se retrouvent dans ce belvedere pour sisoler, se livrant a la lecture et a la contemplation.\nNous sommes tres attaches a la preservation de notre terroir, et a la production de vins « vrais » qui mettent en lumiere le caractere exceptionnel du Vignoble de Gaillac. Nous defendons une viticulture responsable dans le but dassurer lavenir de notre domaine et de notre terroir. Jeunes vignerons, nous avons a cur de communiquer sur notre metier afin de transmettre nos valeurs aux futures generations. En 2017 le domaine a obtenu la certification Haute Valeur Environnementale.\nNous produisons une gamme de vins legers et gourmands. Nous tachons, par le travail a la vigne, de maitriser le degre alcoolique de nos cuvees afin de proposer des produits « plaisir ». Nous avons aussi a cur de defendre et preserver les cepages specifiques du Vignoble de Gaillac. Une volonte qui se traduit dans deux de nos cuvees, travaillees en mono-cepage : Duras et Braucol.',1),(593,'Les Nouveaux Occitans','Vinosolis est avant tout une histoire d',1),(594,'Domaine de la Romance','Production et vente de Vins doux Naturels et de Collioure auprès des CHR et Cavistes, en France et à lExport',1),(595,'Vignobles Esquiro','Depuis 1784 , sept générations se sont succédées au Domaine de la Higuère pour cultiver notre vignoble familial dans le respect de la nature.\nPrécurseur dans la politique d\'une viticulture durable, la famille Esquiro travaille son vignoble en protection raisonnée.\nMaître de stage Erasmus, j\'ai l\'habitude de recevoir des étudiants et des wwoofeurs du monde entier toute l\'année pour leur faire découvrir les joies de la vie en campagne et pour vivre une immersion dans notre univers.',1),(596,'alain et philippe borda','SCEA Alain & Philippe BORDA Vignerons Eleveurs Propriétaires Récoltants\nDOMAINE du ROUGE GORGE et DOMAINE les AFFANIES Pour une superficie totale de 128 Hectares. Siège social et caveau de vente Domaine les AFFANIES 34480 MAGALAS\nTel : 04.67.36.22.86 ou 04.67.36.28.56 Fax : 04.67.36.61.24\nEmail: sceaborda@orange.fr  Site Web www.borda-vins.com\nDOMAINE DU ROUGE GORGE 34480 AUTIGNAC Situé au pied des premiers contreforts des Cévennes entre AUTIGNAC, LAURENS et CABREROLLES sur des sols schisteux et pentus. Le Domaine a été créé de toutes pièces par Alain BORDA en 1982. A ce jour le Domaine compte 44,40 hectares en pleine production, SYRAH, GRENACHE NOIR, CARIGNAN, MOURVEDRE, CINSAULT, VIOGNIER, ROUSSANE, VERMENTINO, GRENACHE BLANC\nDOMAINE LES AFFANIES 34480 MAGALASSitué sur un plateau avec des sols maigres et argilo-CALCAIRE à Magalas. Très vieux Domaine repris et agrandi par Alain BORDA en 1964. A ce jour, le Domaine compte 49.98 hectares en pleine production SYRAH, MERLOT, CABERNET SAUVIGNON, PINOTNOIR, CALADOC, CARIGNAN, NIELLUCIO, GRENACHE NOIR, CINSAULT, TEMPRANILLO, CHARDONNAY, CHASAN, LISTAN, VERMENTINO, COLOMBAR VIOGNIER',1),(597,'LES CRUS FAUGERES','Créée en 1959, la Cave Coopérative de Faugères est dédiée à la production de vins de qualité (AOP) du nord du Languedoc. Nos terroirs de schistes donnent des vins de caractère aux notes minérales et épicées.\nLa cave a été une des premières en France à avoir été certifiée ISO 9001 et aujourdhui, une partie de la production est en Agriculture Biologique.',1),(598,'MAS DE LA BARBEN','Le Mas de la Barben, domaine situé au Nord-Ouest Nîmes est la seule exploitation sur la commune à produire des vins A.O.P. Languedoc. Une originalité quand on sait que les Costières de Nîmes règnent dans ce secteur.\nLexploitation se trouve sur un plateau à 200 mètres daltitude, à lextrême Est de lappellation Languedoc. Les sols sont argilo-calcaires et présentent une très forte pierrosité. Le climat est méditerranéen, marqué par un fort mistral.\nLes premières vignes ont été plantées en 1964 et cela fait plus de 15 ans que la famille Hermann a repris le domaine. Depuis, ils ont rénové les bâtiments et restructuré le vignoble pour donner des vins chaleureux et harmonieux.\nLe Mas de la Barben cest 125.2ha, dont 25 plantés en vigne :\n60 % Grenache noir,\n35 % Syrah,\n5 % Roussanne, Marssanne et Vermentino',1),(599,'Domaine des Sauvaire - Reilhe','Nous perpetuons la tradition de notre lointain aieul et nous exploitons Le Mas de Reilhe construit fin XVI siecle et agrandit au milieu du XVIIeme, puis en 1829, a toujours eu une vocation agricole (mouton, vigne) comme en temoigne la bergerie voutee, mais aussi de relais de diligence pour changer de chevaux avec le hangar central au deux grands portails. Laile ouest presente une tour carree avec un escalier a vis restauree aux portes plein cintre encadrees de divers motifs.\nLes vignes plantees principalement en cepages mediterraneens sur des sols profonds constitues uniquement de pierres (les gres) et classees en Appellation dOrigine Controlee : Coteaux du Languedoc, donne des vins de garde, aromatiques, aux couleurs intenses. Notre vignoble de 28 hectares, par sa diversite, nous permet aussi delaborer des vins de Pays dOc aux aromes de terroir.\nCrespian Situe dans le Gard (30), a 20 km au Nord-Ouest de Nimes (entre Sommieres et Ales) a 30 kilometres de la mer, pres des contreforts cevenols, est domine au loin par le Mont Aigoual. Le climat propice a un bon developpement de la plante et des raisins favorise une maturite optimum sans humidite ni secheresse excessive et permet une culture par traitement raisonne.',1),(600,'DOMAINE D\'HONDRAT','LE DOMAINE\nLe Domaine dHONDRAT est situé au cur du Bassin de Thau dans le Languedoc Roussillon.\nC\'est en 1891 que l\'aventure de l\'exploitation familiale démarre, sous l\'impulsion de Basile VIGROUX, trisaïeul de Romain VIGROUX, Responsable du domaine actuellement. \nCinq générations de vignerons se sont succédées pour contribuer à la richesse du vignoble d\'aujourd\'hui. Firmin, Jean, René, Michel, Jean-Marie et Roger nont cessé de développer lexploitation, la faisant passer de 4 à 80 hectares aujourdhui.  \nDepuis, cet amour du métier de Vigneron sest transmis de père en fils tout en évoluant avec son temps, afin de pouvoir proposer aujourd\'hui des produits de qualité et destinés à une nouvelle génération d\'amateurs de vin.\nLes clefs de ce patrimoine sont aujourdhui entre les mains de Romain VIGROUX, qui au quotidien, exerce son métier de vigneron avec passion.',1),(601,'CHATEAU DE LASCOURS','Domaine familial situé à 25 kilomètres au Nord de Montpellier sur le terroir du Pic Saint Loup.\nNous sommes certifiés en agriculture biologique depuis le millésime 2014.',1),(602,'MAS DE FARJOU','Société familiale depuis plusieurs générations dont le grand père Louis a été le fondateur du cru du Pic St Lou.',1),(603,'DOMAINE GUIZARD','A completer',1),(604,'VIGNOBLES DES 3 CHATEAUX','Situés au pied du Pic Saint Loup, célèbre montagne qui\ndomine le nord de Montpellier, les Vignobles des 3\nChâteaux commercialisent une large palette de vins en\nbouteilles et fontaines à vin produits essentiellement par leur\nmaison mère, la cave « les Coteaux du Pic », premier\nproducteur de lAppellation dOrigine Protégée Languedoc -\nPic Saint Loup. Aux élégantes cuvées dappellation Pic Saint\nloup sajoutent des AOP Languedoc et des vins à\nIdentification Géographique Protégée « Pays dOc » et «\nSaint Guilhem le Désert ».',1),(605,'la gravette','Au cur du Pic Saint-Loup, le vignoble de Corconne se baigne dans la lumière dorée du sud de la France.\nCorconne se situe entre Claret et Quissac, à équidistance de Nîmes et Montpellier. Cest un charmant petit village du Gard, à la limite de lHérault, adossé aux premiers contreforts des Cévennes, composé de maisons du XVIIème et XVIIIème siècles, et entouré dimpressionnants remparts naturels faits de rochers en forme de tuyau dorgue qui ont donné naissance à notre terroir unique de Gravettes (cailloutis calcaires issus de la gélifraction) et dargiles rouges apportant typicité et minéralité à nos vins.\n\nCréée en 1939, la cave de la Gravette comptait jusquà il y a une centaine de viticulteurs exploitant un vignoble denviron 300 ha sur 4 communes (Corconne, Vacquières, Brouzet les Quissac et Sauteyrargues). Elle sest élargie depuis 2009 en fusionnant avec les caves de Saint-Martin de Londres et St Jean de Buèges représentant près de 150 vignerons sur un total de près de 600 ha.\n\nCorconne est également un village aux traditions oléicoles, 3500 oliviers sont plantés et produisent depuis 2005, une huile ardente et fruitée, caractéristique de la variété Picholine : lhuile dolive de Gravette présentée tous les ans en décembre à la Fête de lOlive.\n\nDepuis de nombreuses années, tous nos viticulteurs partagent la même approche de leur métier : intégrer et maîtriser les technologies les plus performantes tout en perpétuant la plus pure tradition du savoir faire et le respect de lenvironnement.\n\nLe terroir de gravette, le micro-climat, le travail méticuleux de la vigne, les vinifications soignées, et les assemblages pointus nous permettent de mettre en bouteille nos plus belles cuvées issues de notre vignoble en AOP Pic Saint-Loup, AOP Languedoc, Vins de Pays dOc et Vins de Pays des Cévennes.\n\nLa saison des vendanges, le raisin gorgé de soleil atteint sa pleine maturité. Il est récolté et rigoureusement sélectionné à la cave selon plusieurs critères : le cépage, le terroir dorigine, le degré, le rendement.',1),(606,'DOMAINE DECALAGE','Le Domaine DeCalage, 100% Bio depuis plus de 15 ans, s\'engage a transmettre une terre saine pour les generations futures. Les vins de Nathalie sont essentiellement composes de varietes/cepages typiques du Languedoc afin de refleter les qualites du terroir de la Mejanelle (galets roules), en AOP. Un vignoble familial de 18 Ha.',1),(607,'MAS CAL DEMOURA','Fondé au début des années 90, le Mas Cal Demoura a contribué à la révolution qualitative des vins du Languedoc. \nLe domaine est situé à Jonquières, à une trentaine de Km au nord-ouest de Montpellier, au cur des Terrasses du Larzac.\nLa production artisanale, issue de pratiques très qualitatives, donne naissance à de grands vins de terroir, élégants profonds et raffinés. Tous les vins du domaines sont certifiés bio.',1),(608,'MAS GOURDOU','La propriété, dans la famille depuis le XVIII ème siècle sétend sur le terroir du Pic Saint Loup à 25 km au Nord de Montpellier sur larc méditerranéen. Les vignes sont plantées sur de petites parcelles au milieu des forêts de chênes verts, de pins dAlep et sont entourées de plantes méditerranéennes.  Son encépagement est composé, de Syrah, Grenache, Mourvèdre, Carignan pour les vins rouges, et de Grenache blanc, Roussane, Marsanne et Clairette pour les vins blancs.\nAu pied de la montagne de lHortus, la famille THEROND vous accueille pour vous faire découvrir ses cuvées de lAppellation Pic Saint Loup et partager sa passion de son terroir. \nA découvrir également, une production de safran pour le moins atypique mais oh! combien passionnante.',1),(609,'LES VIGNERONS DU SOMMIEROIS','Nous  exploitons 700 ha de vignes sur les communes  de Sommières, Salinelles, Aspères, Campagne, Garrigues, Lecques et Fontanes. Nos viticulteurs travaillent  dans le plus grand respect de la terre et de lenvironnement pour élaborer avec passion des vins de qualité à forte personnalité. Un cahier des charges rigoureux et une sélection parcellaire méticuleuse sont à la base de notre travail. Nos vignes sont travaillées en agriculture raisonnée, et une partie en agriculture biologique.\nBénéficiant dune très bonne exposition Sud, notre terroir sommiérois se caractérise par des marnes à forte teneur en argile et en calcaire (plaine dAspères), des terres à alluvions (bassin du Vidourle), des terrains acides composés de terre fine rouge à silex, et des cailloux calcaires apparents où nous élaborons nos AOP hauts de gamme.\nLa cave de Sommières fait partie des 23 vignerons adhérents à la nouvelle appellation AOC \'Languedoc - Sommières\' qui a été inaugurée le 20 Juin.',1),(610,'Vignerons de Cessenon','Cessenon-sur-Orb se situe dans le sud de la France près de Béziers : \nCréée en 1937, la cave est implantée au centre du village, avec ses 150 adhérents et 645 hectares de terroirs de schiste et de calcaire.\nElle produit 45000 hls de vin en IGP Cessenon, IGP Pays d\'Oc, AOP Languedoc et AOP Saint Chinian.',1),(611,'Domaine Nova Solis','',1),(612,'Les Vignobles Plaza Tedaldi','La SARL Les Vignobles Plaza Tedaldi est nee en 2013 suite a le reprise d\'exploitation de deux domaines viticoles: Chateau Borie Neuve, a Badens, et Chateau Baronne Tedaldi, a Aigues-vives, totalisant une surface de vignes en production d\'environs 110 hectares, en AOP Minervois et IGP d\'OC.',1),(613,'DOMAINE DE FABREGUES','Le Domaine de fabregues existe depuis des centaines d',1),(614,'Domaine Costes Rouges','Exploitation viticole de 10 ha.\nProduction de vins IGP Pays d\'OC 2 cuvees blancs et 1 cuvee rouge.\nProduction de vins AOP Languedoc 1 cuvee rose et 2 cuvees rouges.',1),(615,'MAS DU POUNTIL','C\'est a Jonquieres petit village au nord ouest de Montpellier que nous avons cree notre cave en 2000. Heritage de 5 generations de vignerons, nous sommes implantees sur la zone des Terrasses du Larzac. Ce territoire nous offre une grande diversite de sol ou nous cultivons 80% de cepages rouges et 20% de blancs sur 15 hectares. La personnalite de nos cuvees est le resultat d\'une production a faible rendement recoltee a la main et d\'une vinification par terroir, l\'assemblage des differents cepages est realise au moment des vendanges. Notre production est labellisee Vin Biologique depuis 2012.',1),(616,'LE CELLIER DU PIC','',1),(617,'chateau Cambon valcyre','domaine viticole en Pic saint Loup',1),(618,'Domaine de Villeneuve','Le Domaine de Villeneuve est un mas typiquement Languedocien avec ses batisses en pierres de pays : un caveau de vente directe avec une voute du XIIeme siecle, une cave de vinification traditionnelle, magnanerie et four a pain. Entoure de ses vignes implantees dans un cirque naturel forme par le Causse de lHortus, le Domaine de Villeneuve est situe a 30 kilometres au Nord de Montpellier, a la sortie du Hameau Les Embruscalles a Claret,  ce domaine a des origines tres anciennes, celles des lambrusques, vignes sauvages qui poussaient dans cet ecrin au microclimat tres favorable a labri des arbrisseaux et des oliviers. Ce terroir du Pic Saint Loup constitue de cailloutis argilo-calcaires est entoure de garrigues, ce qui lui donne un veritable attrait pour les amoureux dune nature au caractere sauvage mais tres hospitaliere (cf office de tourisme de Claret). Le caveau de vente situe dans une salle voutee du XIIe siecle est agree Qualite Herault et Bienvenue a la ferme.\n\n       Le Domaine de Villeneuve a ete repris en 1980 par Myriam et Christian Florac, agriculteurs qui auparavant apportaient leur  production a la cave cooperative du village. En vinifiant leurs propres raisins, ils avaient le projet de faire des vins de qualite superieure Pic Saint Loup et de faire partager leur passion pour le vin :  mission reussie avec une notoriete aujourdhui reconnue et une importante frequentation du caveau de vente au domaine. Pendant 25 ans de nombreux et fructueux investissements  ont ete realises au vignoble ainsi qua la cave de vinification.\n       En 1989, le domaine sest agrandi avec les 20 hectares de vignes  du pere de Myriam Florac  sur la commune de Valflaunes, au pied de lHortus,  face au Pic Saint Loup. En 2005, leur fille Anne-Lise Fraisse-Florac a pris la suite de ses parents, secondee par  son mari Bernard Fraisse, apiculteur professionnel,  qui  participe a la vinification depuis 1987,  avec le projet de faire partager son enthousiasme et son savoir-faire pour continuer a faire exprimer la grande richesse de ce terroir.\n\nLe vignoble \n       Le vignoble est constitue denviron cinquante hectares situes dans un cirque naturel de coteaux argilo-calcaires expose sud/sud-est et beneficie dune exposition exceptionnelle.\nIl est essentiellement compose de Syrah, de Grenache noir, de Mourvedre et de Carignan pour les vins rouges ; de Syrah, de Grenache, de Mourvedre et de Cinsault pour les vins roses ; et de Grenache blanc, de Roussanne, de Viognier et de Chenin pour les vins blancs. Les vieilles vignes  de Grenache et de Carignan de 30 a 50 ans sont cultivees en gobelet. Celles de Syrah, Mourvedre, Grenache noir, Grenache blanc, Roussanne sont palissees. Le rendement est denviron 49 Hl/ha et de 25 hl/ha pour les tetes de cuvee. Les travaux aux vignes (demarche de conduite raisonnee, labour, maitrise de la vigueur de la vigne, palissage)  et a la cave de vinification (maceration plus longue, pigeage...)  sont realises avec soin pour obtenir des vins de qualite optimale dans le respect de la typicite propre du terroir Pic Saint Loup.\n\nVinification \n       Les meilleures conditions sanitaires sont requises pour concevoir le meilleur des vins : controle des maturites,  vendange essentiellement manuelle et tri de la vendange a la main. La cave est constituee dune partie ancienne avec les cuves de fermentation en beton partiellement enterree et dune autre partie avec les cuves de stockage en beton ainsi que des cuves a chapeau flottant. Le raisin est encuve  en passant par legrappoir en vendange mecanique ou encuve grappes entieres pour la maceration carbonique  en vendange manuelle.\n       Tous les elements nobles de la peau du raisin sont extraits avec des cuvaisons longues et une parfaite maitrise des temperatures pour  obtenir un vin a la belle couleur rouge avec des tanins dune grande souplesse. Lutilisation du pigeage a permis une meilleure extraction des polyphenols des  vins qui sont plus concentres  avec une belle complexite aromatique. Une partie de la recolte est elevee de 18 mois a 24 mois en barrique de chene francais,  pour obtenir un boise plus fin, de vanille et  de reglisse. Le choix de lorigine du bois se fait avec la Tonnellerie Saint Martin apres degustation des vins. Il varie en fonction du cepage et du millesime (bois de chene dAllier, de Troncais, ou des Vosges)\n         Le chai delevage du vin est isole de la cave dans un local  en pierres a temperatures constante  pour permettre un elevage dans de bonnes conditions.',1),(619,'CAVE DU RAZES','Construite en 1947 sur l\'ancienne gare de Routier dans le departement de l\'Aude, notre cave est aujourd\'hui une des plus importante cave de France. Elle dispose de moyens techniques et d\'installations modernes pour vinifier les 250 000 hectolitres de production annuelle moyenne.\nNotre vignoble est implante sur 36 communes situees au sud de Carcassonne. Les sols sont principalement des formations argilo calcaires et des terrasses graveleuses du quaternaire. Nos 3000 ha de vignes beneficient d\'un climat de transition ou se melent influences mediterraneenne et oceanique. Ces conditions pedoclimatiques sont particulierement favorables a nos principaux cepages : Merlot, Cabernet Sauvignon et Cabernet Franc pour les vins rouges, Chardonnay et Sauvignon blanc pour les vins blancs et Cinsault pour les vins roses.\n\nSensibles a l\'impact de notre activite sur l\'environnement, nous sommes engages dans une demarche d\'agriculture raisonnee du vignoble depuis plus de 15 ans. Depuis 2010, nous sommes certifies selon le referentiel \'Vignerons en Developpement Durable\' qui garantit notre engagement dans la prise en compte des 3 piliers du developpement durable : economique, social/societal et environnemental.',1),(620,'Cave La Malepère','Créée en à Arzens dans l\'Aude et regroupant 4 Caves coopératives voisines, la Cave La Malepère rayonne sur 30KM à la ronde et regroupe plus de 200 viticulteurs, sur plus de 2000 hectares de vignes. Ainsi, notre production moyenne est de  155 000 hectolitres, ce qui nous place parmi les caves coopératives les plus importantes de France.\nNos terroirs et notre savoir-faire ,alliés à la modernité de notre outil de production , nous permettent déjà depuis de nombreuses années de produire des vins de qualités, représentatifs de leur région, pour tous les gouts et pour toutes les occasions.Des vins de plaisir vinifiés et élévés en cuves inox ou béton, exprimant beaucoup de rondeur et de fruit, de gastronomie: longues cuvaisons, élevage en fûts de chêne , pour une pure expression du terroir, aux effervescents pour célébrer et partager des moments de joie et de fête.',1),(621,'Les Vignobles de Vendeole','Les Vignobles de Vendeole sont nes de la fusion de La Cave La Malepere a Arzens et de La Cave du Razes a Routier .\nIls regroupent plus de 400 Vignerons adherents pour une production avoisinant 350 000 hectolitres.Situe au carrefour de deux influences climatiques, le vignoble rayonne sur un vaste territoire de 5 000 hectares(40 communes).Toujours a la pointe du progres depuis leur creation, les caves de nos aieux s\'apparentent aujourd\'hui a une cave moderne.',1),(622,'CHATEAU DE PARAZA','Au coeur du village de Paraza, le Château de Paraza est un domaine viticole du Languedoc-Roussillon. Le château date du 17ème siècle et accueillit l\'architecte Pierre Paul Riquet lors de la construction du Canal du Midi. En échange, ce dernier fit construire sept magnifiques terrasses offrant une vue imprenable sur la plaine de l\'Aude et la chaîne des Pyrénées enneigée.\n\nLe vignoble, un des plus anciens du Minervois, compte 75 hectares de vignes et bénéficie d\'une exposition en côteaux exposés plein sud et d\'un terroir très favorable à la culture des cépages traditionnels (Syrah, Grenache, Mourvèdre). Toutes les conditions sont réunies pour faire du vin du Château de Paraza un Grand Cru du sud de la France, reconnu et exporté dans le monde entier.',1),(623,'Chateau PRAT MAJOU','Cest en 2000 que laventure Prat-Majou commence Après plus de 20 ans passés dans lhôtellerie restauration Antoine et Brigitte Gay, originaires de la région, décident de prendre une nouvelle voie professionnelle qui leur permettent dallier leur amour du vin, du « bien vivre » à la Française et du Minervois. Ils se portent alors acquéreur du château Prat-Majou où Géraldine, leur fille, après de hautes études littéraires, travaille seule dans un premier temps avant dêtre rejoint par son compagnon Guilhem Pédréno. Guilhem, quant à lui, est issu dune vieille famille de viticulteurs. Le jeune couple a été formé aux techniques modernes de la viticulture et de la vinification dans des écoles spécialisées. Cest en alliant les techniques traditionnelles de la région et les dernières avancés nologiques que nous élaborons nos vins et que nous menons nos vignes.\nDepuis quelques années cest à quatre quils poursuivent leur route, Brigitte et Antoine Gay ayant rejoint lentreprise. Aujourdhui le château Prat-Majou représente 37 hectares, un chai et une chaîne dembouteillage \nGéraldine et Guilhem soccupent de la vigne, de lélaboration des vins et des relations clients à létranger. Brigitte et Antoine embouteillent et commercialisent sur le territoire français.\n\nNous sommes fiers de notre entreprise à taille humaine. Nous voulons rester en capacité de suivre chacun de nos clients de façon personnalisée. Nous restons avant tout des artisans. \n\nNos vignes sont situées dans le nord-est du Minervois (proche de la fameuse cité de Carcassonne), dans la zone des Balcons de lAude. Laure-Minervois est un charmant petit village, mais cest surtout un des meilleurs terroirs du Minervois.\n\nNous travaillons dans le respect de la vigne et de lenvironnement. Nous souhaitons rester en harmonie avec la nature en témoigne notre passage en agriculture biologique\n. Avec laide de techniciens (viticole et nologue) nous cherchons à optimiser au mieux la diversité et le potentiel de nos sols. Notre seul but respecter nos terroirs et les modes de cultures typiques de la région afin de récolter les meilleurs raisins possible, condition indispensable à lélaboration dun grand vin.\n\nA la cave nous veillons à extraire des tanins fins tout en préservant le goût fruité et frais de nos raisins, à la recherche de vins équilibrés. Nous suivons notre vin de la vigne au consommateur, de la grappe à la bouteille, nous participons à chaque stade de la production (cest pourquoi nous possédons notre propre chaîne dembouteillage).',1),(624,'CHATEAU SAINTE EULALIE','Le Château Sainte Eulalie, installé depuis plus de 19 ans en vigneron indépendant sur le terroir de la Livinière, propose des vins issus de l\'appellation Minervois mais également de l\'appellation Minervois La Livinière. De ses vignes à haute valeur environnementale, le Château ravie les papilles gustatives des amateurs de bons vins : Rouge, Rosé et Blanc sont au rendez-vous. Les labels Qualité Hérault et Sud de France viennent confirmer l\'excellence du Château Sainte Eulalie.',1),(625,'Gibalaux Bonnet','vins',1),(626,'Domaine LA SIRANIERE','Créé en 2008 dans l\'AOC Minervois, Cru La Livinière, le domaine comporte quatre hectares pour moitié sur les hauteurs de La Livinière, le restant sur le piémont de Siran à des altitudes analogues et à proximité.\nLes parcelles insérées dans les pinèdes, orientées au sud, face à la Montagne D\'Alaric et au Canigou sont accrochées au versant méridional de la Montagne Noire.\nL\'encépagement majoritairement en Grenache et Syrah est complété de vieux Carignans et Cinsaults pour une faible production hectare de 25 à 30 hectolitres.\nLes vendanges manuelles en cagettes et l\'égrappage précédent de longues macérations à froid suivies de vinifications thermo-régulées en cuve inox. Certaines cuvées réalisées en vinification intégrale bénéficient de fûts de chêne Francais pour leur vinification et élevage qui pour l\'ensemble hors rosé est de quinze mois.\nDe petits rendements, des taches manuelles, un agriculture raisonnée, de vieilles vignes, un climat méridional, l\'expérience de certains, la passion des autres et la volonté de tous de faire un vin d\'exception.',1),(627,'CAVE DE SAINT-CHINIAN','Le vignoble de la cave des Vignerons de Saint-Chinian est legerement en altitude (120 a 300 m) et reparti naturellement autour de Saint-Chinian sur des terroirs de schistes et argilo-calcaires et parfois, localement sur des zones de gres.\nLes sols sont naturellement peu productifs et la volonte de notre Cave dorienter la production vers de grands, nous pousse a maitriser plus encore la qualite du travail de nos vignerons et a conduire une partie du vignoble en culture raisonnee.\nCree en 1937, la Cave des Vignerons de Saint-Chinian na jamais cesse devoluer. Loutil de production na pas ete neglige loin sen faut.\nLes vinifications en cuves thermo-regulees permettent une maitrise totale des vinifications et le travail sur les elevages entrepris depuis plusieurs annees se poursuit grace a deux chais de 250 futs de chene merrain provenant de 6 tonnelleries et un entrepot de 900 m².\nCertifiee ISO depuis 2001 sur lensemble de nos services : selection parcellaire, vinification, elevage, embouteillage, commercialisation et logistique, notre cave est a votre ecoute et notre reactivite a tous les stades de la commande, en fait une de ses forces.\nLe potentiel du terroir associe au souci permanent de la qualite permet dobtenir tous les ans, de nombreuses distinctions, des medailles aux differents concours, des publications dans les magazines specialises. Nous sommes aujourdhui representes dans 20 pays a travers le monde grace a la passion de nos vignerons et de nos nologues.',1),(628,'DOMAINE DES JOUGLA','Le Domaine Des Jougla est une propriété\nfamiliale de 30ha où se succèdent depuis des années\nplusieurs générations de vignerons.\nIl est situé au nord ouest du département de\nlHérault, sur le versant sud des premiers\ncontreforts des Cévennes, au coeur de laire\nde lappellation contrôlée : Saint Chinian.\nLes deux tiers de notre vignoble se trouvent\nsur les coteaux de schistes feuilletés de\nlOrdovicien, le reste occupe les graves, argiles et calcaires dolomitique de\nlEocène.\nA une centaine de mètres daltitude, sous un\nclimat méditerranéen chaud et ensoleillé,\nnos vignes sont environnées de garrigues où\ndominent le chêne vert, le kermès, larbousier\net où poussent les cistes, le thym et la bruyère.\nLes divers ténements sont complantés en\ncépages traditionnels de la région : Grenache,\ncarignan, cinsault, mourvèdre et syrah :\nassociation harmonieuse qui donne à chacun de\nnos vins son caractère particulier.',1),(629,'Chateau Fonsalade','Situe au cur du Languedoc, dans l\'AOC Saint-Chinian, notre domaine comme son caveau de degustation sont entoures d\'une grande terrasse avec large vue sur les Cevennes et le vignoble. \n\nEn conversion Bio, nous avons des vignes escarpees, a petits rendements et une vinification minutieuse donnent des vins apprecies, aussi bien par le professionnel exigeant que par l\'amateur eclaire. \nGamme d\'AOC Saint-Chinian rouge et rose. Vin de pays d\'Oc blanc. \nSpecificites uniques des lieux : une mosaique de terroirs singulier dans l\'appellation, et la presence d\'une source naturelle d\'eau salee sur le domaine, utilisee pour la viticulture et l\'entretien des vignes et a laquelle on prete de vertus antiseptiques.',1),(630,'SCA LES COTEAUX DE BERLOU','La cave coopérative de Berlou, créée en 1965, regroupe la presque totalité des vignerons du village soit : 23 adhérents. Elle produit en moyenne 8.000 hl de vin dont les 80% en A.O.C. Pourcentage qui tend à augmenter avec les plantations de cépages nobles. Elle est tout entière tournée vers la recherche de la qualité et a toujours été une pionnière dans ce domaine.\nLe vignoble de Berlou, classé Appellation d\'Origine Contrôlée Saint Chinian en 1982, est niché sur les derniers contreforts des Cévennes, dans la bande la plus étroite du versant  méditerranéen, face à la mer. Le sol primaire est constitué, entièrement, d\'un affleurement rare, schisto-gréseux, appelé Ordovicien inférieur, composée de plaques de schistes gréseux et micacés tout à fait caractéristiques. Ces schistes, de couleur relativement foncée, accumulent la chaleur solaire du jour et la restituent la nuit. Le climat et l\'exposition des terroirs, mêmes situés en altitude, permettent une maturité remarquable. Le massif du Caroux abrite Berlou des vents froids du secteur nord et provoque par l\'effet de fun, une transparence de l\'air; d\'ou un rayonnement solaire intense qui ajouté à une faible pluviométrie donne des conditions viticoles idéales. \nLe vignoble s\'étend sur 250 hectares, 80% des parcelles sont classées en A.O.C. Ce qui constitue un fait unique dans l\'appellation. Les cépages qui le composent sont: le carignan (37%), le grenache (24%), le cinsault (13%), la syrah (14%), le mourvèdre (6%) les cépages blanc (5%), les cépages divers (1%).  L\'âge moyen de ce vignoble est de : 40 ans; d\'ou, une marge de progression qualitative très importante. Il est exposé à 80 % plein sud. Il se situe à une altitude moyenne de: 220 m.',1),(631,'LES COTEAUX DE RIEUTORT','Cave Coopérative située à Murviel les Béziers, regroupant 750 hectares et produisant en moyenne 40000 hectolitres.\nAu caveau nous proposons une gamme de Vin de Pays d\'Oc et d\'AOP Saint Chinian, rouges, rosés et blancs en bouteille. Nous avons également une gamme de BiB et de vins en vrac.\nNous proposant également des objets en rapport avec le vin. \nDes artistes locaux exposent à tour de rôle leurs uvres dans notre caveau.',1),(642,'Mas de La Plaine Haute','La plus petite exploitation de lAOC Frontignan. Sur 4 ha de vignes en conversion biologique, contre la garrigue, aux pieds des collines de La Gardiole, je vinifie plusieurs cuvées artisanales : muscat sec et moelleux, Muscat de Frontignan, vin rouge IGP Collines de la Moure, vin rosé.',1),(643,'Domaine de la Plaine','Domaine viticole familial de 20 ha cultive de facon traditionnelle et raisonnee. Situe sur la partie la plus orientale de la zone AOP Muscat de Frontignan.\nNous vous accueillerons personnellement au milieu de nos vignes pour vous faire decouvrir notre metier et toute la gamme de notre production.',1),(645,'Mas de Daumas Gassac','Le Mas de Daumas Gassac est un domaine viticole familial crée par Aimé et Véronique Guibert en 1972.\nLe Domaine se situe à Aniane dans la vallée du Gassac (département de l\'Hérault en France). \n\nSes vins (rouge, blanc et rosé) sont classés en dehors de toute appellation. \nLa raison en est le choix fait de l\'encépagement qui comprend sur le domaine des variétés étrangères à celles retenues dans l\'appellation Coteaux-du-Languedoc.\n\nEn dépit de ce choix, les vins du domaine, compte tenu de la qualité exceptionnelle de ce terroir viticole, ont été salués par la presse nationale et mondiale comme un « Grand Cru du Languedoc. »\n\nGault & Millau : « Un château Lafite Languedocien »\n\nPlaisir Gastronomie Magazine : « Les meilleurs spécialistes estiment que les rouges et les blancs de Daumas Gassac sont parmi les meilleurs vins du monde.\nCe qui se compte sur les doigts dune seule main. »\n\nThe Times : The most magnificent and also the most expensive vin de pays de lHérault must be the headline grabbing Mas de Daumas Gassac',1),(646,'DOMAINE DE LA BELLEDAME','',1),(647,'Domaine de la Rencontre','Vignerons Indépendants et spécialistes en muscat blanc à petits grains, notre jeune domaine est implanté sur le versant sud de la Gardiole, surplombant la côte méditerranéenne et les villages de Vic-la-Gardiole et Mireval.  \nNotre gamme, évolutive et médaillée, se compose aujourd\'hui de six cuvées en AOC, IGP et Vin de France (VMQ). \nNous proposons aussi des cuvées exclusives, élaborées sur mesure pour nos clients, contactez nous pour en savoir plus.\nNous sommes référencé au Guide Hachette des Vins chaque année depuis 2013.',1),(648,'domaine de barroubio','domaine familial de 32 ha\naoc vdn muscat saint jean de minervois\naoc minervois\nigp oc\nproduction en bouteilles',1),(649,'LE MUSCAT','Cave coopérative située dans lHérault à St jean de Minervois. La production est essentiellement du Muscat Petit grain VDN. Petite structure de 40 adhérents se répartissant une surface de production de 216 ha dont 160 ha de muscat',1),(655,'Dell\'ova','Le vignoble du domaine sétend sur le territoire de La Palme en terroir maritime, dans une zone sèche et ventée bénéficiant dembruns maritimes. Ces embruns viennent rafraîchir la vigne plantée sur un sol particulièrement sec, qui permet dobtenir des raisins montrant des concentrations splendides.\n\nCe domaine, chargé dhistoire, est traversé par la voie romaine qui reliait Narbonne à lEspagne, la célèbre Voie Domitienne. Et comme le disait Domitius en 118 av JC : « ici règnent les cailloux, la sécheresse et le vent mais lon domine la Mare Nostrum qui baigne les rivages Romains ».\nSur ce domaine, Thierry et André Dell\'Ova produisent différents vins : AOC Fitou, AOC Muscat de Rivesaltes, AOC Rivesaltes et vins de table blanc, rosé et rouge.\nComposé actuellement de 65 ha, il est désormais certifié AB depuis le 31 mars 2012 en bio, après plusieurs années en lutte raisonnée.',1),(661,'Terre D\'expression, Créateurs De Vins','Au cur des Corbières, les Créateurs de Vin de Terre dExpression vous invitent à découvrir des vins signés pour votre plus grand plaisir.\nDans nos caveaux Charles Cros à Fabrezan et Joseph Delteil à Serviès-en-Val, nous rendons hommage à ces Grands Hommes, issus de la même veine que nos vignerons.\nVins de cépages, cuvées traditions, expression du terroir, produit dexception ou démotion, nous avons un vin pour chaque instant à découvrir lors dune dégustation.',1),(662,'Domaine de Peyrevent','Entreprise familiale produisant des vins appellation corbières et vin de pays d\'hauterive et oc.',1),(663,'Chateau  Cointes','Anne et François GOROSTIS vignerons en cave particulière depuis 1990 ont repris le domaine familial de 30ha acquis par le grand père de François en 1924. Le Château de Cointes produit des vins AOP Malepère Rouge et Rosé ainsi que des Vins de Pays Rouge et Blanc. Depuis 20 ans les vins du Château sont reconnus qualitativement par leurs différentes distinctions reçues lors des concours et leurs citations dans les guides. En 2007 un gîte a ouvert ses portes au coeur du vignoble et peut acueillir jusqu\'à 6 personnes. La famille GOROSTIS déploient d\'importants efforts pour faire partager leur amour de leur terre et du vin.Depuis 2014 nous pouvons acceuillir les groupes.\nEn 2019 1ere année en reconversion bio.',1),(664,'Chateau La Bastide','Le vignoble du Chateau La Bastide se situe sur la commune d\'Escales dans le departement de lAude sur l\'Appellation exceptionnelle du Cru Corbieres.\n\nLe Chateau date de l\'epoque romaine. La BASTIDE a donne son nom au lieu-dit dou sont toujours issus les vins du Chateau. Les batiments actuels datent de 1860-1865.\n\nDote dun outil de production performant, la qualite des vins est reconnue et recompensee regulierement dans la presse specialisee. Chaque millesime est apprecie par les consommateurs du monde entier.\n\nSur 180 hectares du Chateau La Bastide, 60 hectares sont composees des cepages comme : Syrah, Mourvedre, Grenache, Pinot Noir, Viognier, Merlot, Vermentino, Chardonnay, Roussanne et Bourboulenc.\n\nLe soin particulier porte a la vigne permet de travailler la plante en culture raisonnee et a la cave de vinifier le plus naturellement possible avec le concours d\'un grand oenologue M. Claude GROS, Laboratoire Dejean a Narbonne. Cette longue collaboration dure depuis plus de 25 ans.',1),(665,'DOMAINE LA CROIX SAINTE EULALIE','Le Domaine La Croix Sainte Eulalie est un Domaine familial de 32 Ha de Vignes principalement en AOC Saint-Chinian. La particularité du Domaine est de se trouver sur les trois terroirs de lAOC Saint-Chinian : Schistes, Grès et Argilo-calcaire.La production en AOC Saint-Chinian est denviron 1100 HL de vin réparti en 75% Rouge, 15% Blanc et 10% Rosé.',1),(666,'Domaine De Comiac','vigneron independant et hebergeur gite de France.',1),(667,'MAS BRES','Le Mas Brès se déploie sur les collines de Saint-Maurice, dans le piémont cévenol, à 180 m daltitude. Loriginalité du vignoble repose sur un choix singulier : faire côtoyer des cépages traditionnellement utilisés dans le sud de la France avec dautres, issus de régions extra méridionales. Finesse et vivacité caractérisent les vins du Mas de Brès.',1),(668,'Vignoble Chabrier','Aujourd\'hui au pied des Tours du Duché d\'Uzès, à mi-chemin entre le Pont du Gard et les Arènes de Nîmes, le Domaine d\'une soixantaine d\'hectares s\'étend sur les communes de Bourdic, Arpaillargues-Aureillac et Uzès.\nChristophe et Patrick Chabrier, deux vignerons passionnés, héritiers d\'une longue tradition viticole, vous proposent de découvrir une identité Duché d\'Uzès et une griffe Vignoble Chabrier.',1),(669,'domaine du chene','Le domaine du chêne se situe au piémont des cévennes',1),(670,'Le Mazelet Vins-Wines','vins',1),(671,'Domaine Camp-Galhan','Le domaine se situe au cur du vignoble du Duché dUzès, et trouve ses racines sur danciennes terrasses  du  Gardon, la rivière emblématique des Cévennes.Le domaine est donc constitué par  les vignes qui sont donc plantées dans le lit de l\'ancien Gardon ainsi quune cave en gravité pour la vinification.',1),(672,'Cave St Maurice','',1),(673,'LES COLLNES DU BOURDIC','Creee en 1928, notre cave cooperative Les Collines du Bourdic rassemble 108 vignerons autour d\'Uzes, entre Pont du Gard et Cevennes.\n\nNous vous proposons plus de trente cuvees. \n\nNotre vignoble sous lappellation AOP Duche dUzes et sous les denominations IGP Gard, IGP Cevennes et IGP Pays dOc, mise sur la diversite des cepages. Notre terroir se distingue par un microclimat exceptionnel. Plaines et coteaux baignes par le soleil mediterraneen se ressourcent a proximite du piemont cevenol, ce qui donne a nos vins leur specificite : une belle fraicheur. Selection parcellaire minutieuse, cahiers des charges rigoureux, vendanges effectuees a maturite optimale et outil de vinification performant, permettent a notre cave de magnifier le travail de ses vignerons.\n\nSouvent pionniers dans limplantation de nouveaux cepages, comme le Viognier ou le Gewurztraminer, nos vignerons cultivent le gout du risque et de la difference. Regulierement recompenses des plus hautes distinctions, les vins des Collines du Bourdic saffichent aussi bien en France qua letranger.\n\nNous cultivons 25 cepages pour vous offrir une palette de vins\nvaries et seduisants. Des vins de cepages, des assemblages, une\ngamme en agriculture biologique, des cuvees haut de gamme, des vins doux, de fines bulles...en blanc, rose et rouge !\n\nDecouvrez nos cuvees sur l\'espace degustation de nos caveaux de vente, labellises Qualite Tourisme Occitanie Sud de France, a Bourdic et St Maximin dans le Gard.',1),(674,'DURFORT La Cave','Fondée en 1963, la SCA Les Coteaux Cévenols est l\'une des coopératives vinicoles les plus récentes du département du Gard.\nAujourd\'hui spécialisée dans la production de vin de cépages en IGP Oc (rouges, rosés, blancs) et en AOP Duché d\'Uzès, elle regroupe une centaine d\'adhérents répartis sur 9 communes alentour, pour une superficie d\'environ 450 hectares de vignes.\nSituée sur le piémont cévenol, elle occupe une position idéale pour agrémenter vos visites de sites réputés (Musée du désert, bambouseraie de Prafrance, Anduze, grottes de Trabuc) par une dégustation de nos meilleurs crus du terroir.',1),(675,'Domaine de l\'Ancien Prieure','Domaine viticole situe entre Cevennes et Provence, revendique en AOP Duche D\'uzes et en IGP Vins des Cevennes. Nous avons entame notre transition en biodynamie l\'an passe, la vinification se fait au coeur de notre cave hi-tech, et la maturation de notre tete de cuvee se repose le temps necessaire au sein de l\'eglise romane du domaine.',1),(676,'Domaine Charlemagne','',1),(677,'ALMA CERSIUS','Aux portes de Beziers, sur les territoires de trois villages: Cers, Portiragnes, Villeneuve-les-Beziers, le vignoble ALMA CERSIUS s\'etend sur 1200 Ha. La mosaique de cepages, en IGP Pays d\'Oc et IGP Coteaux de Beziers, profite des influences maritimes sur des terroirs de galets roules, caresses par le vent local. Depuis 2009, ALMA CERSIUS construit son propre univers de marques Premium, recompensees chaque annee par de nombreux et prestigieux concours et jurys. Portee par une reflexion qualite permanente, conjuguee avec une audace creative et percutante, ALMA CERSIUS produit et met en marche plus de 4.5 millions de bouteilles en France et a l\'export. Prestigieux vivier de vins de cepages et d\'assemblages, ALMA CERSIUS, vous invite a decouvrir ses vins. « Au dela d\'une qualite remarquable, les vins d\'ALMA CERSIUS s\'attachent a illustrer des moments de vie. Autrement dit : nos vins ont une ame. Nous avons le sentiment que nos vins meritent d\'etre racontes, vecus  Et pas seulement exposes ou annotes. »',1),(678,'Domaine Mi-Cote','Le domaine MI COTE se situe aux portes de Béziers face à la cathédrale St Nazaire, proche du Canal du Midi et du site des 9 Ecluses.\nDepuis 3 générations, de père en fils, le domaine a su garder son caractère authentique et familial.\nVenez nous rejoindre, nous vous ferons découvrir notre gamme de vins blanc, gris, rosé et rouge COTEAUX DE BEZIERS en vrac, BIB et bouteilles.',1),(679,'Domaine de la Barthe','Le Domaine de la Barthe est un domaine ancestral, dont une partie a été repris par la famille EYCHENNE depuis 3 générations. Viera et Yves EYCHENNE oeuvrent pour mettre en valeur les différents terroirs qui le composent. La propriété est située aux portes de Béziers, une des villes les plus anciennes de France, où la vigne et le vin ont laissé leurs empreintes depuis l\'antiquité « Notre vignoble est constitué d\'une grande diversité de cépages (Syrah, Merlot, Cabernet Sauvignon, Marselan, Muscat d\'Alexandrie, Muscat à Petit grains). Les terres sont situées sur des lieux charge dhistoire coteaux bordant le Canal du Midi, les flans argilo-calcaire de l\'Oppidum d\'Ensérune où la vigne, depuis des millénaires a plongé ses racines et a imprégné notre culture comme en témoignent nos ancêtres Grecs et Cathares. N\'oublions pas le plateau de Vendres et son terroir unique entre mer et garigue, où le vent du nord et les embruns de la mer font la typicité de nos cuvées. Après ces présentations partageons ensemble ce moment de convivialité, qui nous est cher, autour dun verre pour découvrir nos vins gorgés de soleil »',1),(680,'Domaine Preignes le Neuf','Ce domaine appartient à la famille Vic depuis plus dun siècle. Situé en pleine garrigue au cur du Languedoc, le vignoble de 150 ha ceinture un élégant château du XIXème siècle aux imposantes tours jumelles. Preignes le Neuf pratique depuis toujours lagriculture raisonnée dans un souci de développement durable. Les vins sont souples, fruités avec une certaine complexité et d\'une grande régularité due à la taille du vignoble et du terroir. Ils sont régulièrement médaillés (Guide Hachette, vignerons indépendants..).',1),(681,'LES TERRES D\'ARMELLE','Il est des rêves qui se réalisent\nAprès 15 années passées à vendre du vin aux 4 coins du monde, je suis désormais Vigneronne.\nMon Domaine « Les Terres dArmelle » a vu le jour en septembre 2013. Les vignes sétendent sur 5 hectares situés sur les coteaux de Corneilhan, au nord de Béziers, en plein cur du Languedoc.  3,13 hectares sont en AOP Coteaux du Languedoc et 1,87 hectares en IGPCoteaux de Béziers.\nJai privilégié des cépages locaux et anciens sur des vignes âgées de 12 à 40 ans. Cépages rouges : Cinsault, Alicante, Carignan, Syrah et Grenache. Cépages blancs : Grenache blanc et Muscat petit grain.\nLes parcelles sont en 2eme année de conversion biologique.',1),(682,'LES VIGNERONS DE SERIGNAN','Depuis 1935, les vignerons des communes de Sérignan, Vendres, Sauvian et Valras regroupés au sein de la cave coopérative \'Les Vignerons de Sérignan\' uvrent quotidiennement pour l\'élaboration d\'un terroir de qualité.\nSur les 950 hectares d\'un vignoble d\'exception, caractérisé par la diversité géologique du sol et par l\'influence d\'un climat maritime qui tempère les variations excessives de chaleur, c\'est un breuvage à la maturation lente et douce, et aux arômes typiques qui est produit par plus de 300 vignerons passionnés.\nCe sont ces vins, aux saveurs inégalées et les secrets de leur fabrication, que les Vignerons de Sérignan vous invitent à découvrir.\nDécouvrez, également, le Rayonnant, travail in situ de lartiste Daniel BUREN, une uvre publique à Sérignan qui sétend sur près de 3 Ha. Visitez le Musée Régional dArt Contemporain. Sérignan vous propose également la première écoplage de France avec un cordon dunaire exceptionnel de 3.2km de long. Un réseau de sentier pédestre permet de découvrir le site protégé des Orpellières et la splendeur sauvage de létang naturel de la Grande Maïre.',1),(683,'Domaine Emile & Rose','Le domaine Emile & Rose est cultive en bio a Corneilhan depuis 2001. \nLe vignoble familial de Marc Royo, artisan-vigneron independant, s\'etend sur 27 hectares en petits coteaux de cepages mediterraneens, typiques ou rares, de faible rendement. \nAu debut du siecle, c\'est le domaine d\'Emile & Rose qui a popularise le vin orange en France - apres un voyage en Georgie a la decouverte de la vinification antique en amphore du Caucase. \nEn 2020, un site de vente en ligne a ete cree et un caveau de vente directe au public amenage dans les murs du Domaine.\nLa specificite du domaine reste le vin du Languedoc eleve en amphore, le fameux Carignan blanc plante par les aieux et le vin orange qui reunit les deux.\nLa vendange est manuelle, la vinification naturelle et l',1),(684,'Domaine Villepeyroux-Forest','Entre landes et pinèdes, en plein cur du Minervois et à quelques kilomètres de la cité médiévale de Carcassonne, le Domaine Villepeyroux Forest exploite 50 hectares de vignes plantées en demi coteaux sur des terres argilo-calcaires.\nUne douzaine de cépages y sont actuellement travaillés : Chardonnay, Marselan, Syrah, Marsanne, Cinsaut pour nen citer que quelques-uns.\nNotre exploitation familiale privilégie lauthenticité de son terroir.\nNous avons fait pour cela le choix de vinifier à la propriété nos meilleures parcelles en petites quantités.\nNos raisins sont ramassés en sur maturité et conservent ainsi tous leurs arômes et leurs fruits.\nNos productions tant limitées, toutes nos bouteilles sont numérotées.\nAfin de préserver leur richesse, les vins issus de nos chais subissent une filtration très légère.\nDans le but de toujours mieux vous accueillir, le domaine vient de se doter dun caveau de dégustation où vous serez les bienvenus toute lannée.',1),(685,'Chateau du Donjon','Le vignoble du Château du Donjon s\'étale sur la commune de Bagnoles, partie ouest de la région Minervois, terroir de la Clamoux. Il se décompose en deux grandes parties, l\'une en A.O.C. Minervois, l\'autre en I.G.P Coteaux de Peyriac. Les rendements de ces vins sont très faibles, afin d\'obtenir une magnifique concentration des arômes.\n\n Depuis 1999, le vignoble s\'est agrandi sur la commune de Villemoustaussou, en deux parties, une en AOC Cabardès et une en IGP Cité de Carcassonne.',1),(686,'Domaine Malys-Anne','Domaine viticole de 8 hectares.',1),(687,'FAMILLE FABRE','La Famille Fabre est installée en Languedoc depuis 1605. Louis Fabre, est aujourdhui à la tête de 4 propriétés (360 hectares de vignes), qui lui permettent de proposer une gamme cohérente et complète de vins sur plusieurs appellations :\n Domaine Grande Courtade, IGP Pays doc et IGP coteaux densérune.\n Château de Luc en AOP Corbières, Languedoc, IGP pays doc.\n Château Coulon, en AOP Corbières et IGP pays doc.\n Château Fabre-Gasparets en AOP Corbières-Boutenac, Corbières.\nChaque terroir sexprime différemment dans des vins typés ou délicats, toujours équilibrés, reflets de nos paysages de garrigues sauvages, ensoleillés et parfumés. Bien distribués en France sur un circuit qualitatif traditionnel, les vins Famille Fabre sont aujourdhui prêts à soffrir à de nouveaux marchés. \nSoucieux de préserver lenvironnement, pour le respect du consommateur, Louis Fabre est, en 1991, parmi les premiers vignerons à adhérer à lagriculture biologique en inscrivant le château Coulon dans la démarche AB. Ce mode de culture est étendu aujourdhui à lensemble de nos propriétés.',1),(688,'DOMAINE ST GEORGES LES CARDINELLES','Dans le collines entre Aude et Orb, le domaine st Georges Les Cardinelles, vous propose sa gamme de vins du soleil, chaleureux, simples ou sophistiqués.\nDes cépages de qualité cultivés avec soins et vinifiés selon les méthodes les plus modernes, conduisent à des produits généreux, subtils et fins.',1),(689,'Domaine Castan','Le Domaine Castan est une entreprise familiale fondé en 1993 par André et Monique Castan. Il est situé dans le magnifique arrière-pays languedocien, sur le chemin de Saint-Jacques de Compostelle, entre l\'étang asséché de Montady, le Canal du Midi et l\'Oppidum d\'Ensérune, au pied du contrefort des Cévennes.C\'est sur ce terroir magnifique et privilégié que le Domaine Castan façonne des vins typés aux notes gourmandes, riches et somptueuses. Aujourd\'hui les trois enfants reprennent avec fierté le flambeau pour continuer la démarche qualitative déjà mise en place. La cave n\'a cessé de se développer pour atteindre son niveau d\'excellence qu\'elle connait actuellement. Il y est produit une grande gamme de vin allant du vin de pays à l\'AOP Languedoc ainsi que de la cartagène (apéritif du Languedoc) et du muscat pétillant.Des vins pour tous les goûts à consommer avec modération dans la convivialité et le partage.',1),(690,'Domaine Augé','Cest en plein cur du plus grand vignoble du monde: le Languedoc Roussillon, dans le village de Boujan sur Libron, à 2 Kms de Béziers que la famille AUGÉ cultive la vigne depuis maintenant  7 générations.                                                                                \nNotre vignoble familial d\'un cinquantaine d\'hectares est cultivé avec rigueur et passion pour obtenir des raisins de qualité. Nous  cultivons les cépages traditionnels à notre région mais aussi dautres régions viticoles françaises afin de proposer des vins plaisants, agréables et diversifiés. \nNos vins vinifiés, élevés et conditionnés par nos soins à la propriété sont commercialisés en vente directe depuis le début des années 70.',1),(691,'VILA VOLTAIRE','Domaine viticole familial, la Vila Voltaire propose des vins singuliers, typés, respectueux du terroir et des vielles vignes, produits en agriculture biologique.\nIGP Coteaux d\'Ensérune & AOC Saint-Chinian',1),(692,'Domaine De Soustres','Le Domaine de Soustres se situe sur la colline du celebre Oppidum d\'Enserune, entre Beziers et Narbonne. \nNous proposons des vins en IGP Coteaux d\'Enserune sur le fruit et la fraicheur, elabores a partir de cepages meridionaux (grenache, Carignan...) , en blanc, rose et rouge.',1),(693,'Domaine de la Patience','Situé à 5 min du Pont du Gard, lexploitation de 70ha en Agriculture Biologique depuis 2008 produit des IGP Coteaux du Pont du Gard et AOP Costières de Nîmes.',1),(694,'VIGNERONS PROPRIETES ASSOCIES','Vignerons Propriétés Associés, gathers together wine makers with a love of their land, The Rhône Valley and the Languedoc, and the willingness to create and sustain quality wines.\nIt is in this spirit that our team of men and women work together, encompassing tradition, and progress while respecting the environment.\nOur commitment to quality from the outset had led the recognition within the industry, we feature in the Wine Guide published by Hachette, at the Concours General of Paris, in Vinalies, and in industry publications.',1),(695,'Domaine Tardieu Ferrand','Le Domaine Tardieu Ferrand est un trait d\'union entre deux personnes mais aussi entre deux exploitations: Une pres d\'Uzes sur les premiers contreforts des Cevennes et l\'autre dans la partie la plus meridionale des Cote du Rhone. Animes par la meme passion et tous deux oenologues de formation nous souhaitons vinifier des vins de qualite. Ainsi, la production est limitee afin d\'y apporter toute l\'attention necessaire.',1),(703,'IN VINHYS DOMAINE','A Florensac, 4 hectares de vignes vivent au rythme de la Méditerranée. Sur ces Côtes de Thau nous avons choisi de cultiver 5 cépages. Le sauvignon blanc, le viognier et le grenache blanc destinés à la production de vin blanc. \nLa syrah et le cinsault pour les vins rouge et rosé.\nLa vigne est lélément fondateur des futurs vins. Il faut y apporter une écoute, un respect et une surveillance  particulière, c\'est ce que nous appelons l\'agriculture raisonnable. Fuir les extrêmes  en matière de méthodes culturales pour maintenir ce fragile équilibre entre culture et nature. Ni pesticide, ni herbicide, ni intrant nuisible ;  un engagement pour la biodiversité. Voilà notre philosophie pour obtenir une vendange saine et élaborer des vins francs et subtils à la fois.',1),(704,'Laetitia Gelly','Notre exploitation familiale, créée il y a 7 générations, sest enrichie de cépages variés au cours de ces 30 dernières années.\nLes parcelles de vignes sont réparties sur 6 communes au Sud de la France dans le département de lHérault : Magalas, Margon, Abeilhan, Coulobre, Neffies et Pouzolles.\nMes vins sont donc issus de terroirs variés.\nEn 2006 avec un diplôme en viti oeno, je prends la suite de mon père qui part à la retraite.\nA la tête dun Domaine qui sétend sur 45 hectares, je décide en 2008 de modifier la politique de vinification.\nDe lourds investissements destinés à améliorer la production et la vinification ont été faits. Aujourdhui doté dun chai moderne, japporte tout mon savoir faire de la culture de la vigne à la mise en bouteille en passant par la vendange et jessaies dallier le traditionnel et les techniques les plus modernes.\nUne nologue passionnée et vigoureuse surveille la vinification.\n\n\nLe travail de la vigne :\n\nFort de lexpérience familiale, je travaille avec des méthodes de culture raisonnables proches de ce que lon appelle « Agriculture Raisonnée » : les vignes sont fumées naturellement, les désherbants utilisés sont choisis avec soin afin de ne pas laisser de résidus dans les vignes ; les traitements sont toujours faits avec prudence afin de maintenir la vigne en bon état phytosanitaire. \nLes vins proposés à la vente seront vendangés, vinifiés et assemblés en respectant de nombreux critères mais avec une approche personnelle en privilégiant les qualités des parcelles et des cépages choisis.\n\n\nLes cépages :\n\nSauvignon, Viognier, Muscat, Chardonnay, Syrah, Cabernet Sauvignon, Grenache, Carignan, Pinot Noir, Gewurtztraminer.\n\n\nLa vendange :\n\nElle se fait selon le degré de maturité de chaque parcelle, le plus tôt possible le matin (avant dix heures) afin de garder la récolte aussi fraiche que possible.\nLe matériel de vinification moderne, les cuves en inox avec froid intégré permettent de mieux contrôler le processus de vinification.',1),(705,'MOULIN DE LENE','Le Moulin de Lene est un domaine viticole de 60 hec­tares, au coeur de lHerault, entre mer Mediterranee et contreforts des Cevennes, dans le vallon de la Lene. Ici, nous travaillons la vigne, le raisin et le vin sous la certification Terra Vitis® agriculture durable (label de la Chambre dAgriculture) depuis une dizaine dannees environ. Toute la recolte est triee a la main, pour ne garder que le meilleur. Des aromes purs, des tannins souples et soyeux. Gage de fraicheur, nous recoltons de nuit les blancs et les roses pour eviter loxydation. Tout y est ou presque, pour vous permettre de decouvrir et deguster des vins uniques qui vous ressemblent',1),(706,'Domaine de l\'Arjolle','Le domaine de l\'Arjolle, domaine familial depuis 4 générations, est situé à Pouzolles, au cour des côtes de Thongue. Chaque génération a participé au renouvellement du vignoble pour l\'inscrire dans une démarche d\'agriculture raisonnée, à la modernisation et au développement du domaine afin de proposer des vins de qualité.Le domaine de l\'Arjolle cultive 90Ha de vignes aux terroirs très variés. Toute la vinification est réalisée à la propriété. Les  vins font l\'objet d\'un vieillissement en barriques, en fondues ou en cuves.',1),(707,'DOMAINE SAINT-GEORGES D\'IBRY','Le Domaine Saint-Georges d\'Ibry est une propriété familiale qui sétend sur 40 hectares. \nIl est situé au cur de l\'IGP Côtes de Thongue. \nSon terroir très varié, a permis l\'implantation de cépages nobles qui bénéficient pleinement de l\'ensoleillement méditerranéen.\nLe chardonnay et le sauvignon profitent de marnes de calcaires coquilliers, idéales pour la production de vins blancs. \nIci, la mer était autrefois présente et de nombreux fossiles de coquillages en témoignent. \nLes sols plus profonds assurent au merlot et au cabernet des conditions idéales de maturité. \nLa syrah, sur terrasses villafranchiennes produit des vins rouges dune grande  complexité.\nMichel CROS, vigneron depuis plus de 35 ans, allie tradition, modernité et respect de lenvironnement. Aujourdhui, son savoir-faire reconnu permet une production de grande qualité, régulièrement primée lors de concours nationaux et internationaux. \n\nLéquipe du Domaine vous réservera le meilleur accueil.',1),(708,'Domaine de Pouzac','Domaine viticole de 35ha situé dans l\'Hérault. Je produis des rouge, rosé et blanc en IGP Oc et Côtes de Thongue',1),(709,'MAS GABAREL','Mas Gabarel est un domaine d\'une superficie  de 10 ha situé en plein cur des  Côtes de Thongue. Nous proposons une gamme complète de vins rouges, rosé et blancs.  Nos cuvées sont élaborées à partir de différents cépages cultivés dans le respect de l\'environnement.',1),(710,'DOMAINE DE BRESCOU','Production d\' IGP COTES DE THONGUE et d\'AOP LANGUEDOC labellisé TERRA VITIS pour une viticulture plus saine et respectueuse de lenvironnement.',1),(711,'Domaine Roquessols','propriete familiale depuis 400 ans, a 5 km de pezenas et 25 du cap d\'agde.\nproduction de vins : blanc, rose et rouge.\nvente sur place au caveau tous les jours sur rendez-vous',1),(712,'Les Vignerons de Roquemaure / Rocca Maura','Vignerons depuis 1922\nAu cur de la Vallée du Rhône méridionale, la situation géographique de Roquemaure, lui a permis de devenir depuis la fin du Moyen Age, une place forte du commerce du vin. Située sur la rive droite du Rhône, notre cave fondée en 1922, rassemble les vignerons de plusieurs communes : Roquemaure, Montfaucon,  Pujaut, Sauveterre, Saint Génies de Comolas, Tavel, Saint Laurent des Arbres, Saint Victor La Coste, sans oublier Lirac, le cur de notre production.\nAvec 50 vignerons, un vignoble de 370 hectares et une production annuelle de 20 000 Hl, notre cave fait figure de petit poucet dans le monde coopératif. Nous faisons de cette caractéristique une force : nous maîtrisons parfaitement chaque étape de lélaboration de nos vins : du vignoble, jusquà lélevage et la mise en bouteille à la propriété. \nSur des terroirs de galets roulets et dargiles rouges, la vigne disposée en terrasses et coteaux senracine jusquaux pieds des massifs rocheux.  Riche de ce grand héritage notre philosophie est de préserver cette nature et de respecter notre environnement à chaque étape de lélaboration de nos vins. Au vignoble, nos vignerons ont mis en place depuis de nombreuses années les principes de « lagriculture raisonnée », leur permettant ainsi de diminuer les traitements. En cave, nous diminuons lutilisation de produits nologiques : réduction des sulfites, pas de colle dorigine animal, utilisation au maximum de levures naturelles. Nous cherchons dans notre processus délaboration des maturités optimales afin de respecter la nature et révéler au mieux lexpression de notre terroir.\nAprès une sélection rigoureuse, seules les parcelles les plus qualitatives sont retenues pour produire nos différentes cuvées en Vins de Pays du Gard assemblage classique ou sélection des cépages, Côtes du Rhône, Côtes du Rhône Villages Laudun, Lirac et Tavel.\nNous vous proposons ainsi des cuvées fruitées et gourmandes tout comme des cuvées plus élaborées et de gardes.\nNotre objectif est de toujours vous proposer des vins de grandes qualités pour le plaisir de vos papilles !',1),(713,'Domaine de La Tour','Petite entreprise familiale oriente bio depuis 2000 nous produisons des Vins de Pays (Oc et Gard) Blanc, Rose et rouge.\nLes mono-cepages sont le Chardonnay, le Merlot et la Syrah.',1),(714,'DOMAINE DE MAYRAC','Le Domaine de Mayrac est une exploitation viticole de 35 ha au sud de la France, en région Languedoc Roussillon, dans l\'aire d\'appellation Limoux. Notre vignoble d\'altitude est implanté sur des sols argilo-calcaires profonds où nous cultivons depuis 1987 l\'intégralité des vignes du Domaine de Mayrac en agriculture biologique.\nL\'appellation AOC Limoux couvre une superficie de 7800ha (dont 2000 ha en AOC) répartis sur 41 communes.\n\nLes cépages autorisés en appellation sont : le Mauzac, le Chardonnay, et le chenin pour les vins blancs et le Merlot, la Syrah, le Cot, le grenache, le Cabernet franc et le Cabernet Sauvignon pour les vins rouges',1),(715,'coume-Lumet','Petit domaine niché au cur du limouxin 50ha de garrigue dont 17ha de vignes. réalisation d\'un rêve depuis l\'acquisition du domaine fin 2012. Premier millésime 2013, aujourd\'hui nous souhaitons développer nos ventes',1),(716,'Domaine Begude','Cerifie en BIO.\n300m altitude a Limoux\n9 Vins: 3 Chardonnays, 3 Pinot Noirs, Gewurz, Sauvignon Blanc, Viognier',1),(717,'CAVEAU LES COTEAUX DE CAPIMONT','Cave Cooperative de vinification.\nVente directe et vente au negoce.',1),(718,'Domaine de Pélissols','Le domaine de Pélissols, se situe à lentrée nord de Bédarieux, à deux enjambées de la rivière Orb, et sarticule autours dun maison de maître datant du XVIIeme siècle. Cest un domaine familial que gère depuis 2012 Vincent Bonnal, le cadet de la famille, de retour au pays après de longues années à parcourir le monde. \n\nAvec convictions Pélissols sest orienté vers la production de vins «natures» et la conduite des vignes en biodynamie. Le tout ajouté dun mélange de techniques ancestrales et innovantes visant à respecter la vie du sol et lécosystème des parcelles afin quils puissent senrichir au lieu de sépuiser. Ces choix aboutissent à des vins vivants, plus complexes, digestes, réel reflets de leur terroir et millésimes. &#65533;',1),(719,'Domaine Serres Mazard','60 ha de vigne niché au cur des CorbièresLa famille Mazard est heureuse de vous faire découvrir ses vins, ses paysages de garrigues et de vous faire partager sa passion. Nos vins sont issus dune exploitation qualifiée au titre de lagriculture raisonnée.Tous nos AOC rouges sont vendangés à la main et vinifiés en macération à grains entiers.Notre Domaine est situé au sud de la France en plein coeur du pays cathare, sur un terroir aux couleurs natures.Dans une garrigue préservé pousse au bord de nos vignes des orchidées sauvages, venez avec nous les contempler, lors dune dégustation de garrigue « sur le sentier des Orchidées  chemin des planètes »(à découvrir sur le site : www.serres-mazard.com).',1),(720,'domaine de rieucoulon','DOMAINE DE RIEUCOULON',1),(721,'abbaye de valmagne','Ancienne abbaye cistercienne du 12 e siecle.  Monument historique classe recevant 40 000 visiteurs par an.\nOuvert a la visite toute l\'annee\nbatiments conventuels , jardin medieval , conservatoire des cepages',1),(722,'Clos Du Gravillas','Le Clos du Gravillas, cest une étendue éblouissante de de 8 hectares de cailloux calcaires blancs, 15 cépages en agriculture biologique, sur un plateau à 300 mètres daltitude dans le Parc Naturel de Haut Languedoc.Notre philosophie : faire des vins sincères et élégants.Se lancer des défis avec des cépages oubliés pour raconter lhistoire--vive le Carignan! Our credo: grow frank and elegant wines and champion the cause of old local varieties  inviting them back to their place in the tale of languedoc',1),(723,'DOMAINE DU CLOS ROCA','Le domaine du Clos Roca est situé dans le sud de la France, près de Pezenas. De vieilles vignes sur de magnifiques côteaux avec une grand diversité de sols et de cépages permettent de faire des vins qui reflètent notre terroir.\nUn soin tout particulier est apporté à la vigne comme à la cave afin de produire des vins de grande qualité alliant finesse et élégance.\nLes vignes sont cultivées sans pesticide ni insecticide chimique, en agriculture biologique.\nLes vendanges sont réalisées à la main.',1),(724,'Domaine du Chapitre','En Languedoc, à 10 km au sud de Montpellier, notre Domaine se situe au cur du village de Villeneuve-lès-Maguelone.\nEntre la garrigue et la mer, forts de lidentité méditerranéenne de notre terroir, nous cultivons 35 ha de vigne et 5 ha doliviers.\n\nSur notre vignoble se côtoient les cépages traditionnels de la région (Grenache, Syrah, Mourvèdre) et des variétés plus récentes (Merlot, Petit-verdot, Viognier).\nNotre originalité réside surtout dans la culture de cépages encore peu connus. Le Domaine du Chapitre est en effet le berceau des cépages Marselan, Caladoc, Aranel et Chasan.\nGrâce à cette diversité, nous proposons une gamme de vins blanc, rosé et rouge.\n\nLexploitation de nos 5000 oliviers nous permet de produire des huiles « vierges extras » de différentes variétés : Picholine, Rougette, Cayon, Arboussane, Arbequine\n\nPour la petite histoire, notre Domaine tient son nom de lhistoire qui le liait à lEvêché de Maguelone. En lieu et place de lancien Prieuré, deux grands chais (typiques de larchitecture viticole de la région) avaient été construits au début du XIXeme.',1),(725,'La Croix Gratiot','Situé entre Bassin de Thau et collines de pins, le vignoble de la Croix Gratiot se trouve sur la commune de Montagnac.\n3 Hectares de vignes implantées sur un sol argilo-calcaire bénéficient des Alizés marins et des senteurs de la garrigue.\nCe microclimat permet au raison d\'atteindre une maturité optimale et lors des différentes vinifications d\'exprimer pleinement la typicité des cépages et du terroir.',1),(726,'DOMAINE DE SAINT BLAISE','Propriete de 40 ha dont 18 ha de vignes.\nAgriculture Biologique.\nPlus de 50% de biodiversite.\nMoitie AOC Languedoc, Moitie IGP 34 de zone\nCepages : Carignan, Syrah, Grenache, Merlot, Marselan.\nCave recente bien equipee.',1),(727,'Chateau Stony','Production de vin en Agriculture Biologique. Depuis récolte 2014, depuis 2011 en conversion',1),(728,'Clos Sorian','Clos Sorian est une  propriété de 7 hectares. située entre Sète et Montpellier, à Poussan. Ambitieux et Créatif Florent Granier, après 15 années au Chateau Labégorce Margaux rachète le domaine et élargit la gamme des vins. La production y est traditionnelle, respectueuse de l\'environnement afin de créer des vins au plus près du terroir languedocien. La gamme  s\'étant sur 6 cuvées et  4 appellations: \nAOC coteaux du Languedoc,   Grés de Montpellier , IGP Pays d\'Oc et  IGP Colline de La Mourre.\nLe Petit Caveau situé rue du Triolet, au coeur de Montpellier où  nous vous proposons de découvrir cette gamme au travers de dégustation tout au long de l\'année et d\'événement ponctuel.',1),(729,'Domaine Maspiquet','Dans un cirque naturel protégé par le relief dun plateau, le Domaine Maspiquet sétend aux portes de Montpellier depuis le XVIIe siècle.\n\nCoplanté sur 15 hectares en Chardonnay, Marselan, Cabernet Sauvignon, Syrah, Petit Verdot et Vieux Carignan, le domaine a pour philosophie de favoriser le développement harmonieux de la vigne afin délaborer des vins dune grande qualité et dune belle typicité. \n\nDans un souci permanent du respect de l\'environnement, du paysage et des Hommes, le domaine a vu croître sa surface menée en agriculture biologique d\'année en année pour atteindre aujourd\'hui plus de la moitié de sa production en bio ou conversion bio.\n\nLe Domaine Maspiquet est lexploitation pédagogique du lycée Frédéric Bazille - Agropolis. Il offre ainsi aux étudiants un espace dapprentissage et d\'observation des techniques vitivinicoles.',1),(730,'domaine souyris','le Domaine Souyris est en agriculture biologique, qui représente 20 hectares. IL se situe à saint Félix de Lodez, au nord-ouest de Montpellier. Au cur des terrasses du Larzac.',1),(731,'DOMAINE SAINTE CECILE DU PARC','DOMAINE VITICOLE - CAVE PARTICULIERE\nLe Domaine Sainte Cécile du Parc se niche au coeur du Languedoc, à Pézenas, à 25 km de la mer méditerranée. Le domaine s\'étend sur 15 hectares de vignes et d\'oliviers, un terroir exceptionnel que nous travaillons en agriculture et vinification biologiques.\n\nMots clefs : Audace; Authenticité; Excellence.',1),(732,'Domaine de Castelnau','Société de commercialisation des produits (vins), issue du Domaine de Castelnau.',1),(733,'Domaine des 4 Rodes','Sur les coteaux qui surplombent le village de Thézan lès Béziers, Nadine et Gilbert Querelle conduisent avec passion leur Domaine des 4 Rodes selon les règles de l\'Agriculture Biologique.\nFort d\'un siècle de tradition Vigneronne dans la famille, ce vignoble a toujours été porté par les valeurs de respect de la vie des sols et des équilibres de la vigne grâce à des interventions raisonnées.\nDes rendements sages, une vendange entièrement manuelle associée à un tri rigoureux permettent une bonne mise en valeur des 5 hectares de vignes.\nAfin de laisser le terroir et le fruit s\'exprimer au mieux, les parcelles sont toutes vinifiées séparément. Ainsi, les vins se distinguent par leur personnalité, leur intensité et leur concentration, ils dégagent avec justesse les atouts de leurs cépages ...',1),(734,'Domaine du Pech d\'André','Des vins de terroir à l\'âme rurale et joyeuse !\n\nDans un paysage typique du Languedoc, une allée d\'oliviers centenaires vous conduit au Pech. Depuis 1701, dix générations de la famille d\'André accompagnent ce lieu au naturel dans l\'expression de son terroir.',1),(735,'mas gabriel','Domaine viticole établi en 2006, sur 6 ha de terroir magnifique à Caux, Pézenas. Nous produisons des vins en AOP Languedoc, Languedoc Pézenas et IGP Hérault, tous certifié bio.',1),(736,'Domaine de Cadablès','Domaine de Cadablès . Vigneron independant\n\nNous produisons sur notre domaine des vins de qualité sur les trois couleurs en pleine nature, dans un site unique.',1),(737,'Clos des Nines','Le Clos des Nines est une petite exploitation de  10 hectares de vignes et doliviers nichée dans la garrigue entre Montpellier et Sète.Première vendange en 2003 . Le nom est un clin dil à mes 3 filles  Nines en Langue doc.',1),(738,'domaine de mujolan','Le domaine de Mujolan exploite 80 hectares sur la commune de FABREGUES situés dans la plaine littorale du bassin de Thau.\nLa famille BOUTONNET vous attend pour découvrir une large gamme de vins de pays d\'oc et vins de pays des collines de la Moure ainsi que des jus de fruits produits sur le domaine.',1),(739,'LES COMBES','La Combe Blanche, petit domaine de 12 ha, cree a partir 1981 par Guy Vanlancker, qui s',1),(740,'MAS DE JANINY','Fin des annees 80 Thierry et Pascal reprennent la propriete familiale et passent de suite en BIO. Depuis 2 ans Xavier (le fils de Pascal) apporte son dynamisme et savoir faire.\nLes vignes sont situees au milieu des garrigues sur un terroir argilo-calcaire. Chez nous pas de soucis de rendement, la vigne ne produit que ce qu\'elle peut murir dans un parfait equilibre en harmonie avec la nature qui l\'entoure.\nLes vins : une palette aromatique puissante et complexe.',1),(741,'Terra Soleilla','Un petit rendement 28 HL/Ha pour une concentration optimum des arômes; Méthode de vinification Vendanges manuelles. Récolte en petites caisses pour respecter le raisin. r La vigne est conduite en agriculture Biologique et Bio-dynamique. Contrôle ECOCERT sur des coteaux et sur des graves .Ici tout est blanc et anguleux. Terroir exceptionnel pour un vin de qualité.',1),(742,'DOMAINE LA COLOMBETTE','Créé à la fin du XIXème siècle par Louis PUGIBET, le Domaine la Colombette a été transmis de génération en génération depuis plus dun siècle. Situé dans le Sud de la France, au Nord de Béziers, sur des coteaux dominant la vallée le petit fleuve côtier du Libron, il bénéficie dun emplacement privilégié.',1),(743,'DOMAINE D AGEL','Le Domaine d\'Agel est la fusion passionnelle d\'un terroir exceptionnel de grande diversite et d\'hommes amoureux de la vigne et du vin.\nOn y elabore avec passion des vins tout a la fois plaisants, soyeux, riches de caracteres, issus de cepages uniquement meridionaux, gaves de vent, de soleil et de plaisir.',1),(744,'PRIEURE SAINT SEVER / MAS GABINELE','MAS GABINELE est un domaine viticole de 20 hectares situe sur la commune de Laurens au cur de lappellation Faugeres.\nLe sol est constitue de schistes greseux. Il sagit de sols tres pauvres, donnant de faibles rendements : la production oscille suivant les annees entre 20 et 25 hectolitres par hectare en moyenne.\nLa conduite du vignoble respecte au maximum les equilibres naturels suivant les principes de la lutte raisonnee.\nLes vendanges sont manuelles avec tri a la parcelle de raisins tres murs.\nLes macerations sont longues, entre 20 et 30 jours suivant les cuvees.\nLes vinifications sont conduites en douceur pour eviter des extractions trop fortes, lobjectif etant de produire des vins « aimables » : agreables, fruites avec des tannins souples et ronds et cependant de bonne garde.\nNotre philosophie consiste a produire peu mais bon. La qualite est ici une obsession, ce qui nous oblige a ameliorer sans cesse notre travail, du vignoble a la cave.',1),(745,'Ermitage du Pic Saint Loup','Domaine familial situe en Pic St Loup.',1),(746,'Chateau Beaubois','Domaine familial créer au XIII siècle par les moines cisterciens de l\'abbaye de Franquevaux\nActuellement dirigé par Fanny et françois Boyer, frere et soeur, ils appliquent l\'agriculture Biologique depuis 2009',1),(747,'Domaine Du Grand Chemin','Au pied des Cévennes, le Domaine du Grand Chemin est exploité par la même famille, de pères en fils depuis plus de 300 ans.\nAvec un climat particulier, des journées chaudes et des nuits fraiches, Emmanuel et Jean-Marc FLOUTIER vous propose des vins fins et élégants en rouge, rosé, blanc, à bulles ou tranquilles et vendanges automnales.',1),(748,'Condamine Bertrand','Autour du splendide château du 18ème siècle, le vignoble sétale sur les pentes douces dune des plus exceptionnelles formations géologiques de la façade méditerranéenne. Baignant dans un climat privilégié, ce terroir exclusivement constitué de cépages en parfaite adéquation avec lui, confère aux vins, lélégance inimitable des plus beaux vins du Languedoc. Sur ce terroir ont prospéré : Syrah, Grenache, Mourvèdre, Merlot, Petit Verdot, Cabernet-sauvignon, Marselan  Clairette du Languedoc, Viognier, Roussanne & Sauvignon.\nA la Condamine Bertrand, technologie et tradition se conjuguent au présent et au passé pour enfanter des vins davenir les plus respectueux qui soient de leur noble origine.\nTant à la vigne par une culture raisonnée et respectueuse du sol, quau chai, par des vinifications soignées et par un élevage adapté, tous les moyens sont mis en uvre pour exalter la typicité de chaque cépage. Aux récoltes manuelles et mécaniques sajoutent le travail de lhomme et la passion dune famille.',1),(749,'Château Le Bouïs','Aux portes du massif de la Clape, le Château le Bouïs ouvre ses portes depuis près de 300 ans.\nLa Clape, petite île de lépoque Gallo Romaine qui sest attachée au continent, a plus de 2000 ans de savoir faire dans lart  vigneron.\nLa qualité de ses terroirs et de ses vins lui valent une réputation\ninternationale.\nCest à lorée de ce site exceptionnel, sur le remarquable terroir appelé Corbières Méditerranée, que les 49 hectares du domaine Château le Bouïs sont implantés, exposés au sud, face à la mer.',1),(750,'Chateau Saint Andre','Le long du delta du Rhône, là où les collines de la terre se tournent déjà vers la mer, les vins du vignoble du Château Saint André sépanouissent en dominant la Camargue. Situé en pleine costière sud, le Château est constitué de galets roulés par le Rhône et offre à la vigne des conditions idéales afin de produire des vins de qualités ronds et équilibrés. Une vinification traditionnelle alliée aux techniques les plus modernes  de lnologie garantit à nos vins une parfaite harmonie.\n\n\nSoucieux du respect de lenvironnement, le vignoble a signé une chartre environnementale, impliquant la lutte raisonnée, lenherbement naturel, et la plantation de haie pour lutter contre les incendies. Le Château sest muni de sa propre chaîne dembouteillage, assurant ainsi une parfaite traçabilité de ses produits.\n\n\nLes meilleurs vins sont élevés en barrique, de 9 à 18 mois, ce qui permet de développer leurs arômes et den affiner les tanins. Nourris par la générosité du climat, les fruits drapent avec force et élégance un art de la mise en fête et des arômes.\n\n\nLe Château Saint André est une propriété familiale depuis 1974, elle est exploitée aujourd\'hui par Philippe GUICHARD qui vient d\'être rejoint par Cyril, Alexandra ses enfants et Jackie. Il sétend sur une superficie de 140 hectares. Le vignoble crée en 1929 est composé par les cépages typiques de nos différentes appellation à savoir Grenache, Merlot, Cabernet, Syrah, Chardonnay, Ugni Blanc,  Roussanne, Role.\n\nLe Château compte trois appellations : Vin de Pays du Gard , Vin de Pays doc, Costières de Nîmes.',1),(751,'CHATEAU DU GRAND CAUMONT','Le Château du Grand Caumont, situé en plein coeur des Corbières sur l\'emplacement d\'une ancienne villa romaine est exploité par Laurence Rigal qui y élève avec passion des vins fruités, épicés, rond et soyeux.\nNous serons heureux de vous y accueillir pour une visite de la Tour de la Noria et de la Cave ou une simple dégustation de nos cuvées de Corbières et vins de pays.',1),(752,'sainte marie des crozes','Des artisans du vin a l\'imagination debordante dont les noms de cuvees appellent le reve; Les mains sur les Hanches, Premiers Pas sur la Lune, Les pipelettes...',1),(753,'Château Les Cèdres de Robert','L\'allée des Cèdres de Robert impose sa silhouette majestueuse sur des terres héritières d\'une culture plus de deux fois millénaire.\n\nLe vignoble est situé sur un plateau de graves sablonneuses entre la montagne noire et les Pyrénées qui dessinent lhorizon ; les vins issus de pratiques raisonnées et de vignes à faibles rendements illustrent parfaitement l\'alliance de la chaleur méditerranéenne et la structure du sud ouest.\n\nPersuadés que les grands vins se préparent dans un premier temps à la vigne, toute l\'énergie des vignerons est réservée à lui prodiguer les meilleurs soins et à préserver l\'équilibre de ce terroir. Chaque parcelle reçoit des soins adaptés en fonction de la nature même du sol, des conditions climatiques ou encore du choix de la taille pratiquée afin d\'obtenir une qualité optimale des baies de raisins et de les amener jusqu\'à une maturité parfaite.',1),(754,'Domaine Pain De Sucre','Domaine viticole de 28ha au bord du canal du midi.\nVigneron independant, vente en bouteilles vin rouge blanc et rose et vente en cuve au negoce.',1),(755,'Les Coteaux Du Minervois','Les coteaux du Minervois  regroupent 205 adhérents cultivant un vignoble de 1500ha.\nLa diversité de sols qui le compose donne à nos vins le caractère et lauthenticité de notre terroir. \nNotre gamme de vins se décline avec différentes appellations telles que : A.O.P Minervois, Cru La Livinière, IGP dOc  et Agriculture Biologique.\nMédaillés régulièrement au  Concours Général Agricole, au  concours des féminalises, ainsi quau concours de la coopération Languedoc-Roussillon, nos vins ne laissent pas indifférent.\nSoucieux de lenvironnement, nos viticulteurs sont engagés dans une démarche de conduite raisonnée de la vigne répondant aux exigences des référentiels « qualité environnementale »et Fair choice (choix équitable par référentiel allemand).\nNotre challenge est de conjuguer lamélioration continue de notre processus de vinification et le respect de la nature.',1),(756,'Clos De L\'amandaie','Le domaine du Clos de l\'Amandaie est situé à 25km au nord ouest de Montpellier sur les pentes argilo-calcaires du causse d\'Aumelas en zone d\'appellation côteaux du Languedoc et Grès de Montpellier.\n\nDepuis 2002 Stéphanie et Philippe Peytavy ont usé de leur passion, de leur créativité pour élaborer toute une pléiade de crus parmi les plus singuliers du Languedoc.\n\nEn effet, l\'association d\'un terroir bénéficiant d\'un micro climat spécifique révélateur d\'arômes élégants et complexes donnent au clos de l\'Amandaie une identité à part.',1),(757,'Domaine de Puilacher','Domaine familial de 38 ha exploité par la famille FAGES depuis plusieurs générations .\nIl tient son nom du village éponyme perché sur les contreforts de la Vallée de l\'Hérault .Les vins fins et élégants du domaine sont l\'expression d\'un terroir typiquement méditerranéen .Nos cuvées en blanc , rouge et rosé sont maintes fois reconnues dans les concours régionaux , nationaux et internationaux.',1),(758,'Domaine La Grange','Le Domaine La Grange c\'est plus de 50 hectares de vignes dans la vallée paradisiaque entre les pittoresques villages de Gabian et Fouzilhon. Nous sommes membres Terra Vitis, preuve de notre engagement pour préserver notre superbe planète et en particulier le terroir extraordinairement riche où nos vignes sont plantées. Nous avons fait beaucoup d\'effort pour restructurer chaque parcelle de vigne depuis le rachat du domaine en 2007 et depuis 2015 nous avons une superbe nouvelle cave en pierre de taille. Un bâtiment à la fois moderne, pratique et impressionant où nous recevons pour des dégustations au caveau dans un cadre exceptionnel!',1),(759,'CAVE DES VIGNERONS DE SAINT JEAN DE  SERRES','CAVE COOPERATIVE VINICOLE AVEC CAVEAU',1),(760,'Maison Ventenac','Logee au cur du Cabardes, dominant la Cite de Carcassonne, exposee plein Sud  et face aux Pyrenees, la Maison Ventenac couvre 130ha de vignes exploitees. Notre philosophie a toujours ete de desacraliser le vin. Nous luttons pour que le plaisir simple de boire un canon reste accessible a tous, sans chichi ou surenchere.',1),(761,'DOMAINES JULIEN ET FILS','La Sarl DOMAINES JULIEN & FILS commercialise les vins des domaines de la famille JULIEN, le Domaine de BACHELLERY a Beziers, et le CHATEAU DE MUS a Murviel les Beziers (Vins de Pays d\'Oc et AOP Languedoc, en blancs, rouges et roses)',1),(762,'LES VIGNERONS DE BARJAC','La cave , situee entre le nord du Gard et Le sud ardeche , produit en moyenne 20.000 hls sur 300 ha de vins de ce cepages et appellation Cotes du Vivarais.',1),(763,'CAVEAU D\'HERACLES','Héraclès compte 800 hectares de vignoble autour de Vergèze dans le Gard dont 75% en Agriculture Biologique.',1),(764,'Domaine de Daurion','Domaine familial de 60 hares dun seul tenant en cave particuliaire depuis plus dun siècle, coulée de basalte et terroir villa franchien, bercé pour les vents de la méditerranée amène fraicheur et complexité aux multiples cépages pour des cuvées en pays doc et en coteaux du languedoc et aux méthodes traditionnelles.',1),(765,'Domaine de Nizas','Le Domaine de Nizas fut acheté en 1998 par John Goelet, descendant dune famille de négociants à Bordeaux. Dès 1970, sa passion pour les grands vins et son esprit pionnier lont conduit à créer quatre autres domaines : Clos du Val en Californie, Taltarni Vineyards, Clover Hill et Lalla Gully en Australie. Aujourdhui, Goelet Wine Estates commercialise lensemble des vins de ces domaines qui expriment chacun leur terroir respectif.\nNous nous attachons à créer de grands vins méditerranéens, qui reflètent lextraodinaire terroir de Pézenas en Languedoc.\nConçus dans le respect total de leur environement naturel, nos vins montrent une grande complexité, élégance et fraîcheur qui révèlent harmonieusement les saveurs des meilleures cuisines du monde.',1),(766,'Chateau Saint-Benezet','Le Chateau Saint-Benezet est une exploitation viticole familiale appartenant aux familles Soulairac et Bosse-Platiere depuis 1999. \nSituee dans le Sud de la France, entre la ville historique de Nimes et la Mer Mediterranee, ses vignobles sont implantes sur la commune de Saint-Gilles, a lextremite Sud de la Vallee du Rhone.\nSon terroir de « gress », galets siliceux roules deposes par le Rhone, son exposition sur des coteaux en pente douce a proximite des etangs de la Camargue et de la mer, son climat mediterraneen ensoleille et le souffle du Mistral en font un vignoble dexception. \nAu fil des annees, lexploitation sest considerablement agrandie grace a  un important programme de restructuration et lacquisition de nouvelles proprietes dans les terroirs les plus qualitatifs de la region. Les vignobles de Silex et Fonteuil sur la commune de Gallician, de Haut-Broussan et des Aveylans sur celle de Bellegarde ainsi que le Chateau Bellefontaine, propriete de 66 ha dun seul tenant situe a Franquevaux, ont tour a tour ete acquis.\nAujourdhui, lensemble des Vignobles Saint-Benezet, diriges par Yann Soulairac et Elise Bosse-Platiere, setendent sur plus de 200ha integralement cultives en agriculture raisonnee « Terra Vitis ». \nLe developpement a ete tout aussi considerable au niveau de la cave avec lextension de la cuverie et lacquisition de materiel de vinification performant afin dassurer la qualite optimale de nos vins.\nSuivant le cepage, le terroir, le mode de vinification et delevage, nos vins sont degustes, selectionnes et assembler afin de realiser nos differentes cuvees en AOP Costieres de Nimes et IGP Pays dOc.\n Enfin commercialement, les ventes se sont considerablement developpees et ce sont aujourdhui quelques 800 000 bouteilles par an qui sont conditionnees par nos soins avant detre distribuees dans une 20aine de pays a travers le monde.\nEntre tradition et modernite, nos vins, a la fois intenses et fruites, vous accompagneront en toutes occasions pour un moment de plaisir a partager avec vos proches.',1),(767,'Domaine De Cébène','Domaine de Cébène, un vignoble aux terroirs étonnants ! Conquise par le potentiel et les promesses des schistes, Brigitte Chevalier fait lacquisition de ses premières parcelles de vigne en 2007, à Faugères, au cur du Parc Naturel Régional du Haut-Languedoc.\n\nDès le tout premier millésime, le style et la délicatesse des vins\nont conquis les meilleures tables.',1),(768,'MAS PELLIER','A COMPLÉTER',1),(769,'DELTA DOMAINES','exportateur depuis 30 ans',1),(770,'CHEVAL QUANCARD','Viticulteur et négociant-éleveur depuis 1844, \nCheval Quancard sélectionne, vinifie et élève avec la plus grande exigence les meilleurs cru des vignobles bordelais.',1),(771,'Domaines Paul Mas','Les domaines Paul Mas sont les ambassadeurs du Luxe Rural,\nun style de vins et de vie à la française signés Jean-Claude Mas.\nNos vins sont issus de nos vignobles situés dans les meilleurs crus du Languedoc et sur les coteaux des cinq principales vallées de la région.',1),(772,'BADET CLEMENT','BADET CLEMENT est spécialisé dans la production et la commercialisation de vins de marques et de domaines issus principalement du Languedoc, de Bourgogne et de la Vallée du Rhône.\nFondée en 1995 par Laurent et Catherine Delaunay, la société est notamment connue pour sa marque phare « Les Jamelles » et sa signature haut de gamme « Abbotts & Delaunay ».',1),(773,'DOMAINE LA PROVENQUIERE','Ce château, datant du 15ème siècle, appartient à la famille Robert depuis 1954.\nLe vignoble, dune superficie de 155 hectares, est reparti sur 3 communes.\nLencépagement permet lélaboration dune large gamme de Vins de Pays dOc, en blanc, rosé et rouge.',1),(774,'Domaine Les Quatre Amours','Nos quatre amours s\'appellent Paul, Olga, Louis et Rose. Ils ont inspiré le nom de notre domaine qui a vu naître quatre générations de vignerons. Implantées au 19ème siècle sur un terrain de vins de pays à Bélarga et d\'AOC à Aspiran dans l\'Hérault, les vignes font partie du patrimoine de la famille. Nous avons choisi de perpétuer la tradition sur les 18 hectares. Le domaine Les Quatre Amours était né, prolongeant ainsi l\'aventure humaine et familiale où chacun quel que soit son âge participe à la création d\'un vin de conviction\nDepuis 2018, nous sommes engagés dans la conversion à l\'agriculture biologique.',1),(775,'MAS ONESIME','Le domaine Mas Onésime est situé à La Liquière, un hameau de la commune de Cabrerolles.\nC\'est 7 Ha de vignes vinifiées à la propriété depuis 2011.',1),(776,'Domaine Jones','Vieilles vignes des cépages traditionnel',1),(777,'Calmel & Joseph','Fondee en 1995 Calmel & Joseph est une maison de negoce specialisee dans les vins du Languedoc Roussillon issus de caves particulieres reparties sur lensemble du territoire. Nous avons developpe patiemment des relations privilegiees avec un grand nombre de viticulteurs de toutes appellations. Convaincu du potentiel extraordinaire de cette region, Laurent Calmel, nologue et Jerome Joseph vinifient, assemblent et elevent lensemble des vins avec la volonte commune de prouver la qualite unique et trop meconnue de ces terroirs mediterraneens. Outre le desir de produire des vins de grande qualite en adequation avec leurs terroirs, nous sommes tres attaches a vinifier selon nos convictions et notre experience.',1),(778,'les vignerons de Montblanc','Fondée en 1937, la cave coopérative \'Les Vignerons de Montblanc\' a été inaugurée en 1939 par Albert Lebrun, Président de la République.\nL\'aire d\'apport de la cave prend en compte les communes de Montblanc, St Thibéry, Nézignan l\'évêque et les communes limitrophes. Le vignoble s\'étend sur 1700 hectares environ, avec une forte proportion de cépages permettant la production d\'IGP Oc et Côtes de Thongue.',1),(780,'domaine Gayda','Situe sur les premiers contreforts de la Montagne Noire, a quelques kilometres au nord de la cite de Carcassonne, le Domaine de Cazaban s\'etend sur plus de 20 Ha de vignes conduites en agriculture biologique depuis 2010 et biodynamique depuis 2013. Il offre un terrain d\'expression exceptionnel de par la variete de ses sols (argilo-calcaires et schistes), de ses cepages (merlot, cabernet franc, cabernet sauvignon, syrah, grenache, carignan, mourvedre pour les vins rouges et roses, roussanne, marsanne, vermentino, grenache gris pour les vins blancs) et de ses expositions (plaine, coteaux et montagne). Au Domaine de Cazaban, on elabore des vins elegants a partir de vendanges 100% manuelles.',1),(781,'MAS DES QUERNES','Ce vignoble d\'une superficie de 12 hectares peut être décomposé en trois parties : le plateau, des terrasses et la petite vallée. L\'ensemble est dominé par l\'imposant Mont Baudile qui tempère les excès climatiques.\n\nLes parcelles Ruches, Plan et Villa Romaine s\'étendent sur cinq hectares d\'un sol caillouteux. Le sous sol reste bien alimenté en eau. Les cépages mourvèdre, carignan, grenache se trouvent sur ce plateau, un terroir apte à exprimer leurs qualités.\n\nLes parcelles Nabout, Jumeaux, Levant, Ponant, Guinet, Grand Travers, Hermes et Cades se trouvent sur les terrasses étroites, nées de l\'effondrement du cône d\'épandage constituant le plateau.\n\nDes lentilles de galets siliceux et de marnes créent une hétérogénéité sur certaines de ces parcelles. Le cinsault y trouve sa meilleure place mais grenache et merlot s\'y comportent remarquablement.  \n\nSur les basses terrasses essentiellement constituées de marnes jaunes se trouvent les parcelles d\'En Bas, Feuilles Mortes, Poiriers, Blaireau et Armand. Nous compensons la vigueur plus grande de ces vignes par un enherbement raisonné.\n\nLes cépages merlot, carignan, syrah et Mourvèdre produisent des vins rouges fruités, plus légers.',1),(782,'DOMAINE LA JASSE D ISNARD','Le domaine, étendu sur 70 hectares dont 50 plantés en vigne , bénéficiant du label BIO, bénéficie d\'un terroir argilo calcaire et d\'un climat méditerranéen qui permettent aux cépages tels que merlot, cabernet-sauvignon, syrah pour les rouges et chardonnay pour les blancs de sexprimer pleinement.\nLa conduite de la vigne et la vinification seffectuent dans le respect de la charte de production biologique.\nUn personnel attentif et expérimenté apporte sa compétence tant dans les vignes que dans les chais.',1),(783,'cave du pays de quarante','cave coopérative vinification \n- vinification vins bio',1),(784,'TOP WINES LANGUEDOC','Notre societe distribue et elabore exclusivement des vins du Languedoc . Nous avons developpe une gamme complete et exclusive d\'IGP Oc mono cepages et bi-cepages et d\'AOP Languedoc, Saint Chinian, Coteaux du Languedoc, Cabardes.  Nous disposons d\'une quinzaine de marques et somme specialises dans les mises a facon sur site de production avec des partenaires vignerons.',1),(785,'Château De Flaugergues','Le Château de Flaugergues, se situe sur l\'un des 12 terroirs des Côteaux du Languedoc \'La Mejanelle\' dans la zone Grés de Montpellier.\nLe vignoble dune superficie de 30 hectares. Les Romains cultivaient ici la vigne et l\'olivier depuis plus de 2000 ans. Les Moines de GRAND MONT ont aussi entretenu ces cultures, ainsi que les ancêtres du propriétaire actuel depuis 1696 jusqu\'à maintenant.\nCe terroir d\'exception, composé de galets roulés \'les Grés\' (vestiges du Delta du Rhône) bénéficie d\'un climat méditerranéen sous forte influence marine.\nUn vignoble de 30 Ha marqué par la précocité des raisins sur lequel une palette harmonieuse de cépages donne naissance à un gamme riche de vins fins aromatiques. \n\n Le Château de Flaugergues, splendide  folie  du XVIII°, propriété du Comte et de la Comtesse Henri de COLBERT, se situe aux portes de Montpellier.\nCette propriété est à la fois une exploitation viticole et un site touristique, classé monument historique. Elle est habitée et animée par la même famille depuis sa création (1696).\n\nUne partie du domaine se situe aux abords de Montpellier sur l\'un des 12 terroirs des Côteaux du Languedoc \'La Mejanelle\', dans la Zone des Grés de Montpellier. Le vignoble dune superficie de 30 hectares.\n\nUne partie du vignoble (33 ha) est classée en Côteaux du Languedoc, terroir \'La Méjanelle\' dans la zone \'Grés de Montpellier\'.\nIl est marqué par la précocité des raisins sur lequel une palette harmonieuse de cépages donne naissance à une gamme riche de vins fins et aromatiques.\n\nLencépagement rouge comporte : grenache noir, syrah, mourvèdre, carignan, cinsault, merlot et cabernet sauvignon. Lencépagement blanc est composé de : grenache blanc, marsanne, roussanne, rolle et viognier.\nTous nos vins (soit 160 000 cols) sont mis en bouteilles au château par nos soins.',1),(786,'Chateau La Villatade','Le Domaine de La Villatade s\'etend sur 130 hectares d\'un seul tenant situes dans la partie Ouest du Minervois, a 15 Km au nord de Carcassonne, un site exceptionnel de collines de schistes, marnes et calcaires sur les contreforts de la Montagne Noire. \nEn 2016, les nouveaux proprietaires Richard et Sophie, passionnes par le developpement durable, ont souhaite que leur vignoble soit conforme aux principes de la biodynamie, une viticulture raisonnee, HVE3, propre et soucieuse de l\'environnement.',1),(787,'Domaines Pierre Chavin','Pierre Chavin est un jeune producteur de vins français basé dans le Languedoc Roussillon, présent dans les plus grands terroirs, leader dans linnovation dans le monde du vin. Forte dun record de croissance, la maison Chavin imagine et dessine des créations offrant des réponses élégantes, tendances et innovantes aux goûts des citoyens du monde.',1),(788,'Château de Raissac','Demeure familiale dexception au cur de son vignoble languedocien, le Château de Raissac vous offre des vins élégants dans un cadre unique. Situé, en Bas-Languedoc, sur les terrasses de Béziers, ce domaine viticole de 80 hectares est la passion de la famille Viennet depuis 1828. \n\nEn contrepoint de son caveau de dégustation et de ses caves, le Château vous ouvre ses chambres confortables dans une atmosphère artistique ainsi que des salles de réceptions haut de gamme pour lorganisation de séminaires ou dévénements privés.\n\nChâteau dhôtes dédié au vin, cette demeure familiale vit également au rythme de l\'Art depuis des générations. Aujourdhui, céramiste de renom, Christine Viennet a créé dans le prolongement de son atelier dart, un Musée de la Faïence et des Arts de la Table au sein des anciennes écuries et Jean Viennet, portraitiste plein de fantaisie expose ses peintures et fresques dans les salons du Château. \n\nLa créativité et lart de vivre de ce lieu vous séduiront.',1),(789,'Domaine du Bosc','',1),(790,'DOMAINE DES 3 ANGLES','Le Domaine des 3 Angles est une exploitation vinicole familiale créée en 1972 par Henri VABRE lorsque celui-ci sinstalle à Cazouls-lès-Béziers, dans le Sud de la France, pour reprendre les vignes cultivées par son père Louis et la cave de son oncle Georges.\nEn ces temps-là, lexploitation vinicole ne comptait que 12 hectares.  Depuis, Henri a travaillé sans relâche pour faire prospérer ses vignes et accroître ses terres. Aujourdhui,  le Domaine des 3 Angles représente près de 85 hectares de vignes situées tout autour du village de Cazouls-lès-Béziers en Pays dOc.\nToutefois, ce dur labeur ne fut pas accompli seul. Henri est rejoint en 2001 par son fils aîné Vincent puis par sa plus jeune fille Solange en 2007. Ces derniers reprennent les rennes du Domaine et permettent dassurer la relève.\nSolange & Vincent, toujours soutenus par leur père, se lancent dans une agriculture plus raisonnée. Ils modernisent leurs caves qui datent du début du XXe siècle en veillant à préserver leur cachet dantan. Ils améliorent les méthodes de vinification tout en respectant le savoir-faire de leurs anciens et initient la vente en bouteilles du vin du domaine.\nEn 2018, Solange & Vincent ont la possibilité de rénover une vieille maison attenante à leurs caves dans l\'idée d\'en faire un caveau de dégustation. Il leur tenait à coeur que l\'histoire reste familiale, c\'est pourquoi ils songent à leur soeur Agnès pour s\'occuper de la vente des bouteilles et la dégustation. Depuis, on peut rencontrer presque tous les descendants d\'Henri Vabre sur le Domaine situé sur l\'avenue principale du village de Cazouls-les-Béziers.\nEn 2019, l\'exploitation obtient la certification Haute Valeur Environnementale (HVE) qui confirme leurs efforts et leur volonté de travailler dans le respect de l\'écosystème environnant, de renforcer la biodiversité et d\'avoir un cheminement technique à la vigne comme à la cave pour s\'adapter aux exigences environnementales.',1),(791,'Chantovent','Chantovent a été créée en 1953. Depuis 1993, nous appartenons au monde de la production viti-vinicole au sein du Groupe Jean d\'Alibert. Nous possédons 6 caves, 17 Domaines et Châteaux et 6 000 hectares de vignes. Spécialiste des vins du Languedoc, la stratégie de notre entreprise est avant tout de développer, dans un concept \'Terroir\', des marques fortes en IGP et AOC. Chantovent est le 1er producteur de Coteaux de Peyriac IGP avec 90% de la production, et est également le 1er producteur de Minervois avec 35% de l\'appellation du même nom.',1),(792,'Compagnons de Maguelone','Retrouvant la vocation millenaire de cette terre d\'accueil et d\'hospitabilite, L\'association Les Compagnons de Maguelone permet aux personnes accueillies dans son Etablissement et Services d\'Aide par le Travail, de mener une vie active partagee entre l\'exploitation du domaine viticole, la conchyliculture, la peche et un riche eventail de prestations de services.\nLe vignoble du Domaine de Maguelone s\'etend au pied meme de l\'ancienne cathedrale de Maguelone, monument prestigieux, temoin depuis le Moyen Age de l\'histoire du Languedoc.\nLes Compagnons elevent, sur un terroir original compose de tuf volcanique, des vins elegants et aromatiques, nes de cepages nobles, pour le plaisir de votre palais.\nDes vendanges exclusivement manuelles, des operations culturales respectueuses de notre environnement exceptionnel, contribuent a la qualite constante et reconnue de nos vins certifiee BIO.',1),(793,'Terre des Dames','Terre des Dames est une domaine du 18eme siecle sur les coteaux au nord de Beziers.  Les 14 hectares a bas rendements sont entierement vendanges et tries a la main. Viticulture Biologique depuis 2009. Les vins de Terre des Dames sont connus pour leur purete, concentration, et surtout pour leur fraicheur peu commune pour la region.',1),(796,'DOMAINE DE LA CONSEILLERE','Le Domaine de La Conseillere est etroitement lie a lhistoire du Chateau de Lavagnac. Il appartient a la meme famille depuis 1912. \n\nDates au Domaine de La Conseillere :\n\n1926 : Prix de linnovation de La Chambre de lAgriculture\n2002 : Les vins du Domaine de La conseillere sont « IGP »\n2011 : Mise en place de 690 m2 de Photovoltaique pour produire de lelectricite\n2013 : Le domaine de la Conseillere debute sa presence sur les salons et foires aux vins\n\n2014 : \n-	Le Domaine de La Conseillere devient une etape accueil des campings car de France Passion\n-	Le Domaine de La conseillere sassocie aux vignerons independants pour organiser un pic-nique et accueillir les passionnes.\n\n2019 : Le domaine devient HVE 3 (Haute Valeur Environnemental)\n\n2021 : Le domaine est en cours de transformation. Nous sommes en Terra Vitis.',1),(797,'Domaine Sesquieres','Il s\'agit d\'un domaine familial depuis 5 generations idealement situe  a 20km de Carcassonne au coeur du Cabardes.\nLe vignoble est tres bien isole au centre du domaine entre garrigue et foret de chenes verts.',1),(798,'VIGNOBLES BONFILS','LES VIGNOBLES BONFILS sont une entreprise familiale, vignerons depuis 6 generations, proprietaires de 17 domaines et chateaux, soit 1600 hectares, en Languedoc-Roussillon dont un dans le Bordelais. Le cur de metier est la culture de la vigne et l\'elevage du vin puis la mise en bouteille et la commercialisation en France et a l\'Export.',1),(799,'LES VIGNOBLES MONTAGNAC','Situe au cur historique du Languedoc, les Vignobles Montagnac sont producteurs de vin depuis 1937, 400 vignerons issus de 8 communes cultivent 2 000 ha de vignoble.\n Les Vignobles Montagnac sont bordes au sud par l\'etang de Thau, celebre pour la finesse de ses huitres et la mer mediterranee, des reliefs calcaires au nord dans lequel le fleuve Herault a creuse des gorges profondes.\n Le vignoble s\'etend au sud de Montpellier, sur les coteaux qui dominent la vallee de l\'Herault et le littoral mediterraneen.\n \nNos vins etaient exportes vers la Rome antique comme en atteste le sceau MAF retrouve sur les amphores de la Villa Loupian dont les mosaiques sont exposees dans un musee de site situe au coeur des Vignobles Montagnac.\n Les vignerons perpetuent la mise en valeur de leur patrimoine viticole ancestral par la mise en place de statues monumentales au cur des vignes et des paysages a decouvrir lors de votre visite dans nos chais. \n \n\n\nNotre metier : vous proposer des vins de caractere a travers notre marque M et nos assemblages Coteaux de Bessilles, vous proposer des vins modernes a expression de terroir en Appellation d\'Origine Controlees Languedoc.\n\nNotre metier : vous proposer des vins de caractere a travers notre marque M et nos assemblages Coteaux de Bessilles, vous proposer des vins modernes a expression de terroir en Appellation d\'Origine Controlees Languedoc et Picpoul de Pinet.\n\n Notre metier c\'est egalement repondre a vos attentes en vin non conditionnes, elabores, assembles et prepares a la mise en marche selon le degre de vos exigences.\n\n Une veille permanente des marches, une equipe de haut niveau d\'exigence et de technicite, nous permet d\'etre reactif, au plus pres de vos besoins europeens ou mondiaux.',1),(800,'DOMAINE DE FAVAS','Le Domaine de Favas est un domaine viticole familial depuis plus de 22 generations. Nous sommes deux freres a travailler les terres et a vinifier, Geoffrey et Samuel Masse. Nous avons converti en 2018 l\'ensemble du vignobles a l\'Agriculture Biologique. Nous sommes sur un Terroir en AOP Languedoc, principalement constitue d\'eboulis calcaires et d\'argiles, et en IGP Pays d\'Oc, en zone de Garrigue entre le Cevennes et la Mer Mediterranee .',1),(801,'Savary De Beauregard','Domaine viticole de 21Ha en AOC Picpoul de Pinet et IGP OC.\n7 cepages y sont cultives ; elevage en cuve ou futs - nous proposons des vins en mono-cepage ou en assemblage. 10 vins peuvent etre degustes dont certains sont de vieux millesimes.',1),(802,'Les Vignerons de Saint-D','La Cave Coopérative de Saint-Dézéry c\'est 90 ans d\'histoire, et de passion. Ce sont 4O vignerons qui chaque jours travaillent leurs vignes et permettent à leurs raisins de mûrir et de s\'exprimer pleinement une fois les vendanges faites et la vinification passée. C\'est aussi une équipe de techniciens respectueux des bonnes pratiques et à l\'écoute de leurs clients. C\'est, enfin, une cave aux produits reconnus par les différents concours régionaux et internationaux.',1),(803,'NATURA VINS ET TERROIR','Exploitation agricole sur 20 ha, une partie viticole et une partie arboricole. Cave particulière créée en 2004, nombreux vins médaillés et sélectionnés dans des guides. Nous organisons des manifestations au domaine autour du vin et des fruits.',1),(804,'DOMAINE DE MEDEILHAN','Acquit en 1890, Le domaine de Médeilhan reste toujours un domaine familial. \nDepuis 1999, Christine de Saussine, vigneronne confirmée, cultive ce domaine pour vous proposer une gamme de vins frais, fruités, certifiés TERRA VITIS qui sadaptent à toutes vos envies culinaires et festives.\n« Ces certifications nous confortent dans notre démarche.\nEn effet, respecter lHomme, la nature, pour donner naissance et proposer des vins sains et authentiques à nos consommateurs sont des valeurs qui nous défendons depuis près de 130 ans dans notre domaine familial ».',1),(805,'Domaine Lalaurie','Dans la famille Lalaurie, le vin est une passion qui unit authenticite et modernite\ndans le respect des traditions et du terroir. C\'est au coeur de la region Languedoc-Roussillon,\ndans l\'Aude, a Ouveillan , qu\'est implante le Domaine Lalaurie. En 1974 Jean-Charles Lalaurie a\ncommence a reencepager sur son vignoble des cepages tels que Cabernet Sauvignon,\nCabernet Franc, Merlot, Syrah, Grenache, Marselan, Chardonnay, Sauvignon blanc... afin\nd\'obtenir des vins de qualite. Depuis 2007, la 10eme generation est a l\'oeuvre. Camille et\nAudrey, les soeurs jumelles, deux personnalites bien distinctes mais aussi tres complementaires,\nconjuguent dorenavant leur savoir-faire et leur energie toute neuve pour apporter leur touche\nparticuliere sur le domaine et optimiser un patrimoine que l\'intuition et le travail acharne de leurs\nparents, Jean-Charles et Catherine ont contribue a developper.Le Domaine Lalaurie couvre une\nsuperficie totale de 52 ha de vignes qui se repartissent sur differents types de sols. Ceci permet\nd\'obtenir des vins possedant des caracteristiques particulieres au lieu d\'implantation. Camille\nl\'oenologue, introduit des pratiques de vinification \'derniere generation\' visant a elever de\nnouveaux types de vins. Son objectif: enrichir la gamme tant en Pays d\'Oc qu\'en Coteaux de\nNarbonne. Audrey quant a elle, exerce ses dons dans le domaine commercial. Communication,\npackaging, export n\'ont plus de secrets pour elle. Le Domaine Lalaurie est present sur la plupart\ndes salons des vins des Vignerons Independants, Vinisud, et regulierement dans tous les pays\nou nos vins sont apprecies: Belgique, Angleterre, Irlande, Suisse, Allemagne, Pologne, USA,\nCanada.',1),(806,'DOMAINE SAINT ANDRE','. Au  cur  du  Languedoc, face  a  la  ville  de Sete  et  le   Mont   Saint   Clair,   berce  par   la Lagune de Thau,  le domaine de  Saint  Andre,  d une  superficie  de 40  ha  d un  seul tenant,  reunit    a    lui   seul   l  ensemble   des cepages  traditionnels  du  Languedoc (Cinsault,    Carignan,  Chardonnay,  Muscat, Roussanne, Vermentino, Viognier),  complete   par   des cepages bordelais, ( Merlot,  Cabernet  Franc).',1),(807,'Pierre et Nico','Pierre & Nico sont deux agronomes et',1),(808,'Vignoble Nicolas Therez','En 2008, Nicolas Therez prend la Direction du Vignoble familial, qui etait en cave cooperative, pour se mettre en cave particuliere afin de creer ses propres bouteilles. Viticulteur passionne, il se lance dans ce projet avec sa compagne, Amandine Caruso, qu',1),(809,'TERROIRS D&#39;OCCITANIE','T.O. Terroirs d',1),(810,'DOMAINE SAINT HILAIRE','Le Domaine d\'une surface de 76 hectares, dont 28 hectares de vignes, produit probablement du vin depuis l\'epoque romaine. Mais, c\'est au baron Hilaire Reynaud, un illustre heros et general dans l\'armee Napoleonienne, qu\'il doit son nom lorsqu\'il en fit l\'acquisition en 1817.\nFiers de leurs vins et de cette riche histoire les proprietaires, Betty et Patrick Martellucci, vous invitent a venir deguster leurs vins de nombreuses fois recompenses et a apprecier la beaute des lieux.',1),(811,'Domaine du petit chaumont','Vignerons indépendants dans la petite Camargue, \n120 hectares en bio.',1),(812,'MAS DE L\'ONCLE','Après une quinzaine dannée à silloner la France, Fabrice BONMARCHAND , ingénieur en bâtiment \nrevient vers ses origines, lui amoureux de la nature et du terroir pour donner une nouvelle impulsion au\nMas de lOncle. Cette exploitation familiale de 15 hectares crée en 2004.\nSitué à 20 kms au nord de Montpellier en plein coeur du Pic Saint Loup, nous serons heureux de vous \naccueillir afin de vous faire partager notre passion.',1),(813,'Villa Dondona','Sur le Chemin de Saint Jacques de Compostelle , à la sortie du hameau du Barry à Montpeyroux vous pouvez vous arrêter chez André Suquet et Jo Lynch , vignerons . Ils habitent le vieil Hôpital du 14° siècle derrière l\'Eglise . En 2000 Ils ont implanté à VILLA DONDONA : 5,5,ha de vignes originales sur 15 ha de garrigue vierge . Les \'rouges\' Grenache , Syrah , Mouvèdre sont au ras du sol à 8000 pieds / ha ; le Vermentino est en pergola à 2,6 m de haut ! L\'année dernière ils sauvèrent de l\'arrachage 3,5 ha de vieilles vignes : Carigan , Cinsault et Grenache blanc . Ainsi leur gamme de rouge : OPPIDUM , DONDONA s\'enrichit d\'un rosé l\'ESQUISSE et d\'un blanc l\'ESPEREL ; \nJo Lynch artiste peintre participe à la création des vins et orne les bouteilles de ses oeuvres : un Zèbre , un Orang-Outang , des fleurs et des insectes méridionaux . André Suquet fut médecin , il veille à la production des raisins , l\' élaboration du vin et fait les choix agronomiques . Il a toujours réduit les traitements au minimum étant Bio sans le savoir ! Depuis 2 ans, il adhère à la charte bio. \nVILLA DONDONA cherche l\'harmonie entre : la terre / et les raisins , les raisins / et le vin / et les hommes qui le produisent et ceux qui le consoment . .',1),(814,'DOMAINE DU PIN','Le Domaine du Pin est avant tout une histoire de famille (3ème génération), chaque génération nouvelle ayant appris de la précédente les secrets de ce noble métier ; ce savoir- faire ancestral évolue, mettant à profit des techniques modernes pour renforcer et améliorer la culture de la vigne. C\'est dans le département de l\'Hérault, sur la petite commune de Moulès et Baucels dans l\'Hérault qu\'est situé le Domaine du Pin, sur les hauteurs des Terrasses du Larzac et aux limites du Pic-st-Loup. Le vignoble se situe au cur dun paysage varié entre montagnes et plaines. Dannée en année le vignoble se restructure en incorporant des cépages différents pour convenir aux goûts de chacun et réaliser des assemblages de qualité.  Les différents cépages utilisés tels que la Syrah, le Grenache ou le Chardonnay permettent d\'élaborer des vins de caractère.',1),(815,'CAVES DU MONT TAUCH','Située dans le Languedoc, au cur dun paysage surprenant entouré de montagnes majestueuses et de châteaux Cathares, la cave coopérative Mont Tauch produit ses vins depuis plus dun siècle.\n Mont Tauch est un vignoble de 1 250 hectares partagé en près de 5 000 parcelles réparties sur les villages de Tuchan, Paziols, Villeneuve-les-Corbières et Durban. Chaque village est reconnu pour son terroir et lauthenticité de ses vins.\nMont Tauch propose une large gamme de vins dAppellation dOrigine Protégée (Fitou, Corbières, Rivesaltes, Muscat de Rivesaltes) et de Vin de Pays (Vallée du Paradis, Vallée du Torgan) appréciés en toutes occasions. Ces vins reflètent lexceptionnelle richesse naturelle du paysage méditerranéen.',1),(816,'DOMAINE DE LA CADENETTE','Le domaine de la Cadenette est situé au sud des Costiéres de Nimes et s\'étend sur environ 60 hectares de vignes. Nous produisons à la fois des vins d\'appellation Costiéres de Nîmes, des vins de pays dOc et pays du Gard.',1),(817,'DOMAINE DE DONADILLE','Structure viti-vinicole avec 30 ha de vignobles, une cave particulière, un caveau de vente et une oliveraie.',1),(818,'CHATEAU DE MONTFRIN','Entre Languedoc et Provence, Montfrin, du latin Mons Fremens signifie \'montagne des bêtes sauvages \'parce que les animaux fuyant les inondations du Rhône et des gardons furieux, venaient s\'y réfugier. Aujourd\'hui d\'autre bêtes y vivent, certaines mêmes cultivent la vigne, l\'oliviers.\nNous avons créé en 1995 le moulin des ombres, sur le plateau des costières à Meynes et plantés depuis 15 ans des oliviers.\nEn 2011 nous avons eu la chance de pouvoir nous agrandir, juste à coté. La Cave... le domaine des captives, au bout du chemin, pour enfin élever notre vin.',1),(819,'Domaine PASTOURET','Exploitation familiale viticole.\nEn Bio depuis 1993.',1),(820,'Domaine de Poulvarel','Le Domaine de Poulvarel à Sernhac, proche du pont du Gard est un vignoble familial cultivé avec passion depuis plusieurs générations. Ce vignoble de la Vallée du Rhône, vous propose des dégustations de vins rosé, blanc et rouge en appellation Costières de Nîmes et Vins de Pays.\n\nIl est impossible de dissocier le Domaine de Poulvarel dElisabeth et Pascal Glas. Et pour cause, en 2004, alors que Pascal travaille dans des domaines viticoles depuis 25 ans, ils décident de créer leur cave particulière sur les terres familiales.\n\nCe qui pouvait paraître comme un pari fou à ce moment là, est à présent un pari bien défendu. Les millésimes du Domaine comptent parmi les vins primés de la région et sont remarqués par la presse spécialisée. Pascal a transmis sa passion du vin à Elisabeth et cest ensemble quils ont eu laudace de se lancer et la volonté de continuer. Ils ont su unir leur force, leurs différences, leur savoir-faire et proposent aujourdhui des vins dignes des meilleures tables.',1),(821,'Domaine des Clement','Située sur le plateau des costières de nimes , propriété familiale crée en 1938 sur une superficie plantée de 21 hectares en cépage syrah et grenache.\nla quatrième génération des Boucoiran à travers Benoite a pris la suite il y a 2 ans',1),(822,'Château d\'Or et de Gueules','Le Château d\'Or et de Gueules est né en 1998. C\'est le blason familial de Diane de Puymorin qui a donné ce nom original reflétant par ses couleurs la personnalité des vins qui y sont élaborés : L\'Or pour l\'ampleur, la richesse apportée par le soleil et la chaleur du Sud, et le Rouge (Gueules en vieux français) pour le caractère, la puissance et le gouleyant.\nLes vins du Château d\'Or et de Gueules \'ont leur propre griffe. Dans les trois couleurs, ils sont personnalisés, amples, subtils et prometteurs\'. Ce sont des vins de structure affirmée, qui s\'expriment sur l\'élégance et la finesse',1),(823,'SARL DOMAINE DES TROIS GALETS','Notre vignoble, situé dans la vallée du Rhône, s\'étend aux portes de la Camargue, à la limite ensoleillée entre la Provence et le Languedoc-Roussillon.\nIci les conditions sont idéales pour créer des vins d\'exception : les vignes du domaine, dans l\'appellation Costières de Nîmes, bénéficient d\'une situation exceptionnelle, a la fois géologique, géographique et climatique.\nAu Domaine de Calet, les hommes et les femmes, liés à leur terroir, sont animés par la volonté, l\'exigence et la créativité pour donner le meilleur.',1),(824,'Domaine Du Vistre','Situé dans l\'extrémité Sud du département du Gard, au centre d\'un triangle formé par les villes de Nîmes, Montpellier (Hérault) et Arles (Bouches du Rhône), Vauvert occupe une situation stratégique au cur même de la Petite Camargue.',1),(825,'DOMAINE TERRE DES CHARDONS','La famille Chardon, installe&#769;e sur la commune de Bellegarde depuis 1982, a de&#769;cide&#769; de planter ses premie&#768;res vignes en 1999. Vignoble de 9 hectares, se tenant autour du Mas et de lexploitation devolue au maraichage bio, le domaine Terre des Chardons produit des vins de temperament, sur la finesse et la fraicheur du sud en AOP Costie&#768;res de Ni&#770;mes et Clairette de Bellegarde.',1),(826,'Domaine la Réméjeanne','Le Domaine La Réméjeanne existe depuis 1960. Il est niché au milieu des bois et collines. Du vignoble en terrasses, il y est possible d\'admirer la vallée du Rhône et le Mont Ventoux.\n\nLe Domaine compte aujourdhui 38 hectares de vignoble, 2 hectares doliviers et 0.50 hectare de figuiers.\n\nLe travail des vignes seffectue dans le respect du sol. Les raisins sont récoltés manuellement afin de vous proposer un vin de caractère tout en fraîcheur et pureté du fruit.\n\nDepuis 2010, lensemble du Domaine est certifié Bio. Tous les millésimes depuis 2012 sont des vins biologiques.',1),(827,'Les Vignerons de Saint-Gély','Cave des Vignerons de Saint-Gely depuis 1925. Producteur de Vin de Pays, Cotes du Rhone,  Cotes du Rhone Village. Ouvert toute lannee. Degustation, Vente, Animations',1),(828,'DOMAINE DE MAGALANNE','Le Domaine de Magalanne, situé à Domazan dans le Gard (30), est une exploitation familiale spécialisée dans la production de Côtes du Rhône classés. Sur plus de 25 hectares, léquipe de passionnées récolte le raisin pour vous offrir des vins prestigieux rouges, rosés et blancs. Médaillés, nos vins accompagneront à merveille vos repas.',1),(829,'CHATEAU DES COCCINELLES','Cest à Domazan, entre le pont dAvignon et le Pont du Gard que vous découvrirez le Château des Coccinelles. Situé sur la route pourpre de la vallée du Rhône Méridionale, le Château des Coccinelles couvre 77 hectares sur un beau terroir de galets roulés exposé sud/sud-est et balayé par le mistral.\n\nDomaine converti en AB depuis plus de 40 ans.\n\nLa philosophie de la famille Fabre a toujours été de préserver au maximum lenvironnement. Ils seront les précurseurs de lAgriculture Biologique et de la notion de vin de terroir. Grâce à cette culture naturelle de la vigne et au travail précis du maître de chai le domaine produit une gamme de vins purs, gourmands et fruités, pour amateurs ou connaisseurs. Le Château des Coccinelles vous accueille tout lété de 9h à 18h\net se fera un plaisir de vous faire déguster sa large gamme de vins. Des blancs fruités et gorgés de soleil, aux rouges tout en rondeur et en souplesse, venez découvrir lensemble de nos cuvées tout en fraîcheur et en légèreté.',1),(830,'DOMAINE BRICE BEAUMONT','Domaine familial cree par mon arriere-grand-pere David, en 1909. Je represente la quatrieme generation de vignerons. Notre domaine produit ses vins sur 28 ha, en Lirac, rouge, rose, blanc, Tavel rose, Cotes du Rhone rouge et vin sans IGP rouge.\nNous vinifions en cave particuliere, et pratiquons l\'agriculture raisonnee. Une cuvee speciale a ete creee en hommage a notre aieul fondateur du domaine.',1),(831,'Domaine d\'Eujies','Propriété de 16ha, située à deux encablures du Pont du Gard. Historiquement apporteur en cave coopérative, le domaine né en 2016, avec lélaboration de cuvées atypiques, est issu de lassociation dun vigneron gardois, Jérémy et de Julie, originaire et sous influence des vins du Val de Loire. De cette union ressort des vins concentrés et ensoleillés, dans le même temps frais et gourmand.',1),(832,'DOMAINE DE CABASSE','L?origine du nom Cabasse est italienne : « Casa Bassa », « la maison sous le village ». C\'est bien le cas du Domaine de Cabasse, dont les vignes s\'étendent jusqu\'au pied de Séguret, l\'un des plus beaux villages de France. \n\nQuinze hectares de vigne, dont douze entourent comme une divine protection lhôtel  et la cave, et trois hectares que les plus courageux pourront découvrir à pied dans les montagnes qui surplombent Gigondas. Ces vignes recouvrent les appellations de Séguret, Sablet Côtes du Rhône Villages et de Gigondas A.O.C.\n\nLes racines du Domaine de Cabasse remontent vraisemblablement au 14ème siècle quand les Papes se succédaient à Avignon. Saint Quenin, Patron de la paroisse, a sans doute pu fouler nos vignes car dès son époque (Vème siècle) les vignes envahissaient déjà nos coteaux.\n\nNous menons ces vignes en culture raisonnée, respectueuse des rythmes de la nature, en observant attentivement avec notre équipe les évolutions des plantes exigeantes. Le mistral est un précieux allié pour lutter contre certains développements de maladies, ce qui nous permet aussi de rationaliser au strict minimum les apports extérieurs.\n\nSoleil généreux, terroirs sableux ou plus lourds, coteaux escarpés bien exposés se conjuguent pour amener à maturité chacun de nos cépages. Grenache, Syrah, Mourvèdre, Carignan, Clairette et Viognier, produisent un raisin sain de grande qualité, base nécessaire pour la vinification dun vin exceptionnel.',1),(833,'VIGNOBLES DAVID','Les VIGNOBLES DAVID, propriété de 54 hectares plantée en vigne et en olivier, sont une entreprise familiale créée en 1991.\nL\'intégralité du domaine, vins AOC et huile d\'Olive AOC sont produits selon les principes de l\'agriculture biologique certifiée. Les engrais organiques et les traitements bio, nous permettent de relever l\'expression de nos terroirs, de nos cépages rhodaniens, Notre travail à la vigne favorise la pleine maturité de nos raisins : haute surface foliaire, débourgeonnage sévère, effeuillage, récolte nocturne ou le matin, En cave, grâce à la maîtrise des températures, en vinification le profil des vins est sur l\'élégance et les tanins fins.Depuis cette année , les VIGNOBLES DAVID sont également propriétaire récoltant à Châteauneuf du Pape,',1),(834,'Domaine du Mas de la Baraque','Exploitation viticole de 20 hectares dont 14 en coteau sur la colline du Mont de Camp. Une partie , environ 4 hectares, est en culture  bio et classé en AOP duché d\'Uzès. Cette partie la est vinifié en bio au domaine.',1),(835,'CHATEAU CORRENSON','Notre château est situé à St Géniès de Comolas et s\'étend\nsur 70 hectares, dont une grande partie borde la propriété.\nVincent Peyre, Propriétaire Récoltant, représente la\ntroisième génération de sa famille à partager cette belle\npassion du vin au Château Correnson.\nDepuis près de 40 ans, l\'exploitation se modernise, sans pour autant tourner le dos aux traditions qui sont chères aux propriétaires. Respect, partage et volonté, trois maîtres mots qui illustrent la philosophie de notre domaine familial. L\'équipe du Château met tout en uvre pour proposer des vins de qualité d\'AOC Châteauneuf du Pape, Tavel, Lirac et Côtes du Rhône.',1),(836,'DOMAINE PELAQUIE','Au coeur des Côtes du Rhône Gardoises, venez découvrir notre vignoble, travaillé dans le respect de notre terroir depuis le XVIème siècle par la famille Pélaquié. Vous pourrez y déguster nos vins d\'appellations Village Laudun et crus Tavel et Lirac, dans les 3 couleurs.',1),(837,'SAS LES VIGNERONS DE TAVEL','Cave construite en 1937 dans un style provençal.\nElle est inscrite aux Monuments Historiques en 2013.\nLa Cave produit du Tavel, Lirac, Côtes du Rhône Villages, Cotes du Rhône et vin de pays d\'oc.\nDes journées d\'oenotourismes sont organisées ; vernissage, randonnée dans les vines, soirée musicale et portes ouvertes.',1),(838,'Chateau Auzias','Le vignoble du Chateau Auzias setant sur 140 ha en un seul tenant avec un encepagement tres diversifies. On y trouve des Merlot, Cabernet Franc, Cabernet Sauvignon, Grenache, Syrah, Cinsault, Chardonnay et Muscat Petit Grain. Le Chateau Auzias assure une culture de la vigne tres respectueuse de lenvironnement pour produire des vins de qualites.',1),(839,'CHATEAU DE BRAU','Brau, chateau vinicole, contemple la Cite de Carcassonne toute proche et une bonne partie des Pyrenees. Les batiments massifs de lexploitation et la grande cave fraiche de 1877 (a la charpente etonnante) sont au coeur du vignoble.\n\nCest en 1982 que Wenny et Gabriel Tari decident de reprendre une partie des terres qui appartiennent a la famille depuis les annees 60. Gabriel finit ses etudes de Droit et Wenny est archeologue de formation, mais ils sont bien determines a transformer ce domaine ou lon ne produisait traditionnellement que du vin de table rouge. Un vaste travail de fond est entrepris aussi bien a la vigne qua la cave. Plantation de nouveaux cepages et surgreffage ou arrachage des cepages peu qualitatifs, modernisation des equipements. En meme temps un travail  dinformation et formation, de reflexion, dessais et de multiples degustations est fait pour aboutir en 1989 a la reconversion a lagriculture biologique, controlee par Ecocert selon la toute nouvelle reglementation europeenne.  \nBrau compte aujourdhui 40 hectares cultives en agriculture biologique. Avec un encepagement tres riche: Merlot, Cabernet Sauvignon et Franc, Grenache, Fer Servadou, Egiodola, Cinsault, Syrah, Chardonnay, Roussanne et Ugni Blanc. Et plus recemment sy sont ajoutes: Petit Verdot, Viognier et Pinot Noir.\n\nLa cave est actuellement equipee dun materiel moderne  pressoir pneumatique, groupe de froid, egrappoir, cuves inox avec maitrise de temperature, climatisation  et dun chai a barriques qui nous permet de prolonger leffort apporte au soin de la vigne et de produire des vins toujours respectueux de la nature. Nous produisons une large gamme de vins en AOC Cabardes et Vin de Pays.',1),(840,'DOMAINE GALY','Le Domaine Galy, est niché sur un plateau recouvert de garrigue au cur du Cabardès, à une dizaine de kilomètres au nord de la Cité médiévale de Carcassonne.\nLhistoire du notre domaine commence en 1907, lorsque Auguste Galy, notre arrière-grand-père achète 7 hectares de vignes. Quatre générations plus tard, le domaine compte 110 hectares, dont 50 hectares sont consacrés à la culture de la vigne et 5 hectares à celle de la truffe. \nNos parents, Jean Michel et Bernard Galy ont façonné notre vignoble, et nous ont transmis, savoir-faire et passion. Depuis 2016, Yann, Loïc, Camille et Romain Galy, apportent une nouvelle dynamique. Installation en cave particulière, création dune gamme de vin et projet oenotouristique, le tout associé au diamant noir du Cabardès, la truffe.',1),(841,'Domaine de La Cendrillon','Installée depuis le XVIIème siècle à Ornaisons, petit village de lAude situé à une dizaine de kilomètres de lantique cité romaine de Narbonne, la famille Joyeux exploite en BIO un vignoble de 42 hectares. Situé sur les terrasses moyennes et hautes qui bordent l\'Orbieu, le Domaine de La Cendrillon, produit des vins rouges, blanc et rosé avec un souci extrême de recherche de perfection et délégance.',1),(842,'clos de l\'Anhel','Domaine créé en 2000, 10 ha, vins rouges où dominent le cépage des Corbières, le carignan; travail artisanal, attention particulière à l\'environnement de la vigne, vins biologiques ( c\'est logique )',1),(843,'Domaine La Bouysse','Pas dartifice, la vérité passe par la qualité\nCest au coeur des Corbières, entre Méditerranée\net Pyrénées, sur le terroir de Fontfroide (à 5 km de lAbbaye)\net de Boutenac, que sétendent les vignes du Domaine\nLa Bouysse à St André de Roquelongue.\nQuatrième génération dune famille de vignerons,\nMartine Pagès et Christophe Molinier, après avoir tous deux\nsuivi une formation doenologue, ont repris lexploitation\nfamiliale en 1996. Depuis, ils nont cessé de jouer la carte\nqualitative des Corbières.\nUne grande partie du vignoble est constituée de vignes âgées\nde 30 à 50 ans. Certaines atteignent même 80 à 115 ans.\nLe Domaine sest engagé, par conviction, en agriculture\nbiologique depuis 2010.\nToute l\'équipe du Domaine a pour philosophie le respect de la\nvigne et de l\'environnement. Nous sommes fiers de vous\nproposer des vins de qualité, frais et fruités, qui portent haut\nnos terroirs. Prenez plaisir à les découvrir et à les partager.',1),(844,'CHATEAU DE LILLE','Domaine viticole situé sur une presquîle méditerranéenne, sauvage et protégée, mariant garrigue, étangs et vignes, qui possède 50 ha de vignes et produit huit cuvées de vin (rouge, blanc, rosé)',1),(845,'CHATEAU SALVAGNAC','un travail d\'orfevre exalte à la perfection le terroir d\'exception du Chateau Salvagnac',1),(846,'Domaine de Fontenelles','Dans la famille depuis cinq generations, le Domaine de Fontenelles etend aujourdhui ses 40 hectares de Syrah, Grenache noir, Carignan et Mourvedre sur le terroir de lAlaric, en zone dAOP Corbieres et dIGP Aude Coteaux de Miramont. Fontenelles, cest une histoire de famille mais cest aussi la passion dun couple de vignerons resolument tournes vers lavenir. Guides par lamour de la vigne et du vin, la famille Tastu s\'attache chaque jour a allier culture dexcellence, respect de lhomme et de lenvironnement et demarche qualite.',1),(847,'Château de Saint-Estève','Situé sur le terroir de Boutenac aux sols argilo-calcaires peu fertiles et de galets roulés, au cur des Corbières, le Château Saint-Estève révèle la beauté et le charme dun paysage préservé.\nSes propriétaires, Eric Latham, petit-fils dHenry de Monfreid, et son fils David qui la rejoint dans laventure, exploitent leur vignoble avec passion, et mettent tout en uvre pour obtenir le meilleur de leur terroir.',1),(848,'LA CAVE DE GRUISSAN','La Cave de Gruissan est batie face l\'etang qui s\'etale au pied de la celebre Tour Barberousse. Elle regroupe 50 vignerons sur 280Ha et produit des vins rouges, roses et blancs au sein des Appellations d\'Origine Protegees Corbieres, La Clape et Languedoc. L\'ensoleillement exceptionnel et la faible pluviometrie en font un terroir ideal pour la vigne. Ces atouts et les soins apportes a la vinification nous permettent de proposer une large gamme de vins de qualite.',1),(849,'Chateau Ollieux Romanis - Artisans Partisans','A completerArtisans Partisans, c',1),(850,'Chateau Maylandie','Château Maylandie est un vignoble familial de 23 hectares, situé au coeur des Corbières, sur le Terroir de Boutenac, entre Carcassonne et Narbonne.Nous sommes Vignerons Indépendants et produisons des vins blancs, rosés et rouges en AOC Corbières et AOC Corbières-Boutenac (lun des rares crus du Languedoc). Nous cultivons nos vignes dans le respect de lenvironnement (Agriculture Raisonnée) et créons des vins de qualité régulièrement récompensés par les Guides et les Concours.Toute lannée, nous vous accueillons dans notre caveau de dégustation ; il est très facile daccès et se trouve à 4 km du péage de Lézignan (A61). Vous pourrez y déguster nos vins, acheter des produits régionaux et vous procurer un circuit pédestre pour vous balader à travers nos vignes et la garrigue, à la découverte du terroir de Boutenac ! Seul, en couple, entre amis, en famille, avec vos enfants, vous êtes les bienvenus au Château Maylandie !\nAu plaisir de régaler vos papilles !\nDelphine Maymil & Eric Virion, vignerons',1),(851,'DOMAINE LA COMBE GRANDE','Domaine familial de 80ha de vigne situé sur les commune de camplong d\'aude et Montlaur dans l\'Aude\nProduction de Vins : \nAOP Corbières rouge et rosé\nIGP Pays d\'Oc',1),(852,'DOMAINE DE LONGUEROCHE','Le DOMAINE DE LONGUEROCHE sétend sur 30 ha de sols de type argilo-calcaire et grès ferrugineux (à 8 km de la mer méditerranée et protégé de celle-ci par le massif du bois du vicomte) balayés par les vents marins et du nord et inondés de soleil une très grande partie de lannée.\n\nLe nom du domaine rappelle celui du village où il est implanté, Saint-André-de-Roquelongue. La commune doit elle-même son nom à une barrière rocheuse derrière laquelle les vignes plongent leurs racines dans le massif de Fontfroide. Un terroir particulier, par sa topographie - fait de collines en pente douce dont les plus hautes sont coiffées de chênes et de pins - par ses sols gréseux légers, et par la relative fraîcheur de son climat (comme l\'indique le nom Fontfroide ou \'fontaine froide\').\nEn s\'installant en 1986 dans son village natal, au pied de la barre rocheuse de Roquelongue, Roger Bertrand a trouvé sa voie. Diplômé en droit, il cherche un local pour y créer une agence d\'assurance, avant d\'opter pour un commerce d\'antiquités. Sa passion pour le vin l\'emporte finalement. Le voilà vigneron. \nEn créant son propre domaine en 1995, Roger Bertrand réalise le rêve de son père, viticulteur en coopérative.\n\nLe domaine produit des vins de pays dOc  (merlot, cabernet sauvignon, chardonnay, viognier) et des Vins dappellations dorigine contrôlée Corbières (carignan, grenache, cinsault, mourvèdre et grenache blanc).\n\nLa vigne y est cultivée dans la tradition sans engrais ni produits chimiques.\nLes raisins sont vendangés à la main, les rendements sont très faibles.\n \nLa vinification, lélevage en fût de chêne français et la mise en bouteille ont lieu au Domaine.\n\nLes vins du DOMAINE DE LONGUEROCHE sont régulièrement analysés après chaque mise en bouteille, ils ne contiennent aucun pesticide.\nCes vins sont cités dans de nombreuses revues et guides : guide Hachette, Gilbert & Gaillard, Guide Hubert, RVF et sont régulièrement médaillés : Mondial du Rosé, concours des Grands Vins de France, Concours International de Lyon, challenge International du Vin',1),(853,'Domaine de la peyrouse','Issue dune longue lignée de viticulteur notre famille « GILIRAYNAUD » exploite aujourdhui un domaine situé au cur du PAYS CATHARE, sur le  terroir de DURBAN. Nous avons su nous adapter aux nouvelles techniques de culture en profitant du climat venté des Corbières qui permet d\'éviter une trop grande fréquence des traitements. L\'état sanitaire de la vendange est naturellement bon, ce qui nous permet daller plus loin et nous sommes fiers davoir  obtenue en 2013 \nla certification « agriculture biologique »\nLes vendanges s\'échelonnent de septembre à octobre en fonction des cépages, des terroirs et des types de vins recherchés, les raisins cueillis à leur maturité optimale sont vinifiés de façon traditionnelle nous avons à cur  de conserver nos traditions tout en utilisant les dernières techniques de vinification, ainsi grâce à un égrappage total  et à un contrôle constant des températures de fermentation les macérations peuvent être longues et extraire tous les tanins et arômes des cépages\nLes vins, ainsi élaborés, dun rouge profond, présentent une belle structure tannique qui associé aux arômes particuliers de chacun des cépages permettra un long vieillissement et feront honneur à votre table. \nNotre politique commerciale est basée sur le relationnel avec nos clients que nous recevons toute lannée dans notre cave à DURBAN-CORBIERES, lété à notre magasin de PORT-LEUCATE et sur nos stands dans les SALONS.',1),(854,'Chateau Grand Moulin','Production de vins AOP CORBIERES et CORBIERES-BOUTENAC. 120 hectares de vignes. 600000 bouteilles vendues a travers le monde.',1),(855,'WINES TREE','Situé au cur de la région Provence l\'entreprise sélectionne , développe et commercialise certains des meilleurs vins français dans toute l\'Europe , le Japon , l\'Australie , les États- Unis et le Mexique .',1),(856,'LES TERROIRS DU VERTIGE','',1),(857,'GRANDS CHAIS DE FRANCE','Société familiale, le Groupe Les Grands Chais de France a été créé en 1979 par son dirigeant Joseph Helfrich. Le Groupe GCF c\'est aussi l\'un des tous premiers négociants en vins et alcools.',1),(858,'CHATEAU AURIS','Produisant du vin depuis 1976, le Château Auris est situé aux portes de Narbonne, sur le terroir exceptionnel de Fontfroide.',1),(859,'Chateau Etang Des Colombes','Situé au coeur des Corbières, le Château Etang des Colombes produit des vins d\'appellation AOP Corbières, Vin de Pays d\'Oc et vins de cépages. Implanté sur une superficie totale de 77 ha de vignes, le domaine dispose d\'un terroir argilo-calcaire, caillouteux dont la majorité des parcelles est exposée plein sud.\n\nNous cultivons les cépages traditionnels de l\'Appellation Corbières : Syrah, grenache, carignan et mourvèdre. Notre gamme de vins ne s\'arrête pas aux Corbières, nous vous proposons aussi des Vins de Pays d\'Oc : sur le cépage Viognier ainsi que le Grenache.\n\nLa constante régularité de la qualité de nos vins depuis plus de 25 ans nous a hissé parmi les meilleurs crus des Corbières.',1),(860,'Chateau De Saint Louis','Les légions romaines vendangeaient déjà en Corbières au premier siècle de notre air ; plus tard au Moyen-Age les domaines viticoles ont essaimé à partir de riches abbayes.\n\nLe terroir de Boutenac est la matrice du Château de Saint-Louis, dont il est la porte nord. Les terres de galets roulés aux multiples teintes ocres sont pauvres en matière organique mais d\'une grande diversité minéralogique ; leur profondeur est attirante pour les racines des vieux ceps de carignan et de grenache, ce qui compense leur pauvreté nutritionnelle ainsi que les déficits en pluies estivales. La complexité minéralogique du sol induit la complexité aromatique de ses vins.\n\nLes collines basses et caillouteuses, semées de pins, sont confrontés à l\'ardeur du soleil, tempérées par le Cers, un vent fort et sain du nord-ouest, et par le vent humide venus de la mer. Le climat est typiquement méditerranéen avec un été sec et chaud. Les pluies sont rares et imprévisibles. L\'hiver peut être doux.\n\nAujourd\'hui, au-delà des vignes et de la garrigue, au fond des bois de pins maritimes, poussent le ciste, l\'alaterne, le chêne kermes ou l\'arbousier. Quelques rivières, discrètes mais imprévisibles  l\'Aussou, la Nieille, l\'Orbieu  ceinture l\'appellation Corbières, entourées de collines et de serres, ces longues cretes rocheuses qui cernent le paysage. Les vignes s\'étendent de 80 à plus de 100 mètres d\'altitude.\n\nLe sous-sol est composé de quatre grands types géologiques ; les affleurements de calcaire dolomitiques hettangiens des collines occidentales de Boutenac ; les grès de la pinède de Boutenac ; les dépôts molassiques du miocène continental et marin ; mais également les dépôts molassiques de l\'éocène, du cuisien, du lutétien et bartoniens, dites aussi molasses de Carcassonne, principalement sur le sud de Ferrals-les-Corbières.\n\nLes critères de production de l\'appellation Corbières-Boutenac, reconnue par l\'INAO en 2005 et futur Cru du Languedoc, sont particulièrement contraignants, tant à la vigne qu\'à la cave. La dimension de l\'aire géographique et le nombre réduit de vignerons s\'y prêtent ; rendements faibles (45hl/ha maximum, mais il est souvent inférieur), climat méditerranéen doux, sols caillouteux favorables, peu fertiles, et cépages en adéquation (carignan, syrah, grenache noir et mourvèdre). L\'irrigation est interdite, les vendanges de carignan sont obligatoirement manuelles. Le Boutenac fait partie des premières AOP de France a exiger l\'élevage de ses vins pendant au moins 2 mois en bouteilles avant la mise en marché.\nUne personnalité forte dans un cadre rigoureux, et des vins aptes au vieillissement.\n\nLe Château de Saint-Louis produit par ailleurs une large gamme de vins d\'un accès plus immédiat et orienté sur le fruit et la gourmandise, que ce soit en AOP Corbières, d\'IGP de pays d\'Aude, et des vins de cépage. La meme rigueur tant à la vigne que dans les chais est de mise pour la production de l\'ensemble de la gamme des vins du Château de Saint-Louis.',1),(861,'SPH GERARD BERTRAND','Gérard Bertrand se positionne comme lexpert des vins du Sud de la France reconnu par les plus grands amateurs. En tant que vigneron et propriétaire de domaines de référence, il a acquis une expertise unique des terroirs du Languedoc-Roussillon.',1),(862,'CHATEAU GLÉON','L\'origine du domaine de Gléon remonte à la plus haute antiquité. Ceci est attesté par de nombreux vestiges Gallo-Romains et Wisigothiques (poterie de la graufresenques, chapelle du 4ème siècle). Le domaine a appartenu, pendant un millénaire, à la famille de Treille-Gléon-Durban-Narbonne. Le Château de Gléon défendait l\'entrée des Hautes Corbières. Il fut assiégé par les Espagnols en 1503. La dernière marquise de Gléon le vendit aux ancêtres des propriétaires actuels en 1861. Depuis, les Bonnes puis les Montanié ont dirigé l\'exploitation du Château Gléon de père en fils. Six générations se sont ainsi succédées afin d\'assurer la prospérité et la qualité des terroirs du Château Gléon. Les premières mises en bouteilles datent de la fin du 19ème siècle.\n\nLe domaine se situe aux portes des Hautes Corbières, canton de Durban, commune de Villesèque des Corbières.\n\nSa superficie est de 300 hectares, dont 38 en vignes AOC Corbières.\n\nTerrasses et coteaux au sol argilo-calcaire du secondaire (jurassique et trias).\n\nClimat méditerranéen aride (pluviométrie : 450 mm, pluies concentrées en mars et novembre ; températures minimales de 4° C en janvier et 19° C en juillet-août ; maximales de 11° C en janvier et 30 ° C en juillet-août).',1),(863,'Domaine Mandourelle','Le Domaine Mandourelle est situé à Villesèque des Corbières et se compose de 22 ha. Il a été récemment racheté par la Famille Van Haute qui a fait de nombreux investissements et réaménagé le chai. Actuellement nous produisons des rouges en appellation Corbières et des rosés en appellation Languedoc. Le domaine dispose également de 5 gîtes haut de gamme.',1),(864,'Chateau Cambriel','Notre Domaine est particulierement dynamique au niveau qualitatif et toujours a la recherche de la creation de nouveaux vins. La diversite de notre encepagement et notre materiel de chai actuel nous permet dadapter la vinification de nos vins a vos exigences a vous: nos Clients. \nNotre terroir et nos competences nous ont incite a adapter l\'encepagement du vignoble et le chais de vinification depuis 2001....\nLe resultat de ce travail de fond nous a pousse a creer un veritable chai d\'elevage de nos vins et un nouveau caveau au 79 avenue saint Marc a Ornaisons.\n...Une nouveau chai d\'elevage cree pour pour faire vieillir nos meilleurs vins issus de la plus grande region viticole du Monde...Le Languedoc!',1),(865,'CHATEAU BORDE ROUGE','Le domaine de Borde-Rouge a été repris en 2005 par Frédéric CARRERE et son père Jean CARRERE. \nCest un terroir chargé dhistoire. Occupation romaine, sarrasine, rébellion  Cathares et travail des Bénédictins ont marqué le destin de Château Borde-Rouge. \nAncien Prieuré de lAbbaye de Lagrasse, classé parmi les « plus beaux villages de France »au cur des Corbières, Borde-Rouge est aussi ancien que lAbbaye dont il dépendait.\nLa bâtisse est entourée de 34 hectares de vignes en AOC Corbières dune moyenne dâge de 40 ans.\nSyrah, Grenache et Carignan pour les rouges et rosé, Roussanne, Grenache blanc et Vermentino pour le blanc.\nLe rendement moyen est de 35 hecto /  hectare.\nDans un terroir à très fort potentiel nous travaillons la vigne avec un profond respect de lenvironnement. Toutes nos cuvées sont certifiés BIO (Ecocert) depuis 2012.\nLa couleur des sols est une terre rouge, spécifique du domaine, très riche en oxyde de fer qui a donné son nom au Château. Argilo calcaire avec des calcaires blancs fissurés permettant un enracinement très profond.\nTravail manuel des ceps, vendanges à la main, vinification traditionnelles,  levures indigènes le plus souvent, élevages maitrisés, filtrations légères tels sont nos crédos.',1),(866,'LES VIGNERONS DE CAMPLONG','Fondée en 1932, actuellement 30 000 hls de cuverie, inox, acier, béton revêtu, parc de 200 barriques, 1 cave de vinification, un hangar de stockage bouteilles isolé.\n\n		Tout le matériel technique moderne nécessaire :\n	\n	Pressoir pneumatique, installation macération en grains entiers,\n	Egrappoir, 3 groupes de froid, cuves isothermes, filtres.\n\n		Tous les stades de vinification, de la cueillette au conditionnement en bouteilles sont réalisés par nos soins.\n\nLE VIGNOBLE :\n\n		270 hectares classés à 90 % Appellation dOrigine Corbières sur un terroir argilo-calcaire caillouteux, provenant des terrasses de la Montagne dAlaric, laltitude des vignes sétage de 60 à 190 mètres.\n		Exposées plein sud, les vignes sont abritées des grands vents par la Montagne dAlaric (610 mètres daltitude) qui bloque les embruns maritimes.\n		Lencépagement est  composé principalement de 5 cépages méditerranéens :\n\n	CARIGNAN	35 %,  CINSAULT		4 %\n	GRENACHE	23 %,  MOURVEDRE	8 %\n	SYRAH		30%',1),(867,'Chateau Fabre Cordon','Château Fabre Cordon Peyriac de Mer est un village pittoresque qui a vu naître des générations de vignerons et des pêcheurs. C\'est ici que depuis 40 ans, Henri et Monique Fabre ont consacré leur passion à cultiver leurs vignes et à produire des vins fins. Sur 15 hectares, ils élèvent les cépages traditionnels que sont le Grenache, la Syrah, le Carignan et le Mourvèdre. De très faibles rendements et une Agriculture Biologique donnent des cuvées exceptionnelles, en édition limitée. Leur fille Amandine a rejoint l\'équipe après avoir terminé ses études dnologie et devient elle aussi naturellement une ambassadrice des Corbières. Les critiques ont salué et primé leur travail, avec notamment des récompenses régulières au Guide Hachette des Vins.',1),(868,'Abbotts & Delaunay','',1),(869,'CHATEAU MONTFIN','Crée en 2002, CHATEAU MONTFIN est situé sur les collines dominant l\'étang de Bages et de la Méditerranée.\nLa propriété exploite une vingtaine d\'hectares en agriculture biologique sur des sols argilo-calcaires et issue de cépages méditerranéens et rhodaniens.Afin de garantir des vins de qualité, les rendements sont limités à 30 hectolitres par hectare, les vendanges réalisées manuellement en comporte et les raisins triés soigneusement.\nLe vin est ensuite vinifié de manière traditionnelle sans filtration ni collage et élevé en partie en barriques de chênes français.',1),(870,'Le Chai des Vignerons','Le Chai des Vignerons, Cave cooperative, se situe dans lAude, a Lezignan Corbieres, Capitale de lAppellation  dOrigine Protegee Corbieres.\nFondee en 1909, notre cave est aujourdhui la plus ancienne cave du departement et la deuxieme plus ancienne cave de France.\nCette longevite demontre une forte capacite dadaptation et un reel savoir faire pour produire des vins de qualite : blancs, roses, rouges soit en AOP Corbieres, soit en Indication Geographique Protegee Aude, Cathare, Terres du Midi ou Oc.\nTout en restant fidele a leurs valeurs, les vignerons de notre cave, ont su sadapter aux gouts du public. Dans cet esprit, la gamme des produits sest considerablement elargie. Elle se compose de vins de consommation immediate et de vins de garde, boises ou pas, regulierement primes et recompenses.',1),(871,'Vignobles Vellas','Négociants en vins à Teyran.\nPromotion des vins du Languedoc-Roussillon auprès de la GD, du CHR, des particuliers ainsi qu\'à l\'Export.',1),(872,'DOMAINE DE FONTSAINTE','Yves LABOUCARIE et son fils Bruno sont des hommes de ce terroir : Languedociens par leur nom, mais aussi par l\'histoire de leur famille installée à Boutenac depuis 1545.\nDepuis 1985, l\'encépagement a été amélioré en introduisant à côté du Carignan, Grenache Noir et Gris, Syrah et Mourvèdre, en limitant les volumes produits, l\'objectif étant de réussir le pari de la qualité et extraire du terroir les promesses qu\'il recèle de part sa nature géologique et son climat méditerranéen.\nLe Domaine de Fontsainte est situé sur l\'emplacement d\'anciens thermes romains et s\'étend sur près de 65 hectares sur la commune de Boutenac.\nLes sols, bas de versant d\'un massif forestier de grès rouge sur marne calcaire, à l\'exposition sud-est, bénéficient du meilleur ensoleillement pour cultiver les cépages Carignan, Grenache Noir et Gris, Syrah, Mourvèdre et Cinsault.\nCes cépages méditerranéens confèrent aux productions du Domaine de Fontsainte une concentration aromatique où se tutoient les fruits rouges et l\'essence des plantes aromatiques de la pinède.',1),(873,'Hecht & Bannier','Créé en 2002 par Grégory Hecht et François Bannier, Hecht & Bannier est la première Maison de Négoce et dElevage dédiée aux vins de la Méditerranée. Nous  proposons une gamme unique de vins dappellations issue dune sélection rigoureuse. Notre conviction est que, du Roussillon à la Provence, le plus talentueux des vignobles français est encore méconnu : nos vins doivent permettre aux amateurs de découvrir lextraordinaire qualité et richesse de ces régions.',1),(874,'LA CAVE','Négociants en vins du Languedoc depuis 1972, nous sommes spécialisés dans les vins de domaines et de châteaux.',1),(875,'Le Cellier De La Vigneronne','Véritable maison des vins de l\'AOP Faugères avec plus de 40 producteurs présents. Egalement, quelques coups de cur dans les différentes appellations du Languedoc Roussillon.\nOuvert 7j/7 de mi avril à mi octobre. Sur rv en hiver. Dégustation gratuite.',1),(876,'CHATEAU DES PEYREGRANDES','Domaine viticole familial de 25 hectares situé sur la commune de Roquessels (Hérault) au coeur de l\'appellation Faugères. Agriculture biologique.',1),(877,'Domaine Du Causse Noir','?Entre plaine et montagne, le village et son castrum sont édifiés au bout dun éperon rocheux séparant deux vallons profonds qui souvrent?vers?la?plaine biterroise.\nLa commune a quatre hameaux : La Liquière, Lenthéric,?Aigues-Vives,?La?Borie Nouvelle.\nSon histoire est liée à sa situation\nstratégique sur une voie de communication importante\nqui reliait, à travers les Avant-Monts,\nle Haut-Bassin de lOrb à la plaine de Béziers.\nHistoire et patrimoine se découvrent grâce à un parcours aménagé qui traverse le village et grimpe\njusquà lenceinte fortifiée et la chapelle Notre Dame de la Roque.',1),(878,'Domaine des prés lasses','Le domaine représente aujourdhui plus de 30 ha au total dont 26,5 ha en production dont beaucoup de vieilles vignes, en particulier, 7 ha de carignan. Le vignoble est cultivé en agriculture\nbiologique ; la vitalité des sols et léquilibre du vignoble sont prioritaires, de manière à favoriser leurs pérennités et le caractère des vins. Nos vendanges sont manuelles et\nsoigneusement triées. Le travail de cave est classique et peu\ninterventionniste. Les intrants oenologiques, en dehors de faible dose de soufre, sont supprimés et les vins sont généralement mis en bouteilles sans collage ni filtration. Lélevage, qui sétale entre 18 et 24 mois, est réalisé en\ncuves de béton brut et en barriques de chêne avec une faible proportion de fûts neufs. Nous cherchons à produire des vins de gastronomie, capable de vieillir, transparents vis-à-vis de lexpression du terroir et des millésimes et sexprimant avec finesse et complexité.',1),(879,'DOMAINE DU METEORE','Pourquoi le nom : Domaine du Météore.....voici lhistoire :\n\nLe Domaine du Météore doit son nom à un immense trou de 220 mètres de diamètre et de 60 mètres de profondeur dont lorigine pourrait être la chute dune météorite, tombée il y a environ 10 000 ans.   \n\nNous avons planté une vigne (de la syrah) au fond du cratère et afin de poursuivre le mystère nous avons donné à nos cuvées des noms de constellation : \n\nLes Perséides,    Les Orionides,    Les Léonides,    Les Lyrides....\n\nTout a commencé il y a quelques années quand des géologues ont découvert ce trou au milieu des collines et sont venus faire des recherches sur place. Depuis, de nombreux géologues, astrophysiciens, passionnés, clients, etc. viennent visiter le site.\n\n\nPropriété familiale :\n\nPropriété familiale depuis plusieurs générations, le vignoble est aujourdhui exploité par Geneviève et Guy Libes. Notre domaine est situé à Cabrerolles petit village niché au pied des Cévennes, en Languedoc dans le Sud de la France, à 30 kms au nord de Béziers.\n\nNotre vignoble sétend sur une superficie de 23 ha. A Cabrerolles, (Faugères), il culmine entre 300 et 350 mètres daltitude, exposé plein sud sur de fortes pentes au terroir schisteux, terrains pierreux, secs et acides, venté par la Tramontane avec au loin un extraordinaire panorama sur la méditerranée. \n\nLe vignoble de St Chinian est situé à St Nazaire de Ladarez également sur un terroir de schiste.\n\nLa totalité du vignoble est engagé en Agriculture Biologique.',1),(880,'Domaine Valambelle','',1),(881,'Domaine de la Rochelierre','JeanMarie Fabre a repris le domaine familial dans la plus pure tradition et dans le respect de la souche. En effet le travail de la terre et laccompagnement de la végétation sont faits suivant la méthode Cousinié (utilisant uniquement des produits organiques). Ce vigneron qui est aussi nologue, a su tirer de ces 15 hectares de terre extrêmement pauvre des vins alliant complexité, concentration, mais aussi fraicheur et finesse. Ces vins sont alors élevés soit en cuve inox, soit en fûts de chêne, ainsi cet artisan peut privilègier lexpression de son terroir, mais aussi et surtout sa passion.',1),(882,'Domaine de la Ramade','Le Domaine se compose en 3 parties: la premiere est constituee de 15 ha de vignes, la deuxieme de 2 ha d\'oliviers et la derniere, nos chambres d\'hotes. Le tout, situe au Cur du massif de la Clape, a 3 km de la mer a vol d\'oiseau.\n Ce vignoble existe depuis le 19eme Siecle, bien que la decouverte d\'artefacts datant de l\'epoque romaine sur la propriete indique qu\'il etait deja en exploitation il y a quelques 2000 ans.\n Depuis 2007, une grande partie des vignes a ete sur-greffees avec des cepages selectionnes, 4 ha ont ete replante suivant des methodes culturales respectueuses de l\'environnement, les vignes ont ete repalissees pour favoriser le developpement de la plante.\n Le Domaine de la Ramade produit du vin rouge compose de Grenache, Syrah, Carignan ou encore Mourvedre. Le vin blanc quant a lui est produit a partir de cepages de Bourboulenc, Vermentino et Viognier. En conversion vers le biologique depuis 3 ans, les vendanges de 2011 seront les premieres a beneficier de l\'appellation Agriculture Biologique',1),(883,'Chateau Puech Haut','Château Puech Haut situé au Nord Est de Montpellier, en appellation Languedoc, produit et commercialise des vins haut de gamme. En Rouge, Rosé, blanc, le Domaine est présent chez de nombreux cavistes, chez les restaurateurs et sur les tables des Etoilés. Puech-Haut est également présent partout dans le monde, des Etats Unis à la Chine, en passant par l\'Australie, le Japon, et bien sûr l\'Europe.',1),(884,'Villa Tempora','De la vigne\nNotre vignoble est reparti en plusieurs parcelles aux alentours des villages de Caux, Gabian et Pezenas, sur les premiers contreforts des Cevennes meridionales qui beneficient dune grande diversite de sols (argilo-calcaires, galets roules villafranchiens, schistes et basaltes), dexpositions et dencepagements. Lage des vignes varie de 20 a 50 ans.\nLa preservation des ecosystemes (haies, bosquets, talus, etc.) participe a la sauvegarde de la biodiversite et a stimuler les defenses naturelles de la vigne.\nBeaucoup de soins et dexigence sont apportes a la culture de nos vignes (methodes biologiques, Domaine certifie Bio Ecocert en 2011) avec un respect constant de lenvironnement et du terroir, sans produits chimiques ni insecticides. En 2018, nous initions notre conversion en biodynamie.\nLemploi dengrais organiques naturels, un desherbage mecanique et un ebourgeonnage manuel permettent de limiter les rendements et dobtenir un etat sanitaire parfait avec des fruits concentres et de belles maturites.\nLes vendanges sont manuelles et les raisins sont tries avec rigueur dans les vignes puis en entree de cave. Nous recherchons la meilleure maturite phenolique et limitons lextraction pour exprimer la fraicheur, la finesse et respecter la typicite du terroir particulier de Pezenas.\n a la cave!\nNos methodes de vinification naturelles avec levures indigenes et sans aucun intrant, associees a des pressees delicates et une utilisation parcimonieuse du SO² (generalement plus de 10 fois moins que la dose autorisee), nous permettent de produire des vins naturels et authentiques de grande qualite. Nos vins ne sont en general ni colles ni filtres.\nLe vin blanc est issu dassemblage de Bourboulenc et de Marsanne.\nles vins rouges sont issus dassemblages de Mourvedre, Syrah, Grenache et vieux Carignan.',1),(885,'Vignobles Rambier Ainé Et Ses Enfants','Vignerons de père en fils depuis 5 générations au pied du Pic Saint Loup, les Vignobles Rambier Ainé et ses enfants produisent et élèvent des vins sur plusieurs terroirs dont certains sont issus de l\'agriculture biologique. Ces vins de grande qualité vous feront découvrir les aromes et les saveurs des terroirs du Languedoc.',1),(886,'Costeplane','Nous cultivons ce domaine en culture biologique, label Nature et Progres, puis en biodynamie, label Demeter depuis 1989, date ou nous sommes passes en cave particuliere. Nous avons une petite trentaine d\'hectares de vignes, avec une production annuelle d\'environ 150 000 bouteilles. Le domaine est dans le midi de la France, a 30 km a l\'Ouest de Nimes, a 45 km au Nord de Montpellier, au milieu des collines de la bordure des Cevennes .',1),(887,'Maison S.Delafont','Vins fins du Languedoc',1),(888,'domaine  de campaucels','',1),(889,'Mas De Figuier','Le domaine du Mas de Figuier est un domaine viticole situé sur le terroir du Pic Saint Loup au Nord de Montpellier.\nMené d\'une main de maître par la famille Pagès depuis maintenant quatre générations.\n\nNous vous proposons de venir découvrir nos sept gammes de vins répartis en trois couleurs en appellation Pic saint Loup et en agriculture Biologique !\n\nNous sommes également présents sur de nombreux salons partout en France.',1),(890,'DOMAINE PIERRE ET ESTELLE CLAVEL','L\'histoire du domaine Clavel commence en 1986 quand Pierre Clavel vinifie ses premiers raisins avec une seule envie en tête : faire parler son cher terroir du Languedoc. \nEstelle et Pierre Clavel travaillent aujourdhui deux territoires qui leur sont chers : Pic Saint Loup et Montpeyroux.\nNotre vignoble est en agriculture biologique avec de nombreuses pratiques biodynamiques.\nLes variétés anciennes de blés, les oliviers, les chênes truffiers viennent sajouter à nos vignes pour créer un véritable écosystème.  \nNos vins sont lexpression de notre travail vigneron. Chaque cuvée est le reflet dun terroir, dun assemblage singulier, dune recherche démotion. Notre climat méditerranéen nous permet dobtenir une intensité et une concentration de fruits et dépices. \nNotre territoire sauvage et calcaire assure finesse et équilibre dans le vin blanc comme dans les rouges.\n\nNous vous accueillons dans un cadre privilégié, aux portes de Montpellier, dans l\'environnement somptueux du Pic Saint Loup : découvrez ce lieu authentique mis à la disposition de vos yeux, de votre nez et de votre palais.',1),(891,'MAS DE MARTIN','Le domaine viticole du Mas de Martin est situé à une vingtaine de kilomètres au nord de Montpellier, près du Pic Saint Loup.  \nLe vignoble est planté sur 19 hectares de sols pauvres.  \nLa cave de vinification est dotée de la dernière technologie et lélevage des vins se déroule dans le chai à barriques et cuves tronconiques en chêne français.\nTous les principes développés et appliqués sur le domaine, tant caulturaux qu\'nologiques, reposent sur le NON CHIMIQUE.',1),(892,'DOMAINE VIRGILE JOLY','Le Domaine Virgile Joly est situé sur lun des meilleurs terroirs du Sud de la France : lairedAppellation dOrigine Contrôlé (AOC) Coteaux du Languedoc - Saint Saturnin. Les parcelles sont situées sur de vastes terrasses caillouteuses argilo calcaires culminant\nentre 100 et 400 m daltitude plantées de vieux Grenache, de Syrah et de Carignan, conjugués à la richesse du climat méditerranéen. Ce terroir exigeant est travaillé dans un total respect de la nature pour permettre au Domaine Virgile Joly doffrir des vins sincères et francs à la riche palette aromatique. Dans le respect des écosystèmes, le travail manuel\nest privilégié afin de laisser la vigne s\'exprimer le\nplus naturellement possible.\nLe désherbage non chimique est réalisé sous forme\nde labours et finalisé manuellement; la fumure est gérée par des apports de matières organiques; les moyens de traitement sont ancestraux (souffre et bouillie bordelaise) tout ceci pour\npermettre à la vigne de développer sa propre résistance et ses défenses naturelles. Le respect des raisins comme celui de la vigne impose certains principes : Les vendanges sont\nmanuelles. Directement triés à la vigne, les raisins\nsont transportés à la cave dans des cagettes puis\néraflés et vinifiés de façon traditionnelle, avec pigeage et remontage. Assemblés, les vins seront ensuite élevés en cuves ou en barriques de chêne français.\nAu Domaine Virgile Joly, il n\'existe pas de règles strictes. Lattention et ladaptation sont constantes pour être au plus près du millésime. En résultat, des vins à l\'attaque franche et ample, à la bouche suave et finement structurée\névoluant vers une finale rafraîchissante.',1),(893,'Domaine de Saumarez','Domaine viticole bio avec 11ha de vignes sur des coteaux caillouteux à l\'ouest de Montpellier. Crée en 2004 par un anglais et une néo-zélandaise qui ont changé de carrières pour devenir néo-vignerons.',1),(894,'CHATEAU LANCYRE','',1),(895,'Château Saint-Martin-de-la-Garrigue','Le château Saint-Martin-de-la-Garrigue et sa chapelle romane du 9ème siècle sont protégés par 160 hectares de vignes , oliviers et garrigues. Il   mele harmonieusement histoire, design et modernité. Ses vins, certififiés Terra Vitis, sont régulièrement récompensés par les professionnels.',1),(896,'CHEMIN DES REVES','Domaine Viticole aux portes de Montpellier en Appellation Pic Saint Loup et Languedoc Gres de Montpellier',1),(897,'Mas de Bayle','Domaine familial viticole, le Mas de Bayle cultive son terroir pour en tirer le meilleur vin. En AOP Grès de Montpellier et Languedoc, vous trouverez des vins rouges, rosés ou blanc, meilleur expression de leur origine.',1),(898,'La Fontésole','La cave coopérative de Fontès est située au coeur de l\'Hérault sur les premiers contreforts des Cévennes.',1),(899,'Château Bas d\'Aumelas','Lhistoire du Château Bas commence au 14 ème siècle.\n \nA la suite de la guerre de cent ans, le château fort dAumelas du 12 ème siècle a subi de très gros dommages, en partie pillée par les bandes désuvrées, et livré aux caprices de la météo. Il devient inhabitable à la renaissance. En raison de ce manque de confort, en 1595 le Sieur Bonnet, propriétaire des lieux, choisit de sinstaller à Château Bas.\n \nCest une ferme appartenant au Château dAumelas, située à flanc de colline à un kilomètre de là. Lactivité est avant tout pastorale mais on y pratique également la culture de la vigne. Le seigneur du Château-Bas procède à des transformations et la bâtisse devient alors un ravissant château flanqué de deux tours rondes et dépendances. Depuis trois siècles, la famille dALBENAS est propriétaire du Château !\n \nAujourdhui, Jean-philippe et Geoffroy dALBENAS ont redonné lanimation dantan au domaine en renouant avec son activité viticole. Ils mettent en valeur le château et son jardin à la française en le louant pour des séminaires et mariages.',1),(900,'Vanho','Vins de niche. Superficie totale 12 ha. Total cols par an : 20.000 sur 6 ha en AOC CTX de Languedoc pour les rouges et IGP d\'Oc pour les blancs et rosé.  Petits rendements, vendanges manuelles, table de tri et vinification traditionnelle en cuve à température contrôlée. Elevage en barriques pour les rouges. Vins de qualité élaborés par des vignerons passionnés par leur hobby.',1),(901,'Mas du Novi','Il était une fois...\nL\'abbé Foulques de l\'Abbay de L\'Arborel (Tarn) fonda en 1139 l\'Abbaye de Valmagne sur des terres cédées par le seigneur de Cabrières, vassal de Raymond Trenceval, vicomte de Béziers. Le MAS de NOVI était l\'une de ses \'granges\' à vocation viticole, située sur les collines environnantes et jouissant d\'une ue imprenable sur le littoral proche.\n\nComme son ancêtre romaine, la Via Domitia, tracée entre Nîmes et Béziers, le chemin de Saint Jacques de Compostelle passe à proximité de l\'abbaye qui constituait des haltes pour les pélerins. Un calvaire à leur attention existe encore au MAS del NOVI où l\'on peut lire (\'voyageur, assieds-toi et prie!\').\n\nAu Moyen-âge, le domaine était également connu des chevaliers Templiers.\n\nDans les années qui suivirent 1789, l\'abbaye fut assaillie par les révolutionnaires qui brûlèrent les document concernant la propriété des moines. Et ainsi, ce vaste domaine se trouva divisé entre divers propriétaires privés.\n\nAujourd\'hui, le Mas du Novi (aussi Domaine st Jean du Noviciat) est une propriété de 100ha dont 50 sont actuellement exploités, tout cela autour d\'un nouveau caveau de dégustation et d\'une superbe chapelle. Magnifiquement restauré, le domaine vous séduira tant par la qualité de sa production que par son environnement... \nLaissez-vous transporter par notre savoir-faire!',1),(902,'Château de Lascaux','Propriété de la famille Cavalier depuis 1554, le vignoble du Château de Lascaux s\'étend sur près de 85 hectares de vignes entre Montpellier et Nîmes. En 1984, Jean-Benoît Cavalier reprend le témoin de 14 générations de vignerons et redonne une dynamique à la cave et au vignoble. Le Château de Lascaux produit des vins bio de caractère, complexes et élégants en appellation Languedoc Pic Saint Loup.',1),(903,'CAVEAUX CLAMERY -VIGNERONS DE L\'OCCITANE','Les Vignerons de l\'Occitane se sont regroupés autour d\'une même marque : CLAMERY.\n3 caveaux en sont issus : Servian, Lodève et Le Bousquet d\'Orb.\nGrâce à sa diversité géographique exceptionnelle, le vignoble de l\'Occitane vous propose des vins de grande qualité.\nL\'équipe Clamery vous convie à venir découvrir et déguster leurs vins.\nVous trouverez également dans leurs caveaux une vaste gamme de produits du terroir et des idées cadeaux.\nGamme de Vins : AOP Coteaux du Languedoc - IGP Vin de Pays d\'Oc - BIB Rouge, Rosé et Blanc - Vin mousseux : Blanc de Blancs. Produits du terroir',1),(904,'Mas Montel - Mas Granier','Le mas Montel est un domaine de tradition viticole depuis des siècles.  Il possède aujourd\'hui 40 hectares de vignes. Depuis 1997, le domaine propose une gamme de vin AOC, sous la marque  Mas Granier. Le domaine est en conversion Agriculture biologique depuis le millésime 2018.',1),(905,'FONT DU LOUP','A completer',1),(906,'Millésime Sud','Millésime Sud souhaite faire partager à ses clients lamour quelle porte aux vins, mais aussi faire découvrir et apprécier la région par la mise en valeur de vins uniques et inimitables nés dans le Sud de la France, et qui révèlent la puissance et lélégance de ses multiples terroirs ensoleillés.',1),(907,'CASTELBARRY COOPERATIVE ARTISANALE','Castelbarry Coopérative Artisanale, fleuron de l\'appellation Languedoc, est située sur l\'un des plus beaux terroirs du Languedoc. Vous trouverez à la cave, accueil, qualité des vins et professionnalisme.\nLors de la dégustation, laissez vous porter par la richesse des arômes, le goût du terroir et de l\'authenticité.\nCastelbarry  Coopérative Artisanale est engagée pour une agriculture raisonnée respectueuse de son environnement naturel (Terra Vitis et Bio AB). Un parcours pédestre d\'interprétation sur le territoire est accessible au départ de la cave avec un accompagnement possible par un guide interprète de l\'Office de Tourisme Vallée de l\'Hérault. (renseignements à la cave).',1),(908,'Domaine les grandes costes','Domaine familial depuis 1868 (19 ha) au rendement limité adepte dune agriculture hyper raisonné, respectueuse des sols. Nous vinifions des vins de terroir, confidentiels, naturels et profonds.',1),(909,'DOMAINE LA VOUTE DU VERDUS','Une histoire de famille, simple et forte, ancrée au pied du Causse du Larzac. Chez les BONNET, lhistoire de la vigne et du vin se confond avec les récits que lon se transmet de génération en génération\n \nLa Terre, on la porte en soi, on lui appartient. De chaque parcelle on connaît toutes les particularités et on sait les faire vivre pour produire le meilleur. Les vignes sont le fruit du travail de ceux qui les ont aimées et élevées comme des enfants. Au fil du temps, chacun leur a donné toute son énergie avec vaillance, sagesse et opiniâtreté\n \nLentraide et la solidarité sont des valeurs instinctives et sûres. La terre a forgé des femmes et des hommes généreux et dynamiques. La personnalité et le savoir-faire de chacun a fait évoluer la production.\n \nNous avons été à la création des caves coopératives dAniane et Montpeyroux. Lidée dune cave particulière sest imposée depuis quelques années à Saint-Guilhem-le-Désert où le futur chai pouvait bénéficier dun lieu idéal. Donc le pas est franchi en 2011. Une sélection de raisins issus de 2ha de vignes sont récoltés manuellement et vinifiés dans la nouvelle installation le jour des 50 ans de Guilhem BONNET : on ne pouvait lui souhaiter une plus belle récompense.',1),(910,'Chateau des Mouchères','Le Château des Moucheres, situé sur la commune de St Mathieu de Tréviers est  adossé aux premiers contreforts cévenols.\n\nLe domaine appartient à la famille depuis la fin du XVIIe siècle. De nos jours, Jean-Philippe TEISSEDRE exploite le vignoble dune superficie de 28 hectares dont 1/3 en AOC Pic St Loup.\n\nNous vous proposons une gamme de vins complexes et typés, fruit dun savoir faire ancestral respectueux du terroir et de lenvironnement.',1),(911,'DOMAINE SAINT DAUMARY','Le Domaine Saint Daumary est situe a Valflaunes, au cur du Pic Saint Loup. Il a ete cree en 1999 par Julien Chapel, vigneron, fils et petit-fils de viticulteurs. \n	Julien a debute  avec 4 ha et le Domaine en comprend aujourdhui environ 20.\n	Petite anecdote, Julien pour son millesime 1999, age de 19 ans, etait le plus jeune vigneron du Languedoc-Roussillon',1),(912,'DOMAINE HAUT LIROU et MAS DU NOTAIRE','Le domaine Haut-Lirou est situé sur la commune de Saint Jean de Cuculles au cur du Pic Saint-Loup.\n\nLa famille Jean-Pierre Rambier cultive ce vignoble depuis plus de cinq générations. Les 95 hectares de vignes sont travaillés de façon traditionnelle et raisonnée ( taille courte, vendanges en vert, palissage, effeuillages, apport de fumier naturel...). La vendange est effectuée à la main et en cagettes afin de préserver le raisin. La vinification s\'effectue cépage par cépage, clos par clos. Le vin est ensuite élevé dans le chai souterrain entre 12 et 16 mois dans des barriques de chêne français.\n\nNos vins sont régulièrement médaillés lors des différents concours professionnels ( Concours Mondial de Bruxelles, Concours général agricole, concours des vins de Macon, Challenge international du vin, Vinalies nationales et internationales, Féminalise...) et figurent dans de nombreux guides (Guides Hachette,Bettane et Desseauve, Dussert Gerber, Gilbert et Gaillard...).',1),(913,'DOMAINE LES VERRIERES','xxxx',1),(914,'Prieuré De Valcrose','PRIEURE DE VALCROSE est une petite chapelle\ndu XIIème siècle propriété de notre famille depuis de\nnombreuse décennies. Elle marque notre\nenracinement dans cette région.\n« Notre vignoble de 11 hectares est planté sur des\nterres argilo-calcaires. Lencépagement est composé\nde Syrah, Grenache, Cinsault, Viognier et de\nSauvignon. Nos rendements sont volontairement\nlimités à 30-40 hlha par une vendange en vert\nsévère ce qui permet dobtenir la quintessence de\nnos raisins. Proches de la nature depuis notre\ninstallation, nous avons toujours porté une\nattention particulière à notre environnement en\nréduisant au maximum l\'utilisation des pesticides,\ninsecticides et herbicides. De ce fait nous avons été\namenés naturellement à nous convertir totalement\nen agriculture biologique, ce qui nous permet de\nbénéficier du Label Bio depuis 2012. »\nLaetitia et Romain TREMOULET',1),(915,'Domaine de Montmau','Présentation de lentreprise :\n\nLe Domaine de Montmau est situé à environ 2 km au nord-ouest du centre historique du village de St-Pons-de-Mauchiens.\nSitué sur un promontoire, la propriété domine la vallée de lHérault sur pratiquement 360°.\n Le domaine est composé de 30 Ha de vignes en exploitation, d\'un bois de 6 Ha et d\'un ensemble bâti constitué par plusieurs édifices principaux : le plus ancien, un mas languedocien datant du début du 17e Siècle actuellement en rénovation et destiné à accueillir des gîtes, chambres dhôtes et salle de restauration ; une cave de vinification entièrement réaménagée en 2016 avec un étage actuellement en rénovation pour accueillir une salle dévènementiel et une nouvelle construction bâtie en 2016 comprenant un caveau de vente, des logements de fonction et un « futur » espace sportdétente.\n\n\nLes activités du domaine :\n	Lactivité viticole \n	vinification dune partie de la récolte au domaine depuis 2016 et vente au caveau\n	Coopérateurs à la cave de St PargoireSt Pons de Mauchien\n\n	Lactivité oenotouristique  (à venir)\n	Location de salle pour évènements (réceptions, mariages, sémi-naires dentreprises)\n	Location de gîtes et chambres dhôtes\n\nInstallés depuis 2 ans, notre projet vise à redynamiser l\'exploitation viticole et à développer à nouveau en interne l\'activité de vinification et de vente au caveau. Cette dynamisation passe par une diversification des offres de service autour du vin, aussi l\'activité viti-vinicole sera renforcée par une activité oenotouristique à venir.',1),(916,'CHÂTEAU MONTEL','Aux portes de Montpellier, le domaine du Chateau Montel setend des plaines arides mediterraneennes aux coteaux de larriere-pays Languedocien. \n\nDans un ensemble de batisses du XIXe siecle, le cellier, les chais de vinification, delevage en barriques et dembouteillage, sont situes au cur du petit village de Teyran. Le domaine est familial, et conserve des traditions ancestrales developpees depuis loccupation romaine. Allies aux evolutions technologiques modernes, savoir-faire et passion rivalisent depuis le vignoble jusque dans les bouteilles.',1),(917,'L\'ESTABEL','Créée en 1938, la cave de Cabrières regroupe 30 vignerons  travaillant sur  sur un vignoble de 330 hectares et produisant 18000 hectolitres. Les sols de Cabrières sont essentiellement  des schistes et composent  un terroir original et de grandes expressions. Depuis 1947, les vignerons de Cabrières  conditionnent et commercialisent  directement leur production  dans le monde.',1),(918,'DOMAINE LES TROIS PUECHS','Au cur du vignoble languedocien, le domaine \'Les Trois Puechs\', créé en 2010, est situé sur la commune de Fouzilhon, petit village bâti en cercle autour de son église. Datant du Moyen-Âge, cette circulade est quillée sur son rocher et surplombe les coteaux avoisinants.',1),(919,'Cave cooperative de pegairolles de l\'escalettea','La cave de Pegairolles de lescalette, fondee en 1927 est aujourdhui la plus petite cave et une des premieres du departement de lHerault.\nDepuis 17 ans elle produit la cuvee «  Chateau Pegairolles » qui est la carte didentite de la cave. Le vignoble de Pegairolles est situe sur les eboulis du Larzac, un des sites les plus pittoresques du Languedoc.',1),(920,'MAS TRINQUIER','',1),(921,'Domaine de querelle','Domaine familial de 15 ha le domaine de Querelle détiens son nom de l\'occitan \'cairas\' ce qui signifie terroir rocailleux',1),(922,'SAS ALIGNAN DU VENT CEPAGES','Nous avons deux caveaux: (degustations et ventes de vins, ventes de produits regionaux)\n\n- Caveau d\'Alignan du Vent 27 rue de la Guissaume 34290 Alignan du vent \n\nOuvert du lundi au samedi \nEn saison: de 9h00 a 12h00 et de 15h00 a 19h00 \nHors saison: de 9h00 a 12h00 et de 14h00 a 18h00.\n\n- Caveau de Neffies 28 avenue de la gare 34320 Neffies\n\nEn saison: Ouvert du lundi au samedi de 9h30 a 12h30 et de 14h30 a 18h30. \nHors saison: ouvert du mardi au samedi de 9h30 a 12h30 et de 14h00 a 18h00.',1),(923,'BERGERIE DU CAPUCIN','Notre domaine Bergerie du Capucin sétend sur 15 ha au cur de lappellation Pic Saint Loup. Les terres exigeantes et contrastées du Pic Saint Loup, les typicités de ses sols et de son climat, sont autant de traits de personnalité de nos vins.',1),(924,'Chateau Montpezat','Domaine viticole familial 40 ha dont 35 en vignes, en culture biologique. Ventes en bouteilles environ 120000 et en vrac. Vin AOP et IGP.',1),(925,'domaine cour saint vincent','.....Dans un environnement de Pins dallep et de garrigues,  les Vignes sont plantées sur un sol argilo-calcaire, avec des galets-roulés, cailloutis, calcaire dur et conglomérat. Leur âge moyen est de 30 ans. Le Domaine est en Bio depuis 2007.\n\nLa cueillette du raisin est manuelle et les rendements faibles : 20 à 25 hectos/hectare. La vinification se fait dans la Cave St Vincent au centre du Village, proche du Prieuré.\n\nLes raisins blanc sont pressés au petit matin et vinifiés sous contrôle des températures.\n\nEnsuite , le Vin Blanc est batonné sur lies fines avant dêtre mis en bouteille lannée suivante : Cuvée BL AOC Languedoc - Domaine des Mourguettes .\nSur le terroir AOC de St Vincent les cépages Blanc sont : la Marsanne, la Roussanne, Le Grenache Bl, la clairette .\n\nLes raisins rouge 4 à 5 grappes par souches sont cueillis manuellement en cagettes ou benne élévatrice.\nUne fois rendu dans la Cave St Vincent, les raisins sont égrappés avant dêtre mis en cuve ; les macérations sont longues, les extractions douces avec pigage et contrôle des températures.\n\nLes Vins AOC Languedoc Rouge cuvées Mille Pierres et  Clos du Prieur sont élevées en fûts de chêne 12 mois avant dêtres affinées en bouteille.\nLes cépages AOC rouge pour le terroir de St Vincent sont :  la Syrah , le Mourvèdre, le Grenache n et Le Carignan vieille vigne .\n\nAu total, le Domaine est constitué de 10 Ha avec une production annuelle de \n25 000 bouteilles .',1),(926,'Mas Farchat','A Gabian, niché sur des côteaux ensoleillés au milieu d\'une biodiversité préservée, le vignoble du Mas Farchat produit des vins complexes, élégants et d\'une belle fraîcheur. \nCes qualités sont transmises par le formidable terroir de la région de Pézenas : le basalte !\nAfin de sublimer ce que nous offre cette généreuse nature, le domaine est en recherche permanente de l\'excellence. Depuis plusieurs générations la famille cultive ce terroir d\'exception dans le respect et en perpétuant les savoirs faire.',1),(927,'Les Vignobles Foncalieu','Groupement cooperatif du Sud de la France avec plus de 20 Domaines & Chateaux, nous partageons les ressources et les talents afin de vous offrir les meilleurs vins possibles. A travers le Languedoc, la Gascogne et le Rhone, nous produisons certaines des meilleures appellations de France: Cotes du Rhone, Saint Chinian, Minervois, Corbieres, Picpoul de Pinet, ainsi que de nombreux Vin de Pays.',1),(928,'Château Roumanières','Entre Nîmes et Montpellier, le Château Roumanières s\'étend sur 35 hectares, au cur de l\'arrière-pays héraultais. Un domaine familial créé en 1975 par le père Robert Gravegeal dans l\'appellation Grés de Montpellier. 12 cépages composent le vignoble du Château Roumanières.\nEn appellation LANGUEDOC ,Vins rouges, Rosé et Blancs\nEn appellation LANGUEDOC GRES DE MONTPELLIER en rouge\nEn IGP Vin de Pays d\'Oc rouge , rosé et blanc',1),(929,'Domaine La Rouquette','Le Domaine La Rouquette est situé sur la commune de Saint-Privat 34700  dans le hameau de La Rouquette. Ancrée dans les contres-forts du larzac, composé d\'un sol Argilo-calcaire bordés de chêne blanc, de bruyère et d\'ancienne meulières. Un Domaine familial depuis 3 générations composé de 4 hectares de vignes en conversion Biologique.\nNous vinifions la totalité de notre propriété dans notre cave particulière .',1),(930,'Domaine de Pradines','C\'est en 2016 que Maxime Lapousterle a repris les vignes de Pradines a Montoulieu. Aujourd\'hui en agriculture biologique, le vin de Pradines propose les trois couleurs qui partagent les memes lignes directrices : respect du terroir, structure et legerete. De delicats aromes de fruits rouges caracterisent la cuvee Syrah / Grenache / Cinsault pour les vins rouges et roses, tandis que le vin blanc est compose de Vermentino / Marsanne / Roussane, un assemblage de trois cepages a l\'arome fleuri, bien equilibre entre l\'acidite et le fruit et une fraicheur lui permettant d\'etre servi aussi bien en aperitif qu\'en repas.',1),(931,'SCEA Château Belvize','Culture de la vigne\nVinification\nElabotation du vin\nCommercialisation',1),(932,'LOUISON Monique','Domaine de 7 hectare et demi entièrement biologique.',1),(934,'Domaine Rose et Paul','Niché au coeur de l\' AOC Malepère, proche de la cité de Carcassonne, le Domaine Rose et Paul étonne par la richesse aromatique de ses vins. La famille Foussat cultive ses vignes depuis 5 générations en respectant l\'environnement, en transmettant la passion du vin et de sa terre, la Malepère.Le domaine s\'étend sur une propriété de 43 hectares, nos vins sont issus de cépages merlot, cabernet franc, cabernet sauvignon, malbec, grenache, chardonnay, pinot noir.Aujourdhui cest main dans la main que Gilles et Clément Foussat, deux artisans vignerons, travaillent pour produire, « Des cuvées prometteuses : côtes-de-prouilhe (blancs et rosés), AOP malepère (rosés et rouges), pays d\'oc (rouge) et malbec : des vins légers, agréables en bouche » (Guide du chef amateur, Le petit futé,2014)',1),(935,'Domaine Vordy','Exploitation familiale de 34 ha en Agriculture Biologique situe dans le magnifique village de Minerve; AOC Minervois',1),(936,'LES VIGNERONS DE POUZOLS MAILHAC','Les 150 vignerons de la cave de Pouzols et Mailhac élèvent leurs vins d\'appellation Minervois avec la passion de leurs terroirs. Ce vignoble de 650 hectares, aux sols et aux expositions variés, produit des vins de qualité à haute expression, régulièrement récompensés dans les concours nationaux',1),(937,'CHATEAU VENTENAC MINERVOIS','En son terroir d\'AOP Minervois, Ventenac, son château et ses vignes sont pétris d\'Histoire, marqués d\'une mémoire tellurique ancestrale et portant les profondes empreintes de celles et ceux qui ont choisi d\'unir leur existence pour y forger une destinée viticole. Découvrez ce lieu où la passion de la vigne et du vin évolue sans cesse depuis des siècles. Laissez-vous guider à travers l\'espace et le temps pour un itinéraire varié et étonnant.',1),(938,'Domaines  fonvieille','Les vignobles sétendent sur 65ha :31 ha sur Montouliers, village classé du XIII siècle, et 34 sur Poilhes, à proximité du site gallo-romain dEnsérune.\n\nLa propriété familiale sest développée vers la fin du XIX, mais lachat des vignes remontent au XVIII siècle(1760).  \nLes premières mises en bouteille ont débutées en 1978 et ont été très rapidement primés aux concours agricoles  les plus prestigieux : Paris, Mâcon \n\nToutes nos cuvées sont  vinifiées en cave particulière, que ce soit lAOC Minervois rouge ou nos vins  de Pays dOc  en rouge, rosé, blanc et Muscat sec. Afin de développer et denrichir sa gamme la cave sest dotée de barriques en chêne ou lAOC Minervois vieilli de 10 à 12 mois.\n\nLes terroirs : situé à lest du Minervois, sur le territoire des « Serres », cette région, caractérisée par une grande douceur en toute saison, est balayée par deux vents dominants : la Tramontane et le Marin. Cest ici un sol argilo-calcaire pauvre en réserve deau. A Poilhes, les vignes sétendent dans la plaine de Capestang, dautres dominent, sur le « pech », le canal du Midi.\n\nDepuis quelques années, les terres sont cultivées en agriculture raisonnée, ce qui réduit au maximum lapport de produits phytosanitaires et préserve lenvironnement.\n\nPoints de vente : cave de Montouliers le samedi matin et Poilhes sur rendez--vous téléphonique.',1),(939,'VIGNOBLE DU LOUP BLANC','Vignoble en agriculture biologique et biodynamie situé sur les hauteurs du Minervois.\nNous cultivons 17 ha depuis 2003 sur un sol principalement argilo calcaire avec les cépages Carignan, Cinsault, Grenache, Terret...\nLes vendanges se font à la main exclusivement et à la cave les fermentations se font à partir des levures indigènes.\nEn pleine construction d\'une nouvelle cave, nous accueillerons bientôt des vacanciers dans nos gîtes.',1),(940,'Domaine Parazols Bertrou','Eploitation viticole familliale en cave particulière depuis un peu plus de 10 ans, nous sommes a la croisée des vents d\'est et d\'ouest, a 10 km de Carcassonne.\nNous sommes roducteurs d\'AOP Cabardès et AOP minervois',1),(941,'domaine de chamans','.....',1),(942,'DOMAINE LA PRADE MARI','Dans un vignoble au soleil généreux entouré de collines de garrigues, Eric Mari crée dans le respect de la nature de très beaux vins dappellation Minervois, puissants, fins et élégants, élaborés pour émerveiller vos sens et vous combler de plaisir\n\nSitué dans la partie héraultaise du Minervois, à lEst, le vignoble de 24 hectares est implanté sur un sol limono argileux, logé à labri des vents sur les versants sud de « mourels » érodés. Sur ce terroir les cépages de Syrah, Mourvèdre, Carignan, Grenache, mais aussi Viognier et Roussanne bénéficient de conditions optimales. \nEn 1964 Pierre Mari et son fils Laurent quittent lexploitation agricole (Vignoble, Orangeraie, Oliviers) dans la région dOran en Algérie. Les valises pleines de savoir faire et de volonté, ils sinstallent au hameau de La Prade et reconstruisent un vignoble : le « Domaine La Prade Mari » sur des terres alors bordées doliviers, dans les coteaux prés de la commune dAigne, sur une succession de reliefs constitués darêtes rocheuses recouvertes de garrigue parsemées de pin dAlep et de romarin, séparant des dépressions marneuses. \nAujourdhui le petit fils Eric prolonge lhistoire familiale enracinée sur la terre méditerranéenne à travers son métier de vigneron, dans lesprit de ses ainés, avec le même courage, la même persévérance et la même témérité que ceux qui lont précédé. \nCest par respect de sa terre et amour envers elle quil dirige son Domaine en Agriculture Biologique depuis 2013. La pratique longtemps recherchée par son esprit de cartésien fut trouvée dans la technique \'Naturo-Culture\' élaborée par Michel Barbaud, méthode qui allie les connaissances de la naturopathie avec celles de la science.\n\nNotre gamme se compose de vins de qualité, mis et conditionnés au domaine, qui se caractérisent chacun par un profil authentique et propre. Nous vous proposons des vins de grande finesse, élaborés pour le plaisir des sens avec un excellent rapport qualité-prix.\nUn  Rosé « Rubis des Garrigues » : Séduisant, intense, atypique, aromatique, pour les amateurs de rosé suave et coloré, de rouge léger, dintensité et de plaisir renouvelé tout au long du repas et tout au long de lannée\nDeux  Blancs Un « Viognier » en monocépage, floral et parfumé, et une Roussanne « LOr des Garrigues » élevée en barriques neuves, suprême et unique\nSix  Rouges Du Secret au Trésor « Secret de Fontenille », « Parfums de Garrigues », « Chant de lOlivier », « Conte des Garrigues », « Gourmandise des Bois », « Trésor des Anges » Tant de noms poétiques et évocateurs, aux arômes  plaisants et aromatiques, à la fois intenses, subtils et renommés\nNos vins sont présents sur de nombreuses tables étoilées en France mais aussi à travers le monde.',1),(943,'Domaine Gabelous','Yoann Damian ,son diplôme de viticulture et dnologie en poche, et après des stages chez des vignerons BIO, sinstalle sur les causses de Cazelles .Convaincu par le potentiel de ce terroir et séduit par la beauté du paysage, originaire du Lyonnais, il tombe amoureux de ce coin perdu. Sa passion pour les vieilles vignes , son engouement pour ce terroir , son travail dur et acharné lui permettent dès son premier millésime de 2004 de percer et de se faire un nom dans le minervois.\nIl investit dans un domaine de 15 ha avec des vieux bâtiments à rénover. Le bâti est sain et solide. La cave et le caveau sont semi-enterrés et permettent un travail de vinification et une conservation du vin idéal. Cette superficie lui permet de bien gérer son exploitation avec seulement laide de sa mère (Gisèle). Des embauches sont réalisées pour les vendanges, le travail manuel en petites caisses demandant beaucoup de main duvre.',1),(944,'Château Cabezac','Situé au cur de la région Languedoc-Roussillon, au sud de la France, Château Cabezac est un domaine viticole de 75 hectares classés en AOC Minervois. Gontran Dondain, passionné de vin, acquiert cette propriété en 1997 pour son fort potentiel. Depuis, il na cessé daméliorer son vignoble, de restructurer et moderniser son domaine afin de rendre toutes ses lettres de noblesse à un terroir longtemps sous-estimé. Son ambition est satisfaite, 10 années plus tard, avec le classement de Château Cabezac parmi les grands vins du Languedoc. Le vignoble se situe sur les contreforts du Causse, au pied de la Montagne Noire, et comporte 4 types de terroirs exceptionnels, tous complémentaires pour lélaboration de nos différentes cuvées. Nous avons établi une relation sur le long terme avec les restaurants étoilés et hôtels de prestige, les importateurs, les distributeurs et spécialistes du vin, en France et dans le monde entier. Château Cabezac est aussi une destination touristique avec une cave pédagogique, un centre de formation et un complexe de résidences touristiques. Spa et balnéo/vino thérapie ouvriront plus tard en 2014. Notre ambition est délaborer des vins au sommet de leur catégorie, de les présenter aux visiteurs afin de développer leurs connaissances nologiques tout en profitant dun site exceptionnel.',1),(945,'DOMAINE LES MAILLOLS','Entre Pyrénées et Montagne Noire, à 10 km au nord de Carcassonne, en plein Pays Cathare, le Domaine LES MAILLOLS sétend sur 13 hectares majoritairement en AOP Minervois.\nBaigné de soleil, son vignoble de coteaux principalement exposés sud donne tout son caractère fruité et souple aux vins blancs et rosés, puissant et généreux aux vins rouges aux accents du Sud. Certifié Haute Valeur Environnementale en 2019 et respectueux de la biodiversité, le domaine entame une conversion en Agriculture Biologique dès 2020.',1),(946,'DOMAINE KHALKHAL','A completer',1),(947,'DOMAINE DES MURETTES','Le domaine des murettes est situe LA LIVINIERE dans la zone du petit causse ,secteur chaud aride et mediterraneen  .on y produits des Minervois et Minervois La Liviniere .les vins sont concentres avec des aromes de fruits murs',1),(948,'CHATEAU MARIS','chateau maris',1),(949,'CLOS CENTEILLES','Situe au pied de la Montagne Noire, au carrefour de l\'Herault et de l\'Aude, le Domaine Clos Centeilles est au cur du Petit Causse la partie la plus occidentale du Languedoc sur le territoire delimite de l\'appellation Minervois La Liviniere. Clos Centilles est a la fois la reference cadastrale du domaine et le nom de la premiere cuvee sortie des 1990.',1),(950,'CHATEAU VIRANEL','Bienvenue au coeur du Languedoc, sur le terroir de Saint-Chinian.\n \nCest ici, sur les collines de Viranel, que les vignes partagent le soleil avec garrigues et oliviers. La tradition et la modernite nous ont de tout temps pousses a suivre un mode de culture raisonnee de la vigne sur les 40 ha de notre Domaine familial. Ceci afin de preserver la qualite et la perennite de notre Terroir.\n \nEn effet, la propriete se transmet de generation en generation depuis pres de 5 siecles (1551). Le site trouve ses racines sur les vestiges dune Villa Gallo-romaine, la construction moderne quant a elle fut edifiee en 1911. Elle est ornee dune fresque bachique temoignant de la tradition festive et de lattachement au vin des exploitants.',1),(951,'Chateau Du Prieure Des Mourgues','Nous sommes vignerons dans la famille depuis plusieurs générations.\nA l\'origine, l\'exploitation familiale était située sur la commune de Caussiniojouls, au coeur de la future appellation AOC FAUGERES.\n\nSuite au hasard de la vie, mon grand-père est venu s\'installer sur l\'aire de l\'appellation AOC SAINT-CHINIAN. Celle-ci est très proche de l\'appellation FAUGERES par son terroir, le schiste, et par une climatologie identique.\n\nAujourd\'hui, l\'exploitation a une surface totale de 36 hectares et elle est décomposée en deux domaines.\n\nLE CHATEAU DU PRIEURE DES MOURGUES\n\nSitué à Pierrerue dans le département de l\'Hérault, le Château du Prieuré des Mourgues d\'une superficie de 20 hectares, bénéficie d\'un terroir schisteux exceptionnel.\nLa Syrah est le cépage dominant (60%). Le Grenache ainsi que le Mourvèdre sont répartis d\'égale façon (20% des vignes plantées).',1),(952,'CHATEAU BOUSQUETTE','Domaine viticole en AOC St-Chinian de 25 hectares, cultivé en agriculture biologique depuis 1972.',1),(953,'Domaine des Pradels Quartironi','Nous sommes vignerons en Agriculture Biologique au Domaine des Pradels Quartironi, en Appellation Saint Chinian en Languedoc Roussillon, ou plutot en Occitanie ! \n\nNichees au hameau du Priou, nos vignes en coteaux surplombent la vallee de Saint Chinian. \n Notre terroir de schistes a 300 m  d\'altitude beneficie d\'une situation exceptionnelle, qui favorise le developpement d\'aromes subtils et la fraicheur si caracteristique de nos vins.  \n\nLes vignes en coteaux exigent beaucoup de travaux manuels, dont la vendange qui est encore integralement manuelle sur le Domaine. Dans notre metier de vignerons «du cep au verre» nous allions respect de la nature, techniques et materiels « modernes » aux savoirs faire traditionnels.\n\nVignerons independants, de nos  ceps de vigne a votre verre, nous accordons tous nos soins a l\'elaboration de nos vins biologiques : blanc, rose et rouges, pleins de soleil, fruites, frais, types, riches, complexes, elegants. \nNous vous invitons a les decouvrir .....',1),(954,'Domaine Pech de Saint Paul','Le Domaine Pech de Saint Paul ssétend sur 19 hectares et produits des vins AOC Saint Chiian ,des Vins de Pays dOc et des vins doux liquoreux',1),(955,'CHATEAU LA DOURNIE','Le château La Dournie est dans la famille Etienne depuis six générations et se situe à 30 km au Nord Ouest de Béziers, sur le terroir de Saint Chinian, dans le sud de la France.\nAcquis par la famille Etienne en 1870, le domaine se transmet de mère en fille depuis trois générations.\nLe domaine s\'est développé et acquit un outil de production puissant pour produire des vins de qualité et préserver son héritage.',1),(956,'TERRES FALMET','TERRES FALMET est le Domaine que jai cree en 1996, lors de mon arrivee dans la region de Saint Chinian. Les vins que jelabore dans mon authentique vieille cave languedocienne sont issus de mon vignoble, un tres grand coteau de 20 ha, exceptionnel, aux pentes farouches et au sol calcaire.\nTERRES FALMET est certifie HVE 3 (Haute Valeur Environnementale Niveau 3).',1),(957,'Domaine des Mathurins','Cest sur cette terre de vignobles historiques,que le domaine des Mathurins a grandi.\n\nFruit de cinq générations de vignerons, héritier de vignes séculaires, ce domaine familial a su développer un savoir-faire propre qui confère à ses vins équilibre et audace.\n\nSitué sur un sol argilo-calcaire, les 20 hectares du domaine bénéficient dun climat exceptionnel, favorisant la cueillette des raisins à pleine maturation, quels que soient les cépages. \n\nSyrah, Grenache, Mourvèdre, Cinsault, Carignan et Viognier donnent ici des AOC Saint Chinian et vins de Pays de qualité supérieure.',1),(958,'DOMAINE CARRIERE AUDIER','domaine familial situé a Vieussan très beau village dans la vallée de l\'Orb;',1),(959,'CHÂTEAU MILHAU-LACUGUE','La scea Château Milhau-Lacugue est exclusivement située sur le domaine de Milhau à Puisserguier. \nCe grand domaine Languedocien, d\'origine romaine, s\'est structuré tout au long du moyen age grâce aux Hospitaliers qui accueillaient commerçants et voyageurs à l\'époque des grands pèlerinages. \nLa géologie très tourmentée de ces coteaux exposés Sud-sud-est autorise la production d\'une véritable gamme de vin composée de blancs, rouges et rosés, d\'appellation Saint-Chinian contrôlée, de vins de cépages et de cuvées Igp Coteaux de Fontcaude.\nL\'huile d\'olive complète ces productions viticoles.',1),(960,'Cave De Roquebrun','La Cave de Roquebrun creee en 1967, est situee a 30 km au nord de Beziers entre les deux capitales regionales Montpellier et Toulouse.\nLe village de Roquebrun beneficie dun microclimat exceptionnel. Cette douceur a valu a Roquebrun detre presente comme « le petit Nice de lHerault » et en fait un haut lieu touristique de la Vallee de lOrb. Ce climat tres doux, mais relativement aride, associe aux sols acides des schistes, permettent un epanouissement particulier des differents cepages de lappellation Saint-Chinian.\nIci a Roquebrun, nous produisons des vins en AOC Saint-Chinian-Roquebrun, AOC Saint-Chinian,\nAOC Languedoc et IGP Pays dOc.',1),(961,'Laurent  Miquel','La famille Miquel possédait déjà des vignes en Languedoc sous lAncien Régime. Puis elle reprit en 1791 le domaine Cazal Viel, exploité par les moines de lAbbaye de Fontcaude. Ces générations passées nous ont transmis une grande expérience. Installés au cur du Languedoc viticole, nous connaissons désormais nos terroirs sur le bout des doigts. Nous privilégions dans nos vignes les cépages nobles, la Syrah et le Viognier, qui sont les mieux adaptés à notre terroir.',1),(962,'Domaine Marion Pla','Une exploitation familiale, nous sommes en cave coopérative depuis le millésime 2007.',1),(963,'BORIE LA VITARELE','Nous avons créé le domaine Borie La Vitarèle en 1990. Nous sommes en culture biologique certifié par Ecocert et nous cultivons nos vignes en biodynamie depuis 1999. Nous vinifions 6 cuvées.\nAOC Saint-Chinian : Les Terres Blanches, Les Schistes et Les Crès\nAOC Saint-Chinian-Roquebrun : Midi Rouge\nAOC Languedoc blanc : Le Grand Mayol\nVDP Coteaux de Murviel : La Cuvée des Cigales',1),(964,'Domaine de Pech Menel','Deux Surs respectueuses de l\'environnement exceptionnel de leur Vignoble,  des vins elegants, races, intenses et authentiques comme leur Terroir. Domaine en Agriculture Biologique\n\nDans ce  Domaine ancestral fait dun seul tenant, les vignes empruntent a la garrigue leur juste part, se frayant une voie entre les cailloux, respirant les essences environnantes de thym, de romarin, de lavande, pour reveler un terroir a part entiere. Vendangees a la main, leur fruit s\'apprecie dans les differents vins, expressions d\'un savoir-faire et dune identite affirmee.\nLes Vins : \nla gamme \'plaisir\' avec \nles rouges : Cru SAint Chinian :NO NAME , La Villa Pech Menel, \nle blanc IGP OC :Blanc Poudre \nLA gamme \'passion\' avec : Chateau Pech Menel  (Virtuose) , Chateau Vallouvieres : de tres grands rouges en Cru Saint Chinian\nLe Domaine de Pech-Menel se situe sur une eminence, non loin du village de Quarante. \nOn y accede par un petit chemin sinueux qui monte le long du coteau. \n\nConsacre des lantiquite, le site conserve de nombreux vestiges (dolmen, villa, poteries, armes, outils, etc.) La construction actuelle remonte aux annees 1720. Elle abritait la bergerie des moines de Quarante et probablement une cave puisque la culture de la vigne est attestee a cette epoque.\n\nLa propriete couvre 55 ha, dont 23 en vignes. Elle est implantee en pleine garrigue, a des altitudes variables. Sa vegetation est typiquement languedocienne, et se compose de bois (pins, de chenes kermes) et de plantes buissonnantes (genet, thym, romarin, lavande, ciste, arbousier.) \nLe vignoble est classe dans laire dappellation Saint-Chinian. \nOrientees majoritairement au sud, les plantations sont en coteau, parfois de forte declivite. Les sols, tres caillouteux, sont travailles mais non desherbes ou tres peu. Domaine en Agriculture biologique dans sa totalite. \n\nBien que de conception ancienne, la cave se trouve a moitie enterree et beneficie dune regulation naturelle de son ambiance. \nElle satisfait ainsi aux conditions de production sans recourir aux energies externes. Lequipement y est traditionnel   tout en comportant des outils plus recents, choisis en fonction de leur efficience.     \n  \nLe vin est elabore dans ce cadre, decline en plusieurs cuvees refletant une conception propre ou une unite de terroir. \nLes vinifications sont appropriees a leurs vocations respectives et les elevages assures strictement en cuves, afin de garantir la transparence du fruit et, incidemment, celle du terroir d\'origine. Les vins sont delivres apres un long murissement qui permet a leur caractere de s\'affirmer pleinement. \n \nMarie-Francoise et Elisabeth Poux, proprietaires-recoltantes',1),(965,'MARE DE LAUZERDA','Dans le Sud de la France, au cur du Languedoc, à 250 m d\'altitude sur le plateau argilo-calcaire de Villespassans, Le domaine MARIE DE LAUZERDA produit des vins  \'AOP SAINT CHINIAN\', dans le respect des hommes et de l\'environnement, en conversion vers une agriculture biologique.',1),(966,'DOMAINE DE CAMBIS','Vignoble sur montagne de schiste\ncomposée cardigans centenaires\nculture raisonnée\nvendange manuelle',1),(967,'DOMAINE DU SACRE COEUR','A completer',1),(968,'Mas Champart','Domaine de 16 Ha  - 3Ha en cave coopérative, 13Ha en cave particulière produisant 45000 bts dont 90% en AOC Saint-Chinian.',1),(969,'Domaine des Cimes','Le domaine des CIMES est niche au coeur de parc naturel du haut Languedoc a Roquebrun. Lexploitation dune dizaine dhectare setend sur un terroir dexception, terre de schiste, dans laire dappellation AOP Saint Chinian et AOP Saint Chinian ROQUEBRUN.',1),(974,'LES VINS DE LA DIFFERENCE','Imaginez un lieu unique presque magique, entre mer et montagne, au pied des contreforts pyrénéens. Le paysage est dominé par des falaises abruptes, aux reflets gris, au pied duquel s\'étend un vignoble à couper le souffle. C\'est sur ces 14 ha empreints d\'Histoire, qu\'en 2003 ces passionnés de vin ont décidé d\'encrer leur amitié.\nAujourd\'hui, Le Domaine La Différence fait partie des domaines incontournables du Languedoc Roussillon.\nSitué sur la commune de Tautavel, le Domaine produit aujourd\'hui 4 cuvées d\'exception que sont LA DIFFÉRENCE et sa RACINE CARRÉE en rouge, rosé et blanc.\nDans des écrins aux habillages énigmatiques, La Différence nous livre sa vision du Roussillon : l\'assemblage du Carignan, de la Syrah et du Grenache fait merveille, unique et complémentaire. Ces vins puissants et généreux sont aujourd\'hui reconnus pour leur finesse et leur élégance.',1),(984,'domaine de rolland','exploitation viticole depuis 1850 et 6 générations de vignerons indépendants de père en fils. Nous produisons des vins Biologiques AOP Fitou  et IGP de l\'Aude rouges et blancs. Depuis quelques années, nous nous orientons vers une diversification de la production: en effet, nous produisons de l\'huile d\'olive bio et l\'achat d\'une unité de trituration est envisagé à très court terme.',1),(985,'Domaine de Cazaban','',1),(986,'Sas le Sauzet','Producteur de vin Bio IGP Cévennes. Rouge, Rosé, Blanc, bouteilles & bag in box. Vin rouge «sans sulfites ajoutés»\n\nProduits biologiques : vinaigre de cidre (nature et aromatisés : miel, piment d\'Espelette), vinaigre de vin blanc (nature et aromatisés : noix, estragon, basilic, herbes de Provence), de vin rouge (nature et aromatisés : framboise, échalote), vinaigre balsamique de Modène, vinaigre d\'alcool. Moutarde de Dijon : forte nature, complète à l\'ancienne, au citron, aux 5 plantes de Provence, au miel et épices, Dijon et ancienne au piment d\'Espelette, moutarde au moût de raisin, moutarde à la truffe. \n\nFabrication à façon.',1),(987,'DOMAINE DE LA TOUR','C\'est en 1212 que les Templiers décident d\'élever une commanderie à Saint-Chaptes sur les riches terres alluviales de la rive nord du Gardon.\n800 ans après, le donjon des Templiers domine toujours les bâtiments du domaine auquel il a donné son nom.\nDepuis le 13ème siècle, le Domaine De La Tour n\'a été vendu que trois fois, il a été habité et aimé par des représentants des plus illustres familles du Languedoc qui se sont toujours attachés à son développement et son embellissement.\nTémoin de l\'histoire du Languedoc, le Domaine De La Tour est aussi une exploitation agricole dynamique.\nLa famille propriétaire des lieux depuis 1835 s\'attache à la conservation de ce précieux patrimoine et au développement du Domaine viticole.\nLe vignoble entièrement replanté en cépages nobles dans les années 80, permet lélaboration de deux gammes de vins complémentaires.\nDune part, les vins nobles AOP du Duché dUzès. Dautre part, des vins de cépages reconnus tel que le Merlot, Cabernet Sauvignon, Chardonnay et Viognier.',1),(988,'ADRIEN DEBAUD','A completer',1),(989,'Domaine Sainte Octime','Entre Mer et Cevennes, le Domaine Sainte Octime exploite et vinifie en cave particuliere 25 ha de vignes, en vin de Pays du Gard, Pays des Cevennes, Pays d\'Oc et AOC Coteaux du Languedoc.\nTransmis de Pere en Fils depuis le XVeme siecle, le domaine est situe a Sardan dans le Gard, petit village des premiers contreforts argilo-calcaire des Cevennes et trouve sa specificite dans l\'equilibre de son encepagement.',1),(990,'MAS DES CABRETTES','Notre exploitation et une exploitation familiale ou l\'on produit des vins d\'igp Cevennes et de l\'aop duche d\'Uzes .le mas des cabrettes est ouvert tout les jours du 1er avril au 31 decembre et du lundi au samedi inclus du 1er janvier au 31 mars.\ntout les mercredi de juillet et aout a 17h Mireille et Daniel vous propose la visite du vignoble et de la cave suivi d\'une degustation.\non organise egalement 2 portes ouvertes le mercredi 15 juillet et le mercredi 12 aout',1),(991,'Domaine La Mijane','Domaine viticole depuis le 18eme siecle, La Mijane setend sur une centaine dhectares, dont 30 ha de vignes, situe aux portes de Carcassonne et en bordure du Canal du Midi. \nCette situation nous confere notre appartenance aux appellations : Cabardes , Pays dOc et Cite de Carcassonne. \nLes influences oceaniques et mediterraneennes creent une alternance de fraicheur et d\'ensoleillement nous permettant delaborer des vins complexes, originaux et equilibres.',1),(992,'Château l\'Armoria','Le Château LArmoria est dans la famille depuis 7 générations. 9Ha de vignes, 20Ha de champs, 20Ha de bois, un parc dun hectare et des bâtiments du début du 19ème siècle le composent. Nous travaillons avec une approche agroécologique, en harmonie avec le vivant. Nous favorisons la vie du sol : couvert végétal avec un enherbement de céréales et de légumineuses, fertilisation par épandage de fumier de mouton en frais, peu de travail du sol dans linter rang et décavaillonnage dans le rang. La majorité des vignes ont entre 35 et 60 ans avec un encépagement de carignan, syrah, mourvèdre, grenache, ugni blanc. La volonté est de maintenir ces vieilles vignes par un travail de curetage des ceps, tuteurage, peu de rognage, pas de pré-taillage, vendanges manuelles. Les parcelles sont autour du domaine. Elles sont bordées ou entourées par les 20 hectares de champs en bio sur lesquels nous avons du blé variétés anciennes, ainsi que par la colline boisée qui est accolée à la cave. Cette unité nous permet de travailler sur la biodiversité. Le domaine est entre Laure et Villeneuve Minervois, sur le piémont de la montagne noire sur des sols divers sur ce petit périmètre, très argileux sur certaines parcelles et argilo-calcaire et parfois sablonneux sur les autres. Grâce à ce terroir, la fraicheur est la principale caractéristique de nos vins. Au chai, nous vinifions à la parcelle et parfois même avec une vinification traditionnelle et une macération carbonique pour la même parcelle. Ceci nous permet davoir un maximum de possibilité lors de lassemblage de nos vins.',1),(993,'Domaine de la Gourgasse','Domaine datant du 19eme siècle, de 27hectares en bordure du canal du midi.',1),(995,'WARIS BERTRAND','Situe sur la D28 entre Beziers et Bessan, a seulement deux kilometres de la mer,\nle Domaine de Montmarin est deploye sur plus de 400 hectares. Il beneficie d',1),(996,'Domaine Croix Saint Julien','La Croix Saint Julien est un petit domaine familial situé entre Sète et Montpellier. Nous produisons des vins des collines de la Moure. \nNos raisins sont sélectionnés et vendangés par nos soins, les rendements sont faibles et la vinification se fait de façon traditionnelle.',1),(997,'Domaine de Caylus','Le domaine de Caylus est situé sur une ancienne Villa romaine où à l\'époque on cultivait des oliviers et du blé ; aujourd\'hui nous pouvons admirer quelques vestiges de ce passé au musée archéologique de Portiragnes.\nPour la famille ANDRIEU, l\'histoire commence en 1963 : lorsqu\'Henri Andrieu, négociant en vins issu d\'une famille vigneronne de Rieux Minervois dans l\'Aude, achète le domaine à son retour d\'Algérie.\nSes fils, Louis et Henri reprendront le domaine quelques années plus tard et se convertiront à l\'agriculture biologique en 1999. A ce jour, Inès, la petite-fille d\'Henri est la gérante du domaine et cultive ainsi la tradition familiale en devenant la sixième génération vigneronne de la famille.\nLa superficie du vignoble est de 20 hectares où différents cépages y sont cultivés : chardonnay, merlot et pinot afin de produire des vins de catégorie IGP Vin de Pays de l\'Hérault en agriculture biologique ( Bio Ecocerrt) afin de préserver le plus naturellement possible ce terroir d\'exception.\nAu domaine de Caylus, la famille Andrieu produit des vins rouge, rosé et blanc en alliant le savoir faire familial aux nouvelles techniques de culture et de vinification et obtient des vins avec beaucoup de personnalité.',1),(998,'La Chartreuse de Mougères','Le nom de Mougères désigne un terrain planté de cistes, un arbuste fleuri typique de la garrigue méditerranéenne. La Chartreuse de Mougères est situé à une dizaine de kilomètres de la ville de Pézenas, au pied du massif des Cabrières. La partie supérieure du vignoble forme un plateau d\'une superficie d\'environ 20 hectares. Ce terroir, composé de cailloutis quartzeux et d\'argiles permet l\'élaboration de vins rouges fins où prédominent des parfums dépices.  Le reste du vignoble s\'étend entre de légers coteaux et les méandres de la Peyne qui borde le monastère. Cest là particulièrement que sont plantés les cépages blancs.',1),(999,'La Vendémiaire','Nous sommes la cave coopérative de Fleury dans l\'Aude. Nous produisons environ 60 000 hls sur 900 ha de vignes.\nNous déclinons nos vins en IGP Pays d\'Oc et AOP Coteaux du Languedoc La Clape',1),(1000,'Domaine Ricardelle de Lautrec','Le Domaine Ricardelle de Lautrec est situe\nsur la commune de Coursan dans lAude,\nau carrefour des terroirs de la Clape, du\nMinervois et des Corbieres.\nIci, lhistoire a largement laisse son empreinte :\nla Via Domitia court le long de nos quarante hectares\nde vignes.\nVignoble aux multiples cepages, allant du Merlot a la\nSyrah pour les rouges en passant par le Cabernet\nSauvignon, le Viognier, le Chardonnay ou encore le\nMuscat a petits grains pour les blancs et roses...\nNotre savoir-faire\nCest lhistoire dun terroir mais aussi une histoire\ndhommes.\nNos vins sont le resultat dun travail commence il\ny a longtemps. Voici quatre generations que notre\nfamille cultive la vigne et elabore ses vins selon une\njuste mesure entre oenologie moderne et savoir faire\ntraditionnel.\nAujourdhui, Lionel Boutie (arriere petit fils), perennise\nce travail de quatre generations et a fait le choix\ndepuis 1999 de conduire ses vignes suivant les regles\nde lAgriculture Biologique.',1),(1001,'Neotera','Nichés entre les Corbières, la Clape, et la mer, Néotera jouit d\'un territoire exceptionnel, accompagné par 500 vignerons pour une superficie de 2500 ha de vignobles du Grand Narbonne, les vignobles sont repartis sur 4 villages (Narbonne, Ouveillan, Sallèles d\'Aude et Vinassan). NEOTERA, Cave du Grand Narbonne, est le symbole de la naissance d\'une unité locale pour une même passion, celle du vin et celle de leur terre qui par son grand N devient la racine d\'une véritable expression de son caractère.',1),(1002,'Les Vignerons de Florensac','Les vignerons de Florensac reunissent aujourd\'hui 140 cooperateurs passionnes, fiers d\'etre membres de la grande famille de la cooperation. Ces femmes et ces hommes, qui conjuguent efforts, passion, humilite, savoir-faire, innovation sont la pour transmettre une culture millenaire, \'l\'art de la vigne et du vin\'. Chacun de nous participe avec enthousiasme, a cette nouvelle aventure amorcee avec le projet Vinipolis.',1),(1003,'Domaine Haute Condamine','Coteaux et plaines en terrasses villafranchiennes, avec en toile de fond, au Nord l\'Espinouse et les contreforts des Cévennes, bordés par la mer Méditerranée au Sud, nos vignes s\'épanouissent et prospèrent en Languedoc, près de Béziers, pour nous donner des crus de grande qualité.\nVigneron depuis 1970, sur un Domaine de 30 hectares, c\'est en 1997 que mon père se lance dans la vinification et commercialise ses premières bouteilles.\nDiplômée de l\'Ecole Supérieure Agronomique de Montpellier, je le rejoint en 2004 pour perpétuer la tradition familiale.\nCette passion pour la vigne et le vin est transmise dans notre famille depuis 1732. Nous représentons la 5ème et la 6ème génération de vignerons.',1),(1004,'BLB Vignobles','BLB Vignobles offre des vins de maison à partager avec vos amis et votre cuisine préférée. Derrière les bouteilles des Domaine de la Jasse et Montlobre se cache Bruno Le Breton : fin technicien des vins, il est précurseur de la Responsabilité Sociétale des Entreprises et de l\'agriculture durable. De la Haute Valeur Environnementale à la Responsabilité Sociétale des Entreprises, chaque choix réalisé de la vigne à la cave en passant par le bureau est évalué selon son impact social, environnemental et économique. Voilà pourquoi vous serez dautant plus heureux douvrir les bouteilles de la Jasse et Montlobre : pour le plaisir de vos papilles, et le choix dune maison familiale engagée.',1),(1005,'L\'HERBE SAINTE','D\'origine bourguignonne, nous avons baigné dans l\'esprit du vin avec les Appellations de St Véran, de Pouilly Fuissé, de Bourgogne Pinot noir et bien d\'autres,...\nEn 2001, nous procédons à l\'acquisition du Domaine de l\'Herbe Sainte et à l\'élaboration de notre premier millesime. Aujourd\'hui, notre vignoble atteint une superficie de 65 ha de vigne et de 20 ha de terre à réencépager.\n\nNous vous invitons à partager un moment de détente et de convivialité avec la visite du vignoble et de la cave. Découvrez et dégustez les vins AOP Minervois Rouge et d\'IGP Pays d\'OC Blanc, Rosé, Rouge ; l\'huile d\'olive \'l\'Olivière\', le miel dont les ruches se situent sur le domaine et les confitures maison. A votre disposition, une salle de réception de 300m2 adaptée aux groupes et professionnels du voyage, les associations ou les entreprises (arbres de Noël, séminaires...). La salle dispose d\'un espace traiteur, bar et détente, d\'une terrasse avec vue sur le vignoble. AU niveau de l\'hébergement, nous mettons également à votre disposition un gîte moderne et confortable de 147m2 accessible aux PMR avec une capacité allant jusqu\'à 8 personnes. Il dispose d\'une terrasse privative de 33m2 avec une vue sur le vignoble. 5 emplacements pour camping-cars sont également disponibles.',1),(1006,'Domaine de Guyot','Le Domaine de Guyot construit sur les restes d\'un ancien prieuré est situé sur les coteaux de la haute plaine de Vidourle entre Nîmes et Montpellier .Dans notre cave vous pourrez déguster nos vins : banc ,rosé , rouge et, notre Nectar de Cassis et pourrez mieux comprendre la passion qui nous anime dans l\'élaboration de produits de qualité qui font la réputation de notre domaine',1),(1007,'DOMAINE ALAIN CHABANON','Domaine de 16 ha de vignes en production pour une prodiction moyenne de 55000 bouteilles. Culture biologique et biodynamique',1),(1008,'Domaine La Yole','Un grand domaine de 105 hectares qui inspire la création car il possède des variétés de sols comme des coteaux argilo calcaire et des sables sublittoraux ainsi que des variétés de cépages tels que : Chardonnay, Muscat à petits grains, Terret Bourret, Viognier, Sauvignon, Grenache, Syrah, Merlot, CabernetSauvignon, Cinsault, Alicante Bouschet, Carignan.\nLa Famille Gassier réalise sans artifices ses créations grâce à des produits nés dun environnement privilégié. Ce cocon, où cohabitent une faune et une flore respectées est entretenu dans un souci constant décologie.',1),(1009,'MAS DE MADAME','Le Domaine du Mas de Madame est un domaine familial sur lequel travaillent le père, ingénieur agronome, et le fils, oenologue diplômé. S\'étendant sur 56 hectares dont 46 plantés en vigne, le domaine est l\'un des fleurons de l\'appellation Muscat de Frontignan. Les vins produits sur le domaine reflètent l\'élégance, la finesse et le fruité tirés d\'un micro-climat exeptionnel dû à la proximité de la mer, des sols argilo-calcaires des coteaux du massif de la Gardiole et d\'un ensoleillement exceptionnel. La production du Domaine est très variée. Les vins blancs allient intensité aromatique, finesse et équilibre. Les vins rosés sont fruités et atypiques pour la région. Les vins rouges, frais et fruités reflètent la finesse d\'un terroir habituellement distingué pour ses vins blancs. Enfin, les vins doux naturels d\'appellation Muscat de Frontignan allient finesse, puissance, fruit et complexité. Régulièrement distingué pour la qualité de ses vins, le Domaine du Mas de Madame propose ses vins sur l\'ensemble du territoire Français ainsi qu\'en Europe et en Asie.',1),(1010,'Domaine du Mas Rouge','Situé sur le site exceptionnel des Aresquiers à Vic la Gardiole, vous trouverez sur place le caveau de vente du Domaine du Mas Rouge avec toute une gamme de Vins en AOC Muscat de Mireval, Muscat de Frontignan, Vins de Pays d\'Oc blanc et blanc doux (vendange surmûrie) ainsi qu\'une sélection de vins rouges et rosés de la région Languedoc.\n\nVous pourrez également bénéficier d\'une salle de réception pouvant accueillir environ 150 personnes pour organiser vos événements (mariages, séminaires, conventions...). Tout cela dans un cadre magique et privilégié, au cur du Bois des Aresquiers entouré de pinèdes et de vignes à perte de vue... Un grand bol d\'air en perspective !',1),(1011,'CHATEAU DE GOURGAZAUD','Perché dans sa pinède, adossé aux premiers contreforts de la Montagne Noir, le Château de Gourgazaud a quelque chose dune île. Un univers en soi où, très tôt, sous limpulsion de Roger Piquet, fut pris en famille le pari de redonner à la terre minervoise la fierté de ses vignes et de ses vins. Tout a donc été mis en uvre depuis 1973 afin dancrer durablement dans cette propriété de 100 hectares la culture de la qualité et du grand vin. Outre ses rouges stylés dont lambition demeure de conjuguer la fougue méditerranéenne à lélégance classique, le Château de Gourgazaud, premier producteur de lAOC La Livinière, sest fait reconnaitre par ses blancs et notamment son exubérant  Viognier, né des schistes noirs des collines voisines.\nLa syrah et le Mourvèdre, base de lencépagement du Château, sont cultivés sur des sols argilo-calcaires.\nAprès une sélection de nos meilleures cuvées, la Réserve est élevée en barriques de chêne pendant plus de 12 mois. Ce vin à la robe profonde développe des arômes de fruits rouges, de violette et de sous-bois.\nLe Viognier du Domaine de Gourgazaud puise sa complexité et sa puissance aromatique dans des terroirs de schistes à la richesse minérale. Ce grand vin du Languedoc est souple et gras, riche en arômes puissants dabricots mûrs et de pêches blanches.\nLe Chardonnay, aux notes fruitées, et le Sauvignon, acidulé et vif, se cultivent sur des sols calcaires de lâge du Miocène.\nPropriété de la Famille Piquet  Tiburce depuis 1973, le Château de Gourgazaud est mentionnée sur les cartes dès le 17ème siècle. Son vignoble décline sa palette variée de cépages rouges : Syrah, Mourvèdre, Grenache et Cabernet-Sauvignon, et ces cépages blancs : Viognier, Chardonnay et Sauvignon Taille courte, vendanges en vert, petits rendements, ces divers travaux de la vigne imposent au fil des saisons leurs règles strictes, garantes dun vin de haute expression.',1),(1012,'DOMAINE SAINT MARTIN','Domaine familial situe dans l\'Aude, a 10km au sud de la Cite de Carcassonne, nous produisons des vins en IGP Cite de Carcassonne et IGP Pays d\'Oc, ainsi que de l\'huile d\'olive.\nBeneficiant d\'un climat particulier en languedoc, transition entre le climat mediterraneen et oceanique, nos vins sont majoritairement des assemblages de cepages tels que : merlot - cabernet - marselan - syrah - caladoc...\nL\'alternance de journees chaudes et de nuits plus fraiches lors de la periode de maturation du raisin nous permet d\'obtenir de remarquables aromes de fruits dans les vins. Elegants et bien equilibres, ce sont des vins actuels et accessibles, qui ne demandent qu\'a etre decouverts !',1),(1013,'PICARO\'S','Notre domaine est né à notre retour du ChiliImprégnés par ces 3 années passées en Amérique du Sud, nous avons tout naturellement estampillé lidentité de notre marque crée en 2007 Picaros wine® dune touche hispanique :  Pi de Pierre-Yves et Caro de Caroline signifie Espiègle en espagnol.Linitiative est partie de lintention de mieux connaître les terroirs à notre disposition, sans matériel à notre disposition nous avons réalisé à la main ce quhabituellement font les machines. En séparant les grains de raisin de la rafle à la main nous conservons le grain entier. La fermentation est ainsi lancée sur grains entiers. Le nom de la cuvée, nous est donc apparu comme une évidence : Amano (à la main en espagnol). Nous travaillons à ce jour une seule cuvée.',1),(1014,'Domaine Bois Bories','Domaine Bois Bories \nVin AOP et IGP OC',1),(1015,'Domaine Marié','Situation géographique : moyenne vallée de l\'Hérault (Languedoc) \nAppellations : IGP pays d\'OC et IGP vicomté d\'Aumelas\nterroir : villafranchien. \nSuperficie :  4 ha (issue d\'un ensemble plus important de 65 ha dont la commercialisation est assurée à ce jour par une cave coopérative)\nculture et vinification : culture raisonnée, faible rendements\nProduction : 18000 bouteilles, rouge, blanc, rosé.\n1ere vinification : 2013\nobjectif de développement à 5 ans : 30000 bx sur les 3 couleurs',1),(1016,'Domaine du Quay','Entreprise viticole familiale de 25 ha de vigne. \nSituee entre le Minervois et les Corbieres, petit ville de plaine a proximite du canal du Midi.\nLe Domaine est gere par 2 freres Olivier et Marc Pendriez.\nNous travaillons notre terre et nos vins en culture raisonnee afin de conserver toutes leurs typicites.\nNous possedons egalement 2 ha d\'oliviers, particulierement de la Lucques.',1),(1017,'Clos Sainte-Pauline','Vignoble compose de 2 entites:\n - Clos Sainte-Pauline sur la commune de Paulhan :\nAOP Languedoc Pezenas (vins rouges)\nAOP Languedoc (vins rouges, blancs et roses)\nAOP Clairette du Languedoc Paulhan (vins blancs)\nIGP d\'Oc (vins rouges, blancs et roses)\nVins de France (vins rouges et blancs)\n\n - Mas de Luperia sur les hauteurs de Neffies.\nAOP Languedoc Pezenas (vins rouges)\nAOP Languedoc (vins rouges, blancs et roses)\nIGP d\'Oc (vins rouges, blancs et roses)\nVins de France (vins rouges et blancs)\n\nVignoble en conversion agriculture biologique depuis janvier 2017, conduite du vignoble en Permaculture.\n\nDes le debut de l\'aventure, nous avons decide de conduire le vignoble selon les principes de la Permaculture.\n\nConsultants en Viticulture-nologie, certifies en Permaculture, nous avons developpe ces approches et ces techniques aupres d\'une centaine de vignerons avant de concevoir enfin nos propres vins\n\nUne approche Pere et Fils, deux generations pour un seul objectif : des vins sains de qualite, Nature, Sans SO2 et Vegan.',1),(1018,'DOMAINE DE LA DOURBIE','Vignoble familial depuis 1781, situé au pied des Causses du Larzac, le vignoble est entouré par deux rivières, l\'Hérault et La Dourbie. Notre philosophie affiche une culture respectueuse de l\'environnement, biologique depuis 2009, de faibles rendements, des vendanges manuelles et une vinification traditionnelle.\n\nLarge gamme de vins rouge, blanc et rosé en IGP d\'Oc et AOP LANGUEDOC.',1),(1019,'DOMAINE PY','Au pied du Mont Alaric, le domaine, créé en 2003, possède aujourdhui un vignoble de 154 hectares de vignes (dont 59 ha en AOC) + 12 hectares de champs et oliviers + 18 hectares de bois, bord de rivière (Aude) landes et friches.\nAprès les dernières plantations en 2012, le Domaine possèdera en globalité 160 hectares de vignoble et produira environ 10 000 hectolitres de vin.\nIdéalement exposé, le climat particulier de cette région, caractérisé par des flux marins et occidentaux, permet de produire des vins généreux et expressifs.',1),(1020,'Les Poteaux','Vigneron depuis 23 ans, je vinifie mes cuvées avec pour objectif le plaisir du dégustateur.',1),(1021,'Domaine les Caizergues','Sur le contreforts des Cevennes,au pied du massif de la seranne, le Domaine les Caizergues a tisse son histoire autour de savoir-faire ancestraux. Dans le plus grand respect, il s\'attache a creer des vins authentiques. Les 33 ha de vignes sont cultives en agriculture biologique sur des sols caillouteux tres qualitatifs a dominante argilo-calcaire.\nNos vins se declinent autour de trois gammes dont les noms temoignent du passe sericole de la region :\n\nLes Amoriers (AOP Terrasses du Larzac)\nLes Magnarelles (AOP Languedoc)\nLes Tisserands (IGP Pays d\'Oc et Saint-Guilhem-le-Desert',1),(1022,'Chateau Fonties','Chateau Fonties est un vignoble familial situe a Fonties d\'Aude, a 10 km de Carcassonne. L\'integralite du domaine se trouve en zone d\'appellation Corbieres. Il est exploite depuis sa creation en 1860. \nMarie-Pierre et Cedric SIRVEN sont heureux de vous accueillir au domaine pour vous faire visiter la cave, vous raconter l\'histoire du vignoble et vous faire deguster leurs vins.',1),(1023,'DOMAINE LEVEJEAN','Le Domaine Levejean est situe a Thezan-les-Beziers. Le domaine familial s\'appuie sur un terroir de graves et de semi-coteaux argilo-calcaire rechauffes par le soleil mediterraneen. Depuis trois generations, la famille Prades est guidee par sa passion pour le travail de la terre et du vin. Entre tradition et modernite, le Domaine Levejean est ancre dans l\'histoire mais a le regard resolument tourne vers le futur. Les methodes de production innovantes et vertueuses ainsi que l\'architecture moderne du caveau temoignent de cet esprit novateur. Les vins de cepages d\'Indication Geographique Protegee Pays d\'Oc, sont caracterises par leur elegance et leur fraicheur. \n\nTous nos vins sont certifies HVE, une certification qui repond aux travaux du Grenelle de l\'environnement. Il s\'agit d\'une demarche volontaire basee sur les principes de l\'agro-ecologie. \n\nNous sommes des Vignerons Independants. La presence de ce label atteste que le vigneron cultive sa vigne et qu\'il eleve et commercialise lui-meme son vin. Il assume totalement la qualite de son travail, l\'execute avec soin et competence.',1),(1024,'Domaine Girard','Domaine familial d\'une trentaine d\'hectare situe sur le terroir de la Malepere produisant des vins rouges AOC Malepere et des vins bancs et rouges IGP Pays d\'Oc.',1),(1025,'MAS CAOUDOU','Le Mas Caoudou est un domaine viticole familial situe dans l\'Herault entre le plateau du Larzac et le lac du Salagou.\n\nGrace a son climat chaud et sec, son terroir unique et atypique de ruffes et la passion transmise depuis plusieurs generations, les 34 ha de vignes offrent des vins equilibres, d\'une belle fraicheur et de caractere.',1),(1026,'Domaine de La Réserve d\' O','Superficie totale : 12,6 ha  \n \nEncépagement total :Syrah :	 	40 %   	35 ans\n				Grenache : 	50 %  	35 ans\n				Cinsault : 	        10 %	35 ans\n\nHistorique : \nEn 2005, après une dizaine dannées de recherche, Marie et Frédéric  découvrent cette magnifique parcelle de 10 ha sur le Causse dArboras. Ils savent quils ont alors trouvé le terroir idéal. Marie apprend peu de temps après quils ont choisi de sinstaller sur  le terroir de ses ancêtres. En effet  sa branche maternelle est originaire de St Jean de la Blaquière,  vignerons, ils avaient du quitter leurs terres lors de la crise du phylloxera. \n\nPhilosophie : Marie Chauffray est née à Sao Paulo (Brésil), au cours de ses études en Agronomie Tropicale, elle rencontre Lucia Batista de Almeida, agronome brésilienne dorigine indienne qui va linitier  à lutilisation de préparations à base de plantes  et  de cendres  dans les techniques culturales. Ces méthodes  biodynamiques sont utilisées  à La Réserve d O depuis lachat du Domaine.\nLidée de donner le nom de notre maison La Réserve dO au Domaine vient de lenvie de créer une réserve naturelle où lon puisse produire du raisin dans un écosystème riche tant au niveau de la faune que de la flore. \nQuoi de plus agréable  que de travailler dans un environnement préservé. Optimiser léquilibre des sols, créer de la biodiversité, permettre aux terroirs de sexprimer pleinement dans les vins, ce nest pas seulement un argument commercial, ce nest pas quune question de mode ! Cest lessence de notre métier.\nNotre vignoble est situé à 400 m daltitude sur les contreforts du Plateau du Larzac et surplombe la vallée de lHérault. Les 10 ha  prennent racines dans un terroir de cailloutis calcaire très pauvre et balayé quotidiennement par les vents du Nord.\nAvec des amplitudes thermiques jour/nuit pouvant atteindre plus de 20 degrés en été, la maturation des raisins se fait lentement et confère à nos vins une fraicheur et une grande complexité aromatique. Cette identité « terroir » est la signature de notre appellation « Terrasses du Larzac ».\nTravail de la vigne :Nous avons choisis de produire du vin dans un contexte global, nous souhaitons prendre en compte non seulement le sol et la plante mais aussi tout le système écologique du plus petit ( microbiologie) au plus grand (système planétaire). \nLes pratiques agronomiques habituelles (travail du sol, taille, ébourgeonnage, etc.) sont indispensables, ensuite nous prenons en compte des paramètres  plus « biodynamiques » :\nPar exemple, nos travaux suivent le rythme solaire ,évident et très important : le cycle journalier du soleil (jour/nuit, lever du soleil, soleil au zénith puis coucher du soleil).Nous préférons mettre en bouteille notre cuvée Sanssoo le matin et Hissez O en fin de journéeDans le cas du Sanssoo, le matin lui insufflera un coté aérien et pour Hissez O la fin daprès midi renforcera sa capacité de garde.\nLa taille de la syrah seffectuera plutôt en période de lune descendante (une quinzaine de jours pendant les mois de février/mars. Cette vigne est plutôt fragile, la taille pendant cette phase lunaire laidera à lutter contre lesca en favorisant la régénération du végétal et améliorera sa vigueur.\nLes préparations à base de bouse de vache et de plantes sont également très importantes dans nos pratiques biodynamiques :\nLa bouse de corne que nous préparons est dynamisée et appliquée en fin de journée sur le sol . Elle permet dobtenir une meilleure structure du sol, en favorisant lactivité microbienne et la formation dhumus, en régulant le ph en développant la croissance du système racinaire de manière verticale vers la profondeur.\nUn autre exemple significatif de notre travail, en 5 ans nous avons divisé les quantités de cuivre Métal (bouillie bordelaise ) apportées à la vigne par 5, sur lannée 2011 nous avons utilisé 0,5 kg de Cu ,1,4 kg en 2012 et 0,7 kg en 2013 .  La norme bio européenne limite cette quantité annuelle à 5 kg par an. Cette réduction est due au fait de mélanger à de toutes petites quantités de bouillie bordelaise une décoction de prêle dynamisée (ramassée à Goulier (Ariège). Notre engagement auprès de lagriculture biodynamique est dicté par notre volonté de produire des vins de grande qualité en respectant au mieux la nature et les êtres qui y vivent.\nCes exemples pris indépendamment des uns des autres ne sont pas déterminants pour les caractéristiques de nos vins. Mais mis bout à bout, ils conduisent à notre style de Vins, unique car étroitement lié au terroir de La Réserve dO. \n\n\n\nTravail en cave : Après les vendanges manuelles, les raisins sont eraflés (excepté 2 cuves de grenache) puis encuvés par gravite. La fermentation se fait naturellement avec les levures indigènes dans des cuves inox ou béton brut. Quelques remontages et légers pigeages sont effectués pendant la macération de un mois environ\nUne partie des vins est alors écoulée en demi-muid de 400 l .lélevage en bois nexcède pas plus de 40% du volume, il est réservé à laffinage des cuves les plus puissantes a fin damener une complexité subtile  à lassemblage final qui seffectue 18 mois plus tard.\nNous nutilisons aucun additif  excepté des doses très raisonnées de sulfite pendant lélevage (24 à 30 mois) et le SO2 total sera toujours inférieur 70 mg/hl.\n\n\nVins :\nSansSoo , cuvée produite sans aucun intrant  \n \nLa  Réserve dO en blanc et en rouge,  cuvée éponyme du Domaine,  photographie de notre terroir (même % à lassemblage que % de lencépagement sur le Domaine)\n\nHissez O,   né dans le haut de la parcelle sur un lit de cailloutis calcaire, cette cuvée nous fait prendre le large  \n\nDoux dO  , vin issu de grenache vendangé tardivement, pas de mutage , ni de sulfitage pour bloquer la fermentation, sucre résiduel = 35 g/hl . \n\n\nBilbo , cuvée hommage à la ville de Bilbao ,  avec beaucoup de grenache \n\n \nMélilo Roc ,  nouvelle cuvée, puissante et sans artifice',1),(1027,'CLOS AGUILEM','Clos Aguilem est un domaine viticole créé en janvier 2015 sur l\'Appellation d\'Origine Contrôlée Terrasses du Larzac. La propriété est gérée par Jean-Charles Auffret. Le vignoble en propriété compte 7 hectares. L\'outil de vinification et de vieillissement des vins sous fûts se situe à Saint André de Sangonis à 35 km à l\'ouest de Montpellier.  Elle produit 25 000 bouteilles par millésime, en IGP Saint Guilhem le Désert et en AOP Terrasses du Larzac sous les marques respectives Mas Aguilem (pour les trois couleurs blanc, rouge et rosé) et Clos Aguilem (pour la couleur rouge uniquement). Le domaine est en conversion Agriculture Biologique depuis Août 2016. Les rendements sont réduits autour de 30 hlha. La vinification est parcellaire, en macération longue d\'au moins 5 semaines.',1),(1028,'Vignerons Createurs','',1),(1029,'Chateau Vessiere','Au Sud de Nîmes \' la Romaine\' sur 65 hectares s\'étend le Vignoble du Château Vessière Histoire d\'Amour entre cette Terre et notre famille qui naquit il y a 7 générations. Vignoble de la Vallée du Rhône, situé en plein c?ur des Costières de Nîmes, notre Domaine dévoile toute la force et le caractère de notre fabuleux terroir. Philippe TEULON vous invite à la découvrir.',1),(1030,'Mas Carlot','Située au sud de la Vallée du Rhône, ce domaine de 70 ha sétend au sud-est de Nîmes, au nord de la Camargue. Le vignoble est implanté sur descoteaux à environ 70 mètres daltitude.',1),(1031,'Chateau MOURGUES DU GRES','Domaine viticole familial en vallée du Rhône,sur l\'appellation\nCOSTIERES DE NIMES.Démarche en agriculture biologique certifiée.',1),(1032,'CHARTREUSE DE VALBONNE','La Chartreuse de Valbonne, fondée en 1203, étend son domaine sur environ 15 ha de vignes.\nDe nos jours le vignoble est cultivé en agriculture raisonnée dans le cadre dun E.S.A.T.  Etablissement de Service et dAide par le Travail pour Personnes Handicapées.\nLes vendanges sont réalisées manuellement et transportées en petites caisses. \nLes raisins sont triés et sélectionnés à larrivée à la cave de vinification afin de vous garantir le meilleur des plaisirs gustatifs.',1),(1033,'CHÂTEAU DE MANISSY','Le Château de Manissy, datant du 17ème siècle, produit 4 grands crus biologiques : Tavel, Lirac, Châteauneuf-du-Pape et Côtes-du-Rhône.\nLe domaine des Pères Missionnaires de la Sainte Famille, est transmis depuis 2003 à un jeune vigneron passionné et talentueux, Florian André, qui élabore, en harmonie avec la nature, des nectars qui sauront vous envoûter !',1),(1034,'Domaine Des Maravilhas','Vignoble biodynamique, certifié Biodyvin, sur les appellations Châteauneuf-du-Pape - Lirac - Laudun - Côtes du Rhône.\nNos vins expriment l\'élégance, la minéralité et la puissance de nos terroirs de galets roulés sur fond argilo-calcaire.',1),(1035,'Domaine La Croix Chaptal','Domaine La Croix Chaptal',1),(1036,'Les vins de Fontfroide','Nous exploitons le vignoble historique de lAbbaye de Fontfroide (toujours propriétaire des vignes, situés autour du Monument). Ce vignoble a été remis en état depuis le début des années 1980. Il comporte 36 ha de vignes en exploitation, dont 2 / 3 en Appellation Corbières et 1 / 3 en Vin de Pays dOc et produit une large de gammes de vins, caractérisés par la « fraîcheur, le fruit et la finesse ». Le terroir particulier de la région porte dailleurs le nom de « Terroir de Fontfroide »',1),(1037,'Jean de Cibeins','La Sarl jean de Cibeins commercialise les vins en bouteilles de la SCEA du Château de Cabriac. Le château de Cabriac se situe en zone nord des Corbières, sétend sur 80 ha de vignes dont 2/3 en Corbières et 1/3 en Vins de Pays dOc. Etant donné le terroir plutôt pauvre et les faibles rendements, la qualité des vins se situe en moyen et haut de gamme. Le marché de la sarl Jean de Cibeins est essentiellement orienté à lexport depuis de nombreuses années.',1),(1038,'Domaine Romanissa','Notre vignoble se partage entre deux communes Ribaute et Talairan.\nSon nom, le Romanissa, nous le devons au parfum de nos collines : a celui du romarin\nEn latin, « Romanissat » signifie « espace de garrigue ou le romarin est roi ». Cette plante, sacree pour les romains, etait emblematique au Moyen Age car les troubadours loffraient a leur dame a lepoque de lamour courtois. \nLes cuvees de notre domaine « Romanissa », sont des vins fins qui sinscrivent parmi les valeurs sures des Appellations Corbieres et Languedoc.',1),(1039,'Chateau des Estanilles','Le château des Estanilles est un des domaines les plus réputés en Languedoc-Roussillon ainsi quun des pionniers de lAppellation Faugères.\nNous produisons des vins de la plus haute qualité possible tout en respectant notre exceptionnel terroir. Nos vins sont élaborés à partir de raisins issus de lAgriculture Biologique et nous minimisons tous les intrants dans le chai pour offrir des vins respectueux pas seulement de notre terroir et de lenvironnement mais aussi de nos clients.',1),(1040,'DOMAINE D\'AUPILHAC','Le Domaine dAUPILHAC se situe à Montpeyroux à 36 Kms au nord-ouest de Montpellier. La cave, qui se trouve au cur du village, a été créée en 1989 dans la maison familiale. Notre famille cultive la vigne depuis plus de 5 générations.\n	  Une partie des vignes se répartit en « terrasses » exposée au Sud  sur le  lieu- dit « Aupilhac ». Le Mourvèdre et le Carignan en sont les cépages principaux complétés par la Syrah, le Grenache et le Cinsault. \nLautre terroir se trouve sur le site « Les Cocalières », à trois cent cinquante mètres daltitude, exposée au Nord-Nord ouest. La Syrah y est dominante, complétée par le Mourvèdre et le Grenache. La partie la plus orientée au Nord accueille quatre cépages blancs de lappellation Coteaux du Languedoc qui sont la Roussanne, la Marsanne, la Clairette et le Rolle  (Vermentino).   \n	Nous pratiquons des labours réguliers pour faire descendre les racines afin datteindre la fraîcheur et la minéralité du sous-sol (le terroir). La résistance de la vigne aux éventuelles sécheresses estivales sen trouve facilitée. \nLe respect du sol, avec la préservation de son équilibre est notre priorité. Nous avons toujours limités lutilisation de produits chimiques et actuellement nous sommes en agriculture biologique, certifiés par ECOCERT et en culture Bio-dynamique, certifiés par DEMETER',1),(1041,'Domaine Belles Pierres','Domaine Viticole situé sur l\'appellation AOC Languedoc St Georges d\'Orques.',1),(1042,'Château La Roque','Le Château La Roque est un domaine viticole historique niché au cur de lappellation Pic Saint-Loup.\n\nSitué sur la commune de Fontanès, à environ 20 kilomètres au nord de Montpellier, le domaine constitue un des fleurons de cette appellation célèbre. La propriété couvre 80 hectares dun seul tenant, dont 32 hectares de vignes. Sur un terroir déboulis argilo-calcaire, le vignoble en terrasses, exposé sudsud-est, forme un amphithéâtre composé de différentes parcelles insérées dans la garrigue. Ici, tout est nature. Le lieu est étonnamment préservé, offrant une interaction unique entre minéral et végétal, vignes et bois. Les vestiges dun château féodal témoignent avec fierté dune histoire forte liée à un emplacement exceptionnel, à la croisée de nombreux chemins empruntés par les hommes depuis la nuit des temps. Le château La Roque produit des vins blancs, rosés et rouges qui sont issus de vignes cultivées en biodynamie depuis de nombreuses années. Les vins de La Roque sont appréciés dans le monde entier et la cuvée La Cupa est régulièrement encensée par la presse spécialisée. Les vins rouges et rosés sont élaborés à partir de syrah, mourvèdre et grenache, tandis quen blanc les cépages cultivés sont les viognier, rolle (ou vermentino), grenache blanc, roussanne et marsanne. Sylviane et Bertrand Barascud sont tombés sous le charme de ce lieu magique. Propriétaires du domaine depuis lété 2015, ils sinvestissent avec leur équipe pour écrire une nouvelle page de lhistoire du vignoble. Très impliqués au quotidien, ils cherchent à révéler le terroir et à produire des vins qui en seront lexpression la plus sincère et la plus accomplie.',1),(1043,'Chateau Les Bugadelles','Le Chateau les Bugadelles est situé au coeur du Massif de la Clape , en Languedoc , près de la Méditerranée.Jean Claude Albert l\' a fait revivre à partir e 2005 après un siècle d\'abandon.Sur un grand terroir historique, le domaine bénéficie d\'un éco système exceptionnel pour produire des grands vins de terroir certifiés bios  dans les 3 couleurs ainsi que de l\'huile d\'olive extra vierge bio. Ces vins, médaillés régulièrement et présents dans les principaux guides internationaux, sont exportés dans le monde entier.',1),(1044,'Domaine DeCalage','Le Domaine DeCalage, 100% Bio depuis plus de 15 ans, s\'engage a transmettre une terre saine pour les generations futures. Les vins de Nathalie sont essentiellement composes de varietes/cepages typiques du Languedoc afin de refleter les qualites du terroir de la Mejanelle (galets roules), en AOP. Un vignoble familial de 18 Ha.',1),(1045,'Maison Francois Ducrot','Oenologue de formation, negociant-vinificateur a Lansargues (Herault), j\'accompagne des viticulteurs de ma region a amener leurs raisins a une maturite parfaite. Je recois les raisins dans ma cave a Lansargues ou je les vinifie et eleve les vins afin de les mettre en bouteille sur place.\nJe selectionne les producteurs de raisins en Agriculture Biologique, qui ont une ethique de production respectueuse de l\'environnement et de la biodiversite.\nLa vinification est realise dans ma cave de Lansargues (Herault) dans la continuite du cahier des charges de l\'Agriculture Biologique.\nJe travaille a dose minimale de SO2 me permettant meme de creer des cuvees sans sulfites.',1),(1047,'CHATEAU LA GRAVE','Héritage du prieuré de Milhegrand, fief de l\'abbaye de Lagrasse au XIIème siècle, le domaine est par la suite devenu métairie, entretenue par toute une lignée de viticulteurs. Jean-Pierre et Josiane Orosquette, eux-mêmes issus de ces familles vouées à la vigne, ont perpétué à leur tour cette longue chaîne. \n\nLeur fils, Jean-François Orosquette, le vigneron d\'aujourd\'hui, tient à son équipe. Pas de bon vin sans un travail et des soins minutieux apportés constamment à la vigne. Thierry Bergé, leur gendre, mène la culture. Et toujours, Jean-Pierre et Josiane Orosquette, maîtres d\'uvre du Domaine qui, au rythme de la vie, veillent encore à la bonne marche de l\'exploitation, tout en transmettant leur savoir aux plus jeunes.',1),(1048,'Domaine Monastrel','Le Domaine MonastreL est une petite propriete viticole familiale de 6 hectares situee au pied de la Serre d\'Oupia sur la commune de Pouzols-Minervois.\nDe la taille de la vigne a la mise en bouteilles de nos vins, nous essayons dexercer notre metier de vignerons en harmonie avec notre environnement et en privilegiant autant que possible des pratiques naturelles et eco-responsables : en conversion vers l\'agriculture biologique, desherbage mecanique, vendanges manuelles, adaptation des pratiques oenologiques, maitrise des intrants...',1),(1049,'Château de Pinet','En Languedoc a quelques encablures de letang de Thau et de la mer, entre Montpellier et Beziers, est situe le domaine familial du Chateau de Pinet  Gaujal de Saint Bon. \nDepuis plus de deux siecles, les heritiers de Toussaint Gaujal assurent de pere en fils la perennite de la tradition de ses vins blancs. Actuellement gere au feminin, Simonne Arnaud-Gaujal et sa fille A-Virginie, pharmacien-nologue recherchent lalliance dun savoir faire et de la modernite.',1),(1050,'Mas Saint Laurent','Domaine familial depuis 4 générations entre garrigues et étang de Thau implanté sur un terroir vieux de plus de 65 millions d\'années (présence d\'oeufs de dinosaures)\nDomaine viticole et oléicole à proximité du Bassin de Thau\n\nProductions de la ferme : AOC Picpoul de Pinet, Vins de Pays : rouge, blanc, rosé. Huile d\'olives.',1),(1053,'Les Vignerons De Quissac','C\' est au coeur du plus grand vignoble du monde, dans le sud de la France que les vignerons de Quissac expriment leur passion du vin et de la vigne :\nC\'est d\'abord l\'attachement à leur région, à leur terroir comme à leurs traditions locales qu\'ils se transmettent de génération en génération.  \n\nCe sont aussi les rapports qu\'ils entretiennent avec leurs vignes exigeantes certes mais aux quelles il apportent les soins les plus attentifs et qu\'ils cultivent avec amour...\n\nNous vous invitons à découvrir cette joie de vivre que l\'on retrouve chez tous ceux qui aiment le vin et savent l\'apprécier en particulier devant une bonne table...\n\nCette région méditerranéenne de garrigues calcaires, adossée aux derniers contreforts des Cévennes et bénéficiant d\'un climat exceptionnel convient particulièrement à la vigne.\n\nUne vigne où l\'on retrouve les cépages les plus connus et les plus nobles, susceptibles de donner les meilleurs vins : Syrah, Cabernet, Grenache, Merlot, Chardonnay...',1),(1054,'DOMAINE DES LOUBATIERES','Le domaine des L oubatières est une exploitation viticole familiale de 32 hectares certifiée Haute Valeur Environnementale (HVE).La partie  cave particulière produit des vins en IGP Cevennes, de la Cartagène et du jus de raisin.',1),(1055,'DOMAINE DE PIERRE BELLE','Profitez de lexpérience de 3 générations de vignerons en cave particulière pour savourer nos vins du Languedoc plein de richesse et de surprise.\nLa culture raisonnée qui tend à protéger lenvironnement et la qualité de notre production est pratiquée sur lensemble du vignoble. En cave nous améliorons nos techniques pour diminuer ou supprimer lusage des sulfites.\nNos grands vins sont le fruit dune culture rigoureuse, de la passion et de lexigence de notre famille de vignerons qui semploie à tirer le meilleur de nos nombreux cépages Syrah, Grenache, Carignan, Cabernet-Sauvignon, Merlot, Marselan, Petit Verdot, Chardonnay, Viognier , Sauvignon, Chasan, Muscat.\nIls accompagneront à merveille vos apéritifs et repas et vous feront partager en famille ou entre amis les saveurs dun terroir baigné par le soleil méditerranéen.',1),(1056,'DOMAINE GALUS','Petit Domaine de 15 ha situe sur la commune de Meynes au cur du Terroir des Costieres de Nimes \nNous cultivons nos vignes dans le respect de l\'environnement et la biodiversite nous sommes naturellement  labelise Biologique par Ecocert nous produisons des vins rose et rouge en bouteille  4 cuvees toutes differentes s\'alliant avec tout vos moments de joies.',1),(1059,'DOMAINE DE LA GRANGETTE SAINTE ROSE','Entreprise familiale produisant un piquepoul vinifié dans les 3 couleurs (blanc, rosé,rouge)',1),(1060,'LES CHEMINS DE BASSAC','Les Chemins de Bassac est un domaine familial de 17 ha qui produit des IGP des Cotes de Thongue de belle expression sur un sol de coteaux argilo-calcaires. Il a connu, tour a tour, ombres et lumieres de lhistoire viticole languedocienne jusqua une audacieuse restructuration de la totalite du domaine a la fin des annees 1980 pour donner naissance a une des plus belles proprietes du Languedoc. Bassac est un lieu-dit et les chemins qui y menent vous invitent a flaner sur ces coteaux ensoleilles ou se cotoient oliviers, vignes, chenes et cypres \nLe vignoble est conduit en agriculture biologique (ECOCERT) depuis 20 ans et est certifie NOP (BIO USA). La production de 100 000 bouteilles est vendue a l\'export (60%) et en France (40%). Notre encepagement, compose de 7 varietes : 5 rouges: Grenache, Syrah, Mourvedre, Cabernet Sauvignon et Pinot Noir ; 2 blancs Roussanne et Viognier, offrent un bouquet aromatique delicieusement equilibre resultat de la combinaison de cepages mediterraneens avec leurs cousines plus eloignees.\nAujourdhui reconnus dans le monde entier, les vins elegants et populaires des Chemins de Bassac sont le fruit dun long travail nourri de la passion du vin et de la conviction que ce terroir cache un noble caractere.',1),(1061,'Domaine Montrose','Le Domaine Montrose est un domaine familial créé en 1701 lorsque le blason des \'Trois Lézards\' fût attribué à notre ancêtre. Le vignoble de 95 Ha est situé dans le Sud de la France, en Languedoc, près de la mer Méditerranée. \n\nLe savoir-faire acquis par notre famille depuis des générations, une viticulture respectueuse de l\'environnement et un engagement de tous les instants, nous permettent de créer des vins uniques. \n\nNous avons fait notre le proverbe \'ce qui est beau est bon et ce qui est bon sera bientôt beau\' Sappho (poétesse grecque de l\'Antiquité).',1),(1062,'Domaine Bassac','Situé à Puissalicon, petit village médiéval du Languedoc, à égale distance de Béziers, Pézenas et Bédarieux, le Domaine BASSAC cultive avec la même passion depuis plusieurs générations la propriété familiale.\nLes vignes du Domaine Bassac réparties autour de la commune de Puissalicon couvrent environ 80 hectares sur des sols dune grande diversité.\nLencépagement du Domaine Bassac, varié et original, tient compte des particularités du terroir et de lexposition de chaque parcelle.\nAvec le souci délaborer des vins authentiques dans le respect du terroir, de la nature et du subtil équilibre qui permet lexpression de lharmonie secrète du sol et de la vigne, nous avons choisi de cultiver nos vignes suivant les règles de lAgriculture Biologique.\nLa cave, située dans le village même de Puissalicon, est un bâtiment ancien aménagé et agrandi au cours des générations.\nTout au long de lannée nos vins sont élevés avec beaucoup de soin. Assemblés, décantés et clarifiés, ils sont mis en bouteille au Domaine dans nos propres installations.\nEt quand les vins du domaine Bassac expriment pleinement cet équilibre particulier qui permet au terroir, à la vigne et aux hommes de sépanouir, alors, enfin, nous sommes heureux... heureux de vous les faire déguster... heureux de vous faire partager notre passion...',1),(1063,'Domaine Lou Belvestit','Domaine familial, situé sur la commune de Magalas, fruit du travail et de la passion de 4 générations de vignerons. Aujourd\'hui le domaine compte une vingtaine dhectares lequel les cépages méditerranéens ( Aramon, Carignan, Cinsault. ) adapté à notre terroir et notre climat ensoleille et excessif . \nL observation et lécoute de l environnement nous permettent une intégration complète dans notre paysage méditerranéen et nous offrent à la saison des vendanges , pratiqués à la main, des grappes gorgées de soleil qui procurent des vins de caractère.',1),(1064,'le caveau d\'adissan','La clairette d\'Adissan est une petite cave coopérative. Ses produits phares sont les AOC clairettes d\'Adissan en sec et en moelleux. Elle produit aussi des AOC Coteaux du Languedoc, des vins de pays d\'Oc, des vins de pays Hérault mention cotes du Ceressou. Elle est très présente sur la région à travers sa marque commerciale : l\'Eglantier.',1),(1065,'DOMAINE DE LA COSTE','Née en 2001 l\'entreprise a pour but de développer les ventes de l\'exploitation viticole familiale DI MARZO et de créer de nouvelles gammes issues de cépages locaux (Syrah - Muscat petits grains) (5O Hectares). Vous serez séduit par la note légèrement fruitée de notre Rosé \'Cuvée des Plages\'. Ouvert toute l\'année - Fermé les w.end et jours fériés',1),(1066,'Les Caves Richemer','Nés de la fusion des caves d\'Agde (Hérault) Sud de France, nous sommes spécialisés depuis longtemps dans la production de vins blancs méditerranéens. La production annuelle est de 100 000 hl répartis comme suit : \n- 65% vins blancs\n- 20% de vins rosés\n- 15%de vins rouges',1),(1067,'Domaine Pujol Izard','Le Domaine Pujol Izard est lunion de deux familles vigneronnes centenaires qui ont décidé, à l\'aube du 21ème siècle, dunir leurs forces et de se partager les tâches, créant un domaine de 110 hectares, avec une gamme variée de vins authentiques.\nIssus de villages voisins, amis denfance, de formation vigneronne et scolaire semblable, le partage des tâches sest effectué naturellement, chacun suivant la marche générale de lentreprise mais se spécialisant...\nAndré Izard aux vignobles,\nYves Pujol au vignoble, à l\'entretien du matériel vignes et caves et à l\'embouteillage,\nJean-Claude Pujol assumant la relation clientèle, la vente et la gestion générale, assisté par Emmanuel, son fils, qui assure lélaboration des vins et le suivi des maturités.\nUne dizaine de personnes assure aujourdhui le fonctionnement de lentreprise.',1),(1068,'Domaine de Valensac','Propriété familiale de 46ha située à seulement quelques kilomètres de la mer Méditerranée. Elle bénéficie ainsi de linfluence maritime et de sols frais, conditions idéales pour lélaboration de vins équilibrés. Vignoble en culture raisonnée.',1),(1069,'Domaine du Siestou','Vignoble de 20ha au coeur du minervois, en conversion vers l\'agriculture biologique, nous proposons des vins typiques de la région. Nous avons également plusieurs hébergements disponibles, chambres d\'hotes, gîte et lodges.',1),(1070,'mitys','Mitys est avant tout une affaire de famille passionnee par l\'art de vivre a la francaise. Notre jeune entreprise a elabore un vin exquis ... qui plait aux jeunes  ! \nQue ce soit en soiree ou pour accompagner de succulents repas, nous etions attristes de voir que les jeunes ne buvaient essentiellement que de l\'alcool fort avec un ajout de boissons sucrees (Red Bull, Coca, Jus de fruits). Ils ne pouvaient en effet pas apprecier le vin dont l\'acidite  n\'est pas adaptee a leur palais.\nC\'est pourquoi, mon mari - Directeur commercial dans le domaine viticole, notre fils en master d\'ecole de commerce, notre fille en bachelor marketing et evenementiel et moi-meme - Commerciale dans l\'agro alimentaire, avons elabore un vin avec l\'expertise de notre ami',1),(1071,'DUNE/SABLEDOC','Cave coopérative dAigues Mortes, produit des vins IGP Sables de Camargue.',1),(1072,'Domaine du Mas Alexandre','Le Domaine du Mas Alexandre est une exploitation familiale de 10 hectares située sur la commune dAniane.\nLes vignes sont implantées sur des sols argilo-calcaires, des galets roulés et des graviers. \nLes cépages cultivés sont : la syrah, le caladoc, le grenache, le mourvèdre, le cinsault, le carignan, le cabernet sauvignon, le chardonnay, le sauvignon et lugni blanc. \nLensemble des parcelles sont conduites dans le respect de lenvironnement, en utilisant les produits phytosanitaires dès lapparition des premiers symptômes de maladie. \nLes raisins utilisés pour les cuvées Les Espérelles sont cueillis manuellement. \nLa vinification est effectuée de façon traditionnelle avec des macérations en cuve de 10 à 15 jours pour rouge et en pressurage direct pour le rosé et le blanc.',1),(1073,'DOMAINE D\'ESPEYRAN','Le vignoble le plus méridional des vins de la vallée du Rhône entre Provence et Languedoc\nLe vignoble du château dEspeyran a été planté en 1791 précisément ici à Saint Gilles, à 25 km au sud de Nîmes la Romaine, en lisière de la petite Camargue, sur les dernières terres de la Costière. Ce terroir unique bénéficie de tous les atouts pour produire des vins de grande qualité.\nDepuis 1791, le château dEspeyran propose des vins qui surprennent les connaisseurs. Classés en AOP Costières de Nîmes sur un terroir exceptionnel, nos vins proposent une typicité marquée des vins du Sud !\nIssus de vignes cultivées dans le respect de la norme Haute Valeur Environnementale (HVE), nos vins font le bonheur des amateurs : des vins rouges à la robe profonde et aux arômes prononcés ou des rosés frais et fruités à la robe pâle.\nEn 2017 nous avons créé une nouvelle gamme « Lenvol » en rouge et rosé qui est un condensé de ce que lon fait de mieux au château dEspeyran.\nA votre tour dy succomber !\nÉtablie sur des plaines ensoleillées, la vigne senracine dans des sols composés dalluvions caillouteuses dorigine durancienne : des terrasses de galets roulés typiques des Costières de Nîmes, quon appelle ici le GRESS, sur des terres calcaires.\nEt lorsque la brise marine de la Camargue sallie à la masse des pierres descendues des Alpes encore chaudes jusque dans la nuit, cest pour préserver toute la fraîcheur du fruit et souligner la typicité de nos vins.\nLe soleil, leau, la pierre et le vent participent à cette gloire.\nUn climat de type méditerranéen aux inflexions marines, des sources souterraines, une moyenne exceptionnelle de 2700 heures densoleillement annuel, un régime de pluie concentré sur un nombre réduit de jours et bien sûr le Mistral qui souffle ici toute lannée pour assainir le vignoble.\nLa vigne était déjà cultivée ici au XIIIème siècle pour les qualités exceptionnelles du terroir mais aussi pour sa ressource en eau, fraîche et abondante, présente dès 5 mètres de profondeur.\nAssociée à un système dirrigation installé en 2018, cette source permet au vignoble de supporter les grandes périodes de sécheresse estivales.',1),(1074,'DOMAINE LE VIEUX LAVOIR','C\'est dans une cave davant-garde s\'inspirant de larchitecture du vieux lavoir de Tavel, que s\'est installée la sixième génération de Roudil. Alliant l\'expérience transmise par ses ancêtres et la générosité de sa jeunesse, Sébastien Jouffret propose dans son caveau chaleureux des vins dexception issus dun terroir traditionnel : Tavel, Lirac, Côtes du Rhône, Vin De Pays du Gard, Vin de Pays d\'Oc',1),(1075,'Domaine Chanoine Rambert','exploitation viticole en cave particuliere',1),(1076,'Domaine CASTEL OUALOU Domaine Les Garrigues Domain','Un savoir faire de vigneron indépendant transmis de génération  en génération pour une production de qualité.\nUn accueil chaleureux et une équipe à votre écoute.\n Plus de 90 hectares de vignes classées en Appellation Lirac et  Côtes du Rhône répartis sur \n\nTrois Domaines :\n            Le Domaine des Garrigues - 6 hectares\n            Le Domaine des Causses et Saint Eynes - 32 hectares\n            Le Domaine de Castel Oualou - 52 hectares.\n\nSitué à Roquemaure et Saint Laurent des Arbres, au cur de lappellation LIRAC un terroir dargile rouge à galets roulés, de côteaux secs et rocailleux, déboulis calcaires, pour le Domaine des Causses et Saint Eynes, Argilo sableux pour le Domaine de Castel Oualou et le Domaine des Garrigues.\nExposition Nord  Sud.\nLutte raisonnée et Travail du sol par respect de lenvironnement.\nLors des vendanges, chaque cépage est ramassé séparément en fonction de la maturité. Certains dentre eux sont assemblés avant fermentation.\nLâge moyen des vignes est de 40 ans.',1),(1077,'CHATEAU TRINQUEVEDEL','Le Château de Trinquevedel est un domaine familiale depuis 4 générations, situé dans le sud de la Vallée du Rhône, à Tavel. Il s\'étend sur environ 32 ha, majoritairement en AOC TAVEL, et AOC LIRAC. Objectif de Guillaume DEMOULIN, gérant depuis 2006 : exploiter au mieux son terroir pour produire des Tavel haut de gamme et les promouvoir dans le plus grand nombre de pays.',1),(1080,'Domaine La Coume-Lumet','La Coume-Lumet est une nouvelle cave particulière créée en janvier 2013. \nElle est installée sur un domaine de 54 ha dun seul tenant, isolé, dans une zone classée Natura 2000 sur les hauteurs de la commune de Cépie entre Carcassonne et Limoux dans lAude. \nCe domaine a une histoire ancienne : nous avons retrouvé des traces écrites dans les compoix terriers du XVIIéme siècles (ancêtre du cadastre) de la culture de la vigne et de la construction du bâtiment à cet endroit. Une pierre gravée de la date 1788 sur la maison principale témoigne de ce temps là.\nCe domaine, niché dans un petit cirque naturel (une « coume » en occitan), comporte 15 ha de vignes accrochées à flans de côteaux entre 180 mètres et 350 mètres daltitude, entourées de bois et de garrigue. \nLes vignes sont bercées par les deux influences méditerranéennes et atlantiques  comme en témoigne la flore environnante, et bénéficient, à ce titre, dun bel ensoleillement mais également dune belle fraicheur qui se retrouveront dans les vins. \nLes sols, issus dune ancienne moraine glacière, sont essentiellement constitués de galets roulés sur argilo-calcaire.\nLa conduite du vignoble, très raisonnée, privilégie le travail du sol et lécoute de la nature : nous voulons mieux la comprendre pour laccompagner.\nLe domaine produit un crémant de Limoux, des AOC Limoux blancs et rouges ainsi que des IGP Haute Vallée de l\'Aude blancs et rouges.',1),(1081,'Chateau Ricardelle','Au cur du Parc Naturel Regional de la Narbonnaise sur le magnifique terroir de la Clape se dresse Chateau Ricardelle, petri par plus de 300 ans d\'histoire et de tradition.\nC\'est en 1990 que Bruno Pellegrini, nologue de formation et originaire du Tyrol italien, s\'investit en rachetant la propriete et cree une gamme de vins du Languedoc refletant terroirs, passion et personnalite !\nDans ce vignoble de 36 hectares, ou se confondent garrigues, calcaire, vents, soleil et embruns maritimes de notre chere mer Mediterranee, une selection rigoureuse de clones et de varietes de raisins ainsi qu\'un controle strict de la production ont ete mis en uvre afin de redorer le blason languedocien.\nChateau Ricardelle, c\'est tout a la fois un eventail de grands vins du Languedoc, maintes fois medailles par les concours internationaux, mais aussi des gites proche de Narbonne et des premieres plages de Gruissan dans un cadre paisible et charge de legendes. Les connaisseurs comme les visiteurs sauront apprecier ce sejour rythme par de multiples activites : degustation des grands vins des terroirs sud, randonnees sensationnelles, visites de la cave ...\n\n\nChateau Ricardelle est a la pointe des demandes des consommateurs et connaisseurs des grands vins de Terroir.\nCette notoriete nous oblige constamment a maintenir un resultat et une qualite irreprochables, tout en jonglant avec les methodes traditionnelles et les techniques modernes pour obtenir les meilleurs vins du Languedoc, Notre philosophie se resume a une recherche optimale de l\'expression de notre terroir, la Clape, a la fois petite colline secrete de garrigue ensoleillee en bordure de mer Mediterranee aeree par les vents du sud, et berceau de nos vignes et de nos belles cuvees !',1),(1082,'Château Pech-Céleyran','Château Pech Céleyran est une propriété viticole située sur le terroir de La Clape aux portes de Narbonne.\nLa famille Saint-Exupéry gère et développe depuis 5 générations, les 96ha de vignes en AOP Languedoc La Clape et Vins de Pays, pour produire vins rouges, rosés et blancs de qualité.\nLe développement de l\'oenotourisme a commencé il y a une dizaine d\'années par la rénovation de 5 gîtes et 3 salles de réception dans les chais de foudres centenaires. Depuis quelques mois, 4 chambres d\'hôtes grand confort viennent compléter cette offre afin de vous faire découvrir in situ les vins du terroir.',1),(1083,'CHATEAU CAMPLAZENS','Le Chateau Camplazens est un vignoble de caractere de La Clape, situe au cur du Languedoc dans le sud de la France, entre Narbonne et la mer Mediterranee.',1),(1084,'Chateau de Figuieres','Nous appartenons a notre terroir. \n\nNotre devoir est de lobserver, de le comprendre et de le travailler, afin de le reveler. \nApres le premier contact avec le domaine, coup de foudre sans equivoque, quelques annees de remise en etat de ce joyau auront ete necessaires.\nLessentiel etait dabord dy voir plus clair sur le potentiel du terroir, danalyser les sols, de reperer les sources, et bien sur de tenir compte de lencepagement. \nCe travail dinvestigation, destine a produire le meilleur vin sur ce terroir remarquable, porte ses fruits aujourd\'hui avec nos premiers millesimes. \n\nNotre quete est le gout. \nLes aromes de nos vins doivent etre precis, profonds, elegants, genereux. Nous cherchons a reveler des textures raffinees, des longueurs et complexites remarquables.\n\nNotre quete va plus loin. \nAu-dela du breuvage, le vin constitue un lien entre notre travail manuel acharne et votre recherche de sens et d\'humanite. \n\nNos flacons concentrent ce qui met nos sens en eveil chaque jour : les multiples odeurs de la garrigue, la vue maritime, le decoupage brusque du massif, l\'isolement propice a l\'introspection et a la contemplation.',1),(1085,'Les Chemins de Carabote','Domaine viticole en appellation Terrasse du Larzac.\nTerroir de galets roulés.\nCave gravitaire en pierres du Gard.\nVendanges à la main.\nProduction en Vin de Pays, Languedoc, et Terrasses du Larzac.\nCertification Bio Ecocert\n25.000 bouteilles/an',1),(1086,'Domaine de Rieussec - Vignoble La Croix Deltort','Charmant Domaine viticole de la moyenne vallée de l\'Hérault datant du XVIème siècle, protégé au titre des monuments historiques, appartenant à la même famille depuis 5 siècles.\n\nC\'est dans ce lieu authentique, où la nature y est à peine apprivoisée que nous vous invitons à venir visiter nos jardins dans un environnement boisé en plein cur du vignoble, sur les chemins de Saint Jacques de Compostelle, et à proximité d\'une chapelle romane.\n\nDe cette terre sont issus de grands vins du Languedoc chaque année médaillés.\n\nVisite de l\'Orangerie, du jardin anglais, de l\'allée de buis et des jardins paysagés à la française.',1),(1087,'Domaine Caujolle-Gazet','Alain Caujolle-Gazet a c créé le Domaine en 2010. Le Domaine s\'étend sur 7 ha, à la bordure sud du plateau du Larzac, commune de Lauroux, Hérault. Le sol se développe sur des éboulis calco-dolomitiques fortement pierreux et drainants.\nLa zone, sous la double influence de la Méditerranée et du Massif Central, est soumise à de forts contrastes climatiques, propices ) l\'élaboration de vins frais et expressifs.\nLa vie dans le sol étant la clef de la fertilité, le vignoble est conduit de la manière la plus respectueuse en agriculture biologique (certification ECOCERT) qui intègre aussi des techniques de phytothérapie et de biodynamie.',1),(1088,'Domaine de Brunet','Au pied du somptueux massif de la Séranne, dominant les gorges de lHérault et la vallée de la Buèges, le vignoble du Domaine de Brunet est implanté au coeur de la garrigue sur le plateau du Causse de la Selle, dans un cadre qui invite à la balade et la détente sous le soleil méditerranéen.\n\nDepuis plus de cinq générations, nous cultivons avec force et passion les terres caillouteuses du Domaine qui offrent ce terroir singulier composé dargiles rouges décalcifiées et de roches dolomitiques.\n\nGamme complète de grands vins, complexes, typés, riches, tendres et raffinés, fruit dun savoir-faire ancestral et dune longue tradition vigneronne, respectueuse du terroir et de lenvironnement.\n\nDécouverte dun site préservé et de nos cuvées de référence, Mas Brunet® et Dolinebrune®, élevées en fûts de chêne au sein de nos chais voûtés séculaires...\n\nAccueil chaleureux associé au partage de notre passion de la vigne et de notre amour des vins de convictions.\n\nHoraires douverture du caveau :\n\nde juin à septembre : 9h00  12h00 et 15h30  19h30\n\nde octobre à mai : 9h00  12h00 et 14h00  19h00',1),(1089,'La Jasse Castel','Le domaine a ete cree en 1997 et s\'etend sur 10 hectares autour de MOntpeyroux et de Saint Jean de Fos. Toutes les vignes sont conduites en agricultures biologiques. Les vendanges sont manuelles et les vins a forte personnalite forge leurs caracteres grace a des rendements minimes (15 a 25 hl)ha) et a de longues macerations.\nDeux blancs, un rose , quatres rouges en Montpeyroux et Terrasses du Larzac, une cartagene et une Eau de Vie de MArc du Languedoc, constituent la gamme.',1),(1090,'Mas de Clanny','Domaine familial de 8ha créé en 2015, certifié bio depuis 2010 situé au cur de l\'appellation Terrasses du Larzac.\nJe produit aujourd\'hui environ 10000 bouteilles en AOP Languedoc, Terrasses du Larzac et IGP Pays d\'oc.',1),(1093,'DOMAINE HORTALA','Nous  sommes vignerons en cave particulière depuis 5 générations, installés sur le terroir de Fleury dAude. Nous produisons des vins AOP La Clape et des IGP Pays dOc.',1),(1094,'CHATEAU LA NEGLY','Idealement exposes, les terroirs de la Negly et Boede se distinguent par la diversite de leurs sols. En effet, Boede sablo limoneux et gres, la Negly argilo calcaire donnent aux vins issus de ces vignobles une large palette aromatique.\nLe vignoble s\'etend sur 50 hectares et celui de Boede sur 25. Afin de mieux valoriser celui-ci, la Syrah, le Grenache, le Mourvedre ont remplace l\'Aramon, le Terret, le Carignan blanc. La machine a vendanger a cede la place aux secateurs et aux cagettes.\nBastien Paux-Rosset, responsable de la culture, exploite ces vignobles re-encepages qui s\'etendent sur 75 hectares. Le mode de culture raisonnee s\'adapte parfaitement a nos exigences qualitatives.\nTaille courte, peu d\'apport d\'engrais, labours frequents, palissage haut environ 1,80 m, sont autant de gages de qualite.\nLes 12 salaries permanents, tous plus passionnes les uns que les autres, sont les plus fervents supporters des vins que nous produisons.',1),(1095,'Domaine des Gravalous','Le Domaine des Gravalous est une propriété familiale depuis 1851. Située dans la vallée du Lot, en plein cur du vignoble de Cahors, notre exploitation viticole traverse les générations de père en fils avec succès.\n\nÀ ce jour le domaine s\'étend sur vingt-six hectares de vignes dont le cépage dominant est le Malbec. Nous cultivons dans la vallée, sur les trois terrasses, ce qui nous permet de proposer une large gamme de vin en AOC Cahors et IGP Côtes du Lot.',1),(1096,'Domaine de Marcilhac','Le domaine Marcilhac propriété familiale depuis plusieurs générations est situé sur la rive gauche de la vallée du lot à 10 kilomètres au sud de Cahors.\nVigneron de père en fils depuis 1848 chaque génération a su transmettre son expérience, son savoir-faire et surtout son amour pour la vigne et le vin à ses descendants.\nDans un site privilégié par sa topographie très particulière l\'auxerrois (malbec ou cot noir) à trouvé ici son terrain de prédilection aussi bien sur la deuxième terrasse ou il donne des vins équilibrés ronds et longs en bouche aptes au vieillissement sous bois. La troisième terrasse sur sol rocailleux, argilo siliceux et bénéficiant d\'une exposition plein sud du levant au couchant. Délivre une vendange riche et concentrée, laquelle vinifiée selon la plus pure tradition, donnera naissance à nos meilleurs crus de garde, fleurons de notre production destinés à l\'élevage en fûts de chêne neufs.\nLe vignoble du Domaine Marcilhac est situé dans une boucle du lot bordée de collines aux portes de l\'appellation, d\'une superficie de 12 hectares composé des plus nobles cépages de rouge.',1),(1098,'Domaine Rene Rieux','Le Domaine Rene Rieux est situe a Gaillac sur les premiers coteaux de la rive droite du Tarn. Le Tarn coulant dEst en Ouest, ces coteaux ont une exposition Sud. Les sols sont argilo-calcaires allant dun terroir de roche calcaire (calcaires lacustres) a des coteaux a predominance argileuse ou sablo-limoneuse. Le domaine est agree en agriculture Biologique depuis 2013 (Certification par QUALISUD FR_BIO_16). Il a pour objectif linsertion sociale et professionnelle des adultes en situation de handicap. Les vins du domaine ont une forte personnalite, ils sont le reflet de notre terroir et de notre savoir faire, ce sont des vins dexpression et de garde.',1),(1099,'1501','1501, est le premier AOP Effervescent conditionne en fut de 20 l pour un service a la tireuse.\nAOP Gaillac, produit par les Vignerons de Rabastens issus des cepages historiques regionaux tels que le Loin de lil et le Mauzac.\n1501 sapprecie nature, et se revele aussi une base de premier choix pour les mixologues.',1),(1100,'DOMAINE LE ROC','Cest au coeur de l AOC Fronton que le Domaine le Roc- situé entre Garonne et Tarn- produit des vins de forte personnalité mettant en valeur le cépage emblématique de notre appellation : La Négrette.\n\nDepuis plus de 30 ans, notre philosophie est la même : Travailler en bonne intelligence et dans le respect du vivant. Ici pas de label bio, mais une agriculture saine et raisonnée, avec un travail respectueux et sincère guidé par le bon sens paysan et la certitude que la terre ne nous appartient pas.',1),(1101,'DOMAINE DE GAYSSOU','Situé sur la commune de Broze (canton de Gaillac), à quelques kilomètres de Gaillac, sur les premières Côtes de la rive droite du Tarn, le Domaine de 40 hectares bénéficie dun sol argilo-calcaire et dun très bel ensoleillement favorisant ainsi la bonne maturation des raisins.\n\nLe Domaine est transmis de père en fils, de génération en génération depuis le 16 ème siècle. Déjà dans les années 1900, les vins du domaine de Gayssou étaient reconnus au Concours des vins de 1912 avec une médaille dargent pour le vin blanc doux de 1911, une médaille de Bronze pour le rouge ( côtes de Gaillac) de 1911 et une médaille de Bronze pour le vin blanc sec ( côtes de Gaillac) de 1911.\n\nLabeille apposée sur la porte du four à pain familial en est devenu lemblème. Et aujourdhui Christophe et Nathalie continuent à faire vivre le vignoble dans le respect de la nature, du terroir, et de la tradition familiale, en élaborant des vins issus des cépages locaux tels que le Braucol, le Duras, le Loin de lil ou la Mauzac.',1),(1102,'Domaine Haut Marin','Il y a 23 millions dannees, toute la region etait engloutie par la mer, cest pourquoi lon retrouve encore des nombreux fossiles au pied de nos vignes.                                           \nLhistoire du domaine a debute en 1920, lorsque Jean Francois Morel, viticulteur suisse, decida de sinstaller en Gascogne pour y travailler la vigne.\nAujourdhui le vignoble de 210 hectares est gere par la 3e generation, celle dElisabeth Prataviera, oenologue, et de son frere Philippe Jegerlehner, qui sinvestissent pleinement dans la bonne tenue du domaine.',1),(1103,'HERREBOUC','Le domaine viticole de Herrebouc est un vignoble artisanal gersois typique du Sud-Ouest, compose de 18 hectares de vignes en coteaux argilo-calcaires entourees de 80 hectares de biodiversite, et d\'un chai moderne abrite par les murs du site historique de la tour fortifiee de Herrebouc (XIIIe - XVIIe)\nLes vins blancs et rouges, de gastronomie et de garde, sont issus de 10 cepages - 5 blancs et 5 rouges - et eleves en cuves, jarres ou barriques suivant les gammes : Essentielles, Singulieres et Esprit de Herrebouc. Les vins sont certifies en agricultures depuis 2010 et en agriculture biodynamique - DEMETER - depuis 2020. \nLe domaine elabore egalement une methode ancestrale et quelques jus de fruits.',1),(1104,'LES VIGNOBLES GAYREL','Les Vignobles Gayrel est un domaine familial basé dans le Sud de la France. Nous exploitons 250 hectares de vignes et achetons des raisins aux producteurs locaux pour vinifier l\'équivalent de 700 ha de vignes. Avec une production annuelle de 1,5 Million de bouteilles, nous produisons des vins Vin De France, en IGP et en AOP en blanc sec, rosé, rouge, moelleux et des bulles. Nous produisons aussi des vins personnalisables adaptés aux exigences des marchés visés. Notre réseau National s\'appuie sur le CHR et la Grande Distribution. A l\'export, nous travaillons en Europe et hors EU : Chine, Japon, Taiwan, Vietnam. Autour de Alain Gayrel, fondateur des Vignobles Gayrel, 30 personnes travaillent de la production à la commercialisation. Adaptabilité, flexibilité et savoir-faire tels sont nos points forts et nos valeurs.',1),(1105,'Domaine les pyreneales','Des Pics de saveurs en bouteilles \n\nIssu dune famille de viticulteurs depuis plusieurs générations, Nicolas  Tortigue concrétise son projet en 2013 en achetant  avec son épouse Christelle Celton  le domaine Larroque  situé sur les hauteurs de la commune de Madiran, devenu aujourdhui  le domaine les Pyrénéales.\nPourquoi les pyrénéales ? ce nom est un clin dil à leur deux enfants Pierre et Alan et le massif pyrénéen  que lon aperçoit depuis nos vignes.\nLe domaine sétend aujourdhui sur un peu plus de 10 hectares .Il a été restructuré pour répondre aux exigences de lappellation.\nLa conduite du vignoble est raisonnée. Celle-ci  entraine  la libre expression  du terroir nous permettant dobtenir des raisins de qualité.\nLéquipement du chai de vinification a permis de travailler de manière innovante  les raisins notamment de façon à conserver  un maximum darômes.\nLe domaine Les Pyrénéales a privilégié la mise en avant des vins de Bigorre (IGP comté Tolosan Bigorre), un hymne à la chaine des Pyrénées à travers la découverte de sommets  mythiques comme la cuvée 1489 en rouge et en rosé faisant référence à laltitude du col daspin ; une cuvée plaisir.\nLEsprit de Bigorre, à la découverte du Pic du midi, un blanc moelleux doux et généreux.\nLa cuvée haut de gamme du domaine , le prestige de Bigorre correspond au sommet le plus haut des Hautes Pyrénées  le Vignemale  3298 mètres , un blanc moelleux 100% petit manseng. 1375, Etc...',1),(1106,'Domaine Le Rosier d\'Angelique','Une histoire de famille !\nImaginez-vous au cur des annees 50, a Berrac, un petit village gersois. Cest ici que laventure commence, lorsque mes grands-parents paternels, Andre et Madeleine Corne deciderent de planter leurs premiers pieds de vignes. Au milieu des collines gasconnes, ils vinifiaient leur propre vin quils vendaient a leurs voisins et aux habitues. Chacun avait pour habitude de venir directement a la ferme avec son cubi ou ses bouteilles pour sapprovisionner a la source. Ce moment, plein de convivialite et de simplicite, permettait de prendre des nouvelles de la famille, des amis et meme des animaux.\nMais peu a peu, cette pratique disparue. Les caves cooperatives prenaient de plus en plus dimportances et les petits vignerons se sont mis a vendre toutes leurs recoltes a ces dernieres pour gagner du temps. Mes grands-parents, eux, continuerent a vendre leur vin avec courage et tenacite.\nQuelques annees apres, mes parents, Francis et Nelly Corne prirent la releve sur la propriete familiale. Elle comptabilisait 45 ha de terres agricoles, pour les cereales et 4 ha de vignes. Pour diversifier la production, ils firent le choix de valoriser les vignes des grands parents et de devenir des vignerons independants. Cette annee-la, en 1999, la premiere bouteille du Domaine baptise Le Rosier dAngelique fut commercialisee.\nCette passion pour le fruit de la vigne a continue a rayonner dans la famille Corne. Aussi cette derniere fut transmise aux enfants, Angelique, ingenieur nologue, et Seraphin, gerant de lexploitation. Aujourd\'hui Le Rosier d\'Angelique compte 15 hectares de vignes travailles dans le respect de la nature, au fil des saisons et vinifies entierement au domaine.\nVous pourrez nous rencontrer et continuer a echanger sur notre histoire et nos projets au cours dune degustation conviviale et en toute simplicite.',1),(1107,'Costes-Cirgues','Le Chateau de Costes-Cirgues a Sommieres, ce sont 60 ha, dont 18 ha de vignes, conduits en agriculture biologique. selon les principes de la biodynamie et certifiees Ecocert. Tous nos vins sont vinifies et mis en bouteille sans ajout de sulfites.  La passion du vin et de la nature pour des millesimes exceptionnels, recompenses par des medailles notoires.',1),(1109,'Château de Marmorières','Depuis 1826, la famille de Woillemont produit des vins dans le massif classé de la Clape. Le château de Marmorières est le plus important vignoble du cru et s\'étend d\'Est en Ouest de l\'ancienne île des lacs.\nAvec 16 cépages différents, les vins de Marmorières sont fins et complexes avec une belle fraîcheur. Le domaine est certifié Haute Valeur Environnementale de Niveau 3.',1),(1110,'CHATEAU PECH REDON','Le Domaine de PECH REDON est situe dans  le massif de la Clape, petite montagne entre Narbonne et la mer, sur le plus haut plateau.\nLe vignoble de 30 ha de vignes est compose de Grenache, Syrah, Carignan, Mourvedre, Cinsault pour les rouges et Grenache Blanc, Bourboulenc  pour les blancs.\nSoucieux de respecter les sols et lenvironnement, le domaine est passe en culture raisonnee des 1998, puis en culture biologique  certifiee ECOCERT en 2005.\nLa vendange est exclusivement manuelle et recoltee en caisse de 15 kgs.',1),(1111,'Domaine Cammaous','Viticulteur depuis plus de 30 ans, en 2013, La cave particulière Domaine Cammaous qui est une création me permet de devenir artisan vigneron.\nL\'exploitation viticole s\'étend sur 5ha, située sur le terroir du Pic Saint Loup. \nLes récoltes nous amène à produire du vin rouge et rosé en AOP Languedoc et un vin blanc en IGP Vin de Pays d\'Oc.',1),(1112,'CHATEAU DE LASTOURS','Le vignoble de Lastours sétend en terrasses et collines qui culminent à 300m daltitude avec vue sur la Méditerranée. La synergie entre les sols, le climat et les cépages, fait de Lastours un terroir remarquable des Corbières Maritimes reconnu parmi les Grands Crus du Languedoc. \nEntourées de 800 hectares de garrigue, nos vignes sépanouissent dans un environnement naturel typiquement Méditerranéen : pins boules ou parasols, cistes, chênes kermès, buis, oliviers, thyms sauvages,  amandiers et cyprès\nDans le Midi, planter 3 cyprès à lentrée dun chemin menant à un mas est traditionnellement un signe de bienvenue et dhospitalité.\nLa sculpture, réalisée en inox, incarne aussi la modernité en faisant référence aux cuves de vinification de notre chai. Strié, poli, matifié, cest un matériau, qui se joue à merveille des rayons du soleil et rend hommage à lumière du Midi. \nCette uvre symbolique représente pour nous la richesse de notre environnement et réunit les valeurs qui nous guident : la nature, le partage, la recherche dexcellence dans tout ce que nous entreprenons.',1),(1113,'Terre des 2 Sources','Protege par les contreforts des Cevennes,le domaine s',1),(1114,'Chateau Guilhem','Propriété familiale depuis 1878.\nChâteau Guilhem est située au cur du Massif de la Malepère sous influence Atlantique et Méditerranéenne, avec des cépages inattendus en Languedoc : Merlot, Cabernet Franc, Cabernet Sauvignon, MalbecEn agriculture biologique depuis 2013.',1),(1115,'Domaine Ligneres Lathenay','Le domaine Ligneres Lathenay se situe à Siran (Hérault) dans le sud de la France près de Carcassonne.\n\nCest en 1994 que jai repris le domaine familial de 18 hectares après des études agricoles.\nMa volonté est de valoriser et de pérenniser ce que 6 générations de vigneron avant moi ont bâti jours après jours, dans le respect des traditions.\n\nJai sélectionné  mes meilleures parcelles de Syrah, Carignan, Cinsault et Mourvèdre pour élaborer mes cuvées de Minervois et minervois la Liviniere.\n\nDans un souci délaborer des vins haut de gamme et respect du terroir, jai banni les engrais chimiques depuis 8 ans et je limite lemploi de produits chimiques.\n\nMon exploitation est de taille humaine, jeffectue moi-même les travaux de la vigne jusquà la commercialisation des bouteilles.',1),(1116,'Château Landure','Au cur du Minervois, nous sommes heureux de vous accueillir au château de Landure. Nous vous proposons au cours d\'une de vos visites de vous faire découvrir notre vignoble et de vous faire partager notre passion pour le vin issu de ce terroir exceptionnel.',1),(1119,'DOMAINE LOUIS','vignoble',1),(1121,'LA CEZARENQUE','La Cézarenque est située au cur des Cévennes.\nNos activités sont diversifiées allant de l\'élevage à la vente en passant par la transformation dans nos différents atelier de production.\n\nNos produits :\n- Pâtisserie sucrée et salée\n- Boulangerie\n- Charcuterie, Viande, Volailles\n- Fromage de chèvre\n- Chocolaterie\n- Confitures\n- Biscuiterie\n\nNous vendons directement au magasin. \nNous assurons les livraisons sur le Gard : toutes les semaines sur Nîmes et Alès et tous les 15 jours pour Bagnols sur Cèze et Anduze.\nUne fois par trimestre nous livrons à Montpellier.',1),(1123,'Maison Roux','La Maison Roux est une fabrique artisanale de Macarons à l\'ancienne installée au cur du centre historique de Montpellier. Notre recette authentique est issue de la recette ancestrale servie à la table des Comtes de Provence et du Languedoc depuis le haut moyen-âge. \nNous ne fabriquons que des macarons et des meringues. Nos produits sont naturellement sans gluten.',1),(1125,'SAVEURS DU TEIL','BOULANGERIE PATISSERIE ARTISANALE EPICERIE',1),(1126,'Les Mirliflores','Les Mirliflores cest lhistoire dune amitié et de nos passions communes pour lHistoire et la pâtisserie.\n\nNotre rencontre a eu lieu il y a plusieurs années, durant nos études dHistoire en Master Patrimoine culturel. En 2017, après avoir travaillé dans différentes structures culturelles, nous avons décidé de faire de nos deux passions notre métier en créant une biscuiterie artisanale dans une ancienne ferme du Tarn.\n\nFruit dun long travail de recherches dans différents documents historiques, culinaires, médicinaux ou iconographiques, nos biscuits «Goûtez lHistoire» sont le résultat de nombreuses heures passées à tester et redécouvrir la pâtisserie à travers les siècles.',1),(1818,'La Chanenche','Producteur local de liqueurs et spiritueux. Entreprise familliale depuis cinq générations.',1),(1830,'La belle époque','aaqsdqsd',1),(1838,'c',NULL,1),(1839,'d',NULL,2);
/*!40000 ALTER TABLE `entreprise` ENABLE KEYS */;
