INSERT INTO `produit` VALUES (747,12,'﻿Amandier de Bouzigues',1,'LAmandier de Bouzigues ® (Trophee Herault Gourmand 2002 et 2005), veritable croquant aux amandes entieres et au beurre frais. \nFidele a la tradition gastronomique de cette cite de l\'Herault, cest un biscuit et tendre au palais qui donne toute sa saveur.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/3d0015a5865b8a6deddb144f7ab91c32',1),(748,12,'Anis des Garrigues',1,'LAnis des Garrigues est un biscuit sec, de forme allongee, aux grains danis vert qui conferent au palais ce parfum singulier de notre belle region.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/bbf0b21c522c38f7d7a3d066101237a3',1),(749,13,'diamant vanille',1,'Biscuit Vanille avec de la fleur de sel de Gruissan','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/89d62c337152154cbad455055fa0c504',1),(750,14,'cake nature',1,'cake nature','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/b3f9982755fd213805af70d1d028830f',1),(751,14,'cake aux fruits',1,'cake aux fruits confits','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/59bd8f1f13f69d92a988211a465ff22f',1),(752,14,'cake aux oranges',0,'cake aux oranges confites','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/cb07dc32c3d144298b064f1ea7d00e01',1),(753,14,'PAVE MERINGUES',1,'pave meringues vanille fraise mandarine','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/5542b8dd3842c05c0088485ce0ea05ce',1),(754,14,'mini meringues',1,'mini meringues vanille','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/565401f40cb3793ac8a6706cec70021c',1),(755,15,'LES BISCUITS DE MEL - Le Croquant au chocolat',1,'Le Croquant au chocolat est une declinaison du croquant aux amandes. La rarete de ce biscuit en fait toute son originalite. Sa texture croquante et ses pepites de chocolat associees a la poudre damande seduiront les plus gourmands.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/f009720aa1f864e65bdbcfd045c93407',1),(756,16,'SABLES AUX AMANDES ET CITRON',1,'Reference : ASCI200\n\nSachets de 200gr de sables au beurre et aux amandes (20%) associe a un pur jus de citron. Elabores selon la recette de ma grand-mere \'Mamie Balou. Elaboration artisanale','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/b23c2cbd2e16d385821bf5a0781861ab',1),(757,16,'SABLES AUX AMANDES ET FIGUES',1,'Reference : ASFI200\n\nSables au beurre et aux amandes elabores selon la recette de ma grand-mere, associe a la figue seche. Du gout et du fondant','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/30b4e486207b22e01c0f16973b759cf6',1),(758,16,'MERINGUE AUX AMANDES',1,'Reference : AMER150\n\nDe petites meringues en forme de langue de chat, legeres et gourmandes avec leurs eclats d\'amande. Ideal pour accompagner un cafe ou un the. Ideal pour ne pas choisir entre sa ligne et son plaisir','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/7343a47bb774421dff38ee4e89e3415b',1),(759,17,'PASTIS GASCON',1,'Les Delices d\'Alienor, patisserie artisanale du Gers, perpetue et transmet le savoir faire lie a la fabrication du Pastis Gascon. Cette specificite du Sud Ouest aux pommes et a l\'armagnac est realisee a partir  d\'une pate etiree a la main sur des tables.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/7321759d081ef499617b41a8df38757e',1),(760,18,'TOURTE AUX PRUNEAUX',1,'Une savoureuse recette aux ufs frais casses par nos patissiers, parsemee de delicieux pruneaux et perles de sucre','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/8c16020ab5a19885e6477fb038cceb19',1),(761,18,'TOURTE A LA MYRTILLE',1,'Une savoureuse recette aux ufs frais casses par nos patissiers parsemee de myrtilles et perles de sucre','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/0bd36df92c500cb8d290553a84cc3935',1),(762,18,'MADELEINE CITRON',1,'Une savoureuse recette preparee a base de farine, d\'ufs frais et d\'ecorces de citron confites','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/5f5331d343b5395105b778b74025304f',1),(763,18,'MADELEINE LONGUE RAISINS',1,'Une savoureuse recette preparee a base de farine, d\'ufs frais et de raisins maceres aux rhum Negrita dans notre atelier','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/82828375c13ce8dddc875065bad7d1af',1),(764,18,'MINI CAKES ORANGE CHOCOLAT',1,'Une savoureuse recette aux ufs frais casses par nos patissiers, parsemee de delicieuses ecorces d\'orange confites et de pepites de chocolat','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/15e81ffcea54c1c3f65b549fa806d691',1),(765,18,'BOUDOIR',1,'Une savoureuse recette a base d\'ufs frais preparees a la main dans nos ateliers','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/b343772d71c9a1ba968c2be18b02a58d',1),(766,18,'BISCUIT DE MARTRES',1,'Une savoureuse recette a base d\'ufs frais preparees a la main dans nos ateliers','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/bc91770831384f76326d642caa40f4c9',1),(767,18,'OREILLETTES DU LANGUEDOC',1,'Depuis de nombreuses annees La Biscuiterie Vital Aine selectionne de delicieuses recettes de biscuits traditionnels et gourmands','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/3d997d08730471ff827c84e94fa924e8',1),(768,18,'Madeleine longue aux pepites de chocolat bio',1,'Une savoureuse recette preparee a base de farine, d\'ufs frais, parsemee de pepites de chocolat','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/552fab77f267289df659d19525e0e0e3',1),(769,20,'Croustillant aux Figues',1,'biscuits aux figues','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/159a5b211de3d7fc1f3fc78701dd2