iques avec egrappage et double tri selectif effectue a la parcelle et a la reception. Les vinifications sont conduites pendant 15 jours sur marc','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/591eaec387838989aaf2abe66226c7d1',84),(5781,798,'Vignobles Bonfils - Chateau Capitoul - Grand Terroir - Rouge',1,'CEPAGES:Syrah, Grenache Noir, Carignan\n\nTERROIR : 64 ha SOL: Argilo-calcaire\n\nVINIFICATION : Les vendanges sont mecaniques avec eraflage et tri selectif a la parcelle. Les vinifications sont conduites pendant 15 jours sur marc, avec pigeage manuel.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/2836e2dd80f4956f78fe7dcb04a9670f',84),(5782,798,'Vignobles Bonfils - Château Capitoul - Maelma',1,'CÉPAGES Syrah 56%, Grenache Noir 39%, Carignan 5% - SOL Argilo-calcaire - VINIFICATION Les rendements sont volontairement bas, autour de 25 hl/ha, afin dobtenir une concentration et une complexité maximale','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/9aedd637fa7230be86a35e4cba1c07a3',84),(5783,1026,'La Réserve d\' O',1,'La  Reserve dO en rouge,  cuvee eponyme du Domaine,  photographie de notre terroir (meme % a l\'assemblage que % de l\'encepagement sur le Domaine : 45% Grenache 45% Cinsault 10% Syrah. Terroir argilo-calcaire a 400 m d\'altitude elevage cuve beton et inox','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/5f34755c1c38608ef43687fc3ac3c47b',84),(5784,559,'Les Hauts des Privats',1,'Terrasse du Larzac Syrah-Grenache-Carignan. Récolté à la main sur des schistes, longue macération traditionnelle. Rubis au nez plaisant sur le fruit noir, les épices et la guarrigue, la bouche est soyeuse avec une finale sur le cacao.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/07bc172aec1a71e0bf7a769bd7adf982',84),(5785,559,'Amplitude 20',1,'Terrasse du Larzac Syrah Grenache Carignan. Terroir de schistes et vinification traditionnelle. Robe violine