s)','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/62dff4aab13c0e207bde152a035d4df2',84),(5792,1089,'LES COMBARIOLLES',1,'Les Combariolles est un nom occitan signifiant la colline et le ruisseau. Le vin a dominante grenache, puis un peu de syrah, est produit sur un sol sec et filtrant. Eleve en cuve un an, il exhale des aromes de chocolat, tabac blonc, cerises...','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/7b9746b1a5328a00ec8be64be0cca1cd',84),(5793,194,'L\'Obstinée',1,'Lénergie des Femmes du domaine inspire depuis toujours cette quête dexcellence. Plus quune valeur, LObstinée sélève au rang de symbole familial.\nNez expressif, notes mûres de fruits noirs, réglisse et chocolat noir. Bouche pleine, charnue, riche.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/2302aa4da3d2f7ae960d263b87fb8177',84),(5794,1090,'Amigas',1,'Issu d\'un assemblage de mourvèdre, syrah, grenache et carignan, ce vin vous surprendra par son équilibre entre fraîcheur et puissance, son côté gourmand et sa longueur en bouche.\nAfin de l\'apprécier pleinement, il vous est conseillé de bien l\'aérer','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/dc34de42f0c095ab260d663b98e34234',84),(5795,558,'Les vendanges de Tom',1,'Les plus vieilles vignes saluent le petit dernier\nAssemblage Syrah, Carignan, Cinsault - vieilles vignes. Vinification traditionnelle. Elevage 18 mois\nDomaine en conversion bio','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/a6abea7831f5b2ccd272827822915c08',84),(5796,558,'LES CORMIERS',1,'Cepages : Grenache, Carignan, Cinsault\nVieilles vignes de 50 ans. Lisiere de garrigue.\nVinification traditionnelle.\nUn vin elegant sur des notes de tabac,\nde reglisse, de violette et de mure. Bouche ample et tanins soyeux. \nDomaine en conversion bio','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/2e76655ce23467ce48f00ca25ee2d1c8