2764a0b63a4b9e3',1),(5966,25,'Moelleux d\'antan aux noisettes, amandes et figues',1,'Nos macarons d\'antan aux amandes avec des noisettes en poudre et des figues sont a la fois croquant et moelleux a l\'interieur qui sent bon notre Provence avec ses amandes , la noisette et ses figues sechees coupees en morceaux , sans gluten','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/316711be0b8248c7ee458c966ad731bf',1),(5967,25,'Amaretto coco',1,'L\'Amaretto est confectionné avec des amandes en poudre , une fameuse liqueur d\'origine d\'italienne l\'Amaretto , très douce et sucrée, au goût prononcé d\'amandes un soupçon d\'amande amère et de la noix de coco râpée, biscuits sans gluten','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/2168536a827e469fd2a10b303d535eb8',1),(5968,25,'Canistrelli au citron confit',1,'Nos canistrelli sont réalisés avec la base de recettes de mon arrière grand-père ,avec du vin blanc sauvignon de Gard,des citrons confits sont ajoutés pour renforcer le goût du citron. Ils sont fabriqués sans ufs et sans laitage.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/be092ed9d35756abd064c979618b84e9',1),(5969,25,'Palets aux citrons confits',1,'Une nouvelle création de notre part , un palet différent des autres palets , il est tout en douceur et moelleux avec la fraîcheur du citron et les morceaux de citrons confits qui apportent sa note d\'originalité .','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/a7d04aa4f34d2583bc0b36706ab32e03',1),(5970,25,'Crinkles au caramel',1,'Le dernier né des crinkles qui sort de notre atelier et imagination , une version au caramel dans lequel on retrouve toujours le croquant de la coque et moelleux à l\'intérieur avec son goût de caramel','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/fb4acef2da4a26af0dc564f27e09fa5c',1),(5971,25,'Crinkes au chocolat et framboise',1,'Le crinkles au chocolat et à la framboise est une création de notre part , il est idéal pour les fêtes , sa coque croquante recouverte de sucre , son cur chocolat et ce subtil parfum de framboise qui change tout , du plaisir à chaque bouchée.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/a0dc9f557ba61c3727cb7646c3e3a091',1),(5972,25,'Palets à la noix de coco',1,'C\'est une recette de palets riche en noix de coco pour le bonheur des grands et des enfants , pas trop sucré comme tous nos biscuits , à découvrir pour le goûter ou simplement par gourmandise .','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/175bfac9f95707ccde04589e404c0637',1),(5973,25,'Croquant gourmand aux noisettes et figues',1,'Un melange de croquants et de tuiles aux noisettes cela donne un croustillant qui apporte plus de legerete et de croustillant , le cote gourmand se retrouve avec les figues a l\'interieur du biscuits.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/a4fee4b29b7d297b3b6aadd85cd297f8',1),(5974,26,'craquele des cevennes aux eclats de chataigne des Cevennes',1,'Nos creations artisanales faites main, ingredients de base farines issues de moulin local. Farines de chataigne des Cevennes, ble Gard/Occitanie, seigle France, riz France \nSans huile de palme, conservateur, colorant, rehausseur de gout, additifs, OGM','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/f39a4faffdd89ae898e3841d0dab61b2',1),(5975,26,'Craquele des Cevennes, aux eclats de pomme',1,'Nos creations artisanales faites main, ingredients de base farines issues de moulin local. Farines de chataigne des Cevennes, ble Gard/Occitanie, seigle France, riz France \nSans huile de palme, conservateur, colorant, rehausseur de gout, additifs, OGM','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/0dc44a75bb7e8ce56365257068b2a3f7',1),(5976,26,'Craquele des Cevennes, aux eclats de figue',1,'Nos creations artisanales faites main, ingredients 