tre creation artisanale faites main, ingredient de base farine issue de moulin local. Farines de ble Gard/Occitanie\nSans huile de palme, conservateur, colorant, rehausseur de gout, additifs, OGM','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/1762e9e67c95476fb8ede7d2461ce634',1),(5982,25,'Croqu\'Cevennes chataigne et amandes',1,'Notre croqu\'Cevennes a la chataigne et aux amandes sont une creation a base de farine de chataigne donc il vient enrichir notre gamme de biscuit sans gluten . Il croquant et moelleux a cur','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/814980ba2bd28ad53c26dfec22f8c0cb',1),(5983,28,'Sachet Croquants Figues-Noix 220 gr',1,'Croquants Figues-Noix.\nIngredients : farine* (gluten), sucre, huile de tournesol, oeufs*,  figues, noix, poudre levante bicarbonate, sel.\nSans conservateur, fabrication artisanale.\n*Origine Occitanie','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/a536da8b05fd43b581b8f2c34bb264e5',1),(5984,28,'Sachet Cookies Pepites Chocolat 220 gr',1,'Cookies Pepites Chocolat.\nIngredients : farine* (gluten), sucre, beurre, pepites chocolat, oeufs*, huile de tournesol, poudre levante bicarbonate, sel.\nSans conservateur, fabrication artisanale.\n*Origine Occitanie','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/b5c30bacf082f7245d2ab597c24bd467',1),(5985,28,'Sachet Sable Perles de Sucre 220 gr',1,'Sables Perles de sucre.\nIngredients : farine* (gluten), beurre, sucre en poudre, oeufs*, huile de tournesol, sucre perle, poudre levante bicarbonate, sel.\nSans conservateur, fabrication artisanale.\n*Origine Occitanie','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/fdf25c202935831f0146de1c5ec87f69',1),(5986,28,'Sachet Croquants Citron 220 gr',1,'Croquants Citron.\nIngredients : farine* (gluten), sucre, huile de tournesol, oeufs*, arome naturel citron, poudre levante bicarbonate, sel.\nSans conservateur, fabrication artisanale.\n*Origine Occitanie','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/b01aa20be8c105a7972652bbaef9f4e5',1),(5987,29,'BISCUIT PAVOIS AMANDE',1,'Le Pavois de Sete est l\'unique et irresistible biscuit des joutes nautiques de Sete, fabrique par La Cure Gourmande biscuitier depuis 1989, compose de beurre, de farine et d\'amandes d\'Occitanie et dont la forme reproduit le bouclier des jouteurs.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/93ae15218553c4676649af82f94de1a4',1),(5988,29,'BISCUIT NAVETTE CANNELLE',1,'La Navette, le celebre biscuit du Sud de la France, sous sa robe doree, fondante et croustillante est cuite avec passion dans les ateliers de La Cure Gourmande depuis 1989, a partir de farine d\'Occitanie et dingredients dorigine francaise.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/293766ab277255d5679741e748b4c8a4',1),(5989,25,'Meli-Melo aux noix et amandes',1,'Les Meli-Melo aux noix et amandes sont nos creations a base de farine de noix qui est une farine sans gluten , c\'est un point positif pour ce biscuit original avec une touche d\'amande','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/173b662d62e4b1c67feae071b98ca417',1),(5990,25,'Meli-Melo aux noix et figues',1,'Des biscuits a base de farine de noix qui est une farine sans gluten , c\'est un point positif pour ce biscuit original avec des figues et une touche d\'amandes , les gourmands vont aimer le croquant exterieur et le moelleux interieur.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/06b1fa061e16676c64e94ae6e29a3d4b',1),(5991,32,'Cookie noix - chocolat',1,'Farine de ble*, beurre*, sucre de\ncanne*, pepites de chocolat* (10%,\nmasse de cacao, sucre de canne complet\nRapadura, sucre de canne roux\ncristalino, beurre de cacao, emulsifiants\net lecithine de soja), cerneaux de noix*\n(10%), ufs*, sel de Guerande**','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/f12449670d00b5e5f89725250782f1db',1),(5992,32,'Triangle figues - noisettes',1,'Farine de petit epeautre* (43%),\nbeurre*, sucre de canne*, jaune dufs*,\nfigues sechees* (7,8%), noisettes\nentieres* (5,2%), sel de Guerande','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/95ea86b825f927084db500c0da7ec5b1',1),(5993,15,'Sable aux 3 graines',1,'Ce biscuit sable en forme de fleur, vous apporte un plaisir gustatif equilibre grace a ses 3 graines : tournesol, pavot et sesame.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/e0abe233102bc423f4257de673584c2d',1),(5994,203,'Sables aux amandes torrefiees',1,'De delicieux biscuits aux notes grillees apportees par la torrefaction des amandes et une legere pointe de sel en fin de bouche.\n\nDes ingredients simples, 100% origine France et naturellement riches en gout.','https://data.laregion.fr/api/datasets/1.0/produits-sud-de-france/images/8cf1cd3d4c15ba6ffdabdbd0664b2259',1);
